', 'PRO PLAN® Elegant Somonlu tam kuru kedi maması, yetişkin kedinizin bir öğünde ihtiyacı olan tüm besinsel öğeleri içerirken kedinizin deri ve tüy sağlığınının korunmasına destek olur. Renklendirici ve aroma verici içermez. Hassas deri ve tüy yumağı sorununa karşı özel olarak geliştirilen Pro Plan Derma Plus Hairball, kedinizin yuttuğu tüylerin sindirim sisteminden kolaylıkla atılmasına yardımcı olur.  Somon balıklı içeriği hem kolay sindirilebilir hem de oldukça lezzetlidir. Özellikle uzun tüylü kedilerde sıkça rastlanan tüy yumağı problemine karşı formülüne özel olarak eklenen diyet lifi tüylerin mideden bağırsaklara geçişini kolaylaştırır. Kediler kendilerini temizlerken sağlıklı tüyleri ile derileri arasında henüz dökülmemiş ölü tüyleri yutmalarından dolayı çeşitli mide ve bağırsak sorunu yaşayabiliyorlar.Yutulan tüyler midede sindirilemediği için vücuttan atılması zorlaşıyor ve kedilerin sağlığını negatif yönde etkileyen durumlar söz konusu olabiliyor. Pro Plan Derma Plus, yutulan tüylerin kolayca atılmasına yardımcı olduğu gibi deri ve tüy sağlığını destekleyerek daha az tüy dökülmesini sağlıyor. ​Kuru ve serin bir yerde muhafaza ediniz.', 'Pro Plan' );
