SPHYNX, özel besin öğelerinden oluşan bir kombinasyonla, bu ırk kedilerin istisnai enerji ihtiyaçlarını karşılamak ve bu sırada deri bariyerinin desteklenmesine ve kalp sağlığının korunmasına yardımcı olmak üzere özel olarak üretilmiştir. 
 
12 aylık ile 12 yaş arası Sphynx ırkı kedilere yöneliktir. Özel biçimli mama tanesi, Sphynx ırkı kedilerin çenesi için tasarlanmıştır. 
 
Yüksek enerji ihtiyaçlarının karşılanması için yoğun, yüksek enerji ve daha fazla yağ içeren mama tanesi, deri bariyerinin desteklenmesine yardımcı olmak üzere, hedefe yönelik beslenme kalp sağlığının ve düzgün çalışmasının desteklenmesine yardımcı olur. 
 
 
 
Özel formül - Omega 3 & Omega 6 yağ asitleri 
 
 
 
Sphynx ırkı, tüylerinin yokluğunu telafi etmek için ve vücut sıcaklığını kontrol etmek için çok aktif bir metabolizmaya sahiptir. YÜKSEK ENERJİ ALIMI Artırılmış yağ oranı (%23) sayesinde, tüyleri olmayan bu özel kedi ırkının yüksek enerji ihtiyacını karşılayan, yoğun enerji içeren bir mamadır. 
 
 
 
Sphynx kedilerinin tüysüz cildi oldukça korunmasız bir yapıdadır. SPHYNX mama, cildin bariyer görevini desteklemeye yardımcı olan sinerjik besin kompleksi içerir. İçerik, Omega 6 ve Omega 3 yağ asitleri ile zenginleştirilmiştir. 
 
 
 
Sağlıklı kalp fonksiyonlarının sürdürülmesine yardımcı olmak için içerik, taurin, EPA ve DHA ile zenginleştirilmiştir. 
 
 
 
Yetişkin kedilerin üriner sistemini korumaya yardımcı olacak formüle edilmiştir.  ', 'Royal Canin' );
 
 
Özel formül - Omega 3 & Omega 6 yağ asitleri 
 
 
Kalın ve yoğun iç tüylerle birlikte uzun ve gösterişli dış tüyler, İran kedileri için ayırıcı özelliktir. Özel besin kompleksleri, cildin bariyer görevini desteklemeye ve böylece deri ve tüy yapısını korumaya yardımcıdır. İçeriği, Omega 3 yağ asitleri (EPA ve DHA) ve Omega 6 yağ asitleri ile zenginleştirilmiştir. 
 
 
İran ırkı kediler, tüylerinin uzunluğu ve yoğunluğu nedeniyle, tüy temizliği yaparken sürekli olarak yüksek miktarda tüy yutarlar. TÜY YUMAĞINDA AZALMA Özel lif kombinasyonu, bağırsak geçişini aktifleştirmeye ve tüy birikimini doğal yollarla sınırlandırmaya yardımcı olur. 
 
 
Bağırsak florasındaki dengeyi desteklemeye yardımcı olmak üzere yüksek derecede sindirilebilir protein (L.I.P.*) ve prebiyotikler *L.I.P: yüksek sindirilebilir proteinler 
 
 
