INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kus-urunleri_living-world-ipli-ahsap-kus-oyuncagi.html', 'Living World İpli Ahşap Kuş Oyuncağı', 'Kuş Ürünleri-Kuş Oyuncakları-Salıncaklar', '', '369 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_living-world-kus-salincaklari-90532956.jpg', '', 'İpleri sayesinde kuşunuzun dikkatini çeker. Renk için gıda boyası kullanıldığı için hayvan sağlığına zararı yoktur. Kuşunuzun daha aktif hareket etmesini sağlayarak formda kalmasına yardımcı olur. Ahşap parçalı malzemeden üretilmiş oyuncak kuşunuzun dikkatini kolaylıkla çekecektir. Sallanan iplerin ucundaki halkalar kuşunuzun oyun oynamasını sağlayacaktır.', 'Living World' );
