INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kus-urunleri_flip-askili-celik-kus-yemligi-600ml.html', 'Flip Askılı Çelik Kuş Yemliği 600ml', 'Kuş Ürünleri-Ağustos Seçili Ürünler-Flip Ağustos Seçili Ürünler', '8680468045885', '84 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_flip-kus-yemligi-277194534.jpg', '', 'Flip yem kapları her zaman birinci sınıf kaliteli paslanmaz çelikten işlenmiş ve sıkıştırılarak dayanıklılığı garanti altına alınmıştır. Ürün çeliği ekstra dayanıklı kaplamaya sahip olup, yıllarca ihtiyaçlarınızı karşılayabilecek şekilde tasarlanmıştır. Böylece salınım yapmadığı için hayvan sağlığına da 100% zararsızdır. Ayrıca makinede yıkanabilir özelliği ile tam bir hijyen ve güvenlik sağlar. Flip yem kapları kuşlarınızın beslenme anlarını konforlu geçirmeleri için harika bir yem kabı ürünüdür. Salınım yapmadığı için yem, mama ve özelliklede suyun tadını ve lezzetini bozmaz. Bakteri üreterek koku oluşturmaz. Krom parlaklığında yapıya ve şık bir tasarıma sahipken aynı zamanda yenilikçi canlı krom formlarıylanda dikkat çekicidir. Ölçüler dıştan dışadır. Ölçüler + veya - 1 cm değişiklik gösterebilmektedir.', 'Flip' );
