INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kus-urunleri_garden-mix-platin-sari-dogal-dal-dari-150gr.html', 'Garden Mix Platin Sarı Doğal Dal Darı 150gr', 'Kuş Ürünleri-Kraker ve Ödüller-Garden Mix Kraker ve Ödüller', '8681085420932', '49 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_garden-mix-kus-krakeri-ve-odulleri-313421572.jpg', '10.05.2024', 'Özel, bir taraftan yemin tazeliğini korumasını sağlarken, diğer yandann bozulmasını da önleyen hava alan poşet içerisnde kafes içi askı aparatıyla beraber %100 doğal sarı dal darı. Kuşunuzun beslenmesine çeşitlilik katar ve tek tip beslenmeden sıkılmasını önler. Kuşlar için mükemmel bir ek besindir. İspinoz, macaw papağanları, muhabbet kuşları, paraketler, papağanlar gibi birçok kuşun severek yiyeceği, besleyici ve canlılık verici bir besindir. Kuş kafesine bir tane dal asınız. Bitince yenileyiniz.', 'Garden Mix' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kus-urunleri_gold-wings-classic-balli-muhabbet-kusu-krakeri-3-lu.html', 'Gold Wings Classic Ballı Muhabbet Kuşu Krakeri (3_lü)', 'Kuş Ürünleri-Kraker ve Ödüller-Gold Wings Classic Kraker ve Ödüller', '01.02.2025', '14,50 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_gold-wings-classic-kus-krakeri-ve-odulleri-314624643.jpg', '', 'Muhabbet kuşları için özel olarak hazırlanmış, severek yedikleri, içeriğinde bol miktarda besleyici tohum ve tahıl bulunan çubuk şeklinde krakerdir. Dostlarımızın ihtiyaç duydukları besinleri tam ve dengeli bir şekilde içerir. Ödül olarak verilebilir. Düzenli kullanımda aldığı vitamin ve minerallerle birlikte kuşların sağlıklı bir gaga yapısına kavuşmasına katkıda bulunur. İçeriğindeki ilave vitaminler ile yüksek enerji ihtiyacını destekler. Doğal içeriği ile sağlıklı ve dengeli bir beslenme sağlayarak yaşam kalitesini arttırır. Doğal ortamlarında yetişmiş güçlü tohumlar ile yüksek bağışıklık sağlar. Son teknoloji ambalajlama teknikleri ve malzemeleri ile paketlenerek son tüketim tarihine kadar tazeliğini korur.', 'Gold Wings Classic' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kus-urunleri_jungle-meyveli-paraket-krakeri-3-lu.html', 'Jungle Meyveli Paraket Krakeri (3_lü)', 'Kuş Ürünleri-Kraker ve Ödüller-Jungle Kraker ve Ödüller', '8680468049418', '17,95 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_jungle-kus-krakeri-ve-odulleri-314539884.jpg', '08.03.2025', 'Paraket kuşlarının doğadaki beslenme alışkanlıkları dikkate alınarak özel olarak formüle edilmiş seçkin içeriğe sahip meyveli kraker. Gereksinim duydukları tohumları içinde barındırır. Vitamin ve mineraller ile desteklenmiştir. İçeriğindeki ilave vitaminler ile yüksek enerji ihtiyacını destekler. Son teknoloji ambalajlama teknikleri ve malzemeleri ile paketlenerek son tüketim tarihine kadar tazeliğini korur.', 'Jungle' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kus-urunleri_gold-wings-classic-meyveli-muhabbet-kusu-krakeri-2-li-1.html', 'Gold Wings Classic Meyveli Muhabbet Kuşu Krakeri (2_li)', 'Kuş Ürünleri-Kraker ve Ödüller-Gold Wings Kraker ve Ödüller', '23.04.2025', '10,45 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_gold-wings-kus-krakeri-ve-odulleri-8980223.jpg', '', 'Tüm kafes kuşları tüketebilir. Kuşunuza ödül olarak verebilirsiniz. Lezzetli olmasının yanı sıra kuşunuzun tüy sağlığı için yararlıdır. Kuşunuzun tüylerinin sağlıklı ve parlak olmasını sağlar.', 'Gold Wings' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kus-urunleri_qui-k-portakalli-muhabbet-kusu-enerji-blogu-2-li-7.html', 'Qui̇k Portakallı Muhabbet Kuşu Enerji Bloğu (2_li)', 'Kuş Ürünleri-Kraker ve Ödüller-Quik Kraker ve Ödüller', '8680468040941', '16,50 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_quik-kus-krakeri-ve-odulleri-156512931.jpg', '25.05.2025', 'Tüm küçük kafes kuşları için enerji bloğudur.  Ekstra vitaminlidir. İskelet ve gaga yapısını destekler. Kuşlara sağlık ve canlılık kazandırır. Zengin vitamin, mineral ve iz element kaynağıdır. Gaga yapısını düzenleyerek orginal ve sağlıklı gaga yapısına sahip olmalarını sağlar.  Kafes içerisinde, kuşların rahatça gagalayabilecekleri, kuru bir yere asılması tavsiye edilmektedir.', 'Quik' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kus-urunleri_gold-wings-classic-balli-muhabbet-kusu-krakeri-2-li.html', 'Gold Wings Classic Ballı Muhabbet Kuşu Krakeri (2_li)', 'Kuş Ürünleri-Kraker ve Ödüller-Gold Wings Kraker ve Ödüller', '16.02.2025', '10,45 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_gold-wings-classic-kus-krakeri-ve-odulleri-89647329.jpg', '', 'Muhabbet kuşlarının tüketmesi için üretilmiştir. Kuşunuzun yaşam kalitesini ve günlük aktivitelerini arttıran tüm vitamin ihtiyaçlarını karşılar.  ', 'Gold Wings' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kus-urunleri_gold-wings-premium-meyveli-muhabbet-kusu-krakeri-2-li.html', 'Gold Wings Premium Meyveli Muhabbet Kuşu Krakeri (2_li)', 'Kuş Ürünleri-Kraker ve Ödüller-Gold Wings Kraker ve Ödüller', '20.03.2025', '24,50 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_gold-wings-kus-krakeri-ve-odulleri-156277016.jpg', '', 'Muhabbet kuşları için doğadaki gibi çalışarak zevkle ve iştahla yiyebilecekleri krakerdir. Özenle seçilmiş temizlenmiş tohumlarla birlikte meyve içeren tamamlatıcı besin kaynağıdır. Kanaryaların doğal beslenmelerinin yanı sıra içeriğinde kullanılan bal ve yumurta karışımı oldukça faydalıdır. Sürekli olarak formda ve zinde tutması aynı zamanda gaga yapılarının düzgün kalması için hazırlanmıştır. Gold Wings Premium ailesi her zaman gerçek premium hizmetini sunabilmek için en kaliteli tahıl ve tohumları bir araya getirmiştir. Özel harmanlı içeriği ile tam ve besleyici sunum sağlarken aynı zamanda vitamin ve mineral açısından eksiksiz bir şekilde desteklenmiştir. 8_i Avrupa ülkesi olmak üzere 17 farklı ülke Gold Wings Premium_u tercih etmektedir.', 'Gold Wings' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kus-urunleri_gold-wings-premium-balli-yetiskin-muhabbet-kusu-krakeri-2-adet.html', 'Gold Wings Premium Ballı Yetişkin Muhabbet Kuşu Krakeri (2_li)', 'Kuş Ürünleri-Kraker ve Ödüller-Gold Wings Kraker ve Ödüller', '15.01.2025', '24,50 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_gold-wings-kus-krakeri-ve-odulleri-89526997.jpg', '', 'Gold Wings Premium ailesi, formülüne her zaman güvenerek Avrupa ve Uzak Doğudaki en kaliteli ve zengin yemler yarışmalarına katılmış, çeşitli başarılarla ülkemizi bu alanda temsil etmiştir.Gold Wings Premium ailesi İsviçre, Almanya, Shanghai gibi ülkelerde düzenlenen en kapsamlı pet fuarlarına katılarak yenilikleri ve gelişmeleri en yakından takip etmiş, formülünde günümüzün en iyi diyetlerini kullanmıştır.8_i Avrupa ülkesi olmak üzere 17 farklı ülke Gold Wings Premium_u tercih etmektedir. Muhabbet kuşlarının ana yem dışında ihtiyaç duydukları, lezzetli içeriği ile severek yediği içeriğinde kondisyon arttırıcı tahıllar ve meyveler içeren çubuk şeklinde krakerlerdir. Kafesin teline takılarak servis edilir', 'Gold Wings' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kus-urunleri_gold-wings-yulaf-tohumu-300gr.html', 'Gold Wings Yulaf Tohumu 300gr', 'Kuş Ürünleri-Kraker ve Ödüller-Gold Wings Kraker ve Ödüller', '05.04.2025', '', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_gold-wings-kus-krakeri-ve-odulleri-314806660.jpg', '', 'Kanarya, tropikal finch, küçük paraket, muhabbet kuşları ve diğer tüm kuşlar için, tamamlayıcı ek besindir. Direkt yemliğe kunularak yada mevcut yeme karıştırılarak verilir. Yulaf kuvvetli aynı zamanda mineral bakımından çok faydalı bir besindir. Yazın sıcak havalarda verilmesi tavsiye edilir. Haftada 3 - 4 defa kuşun yemi içerisine karıştırılarak verilmesi tavsiye edilmektedir.', 'Gold Wings' );
