INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kus-urunleri_quik-meyveli-muhabbet-kusu-krakeri.html', 'Quik Meyveli Muhabbet Kuşu Krakeri 30gr', 'Kuş Ürünleri-Kraker ve Ödüller-Quik Kraker ve Ödüller', '8680468041818', '', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_quik-muhabbet-kusu-yemi-171452929.jpg', '17.01.2025', 'Muhabbet kuşları için özel olarak hazırlanmıştır. Kuşların severek yedikleri, içeriğinde bol miktarda meyve içeren çubuk şeklinde krakerlerdir. Özel harmanlı içeriği ile tam ve besleyici sunum sağlarken aynı zamanda vitamin ve mineral açısından eksiksiz bir şekilde desteklenmiştir. Dostlarımızın ihtiyaç duydukları besinleri tam ve dengeli bir şekilde içerir. ​Ödül olarak verilebilir. Kuşlar birbirine yapışmış halde olan yemleri yerken enerji sarf ederek daha formda kalır. Aldığı vitamin ve minerallerle birlikte sağlıklı bir gaga yapısına kavuşur.', 'Quik' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kus-urunleri_oropharma-cins-kuslar-icin-kirmizi-renk-guclendirici-500gr.html', 'Versele-Laga Oropharma Cins Kuşlar için Kırmızı Renk Güçlendirici 500gr', 'Kuş Ürünleri-Bakım Ürünleri-VERSELE-LAGA Bakım Ürünleri', '', '1.749 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_versele-laga-kus-vitaminleri-saglik-urunleri-95512732.jpg', '', 'Oropharma Can-Tax kantaksantin temelli bir kırmızı renk vericidir. Kırmızı kanaryalarda kırmızı rengin yoğunlaşmasını ve daha güzel bir görünüm almasını sağlar. Tüyler ölü hücrelerden oluştuğu için metabolizma tarafından beslenmez. Renklerini oluşturulma aşamalarındayken alırlar.  Ortalama olarak tüyler yılda bir değişir, ama hepsi tek seferde dökülmez. Eski tüylerin dökülmesi için yenilerinin üretilmesi gerekir. Kuş zaman içerisinde tüm tüylerini yeniler. Yeme Can-Tax eklendiğinde, içeriğindeki kantaksantin tüylerin üretildiği yere ulaşır ve kırmızı rengin daha yoğun olmasını sağlar. Beta-apo-8_- karotenal, kantaksantinin daha yüksek oranda emilimini garanti altına alır. Oluşan tüyün kırmızı rengi, yerine yeni tüy gelene kadar korunur.', 'VERSELE-LAGA' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kus-urunleri_versele-laga-oro-bath-guvercin-banyo-tuzu-50gr.html', 'Versele Laga Oro-bath Güvercin Banyo Tuzu 50gr', 'Kuş Ürünleri-Bakım Ürünleri-VERSELE-LAGA Bakım Ürünleri', '', '365 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_versele-laga-kus-bakim-urunleri-123604165.jpg', '', 'Göz alıcı tüyler için banyo tuzu Oropharma Oro-Bath parlak tüyler için özell üretilmiş bir banyo tuzudur. Tüylerin daha güçlü ve parlak olmasını sağlar.Ayaklar ve derilerde tüy dökülmesini önler. Oro-Bath banyo tuzunun kaslar üzerinde rahatlatıcı, tüyler ve deri üzerinde temizleyici etkisi vardır. Bilindiği üzere kuşların da banyo yapmaya ihtiyacı vardır. Düzenli banyo tüylerin güçlü, sağlıklı, temiz ve parlak kalması için gereklidir.', 'VERSELE-LAGA' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kus-urunleri_bio-petactive-avicare-cilt-ve-tuy-bakim-spreyi-150ml.html', 'BIO PetActive Avicare Cilt ve Tüy Bakım Spreyi 150ml', 'Kuş Ürünleri-Bakım Ürünleri-BIO PetActive Bakım Ürünleri', '8698931091307', '97 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_pet-active-kus-vitaminleri-saglik-urunleri-90418079.jpg', '', 'Bio-Avicare Aerosol, formülünde bulunan Palmarosa yağı Cymbopogon marti bitkisinden elde edilir. Alternatif tedavide kullanılan palmarosa yağı nemlendirici özelliği ile kafes kuşları ve güvercinlerin cilt ve tüylerinin sağlıklı ve parlak olmasını sağlar. Ayrıca Palmarosa oil doğal bir bit_pire_kene uzaklaştırıcıdır. Bio-Avicare Aerosol, cildin doğal yağ dengesini korur.Kafes kuşlarının kendi kendilerini gagalayıp tüylerini koparmalarından ileri gelen yara ve berelerin tedavisinde yardımcı olur.Bio-Avicare Aerosol, pire, kene ve bitlerden ileri gelen cilt tahrişlerini giderir. Kafes kuşları ve güvercinlerin deri ve tüylerine 15 cm uzaklıktan 2.3 defa püskürtülür. Gerekirse 15 gün sonra tekrarlanabilr.', 'BIO PetActive' );
