INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kus-urunleri_supravet-kanarya-papagan-guvercin-ve-muhabbet-kuslari-icin-deri-bakim-spreyi-150ml.html', 'Supravet Kuşlar İçin Deri Bakım Spreyi 150ml', 'Kuş Ürünleri-Bakım Ürünleri-Supravet Bakım Ürünleri', '17.01.2025', '77 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_supravet-kus-bakim-urunleri-33937274.jpg', '', 'Kanarya, papağan, güvercin ve muhabbet kuşları için uygundur. Düzenli kullanımda gözle görülür sonuçlar elde edilir. Kuş deri sağlığı için deri bakım spreyidir.', 'Supravet' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kus-urunleri_jungle-natural-kus-kumu-300gr.html', 'Jungle Kuş Kumu 250gr', 'Kuş Ürünleri-Kuş Kumu-Jungle Kuş Kumu', '8680468040644', '9,39 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_jungle-kus-kumu-89932861.jpg', '05.04.2025', 'Kuşların yediği yemleri öğütmesinde etken rol oynayan, içeriği kuşların doğadaki ihtiyaçları dikkate alınarak fırınlanmış çok önemli bir ek besindir. Kuşların yediklerini daha rahat ve etkili sindirmelerinin sağlar. Yumurtlama dönemlerinin verimli geçmesi ve yavruların daha sağlıklı büyümesi de kalsiyum ve mineral içeren kuş kumuna bağlıdır.  ', 'Jungle' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kus-urunleri_quik-kus-kumu-250gr.html', 'Quik Kuş Kumu 250gr', 'Kuş Ürünleri-Kuş Kumu-Quik Kuş Kumu', '8681299605408', '', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_quik-kus-kumu-89918201.jpg', '11.07.2025', 'Kuşlar için, doğal hayatta gereksinim duydukları kalsiyum ihtiyacını karşılayan, sindirim sistemlerinin daha iyi çalışmasını sağlayan, vitamin ve mineral katkılı kuş kumudur. Kuş Kumu kuşların midesinde dişlerin yaptığı görevi yaparak hazım probleminin yaşanmamasını sağlar. Kuş kumu kuşların gerçek anlamda sağlıklı kalmasını sağlayan en önemli ek besinlerdendir.* Yumurtlama dönemlerini daha verimli geçirmelerini ve yavruların daha sağlıklı büyümesini sağlar. Mineral ve besin maddelerinin daha iyi sindirilmesini sağlayarak hızlı bir şekilde kana karışmasına yardımcı olur. Yem içerisine günlük olarak 1 çay kaşığı eklenerek veya ayrı bir kap ile kafes içerisine konularak verilmesi tavsiye edilmektedir.', 'Quik' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kus-urunleri_garden-mix-kus-kumu-200gr.html', 'Garden Mix Kuş Kumu 200gr', 'Kuş Ürünleri-Kuş Kumu-Garden Mix Kuş Kumu', '8681085423070', '34 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_garden-mix-kus-kumu-31348993.jpg', '02.02.2025', 'Garden Mix kuş kumu sayesinde kuşlarınız sindirim ile ilgili bütün sıkıntılarından kurtulur, daha sağlıklı hareketli ve keyifli kuşlar haline gelirler. Kumun içindeki mineraller kuşlarınızın kemik yapısını kuvvetlendiri. Kalsiyum içeriği kuşların kas gelişimi için çok önemlidir ve Garden Mix kuş kumunun yüksek kalsiyum içeriği sayesinde kuşlarınızın tüm ihtiyacı karşılanmaktadır: İçerdiği kömür kuşlar için çoğu zaman en tehlikeli hastalık olan ishale karşı kuşlarınızı korumaktadır.', 'Garden Mix' );
