INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kus-urunleri_profarm-probio-life-ob-tamamlayici-kus-vitamini-tozu-50gr.html', 'Profarm Probio Life OB Tamamlayıcı Kuş Vitamini Tozu 50gr', 'Kuş Ürünleri-Kuş Vitaminleri ve Sağlık-Profarm Kuş Vitaminleri ve Sağlık', '13.01.2025', '49 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_profarm-kus-vitaminleri-saglik-urunleri-130018741.jpg', '', 'Tamamen bitkisel içeriklidir. İçeriğinde bulunan probiyotik bakteri, B. licheniformis, bağırsak mikroflorasını düzenler, proteaz enzimi ise sindirime yardımcı olur. Kolonda bulunan yararlı bakterilerin çoğalmalarını sağlar. Dışkının normal formunu korumasına yardım eder ve kokuyu azaltır. İshal veya kabızlığı gidererek düzenlenmesine yardımcı olur. Yem değişikliklerinde veya bağışıklığın düştüğü durumlarda oluşabilecek rahatsızlıkları önler. Tüylere canlılık ve parlaklık kazandırır. Besin maddelerinin sindirimini arttırır ve yemden yararlanmayı iyileştirir. Kuşunuzun yaşam enerjisinin artmasını sağlar. Kuru ve nemsiz ortamda muhafaza edilmelidir.', 'Profarm' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kus-urunleri_quik-muhabbet-kusu-kafes-seti.html', 'Quik Muhabbet Kuşu Kafes Seti', 'Kuş Ürünleri-Gaga Taşları-Quik Gaga Taşları', '8680468041757', '69 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_quik-kus-vitaminleri-saglik-urunleri-89887052.jpg', '01.12.2024', '5 parçalı bu set kuşunuzun kafes içi ihtiyaçlarını kapsamaktadır. İçerisinde lezzetli atıştırmalıklar ve vitaminler bulunmaktadır. Kuşunuzun keyifli ve sağlıklı vakit geçirmesine destek olur.', 'Quik' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kus-urunleri_gold-wings-coldast-vitamin-kuslar-icin-solunum-destegi-20-ml.html', 'Gold Wings Coldast Kuşlar için Solunum Sistemi Destekleyici Sıvı Vitamin 20ml', 'Kuş Ürünleri-Kuş Vitaminleri ve Sağlık-Gold Wings Kuş Vitaminleri ve Sağlık', '30.03.2024', '25,95 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_gold-wings-kus-vitaminleri-saglik-urunleri-229696563.jpg', '', 'Gold Wings Coldast, kafes kuşlarının soğuk algınlığı dönemini kolay atlatabilmeleri için solunum sistemini destekleyen antioksidan etkili C vitamini içeren kuş yem katkısıdır. Enfeksiyonlara karşı kuşun vücut direncini artırır, bağışıklığı destekler. Bu sayede özellikle üst solunum sistemi enfeksiyonlarında vücudu destekleyici etki sağlar. Kuşlar solunum sistemi enfeksiyonlarına karşı çok hassatır. Ortam sısının değişmesi, banyo sonrası tüylerin ıslak olması, hava akımı gibi sebeplerden etkilenerek kolayca hastalanabilirler. Gold Wings Coldast içerdiği okaliptüs ve propolis gibi bitkisel bileşenler ve C vitamini sayesinde kuşun hastalanmasını önlemeye yardımcı olmanın yanı sıra solunum sistemini destekleyerek hastalık sürecini daha kolay atlatmalarına yardımcı olur.', 'Gold Wings' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kus-urunleri_supravet-plus-kanarya-papagan-guvercin-ve-muhabbet-kuslari-icin-multivitamin-damla-30ml.html', 'Supravet Plus Kuşlar İçin Multi Vitamin Damla 30m', 'Kuş Ürünleri-Kuş Vitaminleri ve Sağlık-Supravet Kuş Vitaminleri ve Sağlık', '15.01.2025', '38 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_supravet-kus-vitaminleri-saglik-urunleri-339405002.jpg', '', 'Kanarya, papağan, güvercin ve muhabbet kuşları için uygundur. Kuş sağlığı için özel olarak formüle edilmiş multivitamin damladır.', 'Supravet' );
