INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kus-urunleri_quik-murekkep-baligi-kemigi-gaga-tasi-12x4cm.html', 'Quik Mürekkep Balığı Kemiği Gaga Taşı 12x4cm', 'Kuş Ürünleri-Gaga Taşları-Quik Gaga Taşları', '8680468041030', '', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_quik-kus-vitaminleri-saglik-urunleri-90119320.jpg', '18.06.2025', 'Quik mürekkep balığı kemiği gerek muhabbet kuşları ve kanaryalar gerekse de tüm papağan grupları için eşsiz bir kalsiyum kaynağıdır. Kuşların doğada bulabildikleri kalsiyum, kemik ve kas yapılarını güçlendirir ve tüylerinin daha sağlıklı olmasını sağlar. Ayrıca içeriğinde bulunan mineral sayesinde yakalanması muhtemel hastalıklarla mücadele eder. Kuşlarda gaganın aşırı uzamasını engelleyerek, çirkin ve sağlıksız bir görünümde olmasını engeller. Ürünü kuşların kolayca uzanabileceği bir noktaya koymanızı tavsiye ederiz.  Ürün ölçüleri 12x4 cm_dir. Ancak organik bir ürün olduğu için ölçülerde küçük değişiklikler olabilmektedir. ', 'Quik' );
