INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kus-urunleri_gold-wings-multi-vitamin-kuslar-icin-tuy-olusum-destegi-20-ml.html', 'Gold Wings Kuşlar için Tüy Oluşumunu Destekleyici Sıvı Multi-Vitamin 20ml', 'Kuş Ürünleri-Kuş Vitaminleri ve Sağlık-Gold Wings Kuş Vitaminleri ve Sağlık', '30.05.2025', '25,95 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_gold-wings-kus-vitaminleri-saglik-urunleri-229633309.jpg', '', 'Gold Wings multivitamin solüsyonu, A, D3, C, K ve E vitamini içeren kuş yem katkısıdır. Papağan, kanarya, muhabbet kuşu ve diğer kafes kuşlarının vitamin ihtiyacını karşılayarak genel sağlığını destekler.', 'Gold Wings' );
