INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kus-urunleri_trixie-dogal-ahsap-kus-yuvasi-21x13x12cm.html', 'Trixie Doğal Ahşap Kuş Yuvası 21x13x12cm', 'Kuş Ürünleri-Kuş Yuvaları-Trixie Kuş Yuvaları', '4011905056326', '479 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kus-yuvalari-116251837.jpg', '', 'Doğal dayanıklı ve kaliteli ahşapdan uzun süreli kullanıma uygun üretilmiştir. Geçme duvarları sayesinde kaydıraraktan kolayca çıkartabilir ve temizleyebilirsiniz. Üzerindeki askılar sayesinde kolayca istediğiniz şekilde konumlandırılabilirsiniz.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kus-urunleri_quik-murekkep-baligi-kemigi-gaga-tasi-15x6cm-m.html', 'Quik Mürekkep Balığı Kemiği Gaga Taşı 15x6cm [M]', 'Kuş Ürünleri-Gaga Taşları-Quik Gaga Taşları', '8680468040965', '', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_quik-kus-vitaminleri-saglik-urunleri-90189452.jpg', '07.06.2025', 'Canlıların en çok kemiklerinde kalsiyum minerali bulunur. Quik mürekkep balığı kemiği gerek muhabbet kuşları gerekse de tüm papağan türleri için doğal kalsiyum kaynağıdır. Kalsiyum eksikliğine bağlı olarak, kemik, tüy ve gaga gelişimi olumsuz etkilenmemesi için gaga taşı kullanımı önemlidir. İçeriğinde bulunan vitaminler sayesinde hastalıklara karşı önem almış olursunuz. Gaga taşı sayesinde kuşların gagası aşırı uzamayacak, çirkin ve sağlısız bir görüntüye sahip olmayacaktır. 15x6 cm boyutlarındadır. Organik bir ürün olduğu için ölçülerde küçük değişiklikler olabilmektedir.   ', 'Quik' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kus-urunleri_quik-dogal-dal-dari-kus-vitamini-5-parca.html', 'Quik Doğal Dal Darı 120gr (5_li)', 'Kuş Ürünleri-Kraker ve Ödüller-Quik Kraker ve Ödüller', '8681299606795', '', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_quik-kus-vitaminleri-saglik-urunleri-89953857.jpg', '25.07.2025', 'Muhabbet kuşları, kanarya türleri, Cennet ve Sevda Papağanları ve Bülbül türü kuşların doğada yedikleri severek tükettiği ek besin kaynağıdır. Doğal ve herhangi bir ısıl veya yapay işleme tabi tutulmayan Dal Darı en saf hali ile kuşların doğadaki beslenme alışkanlıklarını taklit ederek kendilerini evlerinde hissetmelerini sağlar. Her bir tohumun yumuşak ve zarif yapısı sayesinde yavru kuşların yem kırmaya alıştırılması ve henüz sahiplenilmiş kuşların yeni ortamlarına daha hızlı ve stressiz adapte olması için kullanımı tavsiye edilir. Kuşların ihtiyaç duydukları yem ve vitamin kaynağını sağlamaktadır. Direkt bir yem değildir. Diğer ana yemlerle birlikte verilmesi kuşların sağlıklı ve dirençli bir yapıya kavuşmasına yardım eder.', 'Quik' );
