INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_hills-adult-lamb-rice-kuzu-etli-ve-princli-yetiskin-kopek-mamasi-12kg-25kg.html', 'Hill_s SCIENCE PLAN Kuzulu Orta Irk Yetişkin Köpek Maması 12kg + 2kg HEDİYE!', 'Köpek Ürünleri-Köpek Maması-Yetişkin Köpek Maması', '052742059686', '2.357 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_hills-yetiskin-kopek-mamasi-14kg-591197.jpg', '30.11.2024', 'Yetişkin köpeklerin günlük enerji ihtiyaçlarını tam olarak karşılayan Hill_s Adult Lamb & Rice_ın özenle hazırlanan formülü 1-7 yaş arası köpeklerin bağışıklık sistemi, ağız ve diş sağlığı, sindirim sistemi ve kas sistemlerini destekler. Kas yapısının kuvvetini kaybetmemesi ve devamlılığını koruması için yüksek protein oranıyla hazırlanan Hill_s Adult Lamb & Rice bağışıklık sistemini destekleyen mineral ve vitamin yapısına sahiptir.  Formülünde bulunan vitaminlerin dengeli dağılımı köpeğinizin sağlığına olumlu etki eder. Kolay sindirilebilir özellikte olan mama kemik sistemi sağlığı için kalsiyum, kas sistemi sağlığı için protein içerir. Mama içeriğinde bulunan omega 3 ve omega 6 yağ asitleri köpeğinizin tüy ve deri sağlığına olumlu etki eder.', 'Hill_s' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_royal-canin-mini-junior-kucuk-irk-yavru-kopek-mamasi-2-kg.html', 'Royal Canin Mini Junior Küçük Irk Yavru Köpek Maması 2kg', 'Köpek Ürünleri-Köpek Maması-Yavru Köpek Maması', '3182550793001', '', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_royal-canin-yavru-kopek-mamasi-2kg-16811621.jpg', '15.07.2024', 'Küçük köpekler mama tanesinin küçük olmasından daha fazlasına ihtiyaç duyar. Büyük ırk köpeklere kıyasla daha fazla enerjiye gereksinim duyarlar ve daha kısa ve daha yoğun bir büyüme periyodları vardır. Ayrıca tipik olarak büyük köpeklerden daha uzun yaşarlar ve daha zor beğenirler. Mini Puppy, yetişkinlikteki hedef kilosu 4 ile 10 kg arası olan küçük ırk köpek yavrularının 10 aylık olana kadarki özel gereksinimlerini karşılamak üzere tasarlanmıştır. Küçük ırk köpek yavrularının gelişmekte olan sindirim sistemini desteklerKısa ve yoğun gelişim evresine yönelik olarak formüle edilmiştirMinik çenelerinin diş sağlığını destekler. Hassas bağışıklık sistemini destekler. Sindirim sağlığını ve bağırsak florası dengesini desteklemek ve iyi dışkı kalitesine katkı sağlamak üzere, yüksek kaliteli proteinli (L.I.P.*) besin maddeleri ile prebiyotik (FOS) kombinasyonu. *Çok yüksek sindirilebilirliği nedeniyle seçilmiş protein. Büyüme dönemi sırasında küçük cins yavru köpeklerin enerji ihtiyaçlarını karşılar ve titiz iştahları tatmin eder. Özellikle patentli antioksidan kompleksi ve prebiyotikler sayesinde, yavru köpeğin doğal bağışıklığına destek olmaya yardımcıdır.', 'Royal Canin' );
