INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_optimeal-hindili-ve-pirincli-yavru-kopek-mamasi-12kg.html', 'Optimeal Hindi Etli ve Pirinçli Yavru Köpek Maması 12kg', 'Köpek Ürünleri-Köpek Maması-Yavru Köpek Maması', '4820083905483', '1.949 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_optimeal-yavru-kopek-mamasi-12kg-287655406.jpg', '18.10.2023', 'Optimeal hindi etli yavru köpek maması, hamilelik, emzirme ve 2 aylıktan büyük tüm ırktaki yavrularınız için kullanabileceğiniz yavru köpeklerin, hamile ve emzirme dönemindeki yetişkin köpeklerin tüm evrelerinde kullanabileceğiniz, hindi eti ve kızılcık, hodan yağı CA, P ve D3 vitaminleri ile formüle edilmiş, sağlıklı büyümeyi destekleyen, sindirim sistemi ve bağışıklık sistemini koruyan, EPA - DHA ile zeka gelişimini destekleyici besleyici değeri yüksek protein kaynakları içeren yavru köpek mamasıdır. Optimeal köpek mamaları renklendirici, koruyucu ve tatlandırıcı içermez.', 'Optimeal' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_happy-dog-mini-piemonte-hassas-kopekler-icin-ordek-etli-ve-deniz-balikli-kucuk-irk-kopek-mamasi-4kg.html', 'Happy Dog Mini Piemonte Hassas Köpekler İçin Ördek Etli Küçük Irk Yetişkin Köpek Maması 4kg', 'Köpek Ürünleri-Köpek Maması-Yetişkin Köpek Maması', '4001967102086', '1.149 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_happy-dog-yetiskin-kopek-mamasi-4kg-320778879.jpg', '19.10.2023', 'İtalyan kestanesi ile Happy Dog Sensible Piemonte, dört ayaklı arkadaşınız için lezzetli bir öğün sunar. Tahıl ve patates içermeyen glütensiz formülasyonu ile kuru mamalara gıda intoleransı olan köpekler için idealdir.  Yüksek sindirilebilir özelliği ile ördek, lezzetli deniz balığı ve Natural Life Concept® temelli diğer malzemelerden oluşan formülasyona sahiptir. Bu özenle seçilmiş malzemeler ve özellikle hassas üretim yöntemleri, Happy Dog Mini Piemonte_yi bilinçli beslenme için ideal mama haline getiriyor.  Mama taneleri, orta ve büyük köpek ırklarının dişleri için mükemmel boyuttadır. Köpeğinizin metabolizmasını en iyi ve türe en uygun şekilde desteklemek için, köpeğin tüm sistemine bütünsel olarak fayda sağlayan doğal malzemeler kullanıyoruz - keten tohumu, seçilmiş otlar, elma ve Yeni Zelanda midyeleri. Ekstra küçük mama taneleri, 10 kg_a kadar olan küçük cins köpeklerin dişleri için idealdir. ​', 'Happy Dog' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_hills-mature-adult-7-smallminiature-kucuk-irk-tavuklu-ve-hindili-yasli-kopek-mamasi-15kg.html', 'Hill_s SCIENCE PLAN +7 Tavuklu ve Hindili Küçük Irk Olgun Köpek Maması 1,5kg', 'Köpek Ürünleri-Köpek Maması-Yaşlı Köpek Maması', '052742282602', '479 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_hills-yasli-kopek-mamasi-1kg-253854.jpg', '30.09.2024', '7 yaşından büyük, küçük ırk yaşlı köpeklerin günlük enerji ihtiyaçlarını tam olarak karşılayan tavuklu ve hindili köpek mamasıdır. Küçük ırk köpeklerin çene ve ağız yapısına uygun tanecikli yapısıyla kolay tüketilebilir özellikli olan mama, bağışıklık sistemine destek olma özelliği taşır. Yaşlı köpeklerin eklem ve kemik yapısını destekleyici içeriğiyle yaşlı köpeklerin kolay hareket etmesini ve enerjilerinin yüksek olmasını sağlar.', 'Hill_s' );
