INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kus-urunleri_quik-meyveli-muhabbet-kusu-krakeri.html', 'Quik Meyveli Muhabbet Kuşu Krakeri 30gr', 'Kuş Ürünleri-Kraker ve Ödüller-Quik Kraker ve Ödüller', '8680468041818', '', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_quik-muhabbet-kusu-yemi-171452929.jpg', '17.01.2025', 'Muhabbet kuşları için özel olarak hazırlanmıştır. Kuşların severek yedikleri, içeriğinde bol miktarda meyve içeren çubuk şeklinde krakerlerdir. Özel harmanlı içeriği ile tam ve besleyici sunum sağlarken aynı zamanda vitamin ve mineral açısından eksiksiz bir şekilde desteklenmiştir. Dostlarımızın ihtiyaç duydukları besinleri tam ve dengeli bir şekilde içerir. ​Ödül olarak verilebilir. Kuşlar birbirine yapışmış halde olan yemleri yerken enerji sarf ederek daha formda kalır. Aldığı vitamin ve minerallerle birlikte sağlıklı bir gaga yapısına kavuşur.', 'Quik' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kus-urunleri_quik-konusturucu-kus-yem-150gr.html', 'Quik Konuşturucu Kuş Yemi 150gr', 'Kuş Ürünleri-Kuş Yemleri-Konuşturucu Kuş Yemleri', '8680468040583', '8,99 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_quik-konusturucu-kus-yemi-89972703.jpg', '05.04.2025', 'Muhabbet kuşları yavru dönemlerinde konuşmaya daha hazırdır. Öncelikle ilgi ve alaka isterler. Bunun yanında hazırladığımız bu yem karışımı konuşmalarına destek olmak için hazırlanmıştır. Konuşturucu kuş yemi ses tellerini incelterek daha kolay taklit yapabilmelerini sağlar. Günlük olarak yemlerine 1 tatlı kaşığı karıştırabilirsiniz ya da ayrı bir mamalığa koyabilirsiniz.', 'Quik' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kus-urunleri_gardenmix-platin-meyveli-muhabbet-kus-yemi-500gr.html', 'Garden Mix Platin Meyveli Muhabbet Kuşu Yemi 500gr', 'Kuş Ürünleri-Kuş Yemleri-Muhabbet Kuşu Yemi', '8681085420406', '31 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_garden-mix-muhabbet-kusu-yemi-99213352.jpg', '30.12.2024', ' Kullanımı: Günde 1-2 defa kuşun büyüklüğüne ve sayısına göre tespit edilecek miktarda yemi kafes yemliğine koyunuz. Yanında her zaman taze su bulundurulması tavsiye edilir.', 'Garden Mix' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kus-urunleri_gold-wings-premium-muhabbet-kusu-yemi-1kg.html', 'Gold Wings Premium Muhabbet Kuşu Yemi 1kg', 'Kuş Ürünleri-Kuş Yemleri-Muhabbet Kuşu Yemi', '10.07.2025', '79 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_gold-wings-muhabbet-kusu-yemi-314958356.jpg', '', 'Muhabbet kuşları için özel olarak formüle edilmiş, beslenme alışkanlıkları dikkate alınarak hazırlanmış tam yemdir. Gold Wings Premium ailesi her zaman gerçek Premium hizmetini sunabilmek için en kaliteli tahıl ve tohumları bir araya getirmiştir. Özel harmanlı içeriği ile tam ve besleyici sunum sağlarken aynı zamanda vitamin ve mineral açısından eksiksiz bir şekilde desteklenmiştir. 8_i Avrupa ülkesi olmak üzere 17 farklı ülke Gold Wings Premium_u tercih etmektedir.', 'Gold Wings' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_pro-one-kedi-uzaklastirici-sprey-250ml.html', 'PRO ONE Kedi Uzaklaştırıcı Sprey 250ml', 'Kedi Ürünleri-Kedi Bakım Ürünleri-Kedi Uzaklaştırıcılar', '', '125 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_pro-one-kedi-uzaklastirici-sprey-340842057.jpg', '', 'Evcil hayvanların oluşturduğu her türlü kötü kokuyu, yağ özleri ile giderir. İpek hariç her türlü tekstil ürünlerinde kullanıma uygundur. Kedinizin girmesi istenilmeyen ortama mobilyalardan, perdelerden, ağaçlardan, çöpten, çantalardan, halı ve koltuklardan istenmeyen yasaklı bölgelerden uzaklaştırmak için püskürtün. Hareketli petlerde 6 saatte, sakin irklarda 12 saatte bir yüzeye püskürterek uygulanır. 4 gün içinde sonuç alınır.', 'PRO ONE' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_bioline-kedi-ve-kopek-biftek-aromali-agiz-bakim-sivisi-100g.html', 'Bioline Kedi ve Köpek Biftek Aromalı Ağız Bakım Jeli 100gr', 'Köpek Ürünleri-Kedi Bakım Ürünleri-Ağız_Diş Sağlığı', '6970117122589', '169 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_bioline-kedi-agiz-ve-dis-sagligi-75429977.jpg', '', 'Kedi ve köpekler için geliştirilmiş diş ve diş eti temizleme jelidir.  Biftekli olması sebebiyle evcillerinizin çok sevmesini ve sizlerin de ağız bakımını kolayca yapabilmenizi sağlar. Diş etlerine günde bir kez ve hafifçe masaj yaparak uygulamanız gerekir. Evcillerinizin yutması halinde herhangi bir zarara sebebiyet vermez. Ağız sağlığının korunmasına destek olur.', 'Bioline' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_trixie-kopek-ve-kedi-icin-kuru-kopuk-sampuan-230ml.html', 'Trixie Köpük Köpek ve Kedi Şampuanı 230ml', 'Kedi Ürünleri-Kedi Şampuanı-Köpük Şampuan', '4011905294100', '339 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-sampuani-77496355.jpg', '30.07.2025', 'Hem köpek hem de kedi için kullanılabilir. Sudan ve yıkanmaktan korkan veya çeşitli sebeplerden ötürü yıkanamayan köpekler ve kediler için çok pratik ve idealdir. Pratik kullanımı sayesinde seyahatler içinde çok kullanışlıdır. Özel formülü sayesinde kötü kokuları nötralize ederek, tüyleri ve kürkü özenle temizler. 12 haftadan büyük tüm yavru köpekler ve kediler içinde kullanılabilir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_greenfields-kopuk-kedi-sampuani-200ml.html', 'Greenfields Köpük Kedi Şampuanı 200ml', 'Kedi Ürünleri-Kedi Şampuanı-Köpük Şampuan', '22.11.2024', '245 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_greenfields-kedi-kopuk-sampuani-278694544.jpg', '', 'Kediler için özel olarak formüle edilmiş, pH dengeli canlandırıcı etkiye sahip köpük şampuandır. Derinlemesine temizlik sağlar ve kedinizin derisini rahatlatır. Tüm kedi türleri için uygundur. Paraben içermez.', 'Greenfields' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_moderna-doonut-kedi-evi-49x49cm-beyaz.html', '', 'Kedi Ürünleri-Kedi Evi & Yuvası-Moderna Kedi Evi & Yuvası', '', '', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_moderna-kedi-evi-247464745.jpg', '', 'Kediler için, yuva olarak kullanabilecekleri, üst kısmı kapalı, içerisinde minderi bulunan, sağlam ve dayanıklı kedi evidir. 
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kus-urunleri_verselelaga-prestige-papagan-yemi-1000gr.html', 'VERSELE-LAGA Prestige Papağan Yemi 1000gr', 'Kuş Ürünleri-Ağustos Seçili Ürünler-VERSELE-LAGA Ağustos Seçili Ürünler', '05.07.2024', '175 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_versele-laga-papagan-yemi-313219522.jpg', '', 'Jako, Ara Papağanı, Cacadu, Amazon vs papağanlar için tam, doğal içerikli mükemmel bir karışımdır. Papağanızın tüm besin ve vitamin ihtiyacına karşılık verir. Papağanınızın hayat kalitesini arttıran tüm besinsel değerlere sahiptir. Özel teknikle oksijeni alınarak paketlendiğinden, tazeliğini ve lezzetini son kullanma tarihine kadar koruyabilir. Kuşun yaşına ve türüne göre değişiklik gösterebilmek ile beraber ilk beslemelerde, yemin bolca verilerek, kuşun günlük tüketim miktarının gözlenerek belirlenmesi tavsiye edilir.', 'VERSELE-LAGA' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_mp-luna-plastik-kedi-evi-57x38x31cm-beyaz-kahverengi.html', 'Mp Bergamo Luna Plastik Kedi Evi 57x38x31cm (Beyaz_Kahverengi)', 'Kedi Ürünleri-Kedi Evi & Yuvası-Mp Bergamo Kedi Evi & Yuvası', '', '769 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_mp-bergamo-kedi-yuvasi-114749351.jpg', '', 'Mp Luna kedi evi yavru ve yetişkin kedilerinizin dinlenmesi ve oyun oynaması için geniş bir alana sahip olan kedi evidir. Özel olarak kaliteli plastik malzemelerden üretilmiş olup hafif ve taşıması kolaydır. Pürüzsüz yüzeye sahiptir ve temizlemesi kolaydır.', 'Mp Bergamo' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_bioline-kedi-sampuani-1000ml.html', 'Bioline Kedi Şampuanı 1000ml', 'Kedi Ürünleri-Ağustos Seçili Ürünler-Bioline Ağustos Seçili Ürünler', '6970117120820', '289 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_bioline-kedi-sampuani-77987974.jpg', '24.02.2024', 'Kediler suyu az seven canlılardır. Bioline Cat Shampoo, kedilerin sevdiği kokuları içerdiğinden ilgilerini çekip onları yatıştıracak özelliklere sahiptir. Kedinizin tüyleri köpürene kadar kedinizi yıkayın, köpürmüyorsa işlemi tekrarlayın. 
