INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_eurodog-kedi-ve-kopekler-icin-genis-aralikli-pire-taragi.html', 'EuroDog Kedi ve Köpekler için Geniş Aralıklı Pire Tarağı 20cm', 'Köpek Ürünleri-Kedi Tarağı ve Fırçası-Pire Tarağı', '', '89 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_eurodog-kedi-pire-taragi-164701776.jpg', '', 'Kedi ve köpekler için özel olarak tasarlanmış geniş aralıklı pire tarağıdır. Evcilinizi düzenli olarak taradığınızda hem üzerindeki toz hem de pireleri yakalamaya yardımcı olur. Plastik sapı sayesinde elinizden kaymaz ve pratiklik sağlar. Ürünün uzunluğu 20 cm_dir.', 'EuroDog' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_zampa-kedi-ve-kopek-icin-naturel-killi-bakim-fircasi-18x6cm-yesil.html', 'Zampa Kedi ve Köpek için Natürel Kıllı Bakım Fırçası 6x18cm (Yeşil)', 'Kedi Ürünleri-Kedi Tarağı ve Fırçası-Yumuşak Fırça ve Taraklar', '', '52 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_zampa-kedi-yumusak-firca-ve-taraklar-191651191.jpg', '', 'Kediler ve köpekler için, ahşap saplı olan bu tarak aynı zamanda doğal kıldan yapılmıştır. Kedi ve köpeklerinizin ölü tüylerini temizleyerek, tüy sağlığının ve dolayısıyla deri sağlığının korunmasına yardımcı olur. Evcilinizin tüylerini temizlerken, deri altına da masaj etkisi yapar ve kan dolaşımının hızlandırır. Böylece yeni çıkacak olan tüylerin daha sağlıklı ve canlı olmasına olanak sağlar.', 'Zampa' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_trixie-cift-tarafli-bambu-sapli-kedi-ve-kopek-tarama-fircasi-5x19cm.html', 'Trixie Çift Taraflı Bambu Saplı Kedi ve Köpekler için Tarama Fırçası 5x19cm', 'Kedi Ürünleri-Kedi Tarağı ve Fırçası-Çift Taraflı', '4011905230207', '399 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-cift-tarafli-kedi-taragi-224257524.jpg', '', 'Kediler, kısa ve orta uzunlukta kürk yapısına sahip köpekler için uygundur. Çift taraflı bu fırçanın metal tarafıyla köpeğinizi kirden, kopmuş tüylerden derisine masaj yaparak temizliyebilir, diğer tarafıyla bakımı sonlandırabilirsiniz.  Tel kılları ucundaki plastik küçük toplar sayesinde alt kürk taraması çok daha etkili ve rahat yapılmaktadır. Bambu sapı sayesinde hem ergonomik, hemde hafiftir. İnsan ve hayvan sağlığı açısından %100 zararsız malzemelerden üretilmiştir. Alerjenik maddeler bulunmaz.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_true-touch-kedi-ve-kopek-icin-tuy-toplama-ve-masaj-eldiveni-kirmizi.html', 'True Touch Kedi ve Köpek için Tüy Toplama ve Masaj Eldiveni (Kırmızı)', 'Köpek Ürünleri-Kedi Tarağı ve Fırçası-Tüy Toplama Eldiveni', '', '107 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_true-touch-kopek-tuy-toplayici-eldiven-240534730.jpg', '', 'Sevimli dostlarınızın ölü tüylerini silikon uçları sayesinde kolaylıkla temizleyebileceğiniz kullanışlı ve pratik bir üründür. Dostunuzun tüylerini tarayarak kullanabilirsiniz. Kedi ve köpekler için uygundur. 
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_karlie-plastik-sapli-kedi-fircasi-17-5x10x4cm-mor-siyah-m.html', 'Karlie Plastik Saplı Kedi Fırçası 17,5x10x4cm (Mor_Siyah) [M]', 'Kedi Ürünleri-Kedi Tarağı ve Fırçası-Sık Dişli Fırça ve Taraklar', '4016598036341', '389 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_karlie-plastik-sapli-kedi-taragi-79447710.jpg', '', 'Karlie Kedi Fırçası, ergonomik yapısı ve kaymayan tutacak kısmı sayesinde kullanım kolaylığı sağlar. Kedinizi rahatsız etmeden nazikçe kiri ve istenmeyen tüyleri ayıklar. Kedinizin düğümlenen tüylerini açar ve derinin hava almasına izin verir. İnsan ve hayvan sağlığı açısından %100 zararsız malzemelerden üretilmiştir. Alerjenik maddeler bulunmaz.', 'Karlie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_flip-plastik-sapli-kedi-ve-kopek-taragi-14cm-kirmizi.html', 'Flip Plastik Saplı Kedi ve Köpek Tarağı 14cm (Kırmızı)', 'Kedi Ürünleri-Köpek Tarağı ve Fırçaları-Sık Dişli Fırça ve Taraklar', '8681299608096', '52 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_flip-plastik-sapli-kedi-taragi-157201461.jpg', '', 'Evcil hayvanınızın derisine zarar vermeden tüyleri temizler. Tüylerinin daha sağlıklı ve parlak olmasını sağlar. Köpeğinizin ve kedinizin tüylerini tararken aynı zamanda masaj yaparak derinin rahatlamasını sağlar. Nazik bir şekilde köpeğinizi ve kedinizi okşayın ve rahatlamasını sağlayınız. Öncelikle tüylerin çıkış yönünün tersine doğru tarama yapınız. Böylece düğümlenmiş topaklar açılacaktır. Birbirine dolaşmış tüyler için tüylerin diplerini hassasça tarayarak köpeğinizin derisinin yukarıya doğru çekilmemesine dikkat edin. Son olarak tarama yönünü bu sefer tüylerin çıkış yönüne göre tarayın. Tarakta kalan tüyleri sık sık temizleyiniz.', 'Flip' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_zampa-kedi-ve-kucuk-irk-kopek-tuy-toplama-fircasi-14x7cm-kirmizi-s.html', 'Zampa Kedi ve Küçük Irk Köpek Tüy Toplama Fırçası 14x7cm (Kırmızı) [S]', 'Kedi Ürünleri-Köpek Tarağı ve Fırçaları-Sık Dişli Fırça ve Taraklar', '', '45 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_zampa-plastik-sapli-kedi-taragi-13631151.jpg', '', 'Kedi ve küçük ırk köpekler için uygundur. Düzenli olarak taranan tüyler sağlıklı ve parlak görünür. Tüyleri havalandırarak cildin nefes almasını sağlar. Vücudu ölü ve cansız tüylerinden arındırır. Masaj etkisi yaratarak kan dolaşımını hızlandırır. Temizliği kolaydır.', 'Zampa' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_furminator-uzun-tuylu-kedi-taragi-4cm-s.html', 'Furminatör Uzun Tüylü Kediler için Tüy Toplayıcı Kedi Tarağı 4cm [S]', 'Kedi Ürünleri-Kedi Tarağı ve Fırçası-Sık Dişli Fırça ve Taraklar', '4048422151296', '919 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_furminator-plastik-sapli-kedi-taragi-98784988.jpg', '', 'Alerjiye yol açan cansız ve gevşek tüyleri kesmeden kolay ve çabuk alır. Tüyün üzerindeki ölü tabaka Furminatör_ün paslanmaz çelikten yapılan ağzıyla sıyrılır, tüye en ufak zarar vermeden toplanır. Kedinizi rahatsız etmeden nazikçe kiri ve istenmeyen tüyleri ayıklar. Kedinizin düğümlenen tüylerini açar ve derinin hava almasına izin verir. Tüylerin saçılmasını %90 azaltır. Altta kalan ve diğer fırçalarla ulaşılamayan tüyleri kolayca alır. 4,45 cm', 'Furminator®' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_ferplast-gro-plastik-sapli-kedi-ve-kopek-tarama-fircasi-8x16cm.html', 'Ferplast Gro Plastik Saplı Kedi ve Köpek Tarama Fırçası 8x16cm', 'Kedi Ürünleri-Ağustos Seçili Ürünler-Ferplast Ağustos Seçili Ürünler', '8010690111889', '339 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_ferplast-plastik-sapli-kedi-taragi-115024003.jpg', '', 'Kedi ve köpeklerde tüy dökme sorunu sık sık görülmektedir. Kedi ve köpeğinizin daha az tüy dökmesi ve daha sağlıklı tüylere sahip olması için tüy tarama fırçalarından yardım alabilirsiniz. Ferplast plastik saplı tarama fırçasını kedi ve köpeğinizin için kullanabilirsiniz. Ürün oldukça dayanıklıdır. Evcil dostunuzun tüylerini daha kolay taramanız için ergonomik olarak tasarlanmıştır. İnsan ve hayvan sağlığı açısından %100 zararsız malzemelerden üretilmiştir. Alerjenik maddeler bulunmaz.', 'Ferplast' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_zampa-silikon-top-baslikli-kedi-ve-kopek-fircasi-14x6cm-kirmizi-s.html', 'Zampa Silikon Top Başlıklı Kedi ve Köpek Fırçası 6x14cm (Kırmızı) [S]', 'Kedi Ürünleri-Köpek Tarağı ve Fırçaları-Sık Dişli Fırça ve Taraklar', '', '25,95 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_zampa-kedi-sik-disli-firca-ve-taraklar-194492086.jpg', '', 'Kırmızı renk plastik saplı ve silikon top başlıklı olan, bu tarak yavru köpek ve kediler için ideal boyuttadır.  
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_zampa-kedi-ve-kopek-icin-naturel-killi-bakim-fircasi-18x6cm-pembe.html', 'Zampa Kedi ve Köpek için Natürel Kıllı Bakım Fırçası 6x18cm (Pembe)', 'Kedi Ürünleri-Çok Satanlar-Zampa Çok Satanlar', '', '', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_zampa-kedi-yumusak-firca-ve-taraklar-19164158.jpg', '', 'Kediler ve köpekler için, ahşap saplı olan bu tarak aynı zamanda doğal kıldan yapılmıştır.  Kedi ve köpeklerinizin ölü tüylerini temizleyerek, tüy sağlığının ve dolayısıyla deri sağlığının korunmasına yardımcı olur. Evcilinizin tüylerini temizlerken, deri altına da masaj etkisi yapar ve kan dolaşımının hızlandırır. Böylece yeni çıkacak olan tüylerin daha sağlıklı ve canlı olmasına olanak sağlar. 
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kopek-tarama-ve-masaj-eldiveni-14x25cm.html', 'Trixie Kedi ve Köpekler için Tarama ve Masaj Eldiveni 14x25cm', 'Köpek Ürünleri-Köpek Tarağı ve Fırçaları-Masaj Fırçası', '4011905023359', '249 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-tarak-ve-fircasi-12225946.jpg', '', 'Kedi ve köpeklerde tüy dökülmesi önemli bir problemdir. Bu problem için en uygun yöntemi seçmek çözümünü kolaylaştıracaktır. Minik dostunuz tarak ile taranmayı sevmiyor ise tarama ve masaj eldiveni onun için idealdır. Tarama ve masaj eldiveni yardımıyla kolaylıkla tüylerini tararken minik dostunuzla paylaştığınız bu zamanda ayrıca ona sevginizi gösterip mutlu edebilirsiniz. Tarama ve masaj eldivenleri kedi ve köpek için kullanılabilir. Eldiven şeklinde olması kullanım açısından da rahatlık sağlar.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_eastland-silikon-uclu-kedi-ve-kopek-tuy-toplama-fircasi.html', 'Eastland Silikon Uçlu Kedi ve Köpek Tüy Toplama Fırçası', 'Köpek Ürünleri-Köpek Tarağı ve Fırçaları-Yumuşak Fırça ve Taraklar', '', '119 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_eastland-plastik-sapli-kedi-taragi-155108308.jpg', '', 'İki taraflı tüy toplayıcı ve temizleyici fırça. Kumaş veya koltuklardan tüy toplamak için çok bastırmadan fırçalayınız. Binlerce gözenek içerek fırça uçları elektrostatik bir yükleme yaratır ve tüyleri mıknatıs gibi çeker. Halı, köşeler, merdivenler, dolaplar, kıyafetler, araba koltukları ve evcil hayvanlar üzerinde kullanılabilir. Temizlemek için sabunlu suyla durulayınız. Bulaşık makinesinin en üst rafına bile koyulabilir.', 'Eastland' );
