INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_trixie-koseye-monte-edilebilir-kedi-masaj-fircasi-8x13cm-gri.html', 'Trixie Köşeye Monte Edilebilir Kedi Masaj Fırçası 8x13cm (Gri)', 'Kedi Ürünleri-Kedi Tarağı ve Fırçası-Masaj Fırçası', '4011905231310', '249 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-plastik-sapli-kedi-taragi-147274186.jpg', '', 'Uzun tüylü ve kısa tüylü kediler için uygun, ister düz bir alana ister köşeye monte edilebilir kedi fırçasıdır. Taranmaktan çok hoşlanmayan, kendi kendini taramayı, başka alanlara sürtünerek taranmayı seven kediler için ideal bir üründür. Esnek fırça yapısıyla çok kullanışlıdır. Paket içerisinde duvara monte etmek için gerekli malzeme ve catnip çıkmaktadır. Ürün içerisine catnip konularak kedinin fırçaya ilgi göstermesi ve sürtünerek kendini taraması sağlanır. Ürün ölçüsü 8x13 cm_dir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_gimdog-kedi-ve-kucuk-irk-kopek-fircasi-6-3x14cm-s-yesil.html', 'GimDog Kedi ve Küçük Irk Köpek Fırçası 6,3x14cm [S] (Yeşil)', 'Kedi Ürünleri-Ağustos Seçili Ürünler-Gimpet Ağustos Seçili Ürünler', '8009632039435', '66 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_gimpet-kedi-sik-disli-firca-ve-taraklar-312165380.jpg', '', 'Kedi ve küçük ırk köpekler için uygundur. Tüyleri havalandırarak cildin nefes almasını sağlar. Vücudu ölü ve cansız tüylerinden arındırır. Masaj etkisi yaratarak kan dolaşımını hızlandırır. Temizliği kolaydır. Alerjen içermez.', 'Gimpet' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_furminator-kedi-ve-kopekler-icin-hazneli-masaj-ve-banyo-fircasi-7-5cm-gri.html', 'Furminator Kedi ve Köpekler için Hazneli Masaj ve Banyo Fırçası 7,5cm (Gri)', 'Köpek Ürünleri-Köpek Tarağı ve Fırçaları-Masaj Fırçası', '4048422141532', '379 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_furminator-kedi-yumusak-firca-ve-taraklar-299988519.jpg', '', 'Kedi ve köpekler için özellikle sıcak yaz aylarında yıkama işlemini ve şampuanın uygulanmasını kolaylaştırmak için kullanılan hazneli masaj ve banyo fırçasıdır. Kedi ve köpek banyo fırçasının haznesine nemlendirici veya şampuan konulabilmektedir. Fırçanın dişleri deriye zarar vermeyen kauçuktan yapılmıştır. Hazneli kedi ve köpek banyo fırçası şampuanın ekonomik kullanımını sağlarken, derinlemesine temizliğe yardımcı olur. ​Ürün 7,5 cm çapındadır.', 'Furminator®' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_gimdog-kedi-ve-kopek-tuy-kesme-makasi.html', 'GimDog Kedi ve Köpek Tüy Kesme Makası 16,5cm (Yeşil)', 'Köpek Ürünleri-Ağustos Seçili Ürünler-Gimpet Ağustos Seçili Ürünler', '8009632039749', '115 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_gimpet-kedi-tuy-makasi-ve-makineler-190915578.jpg', '', 'Köpekler için uzun, ölü tüylerinden kurtulmasını sağlaması için üretilmiştir. Uzun ve ölü tüyler köpeğinizin deri sağlığını ve kan dolaşımını etkiler. Bu yüzden evcil dostunuzun kürküne sürekli olarak bakım yapmalısınız. Makas paslanmaz çelikten imal edilmiştir ve uzun yıllar dayanıklıdır. Ergonomik tasarıma sahiptir hızlı ve etkili bir kesim garantisi verir. Aynı zamanda yeni tüylerin büyümesini teşvik eder. Ürün 16,5 cm uzunluğundadır.', 'Gimpet' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_eurogold-kedi-ve-kopek-pire-taragi-6x7cm-karisik-renkli.html', 'EuroGold Kedi ve Köpek Pire Tarağı 6x7cm (Karışık Renkli)', 'Kedi Ürünleri-Kedi Tarağı ve Fırçası-Pire Tarağı', '8681144190318', '38 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_eurogold-kedi-pire-taragi-24391258.jpg', '', 'Kedi ve köpekler için özel olarak tasarlanmış pire tarağıdır. Evcilinizi düzenli olarak taradığınızda hem üzerindeki toz hem de pireleri yakalamaya yardımcı olur. Kedi ve köpeklerin tüylerindeki pirelerden temizlenmesi için pratik taraktır. En: 6 cm 
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_eurodog-kendinden-temizlemeli-kedi-ve-kopek-fircasi-buyuk-boy.html', 'EuroDog Kendini Temizleyebilen Mekanizmalı Kedi Ve Köpek Tüy Toplama Fırçası [L]', 'Köpek Ürünleri-Köpek Tarağı ve Fırçaları-Yumuşak Fırça ve Taraklar', '', '175 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_eurodog-kedi-yumusak-firca-ve-taraklar-188509853.jpg', '', 'Evcil hayvanlarınızın dökülmek üzere olan tüy ve deri tabakalarını kesmeden temizlemenizi sağlar.  Kedi ve köpeğinize keyifli bir masaj etkisi yaratır. Normal bakım sürecinde evcil hayvanınız üzerinde bulunan toz, akar, partiküller ile sağlıklı tüylerinin uzamasını engelleyen ölü tüyleri toplayarak, deri üzerindeki kan dolaşımını kuvvetlendirir ve sağlıklı canlı parlak tüylerin gelişimine yardımcı olur. 15 günde bir kullanılmalıdır.', 'EuroDog' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_eurogold-tahta-sapli-kedikopek-fircasi-9x12cm-m.html', 'EuroGold Tahta Saplı Kedi ve Köpek Fırçası 9x12cm [M]', 'Kedi Ürünleri-Köpek Tarağı ve Fırçaları-Sık Dişli Fırça ve Taraklar', '8681144190363', '44 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_eurogold-firsat-petshop-urunleri-34811072.jpg', '', 'Minik ırk köpekler ve yavru kediler için, tüylerin taranması ve ölü tüylerin toplanmasına yardımcı bakım fırçasıdır. Evciliniz uzun tüylüyse, tüylerini her gün ya da en azından haftada birkaç kez taramalısınız. Kısa tüylü evcilleriniz yalnızca haftada bir kez taranmalıdır. Tellerinin ucundaki toplar evcillerinizin hassasiyeti düşünülerek canını acıtmadan taramanızı sağlar. Kullanımı gayet pratiktir. İnce telli, geniş yüzeyi sayesinde daha fazla alanın taranmasını sağlar. İnsan ve hayvan sağlığı açısından %100 zararsız malzemelerden üretilmiştir. Alerjenik maddeler bulunmaz.', 'EuroGold' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_trixie-cift-tarafil-yumusak-kedi-fircasi-6x13cm.html', 'Trixie Çift Taraflı Yumuşak Kedi Fırçası 6x13cm (Karışık Renkli)', 'Kedi Ürünleri-Kedi Tarağı ve Fırçası-Çift Taraflı', '4011905023595', '229 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-tarak-ve-fircalari-37962669.jpg', '', 'Ürünün bir yüzü ince tel kıllı, diğer yüzü yumuşak plastik kıllı kedi fırçasıdır. Karlie çift taraflı kedi tarağı tüylere parkalık kazandırır. Tel dişli fırçası düğümlenmiş tüyleri açmanıza yardımcı olur. Ergonomik, kaydırmaz tutacaklı olması nedeniyle kullanım kolaylığı sağlar.  İnsan ve hayvan sağlığı açısından %100 zararsız malzemelerden üretilmiştir. Alerjenik maddeler bulunmaz. Ürün karışık renklidir, stoktaki mevcut renk durumuna göre gönderim sağlanır.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_true-touch-kedi-ve-kopek-tuy-toplama-eldiveni.html', 'True Touch Kedi ve Köpek Tüy Toplama Eldiveni', 'Köpek Ürünleri-Kedi Tarağı ve Fırçası-Tüy Toplama Eldiveni', '8682631200701', '36 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_flip-kedi-tuy-toplama-eldiveni-44112827.jpg', '', 'Sevimli dostlarınızın ölü tüylerini silikon uçları sayesinde kolaylıkla temizleyebileceğiniz kullanışlı ve pratik bir üründür. Dostunuzun tüylerini tarayarak kullanabilirsiniz. Kedi ve köpekler için uygundur. 
