INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_moderna-odyssey-cift-girisli-kedi-ve-kopek-tasima-cantasi-39x40x58cm-karisik-renkli.html', 'Moderna Odyssey Çift Girişli Kedi ve Köpek Taşıma Çantası 39x40x58cm (Karışık Renkli)', 'Kedi Ürünleri-Kedi Taşıma Çantası-Metal Kapılı', '', '1.649 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_moderna-kedi-metal-tasima-280669599.jpg', '', 'Geniş, sağlam ve güvenli taşıma çantası evcil dostunuzun yol arkadaşı olacaktır. En büyük havalandırma açıklıklarından sürekli temiz hava akışı gerçekleşir. Krom kaplı toksik olmayan metal kapıları mevcuttur. Taşıması kolay bir kulp ile birlikte gelir.  Sıcak sabunlu su ile temizlenmesi kolaydır. Uzun süreli kullanım için üstün kaliteli plastikten üretilmiştir. Yüksek iç alan evcil hayvanınızın stresini azaltır. Üstten açılan kapısı ile kendi çıkmayan istemeyen dostunuzu kolaylıkla çıkarabilirsiniz. Çok noktalı ön kilit ile güvenliği maksimum seviyede sağlar. Yumuşak dokunuşlu ve katlanabilir tutamak taşımayı daha kolay hale getirir. Ürün karışık renklidir. Stok durumuna göre gönderim sağlanacaktır. 
