INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_trixie-pet-tasima-cantasi-riva-45cm-siyah.html', 'Trixie Pet Taşıma Çantası Riva 45cm (Siyah)', 'Kedi Ürünleri-Ağustos Seçili Ürünler-Trixie Ağustos Seçili Ürünler', '4011905362113', '1.499 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-tasima-cantasi-936929.jpg', '', 'Yumuşak iç tabanlı , ön tarafında takılıp çıkarılabilen fermuarlı file bölümlü, yan cepli , tabanı fermuarlı, çamaşır makinasında 30C_ye kadar yıkanabilir pet taşıma çantası. Çantanın içinde bulunan kısa tasma ile petinizin çantanın içinden atlaması engellenir. Kedinizi bu ürüne alıştırmak için Trixie_nin 4238 ve 4241 kodlu catnip spreyi ( catnip ) ürününü kullanabilirsiniz. Catnip kedinizin ürüne karşı merakını arttıracaktır. Kediniz catnip kokusunu aldığında rahatlamış ve sakinleşmiş olarak ürünü benimseyecektir. Kedinizi herhangi bir ürüne alıştırmak için oldukça etkili bir yöntemdir. Özellikle taşıma kaplarında taşıma kabını seyahatten önce kedinizle tanıştırmanız ve ürüne güven duymasını sağlamanız çok önemlidir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_mps-pratiko-plastik-kapili-kedi-ve-kopek-tasima-cantasi-48x31x33cm-kirmizi.html', 'Mps Pratiko Plastik Kapılı Kedi ve Köpek Taşıma Çantası 48x31x33cm (Karışık Renkli)', 'Kedi Ürünleri-Kedi Taşıma Çantası-Plastik Kapılı', '', '429 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_mps-kedi-tasima-cantasi-48466665.jpg', '', 'Gerek geniş ürün çeşitliliği ve bu ürünlerdeki özgün tasarımları gerek ise ürettiği ürünlerde yüksek kalite Mps_yi ön plana çıkarmaktadır. Ürünler İtalyada üretilmiştir.  Kedi ve Tavşanlarınız için yüksek kaliteli malzemeden üretilmiş temizliği kolay taşıma çantasıdır.  Evcil hayvanlar için özel olarak üretilmiştir. Kısa veya uzun yolculuklarda güvenle evcil hayvanlarınızın taşınmasını sağlayabilirsiniz.  Birinci sınıf malzemelerden üretilmiş olup deforme çizilme vb durumlara yüksek oranda dayanıklıdır. Seyehat eden evcil hayvanın rahatlığı göz önünde bulundurulmuştur. Bu kapsamda evcil hayvanınız için rahat ve konforlu bir taşıma sağlar. Şık ve yenilikçi bir tasarım anlayışına sahiptir. Salınım yapmaz. %100 evcil hayvan sağlığına zararsızdır. Delikli yan yüzey ve metal kapısı ile hava sirkülasyonu sağlanmaktadır. Ürün temizliği oldukça kolaydır. Ürün karışık renklerdedir. Stoktaki renk durumuna göre gönderim sağlanır. Ürün 48x31x33 cm_dir.', 'Mps' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_trixie-kedi-ve-kucuk-irk-kopek-tasima-cantasi-16x20x30cm-s-su-yesili-gri.html', 'Trixie Kedi ve Küçük Irk Köpek Taşıma Çantası 16x20x30cm [S]', 'Kedi Ürünleri-Kedi Taşıma Çantası-Omuz Çantası', '4011905288581', '1.049 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-omuz-cantasi-272452631.jpg', '', '5 kg_a kadar olan çok küçük ırk köpekler ve kediler için ideal taşıma çantasıdır. Özel kumaşı sayesinde düzgün bir duruşa sahiptir. Çanta askıları ile omuzda rahatlıkla taşınabilir. Üst tarafı açılabilir pratik ve kullanışlı bir çantadır. Dış yanlarında cepleri vardır. Çanta içerisinde sabit kısa bağlama kayışı vardır. Bu sayede içerisindeki pet çanta içerisine bağlanabilir, kapak açıkken kaçması, aniden dışarı çıkması önlenmiş olur. Çanta kumaşı polysesterdir. Kolay silinebilen ve temizlenebilen bir kumaştır.', 'Trixie' );
