INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_mps-pratiko-metal-kapili-kedi-ve-kopek-tasima-cantasi-55x36x36cm.html', 'Mps Pratiko Metal Kapılı Kedi ve Köpek Taşıma Çantası 55x36x36cm (Karışık Renkli)', 'Kedi Ürünleri-Kedi Taşıma Çantası-Metal Kapılı', '', '599 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_mps-kedi-metal-tasima-84191105.jpg', '', 'Kedi ve köpekleriniz için yüksek kaliteli malzemeden üretilmiş temizliği kolay taşıma çantasıdır.  Evcil hayvanlar için özel olarak üretilmiştir. Kısa veya uzun yolculuklarda güvenle evcil hayvanlarınızın taşınmasını sağlayabilirsiniz.  Birinci sınıf malzemelerden üretilmiş olup deforme çizilme gibi durumlara yüksek oranda dayanıklıdır.  Seyehat eden evcil hayvanın rahatlığı göz önünde bulundurulmuştur. Bu kapsamda evcil hayvanınız için rahat ve konforlu bir taşıma sağlar. Şık ve yenilikçi bir tasarım anlayışına sahiptir. Salınım yapmaz. %100 evcil hayvan sağlığına zararsızdır. Delikli yan yüzey ve metal kapısı ile hava sirkülasyonu sağlanmaktadır. Ürün temizliği oldukça kolaydır.', 'Mps' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_trixie-kedi-tirmalama-kulesi-40x100cm.html', 'Trixie Kedi Tırmalama Kulesi 40x100cm', 'Kedi Ürünleri-Kedi Evi & Yuvası-Trixie Kedi Evi & Yuvası', '4047974043387', '11.401,15 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-tirmalama-tahtasi-18034079.jpg', '', 'Dış yüzeyi tamamen tırmalamaya uygun malzeme ile kaplı, kule dış yüzeyi üzerindeki delikleri uzun tüylü peluş ile kaplıdır. İçerisinde peluş kaplı katları mevcuttur. İçerisinde dört bölüm vardır ve peluş ile kaplıdır. Elastik ip ucuna bağlı oyuncağı vardır. Kahverengi_krem rengindedir. Kedinizi bu ürüne alıştırmak için Trixie_nin 4238 ve 4241 kodlu catnip spreyi ( catnip ) ürününü kullanabilirsiniz. Catnip kedinizin ürüne karşı merakını arttıracaktır. Kediniz catnip kokusunu aldığında rahatlamış ve sakinleşmiş olarak ürünü benimseyecektir. Kedinizi herhangi bir ürüne alıştırmak için oldukça etkili bir yöntemdir. Özellikle taşıma kaplarında taşıma kabını seyahatten önce kedinizle tanıştırmanız ve ürüne güven duymasını sağlamanız çok önemlidir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_mp-luna-kedi-evi-57x38x31cm-beyaz.html', 'Mp Bergamo Luna Plastik Kedi Evi 57x38x31cm (Beyaz)', 'Kedi Ürünleri-Kedi Evi & Yuvası-Mp Bergamo Kedi Evi & Yuvası', '', '769 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_mp-bergamo-kedi-yuvasi-114699815.jpg', '', 'Mp Luna kedi evi yavru ve yetişkin kedilerinizin dinlenmesi ve oyun oynaması için geniş bir alana sahip olan kedi evidir. Özel olarak kaliteli plastik malzemelerden üretilmiş olup hafif ve taşıması kolaydır. Pürüzsüz yüzeye sahiptir ve temizlemesi kolaydır. Kaliteli malzeme yapısı sayesinde uzun yıllar kullanım ömrü sunmaktadır. İnsan ve hayvan sağlığına %100 zararsızdır. Temizlemesi kolay ve pratiktir.', 'Mp Bergamo' );
