INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_trixie-terasli-ve-balkonlu-kedi-evi-45x65x45cm-gri-beyaz.html', 'Trixie Teraslı ve Balkonlu Kedi Evi 45x65x45cm (Gri_Beyaz)', 'Kedi Ürünleri-Kedi Evi & Yuvası-Trixie Kedi Evi & Yuvası', '4011905440934', '3.699 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-evi-131259711.jpg', '', 'Emprenye çamdan üretilmiş, iç mekanda ve dış mekanda kullanılabilecek kedi evidir. Yağmura, kara dayanıklıdır. Ayaklarındaki koruma plastikleri sayesinde ayaklar çürüme yapmaz, dış hava koşullarına dayanıklıdır. Emprenye olması sebebiyle dış hava koşullarında yağmur vb aldığında şişme, dönme vb yapmaz. Kedi evi yüksekliği 65cm_dir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_mp-luna-kedi-evi-57x38x31cm-siyah-beyaz.html', 'Mp Bergamo Luna Plastik Kedi Evi 57x38x31cm (Siyah_Kahverengi)', 'Kedi Ürünleri-Kedi Evi & Yuvası-Mp Bergamo Kedi Evi & Yuvası', '', '769 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_mp-bergamo-kedi-yuvasi-122147901.jpg', '', 'Mp Luna kedi evi yavru ve yetişkin kedilerinizin dinlenmesi ve oyun oynaması için geniş bir alana sahip olan kedi evidir. Özel olarak kaliteli sert plastik malzemelerden üretilmiş olup hafif ve taşıması kolaydır. Darbelere karşı max dayanıklılık sağlar. Pürüzsüz yüzeye sahiptir ve temizlemesi kolaydır. Modülerdir kolayca iki parçaya bölüp taşıyabilirsiniz.', 'Mp Bergamo' );
