INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_peggy-bubbles-pelus-kedi-evi-36x40x38cm-gri.html', 'Peggy Bubbles Peluş Kedi Evi 36x40x38cm (Gri)', 'Kedi Ürünleri-Kedi Evi & Yuvası-Peggy Kedi Evi & Yuvası', '', '509 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_peggy-kedi-evi-275969086.jpg', '', 'Sağlam ve dayanıklı olması için döşemelik kumaştan üretilmiştir. Patili dostunuz için rahat ve konforlu dinlenme olanağı sunar. Yatağın altı tüm yüzeylerde sabit durur ve kaymaz. Alt kaydırmaz kumaş aynı zamanda su geçirmez özelliktedir, yıkama sonrası çökme yapmaz. Yatakta kullanılan elyaf aynı zamanda anti-bakteriyeldir. Kedi evinin minderi istendiğinde çıkarılarak ayrıca kullanılabilir.', 'Peggy' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_bioline-uzun-tuylu-kediler-icin-sampuan-250ml.html', 'Bioline Uzun Tüylü Kedi Şampuanı 250ml', 'Kedi Ürünleri-Kedi Şampuanı-Sıvı Şampuan', '6970117122886', '125 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_bioline-kedi-sampuani-75442862.jpg', '', 'Uzun tüylü kediler için özel formüle edilmiş şampuandır. Kedilerinizin tüylerini yumuşacık yapar ve kolayca taranmasını sağlar. Tüylerinin parlak ve sağlıklı olmasına destek olur. İçeriğinde kedilerin sevdiği kokuları barındırdığından, doğaları gereği suyu sevmeyen kedilerin bile ilgisini çekecek ve onları yatıştıracak özelliklere sahiptir. Kedilerinizin tüylerini köpürterek yıkayın.  Yıkama işlemi sonunda kedinizi bol su ile iyice durulayın.  Gözle temas etmesine engel olun. Ürün; 250ml_dir.', 'Bioline' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_bioline-hasere-kovucu-kedi-sampuani-200ml.html', 'Bioline Haşere Kovucu Kedi Şampuanı 200ml', 'Kedi Ürünleri-Kedi Şampuanı-Sıvı Şampuan', '6970117123883', '112 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_bioline-kedi-sivi-sampuani-189157812.jpg', '', 'Bioline Haşere Kovucu Kedi Şampuanı, her ırktan kediler için uygun hazırlanmıştır. Kedinizi bit, pire ve kene gibi haşerelerden korumak için özel içeriğe sahiptir.  Yetişkin kediler için uygundur. Düzenli olarak kullanımda tüy ve deri bakımını kolaylaştırır. Ürün 200 ml_dir.', 'Bioline' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_beavis-anti-stress-lavanta-ve-biberiye-ozlu-kedi-toz-sampuan-150gr.html', 'Beavis Anti-Stress Lavanta ve Biberiye Özlü Toz Kedi Şampuanı 150gr', 'Kedi Ürünleri-Kedi Şampuanı-Kuru Şampuan', '', '79 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_beavis-kedi-kuru-sampuani-194747933.jpg', '', 'Anti Stress Kuru Şampuan, içerdiği güçlü ve doğal bileşenleriyle istenmeyen kötü kokuları hızlı ve kolay şekilde yok ederek dostumuzun tüy yapısının daha canlı ve parlak olmasını sağlar. Sakinleştirici özelliğe sahip içeriğindeki doğal bitki özleri ile deri ve tüy yapısı problemlerinin azaltılmasına da yardımcı olur. Zararlı kimyasal bileşenler içermeyen bu özel formül yağ ve kirleri absorbe ederek temizler ve düzenli yıkama aralığını da azaltmaya yardımcı olur. Sevimli dostumuzun bakım süreçlerinde sizlere kolaylık, kendisine ise optimum seviyede motivasyon ve hijyen sağlar. Tüylerin üzerine dökülüp bir fırça ile tarayın. Tarama işlemini toz kaybolana kadar yapabilirsiniz.', 'Beavis' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_zampa-moringa-ozlu-kedi-ve-kopekler-icin-kopuk-sampuan-250ml.html', 'Zampa Moringa Özlü Kedi ve Köpekler için Köpük Şampuan 250ml', 'Köpek Ürünleri-Kedi Şampuanı-Köpük Şampuan', '30.12.2024', '84 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_zampa-kopek-kopuk-sampuan-206975377.jpg', '', 'SLES, Paraben, boya içermeyen formülü moringa ekstraktı ile zenginleştirilmiştir.  Uygulama kolaylığı ile tüyleri ıslatmadan nazikçe temizler, kolaylıkla taranmasını sağlar. 
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_mp-luna-plastik-kedi-evi-57x38x31cm-gri-beyaz.html', 'Mp Bergamo Luna Plastik Kedi Evi 57x38x31cm (Gri_Beyaz)', 'Kedi Ürünleri-Kedi Evi & Yuvası-Mp Bergamo Kedi Evi & Yuvası', '', '769 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_mp-bergamo-kedi-yuvasi-114721725.jpg', '', 'Mp Luna kedi evi yavru ve yetişkin kedilerinizin dinlenmesi ve oyun oynaması için geniş bir alana sahip olan kedi evidir. Özel olarak kaliteli plastik malzemelerden üretilmiş olup hafif ve taşıması kolaydır. Pürüzsüz yüzeye sahiptir ve temizlemesi kolaydır. Kaliteli malzeme yapısı sayesinde uzun yıllar kullanım ömrü sunmaktadır. İnsan ve hayvan sağlığına %100 zararsızdır. Temizlemesi kolay ve pratiktir.', 'Mp Bergamo' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_zozo-kedi-ve-kopekler-icin-hipoalerjenik-beyaz-sabun-kokulu-kuru-sprey-sampuan-150ml.html', 'Zozo Kedi ve Köpekler İçin Hipoalerjenik Beyaz Sabun Kokulu Kuru Sprey Şampuan 150ml', 'Kedi Ürünleri-Kedi Şampuanı-Kuru Şampuan', '8699622000073', '159 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_zozo-kedi-kuru-sampuani-314353364.jpg', '30.10.2024', 'İçerisindeki nano colloidal silver ve doğal prebiyotik olan ethylhexylglycerin sayesinde derideki istenmeyen kokuları yok eder, vücut kokusunu tazeler. Sprey formu siz ve patili dostunuz için pratik ve etkili bir temizlik sunar. Kedi dostlarımızı banyoda yıkayamadığımız, köpek dostlarımızı da sık sık banyoda yıkamamamız gerektiği için bakım ve kuru yıkama spreylerimizi evcil dostunuzun temizlik ve bakımı için kullanabilirsiniz. Biotin, aloe vera ve vitamin E sayesinde patili dostunuzun cildini besler ve tüylerini canlandırır. Akredite laboratuvar sonuçları ile kanıtlanmış antibakteriyel ve antifungal özelliğe sahiptir. Hipoalerjeniktir, alerjik dostlarınız için de tercih edebilirsiniz. Kedi ve köpek kullanımına uygundur, kullanım sırasında insan cildine zarar vermez. Günde en fazla 2 kez kullanılabilir. Beyaz sabun kokulu kuru sprey şampuan, patili dostlarınız için özel olarak geliştirilmiş formülü ile cildi tahriş etmez ve vücut kokusunu tazeler. Klor, alkol, paraben, sülfat, parfüm, SLES, SLS, silikon, zararlı kimyasallar, fosfat, amonyak, boya ve sentetik yağ içermez.', 'Zozo' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_bioline-yavru-kedi-sampuani-200ml.html', 'Bioline Yavru Kedi Şampuanı 200ml', 'Kedi Ürünleri-Kedi Şampuanı-Sıvı Şampuan', '6970117123852', '112 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_bioline-kedi-sampuani-90864731.jpg', '', 'Her ırk yavru kedi için uygun bakım şampuanıdır. Kedinizin tüylerin yumuşasık ve sağlıklı olmasını sağlar. Doğaldır ve kedinize zarar vermez. Herhangi bir aromaya sahip değildir, hoş bir kokusu vardır. Kediler çok sık yıkanmamalıdır ve yıkandıklarında iyice kurutulmalıdır. Aksi takdirde kolayca hastalanabilirler. Ürün 200 ml_dir. Direkt uygulanabilir.', 'Bioline' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_le-charme-kir-ve-yag-arindirici-kedi-ve-kopek-sampuani-370ml-1.html', 'Le Charme Kir ve Yağ Arındırıcı Kedi ve Köpek Şampuanı 370ml', 'Köpek Ürünleri-Kedi Şampuanı-Sıvı Şampuan', '28.02.2025', '159 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_le-charme-kedi-sivi-sampuani-18258873.jpg', '', 'Kir ve yağ arındırııcı şampuan. Kedi ve köpeğinizin deri ve tüylerinde temizlik sağlayarak ferah bir koku verir. Uygun sıcaklıkta suyla petinizi yıkayınız. Kısa tüylü patiler için, daha az şampuan kullanınız. Gözlerine ve ağzına dikkat ederek şampuanlayınız. 5-6 dakika masaj yaparak iyice köpürtünüz. Bol su ile durulayınız. Uygulamadan sonra ellerinizi yıkayınız.', 'Le Charme' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_zozo-kedi-ve-kopekler-icin-hipoalerjenik-lavanta-yagli-kuru-sprey-sampuan-150ml.html', 'Zozo Kedi ve Köpekler İçin Hipoalerjenik Lavanta Yağlı Kuru Sprey Şampuan 150ml', 'Kedi Ürünleri-Kedi Şampuanı-Kuru Şampuan', '8699622000059', '159 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_zozo-kedi-kuru-sampuani-314296496.jpg', '30.11.2024', 'İçerisindeki nano colloidal silver ve doğal prebiyotik olan ethylhexylglycerin sayesinde derideki istenmeyen kokuları yok eder, vücut kokusunu tazeler. Sprey formu siz ve patili dostunuz için pratik ve etkili bir temizlik sunar. Kedi dostlarımızı banyoda yıkayamadığımız, köpek dostlarımızı da sık sık banyoda yıkamamamız gerektiği için bakım ve kuru yıkama spreylerimizi evcil dostunuzun temizlik ve bakımı için kullanabilirsiniz. Biotin, aloe vera ve vitamin E sayesinde patili dostunuzun cildini besler ve tüylerini canlandırır. Akredite laboratuvar sonuçları ile kanıtlanmış antibakteriyel ve antifungal özelliğe sahiptir. Hipoalerjeniktir, alerjik dostlarınız için de tercih edebilirsiniz. Kedi ve köpek kullanımına uygundur, kullanım sırasında insan cildine zarar vermez. Günde en fazla 2 kez kullanılabilir. Lavanta yağlı kuru sprey şampuan, patili dostlarınız için özel olarak geliştirilmiş formülü ile cildi tahriş etmez ve vücut kokusunu tazeler. Klor, alkol, paraben, sülfat, parfüm, SLES, SLS, silikon, zararlı kimyasallar, fosfat, amonyak, boya ve sentetik yağ içermez.', 'Zozo' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_bio-magic-toz-kedi-sampuani-150gr.html', 'BIO PetActive Magic Lavanta ve Biberiye Özlü Kuru Kedi Şampuanı 150gr', 'Kedi Ürünleri-Kedi Şampuanı-Kuru Şampuan', '8698931093318', '83 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_pet-active-kedi-sampuani-76011164.jpg', '', 'Bio-Magic Toz Şampuan kolay kullanımı ile evcil dostunuzun kürküne canlılık veririr, kötü kokuları önler. Düzenli yıkama aralarındaki süreyi uzatır. Kürke hacim verir.  %100 doğal formül ile hazırlanmış Bio-Magic boya, paraben, sentetik parfüm ve talk pudrası içermez. Kürkteki kokuyu nötralize eder. Yağları ve kiri absorbe ederek temizler. İçeriğindeki, bitki özleri deri ve tüy problemlerini gidermede ve tüylerin sağlıklı uzamasına yardımcı olur.', 'BIO PetActive' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_zozo-kedi-ve-kopekler-icin-hipoalerjenik-kokusuz-kuru-sprey-sampuan-150ml.html', 'Zozo Kedi ve Köpekler İçin Hipoalerjenik Kokusuz Kuru Sprey Şampuan 150ml', 'Kedi Ürünleri-Kedi Şampuanı-Kuru Şampuan', '8699622000042', '159 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_zozo-kedi-kuru-sampuani-314267581.jpg', '30.08.2023', 'İçerisindeki nano colloidal silver ve doğal prebiyotik olan ethylhexylglycerin sayesinde derideki istenmeyen kokuları yok eder, vücut kokusunu tazeler. Sprey formu siz ve patili dostunuz için pratik ve etkili bir temizlik sunar. Kedi dostlarımızı banyoda yıkayamadığımız, köpek dostlarımızı da sık sık banyoda yıkamamamız gerektiği için bakım ve kuru yıkama spreylerimizi evcil dostunuzun temizlik ve bakımı için kullanabilirsiniz. Biotin, aloe vera ve vitamin E sayesinde patili dostunuzun cildini besler ve tüylerini canlandırır. Akredite laboratuvar sonuçları ile kanıtlanmış antibakteriyel ve antifungal özelliğe sahiptir. Hipoalerjeniktir, alerjik dostlarınız için de tercih edebilirsiniz. Kedi ve köpek kullanımına uygundur, kullanım sırasında insan cildine zarar vermez. Günde en fazla 2 kez kullanılabilir. Kokusuz kuru sprey şampuan, patili dostlarınız için özel olarak geliştirilmiş formülü ile cildi tahriş etmez ve vücut kokusunu tazeler. Klor, alkol, paraben, sülfat, parfüm, SLES, SLS, silikon, zararlı kimyasallar, fosfat, amonyak, boya ve sentetik yağ içermez.', 'Zozo' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_bioline-kedikopek-kopuk-sampuan-220gr.html', 'Bioline Kedi ve Köpek Köpük Şampuan 220gr', 'Köpek Ürünleri-Kedi Şampuanı-Köpük Şampuan', '6970117120219', '209 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_bioline-kedi-sampuani-17552819.jpg', '05.08.2025', 'Bioline Foam Shampoo, sudan hoşlanmayan kediler ve köpekler için ideal bir üründür. Köpük formu sayesinde köpeğinizin ve kedinizin tüylerine parlaklık sağlar.', 'Bioline' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_bioline-beyaz-tuylu-kediler-icin-sampuan-200ml.html', 'Bioline Beyaz Tüylü Kediler için Şampuan 200ml', 'Kedi Ürünleri-Kedi Şampuanı-Sıvı Şampuan', '6970117123869', '112 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_bioline-kedi-sampuani-90875171.jpg', '', 'Beyaz tüylü kediler için özel olarak üretilmiş şampuandır. Beyaz tüylü kedilerin tüyleri hassas ve bakıma ihtiyaç duyan türdendir. Bu sebeple beyaz kedilere özel üretilmiş bir şampuan kullanmanız tüy ve deri sağlıkları için daha iyi olacaktır. Ürünü direkt tüylere uygulayıp köpürterek kullanabilirsiniz. 200 ml hacmindedir.', 'Bioline' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_profarm-kedi-ve-kopekler-icin-cilekli-kopuk-sampuan-150ml.html', 'Profarm Kedi ve Köpekler için Çilekli Köpük Şampuan 150ml', 'Köpek Ürünleri-Kedi Şampuanı-Köpük Şampuan', '30.06.2024', '84 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_profarm-kedi-kopuk-sampuani-276326710.jpg', '', 'Kedi ve köpekler için çilekli kuru yıkama köpük şampuan, güçlü formülü ile ilk kullanımdan itibaren dostumuzun ve yaşam alanının kötü kokulardan arınmasını, tüyleri canlandırarak dökülmesini engeller. E vitamini ve kepek oluşumu engelleyen pentanol (vitamin) içerir. Paraben ve boya içermez. Köpeklerde ve kedilerde yıkama ve temizlik amacıyla kullanılır.', 'Profarm' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_biopetactive-bal-ozlu-kedi-sampuani-250ml.html', 'BIO PetActive Doğal Bal Özlü Kedi Şampuanı 250ml', 'Kedi Ürünleri-Kedi Şampuanı-Sıvı Şampuan', '8698931093486', '56 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_pet-active-kedi-sampuani-75985192.jpg', '', 'Kedi doslarınız için tüylerine parlaklık veren ve sağlıklı görünmesini sağlayan kedi şampuanı. 
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_tri-xi-e-kedi-ve-kopekler-icin-kuru-sampuan-100gr.html', 'Trixie Kedi ve Köpekler için Kuru Şampuan 100gr', 'Köpek Ürünleri-Çok Satanlar-Trixie Çok Satanlar', '4011905029184', '', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-sampuani-15768506.jpg', '30.05.2025', 'Tüm kedi, köpek ve küçük petler (hamster, guinea pig, vb ) için uygun bir kuru şampuandır. Özellikle sudan korkan veya su içerisinde bulunmaktan, yıkanmaktan hoşlanmayan tüm petler için uygundur. Seyahatlerde çok kolay kullanımı vardır. Kürkü hem temizler hem de güzel kokmasını sağlar. Deri sağlığını koruyan, 12 haftalıktan itibaren kullanılabilecek bir kuru şampuandır. İnsan ile köpek deri ph_ı birbirinden farklıdır. Bu yüzden bebek şampuanı bile köpekler için uygun değildir. Köpeğinizi yıkarken muhakkak köpek şampuanı ile yıkamanız gerekmektedir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_bio-pet-active-aloe-vera-ozlu-kedi-sampuani-250ml.html', 'BIO PetActive Aloe Vera Özlü Kedi Şampuanı 250ml', 'Kedi Ürünleri-Kedi Şampuanı-Sıvı Şampuan', '8698931093479', '56 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_pet-active-kedi-sivi-sampuani-76899857.jpg', '', '  İçeriğindeki özenle seçilmiş yüzey aktifler ve aloe vera ile kediniz için arındırıcı, nemlendirici bakım şampuanıdır. İçeriğindeki; Aloe Vera, cilt sağlığını nemlendirerek korur. Kuru ciltlerdeki sık karşılaşılan dökülme ve kızarıklık sorunlarının giderilmesine yardımcı olur. Cilt üzerindeki serbest radikallerin hareket kabiliyetini azaltan Aloe Vera cilt hücrelerini ve cilt dokusunu güçlendirir. Uygulama için önce kedinizin vücudu ılık suyla ıslatılır. Kullanılacak miktar 5 katı suyla seyreltildikten sonra şampuanlamaya ve yıkamaya sırt kısmından başlanarak , masaj yaparak köpürtülür. Son olarak durulanıp kurulanarak tüyler taranır.', 'BIO PetActive' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-natural-kopek-sampuani-1000ml.html', 'Trixie Natural Kedi_Köpek Şampuanı 1000ml', 'Köpek Ürünleri-Kedi Şampuanı-Sıvı Şampuan', '4011905029177', '549 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-sampuani-12119262.jpg', '30.06.2025', 'Güzel tüyler için hassas bakım sağlayan kedi ve köpek şampuanı %100 bitkisel üründür.İnsan ile köpek deri ph ı birbirinden farklıdır.Bu yüzden bebek şampuanı bile köpekler için uygun değildir. Köpeğinizi yıkarken muhakkak köpek şampuanı ile yıkamanız gerekmektedir. Aroma ve koruyucu maddelerden arındırılmış bu şampuan, köpeklerin tüylerini yıpratmadan daha doğal şekilde temizler. Şampuanı ıslak tüylere yayarak ılık suyla yıkayınız. Doğrudan göze temas ettirmeyiniz.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_pro-one-vanilya-ozlu-kuru-kedi-ve-kopek-sampuani-150gr.html', 'PRO ONE Vanilya Özlü Kuru Kedi ve Köpek Şampuanı 150gr', 'Köpek Ürünleri-Kedi Şampuanı-Kuru Şampuan', '08.04.2024', '75 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_pro-one-kedi-kuru-sampuani-239945228.jpg', '', 'Kedi ve köpeklerin deri ve tüy temizliğinde kullanılan vanilya özlü kuru şampuandır.', 'PRO ONE' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_bioline-kedikopek-kuru-toz-sampuan-100gr.html', 'Bioline Toz Kedi ve Köpek Şampuanı 100gr', 'Kedi Ürünleri-Kedi Şampuanı-Kuru Şampuan', '6970117120202', '125 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_bioline-kedi-sampuani-20437414.jpg', '13.01.2025', 'Bioline Dry Clean Powder, özellikle kedi ve köpeğinizi yıkamaktan çekindiğiniz soğuk havalarda veya bunun haricinde hızlıca temizlemek için kullanabileceğiniz kuru toz şampuandır. Tüylerin üzerine dökülüp bir fırça ile tarayın. Tarama işlemini toz kaybolana kadar yapabilirsiniz.', 'Bioline' );
