INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_bioline-kedi-ve-kopek-sabunu-100gr-bitpirekene-engelleyici.html', 'Bioline Çay Ağacı Özlü Kedi ve Köpek Sabunu 100gr', 'Köpek Ürünleri-Kedi Şampuanı-Bioline Kedi Şampuanı', '6970117120400', '96 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_bioline-kedi-sampuani-26124000.jpg', '30.11.2025', 'Kedi ve köpekler için cildi kurutmadan tüylerinde doğal parlaklık sağlayan, çay ağacı yağı ile formüle edilmiş doğal, katkısız sabundur.', 'Bioline' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_bioline-kedikopek-dogal-sampuan-250ml.html', 'Bioline Doğal Kedi ve Köpek Şampuanı 250ml', 'Köpek Ürünleri-Kedi Şampuanı-Sıvı Şampuan', '6970117120066', '129 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_bioline-kedi-sampuani-1747690.jpg', '21.06.2025', 'Bazı kediler ve köpekler yabancı kokulardan rahatsız olabilirler. Bioline Neutral Shampoo, bu tip evciller için kullanılan kokusuz doğal şampuandır.', 'Bioline' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_trixie-kedi-sampuani250ml.html', 'Trixie Kedi Şampuanı 250ml', 'Kedi Ürünleri-Kedi Şampuanı-Sıvı Şampuan', '4011905029085', '245 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-sampuani-7536436.jpg', '30.07.2025', 'Kedilerin tüylerini yeniden canlandıran %100 bitkisel kedi bakım şampuanı.İnsan ile kedi deri ph ı birbirinden farklıdır.Bu yüzden bebek şampuanı bile kediler için uygun değildir.Kedinizi yıkarken muhakkak kedi şampuanı ile yıkamanız gerekmektedir. Kediler için %100 uygun hoş kokulu şampuandır. Ev dışına çıkıp kirlenen kedilerin veya ev kedilerin tüylerinin temizliği için kullanılabilir. Kedi tüy sağlığına olumlu etki eder. Kedilerin cilt sağlığına uyumlu ph değerine sahiptir. Yetişkin, yavru ve yaşlı kediler için uygundur. 250 ml şampuanla dolu plastik şişeli bir üründür. Her renk tüy sahibi kedi için kullanılabilir.      ', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_trixie-kedikopek-kuru-sampuan-200gr.html', 'Trixie Kuru Kedi ve Köpek Şampuanı 200gr', 'Kedi Ürünleri-Kedi Şampuanı-Kuru Şampuan', '4011905291826', '375 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-sampuani-7629256.jpg', '30.06.2025', 'Tüm kedi , köpek ve küçük petler (hamster , guinea pig , vb ) için uygun bir kuru şampuandır.Özellikle sudan korkan veya su içerisinde bulunmaktan hoşlanmayan tüm petler için uygun , seyahatlerde çok kolay kullanımı olan , kürkü hem temizleyen hemde güzel kokmasını sağlayan , deri sağlığını koruyan , 12 haftalıktan itibaren kullanılabilecek bir kuru şampuandır.İnsan ile hayvanların deri ph_ı birbirinden farklıdır.Bu yüzden bebek şampuanı bile evcil hayvanlarr için uygun değildir.Evcil hayvanınızı yıkarken muhakkak hayvanlar için üretilen şampuanlar ile yıkamanız gerekmektedir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_trixie-kedi-kumu-parfumu-bebek-pudrali-750gr.html', 'Trixie Bebek Pudralı Kedi Kumu Parfümü 750gr', 'Kedi Ürünleri-Kedi Bakım Ürünleri-Leke ve Koku Gidericiler', '4011905424064', '489 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-kumu-koku-gidericiler-10378047.jpg', '', 'Kedi kumunda oluşabilecek kötü kokuları giderir, kedi tuvaletinin olduğu bölgeye taze ve hoş bir koku verir. Kedi kumu üzerine ince bir tabaka olarak dökülür. Her kumu değiştirdiğinizde tekrar ince bir tabak şeklinde kedi kumu parfümünü uygulamanız önerilir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_gimpet-baby-paste-yavru-kedi-vitamin-macunu-50gr.html', 'GimCat Kitten Yavru Kedi Vitamin Macunu 50gr', 'Kedi Ürünleri-Çok Satanlar-Gimpet Çok Satanlar', '4002064406787', '', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_gimpet-kedi-vitamin-ve-ek-besinleri-11325283.jpg', '30.01.2024', '12 ayrı vitamin ve kalsiyum içerir. Yavru kedinizin bağışıklığını güçlendirmek için 12 temel vitamin içerir. Kalsiyum kemik, iskelet ve diş gelişimi için önemlidir.  Taurin ise yavru kedinizin görme ve kalp fonksiyonlarının korunması için gereklidir.  Ayrıca TGOS ve lifler içten dışa tüm vücudu kuvvetlendirir.  Baby Paste Macun yavru kediniz için sağlıklı bir büyüme sağlar. 6 haftalıktan katı gıdalarla beslenmeye başlayıncaya kadar günlük 5 cm macun verilebilir.(1 cm=0,5 gr)', 'Gimpet' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_gimdog-tuy-inceltme-makasi.html', 'GimDog Kedi ve Köpekler için Tüy İnceltme Makası 17cm (Yeşil)', 'Köpek Ürünleri-Ağustos Seçili Ürünler-Gimpet Ağustos Seçili Ürünler', '8009632039732', '129 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_gimpet-kedi-deri-ve-tuy-bakimi-19090187.jpg', '', 'Köpekler için kullanılabilecek, paslanmaz çelik tüy inceltme makasıdır. Y Orta bölümündeki ayar vidası sayesinde makas çalışma hareket yumuşaklığı ayarlanabilir. Dostlarımızın uzun tüyleri bazen istenmeyen kazalara ya da deri lezyonlarına neden olabileceği için tüy boylarının kesilmesi uygun olacaktır.  Bütün ırklar için kullanılabilir. Ürün 17 cm uzunluğundadır.', 'Gimpet' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-petler-icin-ozel-islak-mendil.html', 'Trixie Kedi ve Köpeklere Özel Cilt ve Tüy Temizliği İçin Islak Mendil (30_lu)', 'Köpek Ürünleri-Kedi Bakım Ürünleri-Leke ve Koku Gidericiler', '4011905029405', '309 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-leke-ve-koku-gidericiler-9939389.jpg', '30.05.2025', 'Tüm köpek, kedi ve küçük petler için kullanılabilecek petlere özel üretilmiş ıslak mendildir. İçerdiği aloe vera sayesinde tüyleri ve cildi besler, korur. Kolay kullanım için açılıp kapanabilen özel kutusunda 30 adet ıslak mendil bulunmaktadır.', 'Trixie' );
