INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_pro-one-kedi-ve-kopekler-icin-goz-temizleme-solusyonu-50ml.html', 'PRO ONE Kedi ve Köpekler için Göz Temizleme Solüsyonu 50ml', 'Köpek Ürünleri-Kedi Bakım Ürünleri-Göz Bakımı', '', '75 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_pro-one-kedi-goz-bakimi-239963525.jpg', '', 'Kedi ve köpeklerde göz akıntısının sebep olduğu göz çevresindeki birikimleri temizler. Çözeltiyle nemlendirilmiş (1 göz için yaklaşık 2 ml) pamuk veya gazlı bez ile göz çevresindeki lekeler temizlenir. Oda sıcaklığında direkt güneş ışığından uzakta saklanır.', 'PRO ONE' );
