INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_pawise-tuy-toplama-rulosu-yedek-rulo-hediye.html', 'Pawise Tüy Toplama Rulosu 48 Yaprak + Yedek Rulo HEDİYE!', 'Kedi Ürünleri-Çok Satanlar-Pawise Çok Satanlar', '', '', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_pawise-kedi-stok-fazlasi-22747657.jpg', '', 'Kedilerin ve köpeklerin tüylerinin toplanması için kullanımı uygun, Pawise marka tüy toplama rulosudur. Paket içerisinde 1 adet yedek tüy toplama rulosu daha bulundurur. İlk rulo bittikten sonra, diğer rulosunu takarak kullanmaya devam edebilirsiniz.', 'Pawise' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_bioline-kedi-uzaklastirici-sprey-175ml.html', 'Bioline Kedi Uzaklaştırıcı Sprey 175ml', 'Kedi Ürünleri-Çok Satanlar-Bioline Çok Satanlar', '6970117120226', '', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_bioline-yavru-kedi-bakim-urunleri-17568058.jpg', '', 'Bioline Cat Repellent Spray, içerdiği kokular sayesinde kedinizi, uygulanan yerlerden uzaklaştırır. Kedinizin gitmesini istemediğiniz noktalara veya eşyalara sıkarak kedinizi bu bölgelerden uzak tutabilirsiniz. Kedilere bir zararı yoktur, sadece uzaklaştırır. İç mekan kullanımı için uygundur.', 'Bioline' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_beaphar-keep-off-kedi-uzaklastirici-sprey-100ml.html', 'Beaphar Keep Off Kedi Uzaklaştırıcı Sprey 100ml', 'Kedi Ürünleri-Kedi Bakım Ürünleri-Kedi Uzaklaştırıcılar', '', '305 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_beaphar-kedi-uzaklastirici-sprey-91207113.jpg', '', 'Kedilerinizin yaklaşmasını istemediğini yerlere uygulayarak uzak durmasını sağlayabilirsiniz. Ürün sprey şeklinde ve 100 ml_dir. Spreyi duruma göre bolca uygulayabilirsiniz. Uygulanacak yüzeye iyice nüfuz ettiğinden emin olmalısınız. Bitkilerin üzerine uygulamayınız. Gözle temastan mutlaka kaçınınız.', 'Beaphar' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_gimcat-tuy-sagligi-icin-tavuklu-macun-50gr.html', 'GimCat Duo Anti-Hairball Tüy Sağlığı için Peynirli Kedi Macunu 50gr', 'Kedi Ürünleri-Vitaminler ve Ek Besinler-Macun ', '4002064427218', '169 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_gimpet-kedi-macun-odulleri-40667379.jpg', '30.06.2024', 'GimCat Duo Anti-Hairball Tüy Sağlığı için Peynirli Kedi Macunu, çifte faydası olan sağlıklı ve lezzetli bir kombinasyondur. ​Ürünün içerisinde şeker bulunmaz. ', 'Gimpet' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kedi-ve-kopek-icin-dis-temizleme-jeli-100gr.html', 'Trixie Kedi ve Köpekler için Biftek Aromalı Diş Temizleme Jeli 100gr', 'Köpek Ürünleri-Kedi Bakım Ürünleri-Ağız_Diş Sağlığı', '4011905254463', '245 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-agiz-ve-dis-sagligi-44899804.jpg', '', 'Kullanımı çok kolay, köpek ve kedi için kullanılabilen biftek aromalı diş ve dişeti temizleme jelidir. Köpeğinizin veya kedinizin dişlerini ve dişetlerini hem temizler hemde gerekli hijyeni sağlar. Temiz ve ferah bir nefes sağlar. İlk kullanım öncesi tüpün üst kısmını kesiniz. Parmağınızın ucuna bir parça jel alınız ve köpeğinizin veya kedinizin diş etlerine yumuşakça masaj yapınız. Ürünün bulaşması durumunda tamamen zararsızdır, yenebilir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_puffy-love-dogal-badem-ve-aloe-vera-ozlu-tuy-tutmaz-tekstil-spreyi-750ml.html', 'Puffy Love Doğal Badem ve Aloe Vera Özlü Tüy Tutmaz Tekstil Spreyi 750ml', 'Köpek Ürünleri-Kedi Bakım Ürünleri-Tüy Toplayıcılar ve Rulolar', '', '39 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_puffy-love-kedi-tuy-toplayici-ve-rulo-288762022.jpg', '', 'Puffy Love Tüy Tutmaz Tekstil Spreyi evcil hayvan tüylerinin tekstillere tutunmasını zorlaştırır. Evcil hayvan yaşayan evler için özel olarak formüle edilmiştir. Hipoalerjenik ve %100 doğada çözünebilir parfüm ile formüle edilmiştir. %100 doğal kaynaklı temizlik aktifleri, doğal badem ve aloe vera özleri içerir.', 'Puffy Love' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_trixie-kedi-ve-kopek-kulak-bakim-damlasi-50ml.html', 'Trixie Kedi ve Köpekler için Kulak Bakım Damlası 50ml', 'Kedi Ürünleri-Çok Satanlar-Trixie Çok Satanlar', '4011905025476', '', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-kulak-temizlik-bakim-26304038.jpg', '', 'Köpekler, kediler ve diğer küçük petler için kullanılan, özel damlalıklı kulak bakım ve temizleme damlasıdır. Kulak bölgesini hassas şekilde toz ve kirden temizler. Güzel kokuludur. Yavru köpeğinizin yüz bölgesindeki uzuvlara dokunmanız kulak içi, göz bölgesi ve dişlerine bakım yapmanız onun ileriki yıllarda erişkin bir köpek olduğu zaman veteriner bakımlarının daha sorunsuz yapılmasını sağlayacaktır.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_trixie-yavru-ve-yetiskin-kedi-cimi-yumusak.html', 'Trixie Yavru ve Yetişkin Kedi Çimi (Yumuşak)', 'Kedi Ürünleri-Kedi Bakım Ürünleri-Kedi Çimi', '4011905042329', '119 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-yavru-kedi-bakim-urunleri-1543108.jpg', '', 'Özellikle yavru kediler için de uygun yumuşak ve zengin vitaminli kedi çimidir. Özel yumuşak çim olması sebebiyle hem yavru kedilerde hem de yetişkin kedilerde kullanılmaktadır. Kendi çiminizi kendiniz yetiştirerek kedinize özel çimini verebilirsiniz.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_puffy-love-kedi-ve-kopekler-icin-dogal-lavanta-ozlu-leke-cikarici-sprey-750ml.html', 'Puffy Love Kedi ve Köpekler için Doğal Lavanta Özlü Leke Çıkarıcı Sprey 750ml', 'Köpek Ürünleri-Kedi Bakım Ürünleri-Leke ve Koku Gidericiler', '', '39 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_puffy-love-kedi-leke-ve-koku-gidericiler-288733074.jpg', '', 'Evcil hayvanların mama, salya, idrar lekelerinde etkilidir. Sulandırarak ya da direkt olarak kullanılabilir.  Sert yüzeylerde, halı ve koltuk yüzlerinde, kıyafetlerinizde, evcil hayvanların yatak, yastık, kumaş oyuncaklarında doğal lavanta özü içeren formülü ile derinlemesine ve hızlı temizlik sağlar.', 'Puffy Love' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_puffy-love-dogal-pamuk-ve-okaliptus-ozlu-yuzey-temizleyici-960ml.html', 'Puffy Love Doğal Pamuk ve Okaliptüs Özlü Yüzey Temizleyici 960ml', 'Köpek Ürünleri-Kedi Bakım Ürünleri-Leke ve Koku Gidericiler', '', '49 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_puffy-love-kedi-leke-ve-koku-gidericiler-288702747.jpg', '', 'Evcil hayvanların oyun ve yaşam alanları, mutfak tezgahı, yiyecek hazırlama alanları, zeminler, tuvalet, küvet, duş, klozet, musluk, lavabo temizliğinde kullanılabilir. Doğrudan ya da sulandırarak kullanım için uygundur. Banyo, mutfak, evcil hayvan kaynaklı kötü kokuları önlemeye ve azaltmaya yardımcı olur. Yüzeylerde etkili temizlik ve parlaklık sağlar. Evcil hayvan yaşayan evler için özel olarak formüle edilmiştir. Doğal pamuk, okaliptüs özleri ve %100 doğal kaynaklı temizlik aktifleri içerir.', 'Puffy Love' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_eurogold-tuy-yumagini-engelleyen-kedi-cimi.html', 'EuroGold Tüy Yumağını Engelleyen Kedi Çimi', 'Kedi Ürünleri-Kedi Bakım Ürünleri-Kedi Çimi', '8681144140016', '33 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_eurogold-kedi-bakim-urunleri-12996805.jpg', '', 'Kedi çimi arpa, buğday gibi tahılların ve süpürge otu tohumu vb. benzer faydalı bitki tohumu karışımlarından oluşmaktadır. Yeşil yapraklarda bulunan klorofil kediler için faydalıdır ve bu madde kedi çiminde bol miktarda mevcuttur. Klorofil maddesi kırmızı kan hücreleri ile neredeyse aynı özellikleri taşır bol miktarda mineral ve amino asittir. Sindirim sistemin, rahatlatıcı özelliği ile kediler için kedi çimi vazgeçilmezdir. Mide ve bağırsaklardaki kıl yumağı oluşumunun engellenmesine yardımcı olur.', 'EuroGold' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_trixie-kedi-otu-20gr.html', 'Trixie Kedi Otu 20gr', 'Kedi Ürünleri-Kedi Bakım Ürünleri-Catnipler', '4011905042251', '89 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-otu-8475010.jpg', '', 'Catnip özünden filtre edilerek elde edilmiş, %100 bitkisel, önce kedinizin oynama duygularını harekete geçirecek ve daha sonra sakin ve nazik olmasını sağlayacak catnip_tir. Kedinizin ilgisini çekmek istediğiniz alana (tırmalama kulesi, paspası, oyuncak fare veya oyuncaklar vb.) koyabilirsiniz. Kediniz catnip_in konulduğu yerle oynayacaktır.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_hypaw-clean-wipes-kedi-ve-kopekler-icin-temizleme-ve-bakim-kesesi.html', 'HYPAW Clean Wipes Kedi ve Köpekler için Temizleme ve Bakım Kesesi 23x15cm', 'Köpek Ürünleri-Kedi Bakım Ürünleri-Deri ve Tüy Bakımı', '', '3,79 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_hypaw-kedi-deri-ve-tuy-bakimi-189272734.jpg', '', 'Tüm ırk kedi ve köpekler için uygundur. Yıkama gerektirmeden patili dostunuza bakım ve temizlik yapmanızı sağlar. Temizleme etkisi ile birlikte içeriğinde bulunan E vitamini ve Aloe Vera özleri ile evcil hayvanınızın tüylerine bakım yaparken B5 vitamini ile cildini besler ve kurumasını engeller. Ayrıca deri üstünde bulunan ölü hücrelerin temizlenmesine katkıda bulunur. Günlük kullanım için uygundur. Ürünün eni 23 cm, boyu 15 cm_dir.  Paketi çentiğinden yırtarak kilitli kısımdan açınız. Keseyi elinize takarak evcil hayvanınızın temizlemek istediğiniz bölgesine tatbik ediniz.  Farklı bölgeler için ayrı kese kullanımı önerilir. Kullanım sonrası yıkama ya da durulama gerektirmez.', 'HYPAW' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_gimcat-baby-tabs-yavru-kediler-icin-vitamin-tableti-40gr.html', 'GimCat Kitten Tabs Yavru Kediler için Taurinli Multivitamin Kedi Ödül Maması 40gr', 'Kedi Ürünleri-Vitaminler ve Ek Besinler-Tablet', '4002064426174', '75 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_gimpet-kedi-tablet-odulu-30941903.jpg', '30.12.2024', 'Gimcat Kitten Tabs yavru kediniz için en uygun olan doğal kalsiyum ve taurin içeriğiyle yavru kedilerin sağlıklı gelişimini destekleyen bir ödüldür. Kediniz sağlıklı ve güçlü bir yaşama Gimpet Kitten Tabs ile adım atsın. Taurin görme ve kalp fonksiyonu için önemlidir ayrıca L-karnitin enerji kaynağını destekler. Yavru kedilere günde yaklaşık 8 tane verilmesi tavsiye edilir.', 'Gimpet' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_rimba-kedi-tirnak-makasi-6x12cm-karisik-renkli.html', 'Rimba Kedi Tırnak Makası 6x12cm (Karışık Renkli)', 'Kedi Ürünleri-Çok Satanlar-Rimba Çok Satanlar', '', '', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_rimba-kedi-tirnak-bakimi-267896632.jpg', '', 'Kediler için tasarlanmış ve kolay kavranabilen, pratik kullanımlı tırnak makasıdır. Kavisli uç kısmı kedilerin anatomik yapısına uygun olarak üretilmiştir. Plastik tutma sapı, ergonomik yapısı ile kullanım kolaylığı sağlamaktadır. Paslanmaz çelik materyalden üretilmiştir. Metal kısım paslanma ve çizilmeye karşı dayanıklıdır.', 'Rimba' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kus-urunleri_gardenmix-platin-yavru-muhabbet-kus-yemi-500gr.html', 'Garden Mix Platin Yavru Muhabbet Kuş Yemi 500gr', 'Kuş Ürünleri-Kuş Yemleri-Muhabbet Kuşu Yemi', '8681085421175', '29 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_garden-mix-muhabbet-kusu-yemi-500kg-128114606.jpg', '30.08.2024', 'Muhabbet kuşlarının doğadaki beslenme alışkanlıkları göz önünde tutularak fiziksel ve biyolojik ihtiyaçlarını en üst düzeyde karşılayabilecek bir kompozisyona sahip olan eşsiz tahıl karışımı vitaminler, prebiyotikler, kalsiyum ve bal ile desteklenen tam yemdir.', 'Garden Mix' );
