INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kus-urunleri_gold-wings-classics-paraket-yemi-500gr.html', 'Gold Wings Classics Paraket Yemi 500gr', 'Kuş Ürünleri-Çok Satanlar-Gold Wings Çok Satanlar', '05.04.2025', '', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_gold-wings-papagan-yemi-89834530.jpg', '', 'Küçük cins papağan kuşları için üretilmiş yemdir. Gereksinim duydukları temel ihtiyaçlar dikkate alınarak hazırlanmıştır. Kuşların yemliklerinde servis edilir. Gold Wings ailesi her zaman gerçek Premium hizmetini sunabilmek için en kaliteli tahıl ve tohumları bir araya getirerek özel harmanlı içeriği ile tam ve besleyici sunum sağlarken aynı zamanda vitamin ve mineral açısından eksiksiz bir şekilde desteklenmiştir. Gold Wings ailesi, formülüne her zaman güvenerek Avrupa ve Uzak Doğudaki en kaliteli ve zengin yemler yarışmalarına katılmış, çeşitli başarılarla ülkemizi bu alanda temsil etmiştir. ', 'Gold Wings' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kus-urunleri_eurogold-karisik-meyveli-muhabbet-kusu-yemi-500gr.html', 'EuroGold Karışık Meyveli Muhabbet Kuşu Yemi 500gr', 'Kuş Ürünleri-Kuş Yemleri-Muhabbet Kuşu Yemi', '8681144131038', '29 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_eurogold-muhabbet-kusu-yemi-88658904.jpg', '31.05.2025', 'İçeriğindeki doğal mineraller, kalsiyum ve aminoasitler muhabbet kuşunuzun tüm vitamin ihtiyacını karşılar ve saülıklı büyümesine katkıda bulunur.  Yem içerisindeki granüller sayesinde muhabbet kuşunuzun tüyleri daha parlak, sindirim sistemi ve bağışıklık sistemi daha güçlü olur.', 'EuroGold' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kus-urunleri_gardenmix-platin-meyveli-muhabbet-kusu-yemi-1kg.html', 'Garden Mix Platin Meyveli Muhabbet Kuşu Yemi 1kg', 'Kuş Ürünleri-Ağustos Seçili Ürünler-Garden Mix Ağustos Seçili Ürünler', '8681085421168', '58 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_garden-mix-muhabbet-kusu-yemi-12810430.jpg', '30.11.2024', 'Kullanıma hazır, minik dostunuzun tüm besin ihtiyaçlarını karşılayan bir karışımdır. Sindirimi kolay, seçkin tohumlarla hazırlanmıştır. Kuşunuzun her zaman canlı ve sağlıklı kalması için... Günde 1-2 defa kuşun büyüklüğüne ve sayısına göre tespit edilecek miktarda yemi kafes yemliğine koyunuz. Yanında her zaman taze su bulundurulması tavsiye edilir. 
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kus-urunleri_gold-wings-aspur-sade-yem-300gr.html', 'Gold Wings Aspur Sade Yem 300gr', 'Kuş Ürünleri-Ağustos Seçili Ürünler-Gold Wings Ağustos Seçili Ürünler', '05.04.2025', '32 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_gold-wings-kus-yemleri-314839646.jpg', '', 'Aspur yem faydaları saymakla bitmez. Kabuğu kolay soyulduğu için kuşlar tarafından sevilerek yenen aspur tohumu, aspir olarakta adlandırılmaktdır. Muhabbet kuşu, kanarya, paraket türleri ve saka, finch gibi egzotik kuşlar için ana besin olan aspur tohumudur. %15 oranında protein içermektedir. Saka, finch ve kanarya kuşları için ana besin olarak kullanılmaktadır. Muhabbet kuşları ve paraketlerin yemlerine ilave olarak %20 oranında kullanılması tavsiye edilmektedir. Haftada 3 - 4 defa taze porsiyon olarak verilmesi tavsiye edilmektedir.', 'Gold Wings' );
