INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kus-urunleri_jungle-poset-muhabbet-kusu-yemi-1kg.html', 'Jungle Poşet Muhabbet Kuşu Yemi 1kg', 'Kuş Ürünleri-Kuş Yemleri-Muhabbet Kuşu Yemi', '8680468045472', '49 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_jungle-muhabbet-kusu-yemi-314747414.jpg', '14.05.2024', 'Muhabbet kuşlarının doğadaki beslenme alışkanlıkları dikkate alınarak özel olarak formüle edilmiş seçkin içeriğe sahip ana yem. Gereksinim duydukları tüm tohumları içinde barındırır. Vitamin ve mineraller ile desteklenmiştir. Tam beslenme sağlar. Muhabbet kuşlarının doğadaki beslenme alışkanlıkları incelenerek veteriner hekim ve beslenme uzmanları tarafından özenle geliştirildi. İçeriğindeki ilave vitaminler ile yüksek enerji ihtiyacını destekler. Son teknoloji ambalajlama teknikleri ve malzemeleri ile paketlenerek son tüketim tarihine kadar tazeliğini korur.', 'Jungle' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kus-urunleri_jungle-poset-muhabbet-kusu-yemi-500gr.html', 'Jungle Poşet Muhabbet Kuşu Yemi 500gr', 'Kuş Ürünleri-Çok Satanlar-Jungle Çok Satanlar', '8680468045465', '', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_jungle-muhabbet-kusu-yemi-89435632.jpg', '18.07.2025', 'Muhabbet kuşları için özel olarak üretilmiştir. İçeriğindeki vitaminler kuşunuza ekstra enerji sağlar. Kuşların yemliklerinin günlük olarak doldurulması gerekir. Yanında mutlaka temiz içme suyu bulundurulması tavsiye edilir.     ', 'Jungle' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_vet-s-plus-tuy-yumaklarinin-atilmasina-yardimci-100-dogal-kedi-cimi.html', 'Vet_s Plus Tüy Yumaklarına Karşı %100 Doğal Fileli Kedi Çimi', 'Kedi Ürünleri-Kedi Bakım Ürünleri-Kedi Çimi', '', '29 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_vet-s-plus-kedi-cimi-139529300.jpg', '', 'Vet_s Plus Kedi Çimi, kedinizin kendini temizlerken yuttuğu tüylerin rahatlıkla vücuttan atılması için yardımcı olur. %100 doğaldır ve kedinizin sindirim sisteminin sağlıklı bir şekilde çalışmasını destekler. Çimlenmenin başlamasından itibaren kediniz 3-6 hafta kadar keyifle tüketebilir. Küçük çocukların erişemeyeceği yerlerde muhafaza edilmelidir. 1. Paketi işaretli yerinden açın. 
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kus-urunleri_quik-meyveli-muhabbet-kusu-krakeri.html', 'Quik Meyveli Muhabbet Kuşu Krakeri 30gr', 'Kuş Ürünleri-Kraker ve Ödüller-Quik Kraker ve Ödüller', '8680468041818', '', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_quik-muhabbet-kusu-yemi-171452929.jpg', '17.01.2025', 'Muhabbet kuşları için özel olarak hazırlanmıştır. Kuşların severek yedikleri, içeriğinde bol miktarda meyve içeren çubuk şeklinde krakerlerdir. Özel harmanlı içeriği ile tam ve besleyici sunum sağlarken aynı zamanda vitamin ve mineral açısından eksiksiz bir şekilde desteklenmiştir. Dostlarımızın ihtiyaç duydukları besinleri tam ve dengeli bir şekilde içerir. ​Ödül olarak verilebilir. Kuşlar birbirine yapışmış halde olan yemleri yerken enerji sarf ederek daha formda kalır. Aldığı vitamin ve minerallerle birlikte sağlıklı bir gaga yapısına kavuşur.', 'Quik' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_eurocat-premium-class-dogal-kedi-cimi.html', 'EuroCat Premium Class Doğal Kedi Çimi', 'Kedi Ürünleri-Kedi Bakım Ürünleri-Kedi Çimi', '', '42 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_eurocat-kedi-cimi-127765248.jpg', '', 'Kedi çimi arpa, buğday gibi tahılların ve süpürge otu tohumu vb. benzer faydalı bitki tohumu karışımlarından oluşmaktadır. Yeşil yapraklarda bulunan klorofil kediler için faydalıdır ve bu madde kedi çiminde bol miktarda mevcuttur. Klorofil maddesi kırmızı kan hücreleri ile neredeyse aynı özellikleri taşır bol miktarda mineral ve amino asittir. Sindirim sistemin, rahatlatıcı özelliği ile kediler için kedi çimi vazgeçilmezdir. Mide ve bağırsaklardaki kıl yumağı oluşumunun engellenmesine yardımcı olur.', 'EuroCat' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_trixie-seramik-kapli-kedi-cimi.html', 'Trixie Seramik Kaplı Kedi Çimi', 'Kedi Ürünleri-Kedi Bakım Ürünleri-Kedi Çimi', '4011905423418', '355 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-cimi-70042531.jpg', '', 'Kedinizin sağlığı açısından tüketmesi gereken şeylerden biri de kedi çimidir. Evde bakımı konusunda dikkat etmeniz gerekmektedir. Kedi çiminin görünüşü ev açısından da önemlidir.  Trixie kedi çiminin içerisinde bulunduğu seramik kabın çapı 15_cm dir. Kabın kenar yüksekliği 4 cm_dir. Bakımı kolaydır. Kabı sayesinde evinizde şık bir görünüm sağlayacaktır. ', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_trixie-yavru-ve-yetiskin-kedi-cimi-yumusak.html', 'Trixie Yavru ve Yetişkin Kedi Çimi (Yumuşak)', 'Kedi Ürünleri-Kedi Bakım Ürünleri-Kedi Çimi', '4011905042329', '119 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-yavru-kedi-bakim-urunleri-1543108.jpg', '', 'Özellikle yavru kediler için de uygun yumuşak ve zengin vitaminli kedi çimidir. Özel yumuşak çim olması sebebiyle hem yavru kedilerde hem de yetişkin kedilerde kullanılmaktadır. Kendi çiminizi kendiniz yetiştirerek kedinize özel çimini verebilirsiniz.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_trixie-kedi-cimi-100gr.html', 'Trixie Kedi Çimi 100gr', 'Kedi Ürünleri-Kedi Bakım Ürünleri-Kedi Çimi', '4011905042350', '89 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-cimi-70056781.jpg', '', 'Trixie kedi çimidir. Bakımının kolay olması kedinizin sağlığı açısından önemlidlir. Kedinizin çabucak alışıp seveceği bir kedi çimidir. Kedinizin midesinde tüy yumaklarını rahatlıkla çıkarmasına yardımcı olur. ', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_eurogold-tuy-yumagini-engelleyen-kedi-cimi.html', 'EuroGold Tüy Yumağını Engelleyen Kedi Çimi', 'Kedi Ürünleri-Kedi Bakım Ürünleri-Kedi Çimi', '8681144140016', '33 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_eurogold-kedi-bakim-urunleri-12996805.jpg', '', 'Kedi çimi arpa, buğday gibi tahılların ve süpürge otu tohumu vb. benzer faydalı bitki tohumu karışımlarından oluşmaktadır. Yeşil yapraklarda bulunan klorofil kediler için faydalıdır ve bu madde kedi çiminde bol miktarda mevcuttur. Klorofil maddesi kırmızı kan hücreleri ile neredeyse aynı özellikleri taşır bol miktarda mineral ve amino asittir. Sindirim sistemin, rahatlatıcı özelliği ile kediler için kedi çimi vazgeçilmezdir. Mide ve bağırsaklardaki kıl yumağı oluşumunun engellenmesine yardımcı olur.', 'EuroGold' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_quik-kedi-cimi.html', 'Quik Fileli Doğal Kedi Çimi', 'Kedi Ürünleri-Çok Satanlar-Quik Çok Satanlar', '8680468047827', '', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_quik-kedi-cimi-12975670.jpg', '', 'Quik kedi çimi arpa buğday gibi tahılların ve süpürge otu tohumu vb. faydalı bitki tohumu karışımlarından oluşmaktadır. Yeşil yapraklarda bulunan klorofil kediler için faydalıdır ve bu madde kedi çiminde bol miktarda mevcuttur. Sindirim sisteminin rahatlığı için kedi çimi oldukça faydalıdır. Ayrıca mide ve bağırsaklardaki kıl yumağı oluşumunun engellenmesine yardımcı olur. • Quik kedi çimi topraktan yetişmektedir. Topraktan yetişen kedi çimi tamamen doğal olduğundan kedileriniz için maksimum fayda sağlar.  
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_supravet-cat-keep-off-kedi-uzaklastirici-sprey-150ml.html', 'Supravet Cat Keep Off Kedi Uzaklaştırıcı Sprey 150ml', 'Kedi Ürünleri-Kedi Bakım Ürünleri-Kedi Uzaklaştırıcılar', '15.05.2025', '119 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_supravet-kedi-uzaklastirici-sprey-339433812.jpg', '', 'Kedinizin yaklaşmasını istemediğiniz yerlere uygulayarak uzak durmasını sağlayabilirsiniz. Ürün sprey şeklinde ve 150 ml_dir. Gözle temasından kaçınınız. Çocukların ulaşamayacağı bir yerde muhafaza ediniz.', 'Supravet' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-led-isikli-plastik-kene-cikarma-kalemi-14cm-karisik-renkli.html', 'Trixie Led Işıklı Kene Çıkarma Kalemi 14cm (Karışık Renkli)', 'Köpek Ürünleri-Kedi Bakım Ürünleri-Pire_Kene Ürünleri', '4011905242811', '359 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-paraziter-pire-kene-engelleyici-128792380.jpg', '', 'Kedi ve köpeklerde bulunan kenelerin çıkarılması için üretilmiştir. Kalemin ucunda yer alan led ışık sayesinde keneyi rahatça görebilir ve çıkarabilirsiniz. Askı bölümü sayesinde cebe takılabilir. Eğer kene tamamen çıkmazsa veteriner hekiminize danışmanızı öneririz. Ürün karışık renklidir, stoktaki mevcut renk durumuna göre gönderim sağlanır. Ürünün ölçüsü 14 cm_dir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_karlie-kedi-ve-kopek-uzaklastirici-200ml.html', 'Karlie Kedi ve Köpek Uzaklaştırıcı Sprey 200ml', 'Kedi Ürünleri-Bakım ve Temizlik Ürünleri-Köpek Uzaklaştırıcılar', '4016598002384', '329 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_karlie-kedi-uzaklastirici-sprey-182375777.jpg', '', 'Kedi ve köpeklerinizin yaklaşmasını istemediğiniz yerlere uygulayarak uzak durmasını sağlayabilirsiniz.  Ürünü bitkiler üzerinde uygulamayınız. Ürün 200 ml_dir.', 'Karlie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_beaphar-keep-off-kedi-uzaklastirici-sprey-100ml.html', 'Beaphar Keep Off Kedi Uzaklaştırıcı Sprey 100ml', 'Kedi Ürünleri-Kedi Bakım Ürünleri-Kedi Uzaklaştırıcılar', '', '305 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_beaphar-kedi-uzaklastirici-sprey-91207113.jpg', '', 'Kedilerinizin yaklaşmasını istemediğini yerlere uygulayarak uzak durmasını sağlayabilirsiniz. Ürün sprey şeklinde ve 100 ml_dir. Spreyi duruma göre bolca uygulayabilirsiniz. Uygulanacak yüzeye iyice nüfuz ettiğinden emin olmalısınız. Bitkilerin üzerine uygulamayınız. Gözle temastan mutlaka kaçınınız.', 'Beaphar' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_bioline-kedi-uzaklastirici-sprey-175ml.html', 'Bioline Kedi Uzaklaştırıcı Sprey 175ml', 'Kedi Ürünleri-Çok Satanlar-Bioline Çok Satanlar', '6970117120226', '', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_bioline-yavru-kedi-bakim-urunleri-17568058.jpg', '', 'Bioline Cat Repellent Spray, içerdiği kokular sayesinde kedinizi, uygulanan yerlerden uzaklaştırır. Kedinizin gitmesini istemediğiniz noktalara veya eşyalara sıkarak kedinizi bu bölgelerden uzak tutabilirsiniz. Kedilere bir zararı yoktur, sadece uzaklaştırır. İç mekan kullanımı için uygundur.', 'Bioline' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kedi-ve-kopekler-icin-kene-temizleme-karti-8x5cm-beyaz.html', 'Trixie Kedi ve Köpekler için Kene Temizleme Kartı 5x8cm (Beyaz)', 'Köpek Ürünleri-Kedi Bakım Ürünleri-Pire_Kene Ürünleri', '4011905022994', '109 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-pire-kene-urunleri-186642467.jpg', '', 'Keneyi kolayca köpeğinizin veya kedinizin vücudundan ayırmanızı sağlayacak özel plastik kart. Keneyi dibinden tutun ve keneyi dışarı çekin. Çekiş esnasında kartı çevirmeyin. Kenenin çıkarılması sonrası çıkarılmış olan deri bölgesi dezenfekte edilmelidir. Beklenmedik bir durumda lütfen veterinize müracaat ediniz.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_trixie-kedi-pire-ve-toz-temizleme-taragi-15cm.html', 'Trixie Kedi Pire ve Toz Temizleme Tarağı 15cm', 'Kedi Ürünleri-Kedi Tarağı ve Fırçası-Sık Dişli Fırça ve Taraklar', '4011905231204', '229 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-pire-taragi-153754984.jpg', '', 'Kedilerin kürklerinin içerisine gizlenmiş pirelerin bulunması ve taranarak temizlenmesi için tasarlanmış kedi tarağıdır. Kedinin bu tarak ile düzenli olarak taranması sonucu hem kürkü üzerinde biriken toz temzilenmiş olur hemde pireler temizlenir. Ergonomik kauçuk sapı sayesinde kullanımı rahattır. Ürünün ölçüsü 15 cm_dir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_eurodog-kedi-ve-kopekler-icin-genis-aralikli-pire-taragi.html', 'EuroDog Kedi ve Köpekler için Geniş Aralıklı Pire Tarağı 20cm', 'Köpek Ürünleri-Kedi Tarağı ve Fırçası-Pire Tarağı', '', '89 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_eurodog-kedi-pire-taragi-164701776.jpg', '', 'Kedi ve köpekler için özel olarak tasarlanmış geniş aralıklı pire tarağıdır. Evcilinizi düzenli olarak taradığınızda hem üzerindeki toz hem de pireleri yakalamaya yardımcı olur. Plastik sapı sayesinde elinizden kaymaz ve pratiklik sağlar. Ürünün uzunluğu 20 cm_dir.', 'EuroDog' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_karlie-kedi-pire-taragi-5-5cm-mor-siyah.html', 'Karlie Kedi Pire Tarağı 5,5cm (Mor_Siyah)', 'Kedi Ürünleri-Kedi Tarağı ve Fırçası-Pire Tarağı', '4016598036907', '219 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_karlie-kedi-pire-taragi-79466211.jpg', '', 'Karlie pire tarağı sayesinde kedinizin pirelerden kurtulmasına yardımcı olabilirsiniz. Karın, kulak ve omuz bölgeleri taranırken dikkatli olunmalıdır. Bir antipire spreyi ya da tasması ile birlikte kullanılması tavsiye edilir. Kullanımdan sonra antiseptik bir solüsyon ile temizleyiniz, sonrasında suyla durulayınız. İnsan ve hayvan sağlığı açısından %100 zararsız malzemelerden üretilmiştir. Alerjenik maddeler bulunmaz.  Siyah, Mor', 'Karlie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_beavis-catnip-motivation-kediler-icin-oyun-spreyi-100ml.html', 'Beavis Kediler için Catnipli Oyun Spreyi 100ml', 'Kedi Ürünleri-Kedi Bakım Ürünleri-Catnipler', '', '58 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_beavis-kedi-otu-194756463.jpg', '', 'Oyun spreyi kökeni, Kuzey Afrika ve Akdeniz_e dayanan ve günümüzde Avrupa ve Kuzey Amerika_da yaygın olarak yetişen bir bitkidir. Nane familyasına ait olan bu mucizevi bitki, geçmiş yüz yıllarda kedilerin mental ve fiziksel ihtiyaçları doğrultusunda ilgilerini çekmiş, düzenli olarak tükettikleri gözlemlenmiştir. Kedilerin bu bitkiye olan ilgileri uzmanlar tarafından takip edilerek, faydalarının da tespiti ile birlikte literatüre ismi "kedi otu" olarak geçmiştir. Özel olarak hazırlanan sprey doğal catnip yağı ve kedi otu kökü ile desteklenerek daha etkili sonuçlar alınması için geliştirilmiştir. Normal catnip spreylere oranla kediler üzerinde başta eğitim, oyun ve önemli süreçleri olan kızgınlık dönemlerinde sakinleştirip motive eden özel ve doğal bir formüle sahiptir. Kedilerimizle olan ortak yaşamımızda bazı uyum sorunlarıyla karşılaşabiliriz. Halen yırtıcı genler taşıyan kedi familyası, ortak yaşam alanlarımızda kendilerine ve bazı materyallere istemeden, içgüdüsel olarak zarar verebilirler. Onlar için geliştirilen tırmalama tahtaları, çeşitli oyuncak ve aktivite araçlarına özellikle ilgi duymalarını sağladığı gibi, her türlü uyum, davranış, eğitim, motivasyon ve adaptasyon süreçlerinde tam ve eksiksiz bir destek sağlar.', 'Beavis' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_eurodog-kedi-ve-kopekler-icin-pire-taragi-2.html', 'EuroDog Kedi ve Köpekler için Pire Tarağı 19cm', 'Köpek Ürünleri-Kedi Tarağı ve Fırçası-Pire Tarağı', '', '89 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_eurodog-kedi-pire-taragi-164678932.jpg', '', 'Kedi ve köpekler için özel olarak tasarlanmış pire tarağıdır. Evcilinizi düzenli olarak taradığınızda hem üzerindeki toz hem de pireleri yakalamaya yardımcı olur. Kedi ve köpeklerin kürklerindeki pirelerden temizlenmesi için pratik taraktır. Plastik sapı sayesinde elinizden kaymaz ve pratiklik sağlar. Ürünün boyu 19 cm_dir.', 'EuroDog' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_catit-senses-2-0-catnip-roll-kedi-otu-losyonu-50ml.html', 'Catit Senses 2.0 Catnip Roll Kedi Otu Losyonu 50ml', 'Kedi Ürünleri-Kedi Bakım Ürünleri-Catnipler', '', '209 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_catit-kedi-otu-205507268.jpg', '', 'Kedilerin çılgınca ilgisini çeken ve rahatlatıcı etki yapan saf catnip otu liflerinden elde edilen kedi otu ekstraktlarından filtre edilerek özel formülasyonda üretilmiş rulo toplu oyun spreyi. Kedilerin merkezi sinir sisteminde yer alan oyun merkezini uyararak etki yapan catnip rulo sprey kedilerin çılgınca oyun oynayarak rahatlamasını sağlamanın yanı sıra dışarıya çıkma ihtiyacını da azaltır.', 'Catit' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_pro-one-kedi-otu-oyun-spreyi-200ml.html', 'PRO ONE Catnipli Oyun Spreyi 200ml', 'Kedi Ürünleri-Kedi Bakım Ürünleri-Catnipler', '', '99 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_pro-one-kedi-otu-340787852.jpg', '', 'Sadece hayvan sağlığında kullanılır. Saf bitkiden elde edilen ekstrakt ile catnip spreyi kedinizin eğitilmesinde size destek olacaktır. Kullanmadan önce çalkalayınız. 20-25 cm mesafeden yüzeye, oyuncağa uygulayın. Etkisi için birkaç dakika bekleyin. Direkt kedinize uygulamayınız. Gıda malzemelerinden uzakta, çocukların ulaşamayacağı yerlerde muhafaza edilmelidir. Doğrudan göze temas ettirmeyiniz. Hassas kişilerde alerjik reaksiyonlara neden olabilir.', 'PRO ONE' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_bioline-catnip-20gr.html', 'Bioline Catnip 20gr', 'Kedi Ürünleri-Kedi Bakım Ürünleri-Catnipler', '6970117120370', '84 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_bioline-kedi-otu-31287470.jpg', '', 'BIOLINE CATNIP 20 GR Kedilerin ilgisini çeken ve rahatlatıcı etki yapan Nepeta Cataria bitkisi yapraklarından el edilen %100 doğal catnip_tir. Oyuncak, tırmalama tahtası, yatak veya taşıma kabı gibi bulunmasını istediğiniz bölgeye uygulayınız.  Etkisini tam olarak gösterebilmesi için birkaç dakika bekleyiniz. ', 'Bioline' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_supravet-catnipli-kedi-oyun-spreyi-100ml.html', 'Supravet Catnipli Kedi Oyun Spreyi 100ml', 'Kedi Ürünleri-Kedi Bakım Ürünleri-Catnipler', '15.05.2025', '107 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_supravet-kedi-otu-339495680.jpg', '', 'Catnip (Nepeta cataria), kedileri çeken ve uyaran, aktif, eğlenceli davranışlara, mutluluk ve rahatlama belirtilerine neden olan doğal bir bitkidir. Kedilerin yaklaşık %65_i bireyler arasında değişen hassasiyet derecesi olan catnip_e bayılır. Kedilerin çılgınca ilgisini çeken ve rahatlatıcı etki yapan saf catnip otu liflerinden elde edilen kedi otu ekstraktlarından filtre edilerek özel formülasyonda üretilmiş oyun spreyidir. Kedilerin merkezi sinir sisteminde yer alan oyun merkezini uyararak etki yapan Supravet catnip sprey kedilerin oyun oynayarak rahatlamasını sağlamanın yanı sıra dışarıya çıkma ihtiyacını da azaltır Direkt kedinin üzerine sıkılmamalıdır. İnsan vücuduna sıkılmamalıdır. Gıdalar üzerine sıkılmamalıdır. Ateşe püskürtülmemelidir. Konsantre saf catnip özü kediler için harika bir eğitim aracıdır, kedileri oynamak için uyarır. Kedilerde stres ve kaygıyı hafifletmeye yardımcı olur. Herhangi bir oyuncak veya yüzeye uygulanabilir. Sprey olması sebebiyle kullanımı damla ve rolon olan ürünlere göre daha kolaydır. Supravet Catnip Kedi Oyun Spreyi kullanmadan önce çalkalayarak, istediğiniz bölgeye, oyuncak veya tırmalama tahtası üzerine 20-25 cm uzaktan sıkınız. Etkisini tam olarak gösterebilmesi için bir kaç dakika bekleyiniz. Kullanmadan önce çalkalanması gerekmektedir. 6 haftadan küçük kedi ve köpek yavrularında kullanılmamalıdır. Diğer ilaçlar ile birlikte karıştırmayınız. Çocukların erişemeyeceği yerde ağzı kapalı muhafaza ediniz.   Kuru ve serin bir yerde, güneş ışığından korunarak muhafaza ediniz. Raf ömrü üretim tarihinden itibaren 2 yıldır. Sırasıyla üretim tarihi, son kullanım tarihi ve parti no tüpün üzerindedir.', 'Supravet' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_beaphar-calming-spot-on-kedi-sakinlestirici-0-4ml-x-3-kapsul.html', 'Beaphar Calming Sakinleştici Kedi Damlası 0,40ml (3_lü)', 'Kedi Ürünleri-Kedi Bakım Ürünleri-Catnipler', '', '239 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_beaphar-kedi-otu-91325695.jpg', '', 'Kedileri sakinleştirme için üretilmiş içinde kimyasal bulunmayan catnipten yapılmış bir damladır. Damla 3 kapsül olup her kapsülde 0,4 ml damla bulunmaktadır.', 'Beaphar' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_bioline-kedi-kedi-otunanesi-spreyi-50ml.html', 'Bioline Kedi Otu_Nanesi Spreyi 50ml', 'Kedi Ürünleri-Kedi Bakım Ürünleri-Catnipler', '6970117120110', '99 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_bioline-yavru-kedi-bakim-urunleri-17498208.jpg', '', 'Bioline Catnip Sprey, catnipten yapılmış bir spreydir. Kedinizin oyuncaklarına sıkarak oyun oynamasına teşvik edebilirsiniz. Kedilerin çok sevdiği catnipten yapılmış olduğu için, aktif olmayan ve özellikle daha çok haeketli olması gereken kısırlaştırılmış kedilerin oyun oynamasını kolaylaştıran spreydir.', 'Bioline' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_beaphar-play-spray-kedi-otu-catnip-spreyi-150-ml.html', 'Beaphar Play Spray Kedi Otu Spreyi 150ml', 'Kedi Ürünleri-Kedi Bakım Ürünleri-Catnipler', '', '279 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_beaphar-kedi-otlu-oyuncaklar-91259448.jpg', '', 'Kedilerin algoritmasında olan sinir sistemlerini harekete geçirerek daha yoğun şekilde enerjisini atmayı sağlayan bir sprey. Kullanmadığı oyuncak tırmalama tahtası gibi eşyalara sıkıldıgı andan itibaren kedinizin ilgisini çeker ve delisi olur. Daha önceden yüzüne bile bakmadıgı eşyaların şimdi başından ayrılmaz. Huysuzluğunu ve enerjisini atabilecegi oyun evleri ve yerlerine birkaç fıs sıkınız. Etkisi için birkaç dakika bekleyiniz.', 'Beaphar' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_bioline-catnip-230ml.html', 'Bioline Catnip 20gr', 'Kedi Ürünleri-Kedi Bakım Ürünleri-Catnipler', '6970117121216', '106 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_bioline-kedi-otu-31638397.jpg', '', 'Kedilerin çılgınca ilgisini çeken ve rahatlatıcı etki yapan saf ve doğal catnip otu. Kedilerin merkezi sinir sisteminde yer alan oyun merkezini uyararak etki yapan catnip kedilerin çılgınca oyun oynayarak rahatlamasını sağlamanın yanı sıra dışarıya çıkma ihtiyacını da azaltır.', 'Bioline' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_bioline-catnipli-kedi-oyun-topu.html', 'Bioline Catnipli Kedi Oyun Topu 3cm', 'Kedi Ürünleri-Kedi Oyuncağı-Catnipli ve Matatabili Oyuncaklar', '6970117121353', '69 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_bioline-kedi-otu-31654343.jpg', '', 'Bioline catnipli kedi oyun topudur. Kediler de diğer birçok tür gibi günlük olarak mutlaka egzersiz yapma ihtiyacı hissederler. Gün içinde genellikle rutin alışkanlıklarını yerine getirdikten sonra hareketsiz kaldıkları için kas gelişimi ve kilo kontrolünün sağlanması açısından kedi oyuncaklarıyla hareket etmeye teşvik edilmeleri hem eğlenceli hem de faydalı bir seçenektir. Bu oyun topunun içerisinde de bulunan catnip kedilerde pozitif davranışlara yönelme eğilimini arttır. Kediniz catnipna yalayarak, koklayarak veya patileriyle oynayarak tepki verebilir. Catnip_i koklayan kediniz çok kısa bir süre içinde sakinleşecek, mırlayacak, oyuncu ve arkadaş canlısı olacaktır. Catnipli oyun topuyla kediniz dakikalarca sıkılmadan zevkle oynayacaktır. Ürün boyutu 3cm_dir.', 'Bioline' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_bioline-catnip-sprey-15ml.html', 'Bioline Catnip Sprey 15ml', 'Kedi Ürünleri-Kedi Bakım Ürünleri-Catnipler', '6970117121339', '52 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_bioline-kedi-otu-31649287.jpg', '', 'Kedinizin ilgisini çekmek için Bioline Catnip Sprey ideal bir üründür. Kedinizi yönlendirmek istediğiniz eşyaya sıktığınızda kediniz meraklı adımlarla eşyaya yaklaşacaktır. Sprey şeklinde olduğu için kullanımı oldukça kolaydır. Ürünü tırmalama tahtasında kullanmanız kedinizin çabuk alışıp eşyalara zarar vermesinin önüne geçebilir. Alıştırmak istediğiniz oyuncaklarda kullandığınızda çabucak alışıp keyifli maceralara atıldığını göreceksiniz. Enerjisini bu şekilde atması sakinleşmesini de sağlayacaktır. Yavru ve yetişkin kediler için uygundur. ', 'Bioline' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_bioline-catnip-45ml.html', 'Bioline Tüp İçinde Kedi Otu 45ml', 'Kedi Ürünleri-Çok Satanlar-Bioline Çok Satanlar', '6970117121360', '', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_bioline-kedi-otu-31663611.jpg', '', 'Kedi otları kedinizin merkezi sinir sisteminde yer alan oyun merkezini uyararak saatlerce süren oyun serüveninin başlamasına katkıda bulunur. Kedinizin enerjisini bu şekilde atması eşyalara zarar vermesinin önüne geçebilir. Kedi otlarını yeni aldığınız ve kedinizin ilgisini henüz çekmeyen ürünlerde farketmesi için kullanabilirsiniz.  Ürünü koklaması ve tanıması için bir süre bekleyiniz. Ürüne alıştıktan sonra tırmalama tahtalarında veya oynamasını istediğiniz oyuncaklarda rahatlıkla kullanabilirsiniz.  ', 'Bioline' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_trixie-kedi-otu-20gr.html', 'Trixie Kedi Otu 20gr', 'Kedi Ürünleri-Kedi Bakım Ürünleri-Catnipler', '4011905042251', '89 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-otu-8475010.jpg', '', 'Catnip özünden filtre edilerek elde edilmiş, %100 bitkisel, önce kedinizin oynama duygularını harekete geçirecek ve daha sonra sakin ve nazik olmasını sağlayacak catnip_tir. Kedinizin ilgisini çekmek istediğiniz alana (tırmalama kulesi, paspası, oyuncak fare veya oyuncaklar vb.) koyabilirsiniz. Kediniz catnip_in konulduğu yerle oynayacaktır.', 'Trixie' );
