INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kus-urunleri_eurogold-muhabbet-kusu-yemi-500gr.html', 'EuroGold Ballı Muhabbet Kuşu Yemi 500gr', 'Kuş Ürünleri-Kuş Yemleri-Muhabbet Kuşu Yemi', '8681144130017', '28,50 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_eurogold-muhabbet-kusu-yemi-88516239.jpg', '17.05.2025', 'Muhabbet kuşlarının, doğal beslenme alışkanlıklarına uygun olarak hazırlanmış tam yemdir. Bu karışım, en kaliteli tohumların özenle seçilerek harmanlanmasından elde edilmiştir. Tüy değişimi ve yumurtlama dönemleri sırasında diyette ek protein, yağ ve vitaminler bulunmalıdır. EuroGold muhabbet kuşu yemi içeriğindeki bal ve meyve aromaları ile yem yemede isteksiz kuşların bile severek yiyebileceği bir yemdir. Günlük ihtiyaç kuşun türüne, yaşına ve kafesteki kuş sayısına bağlı olarak değişebilir. Bu nedenle kafes içinde iki yemlik bulundurulmalı ve yemlikler sürekli olarak dolu olmalıdır. Yemlikler günlük olarak kontrol edilerek içlerindeki kabuklardan temizlenmeli ve yem tamamlanmalıdır. İçme suyu günlük olarak değiştirilmeli sürekli taze içme suyu bulundurulmalıdır.', 'EuroGold' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kus-urunleri_quik-muhabbet-kusu-yemi-400gr.html', 'Quik Muhabbet Kuşu Yemi 400gr', 'Kuş Ürünleri-Kuş Yemleri-Muhabbet Kuşu Yemi', '8680468040156', '26,95 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_quik-muhabbet-kusu-yemi-89404455.jpg', '17.07.2025', 'Muhabbet kuşunuzun ihtiyacı olan vitamin ve mineralleri içerir. %100 doğal ürünlerden üretilmiştir. Muhabbet kuşunuzun tüy sağlığını korumanın yanı sıra tüylerinin daha canlı ve parlak görünmesini sağlar. Kuşunuzun ihtiyacı olan günlük enerji ihtiyacını karşılar. Kilitlenebilen ambalajı sayesinde yeminiz son kullanma tarihine kadar taze kalır.', 'Quik' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kus-urunleri_eurogold-special-okaliptuslu-muhabbet-kusu-yemi-500gr.html', 'EuroGold Special Okaliptuslu Muhabbet Kuşu Yemi 500gr', 'Kuş Ürünleri-Kuş Yemleri-Muhabbet Kuşu Yemi', '8681144131021', '29 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_eurogold-muhabbet-kusu-yemi-88633352.jpg', '28.03.2025', 'Muhabbet kuşlarının tüm besin ihtiyaçlarını karşılayan muhabbet kuşu yemidir. Yem içerisinde bulunan doğal mineraller, kalsiyum ve aminoasitler muhabbet kuşunuzun tüm vitamin ihtiyacını karşılar. İçeriğinde bulunan granüller sayesinde muhabbet kuşunuzun tüyleri daha parlak, sindirim ve bağışıklık sistemi daha güçlü olur.', 'EuroGold' );
