INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kus-urunleri_gold-wings-premium-yavru-muhabbet-kusu-yemi-1kg.html', 'Gold Wings Premium Yavru Muhabbet Kuşu Yemi 1kg', 'Kuş Ürünleri-Ağustos Seçili Ürünler-Gold Wings Ağustos Seçili Ürünler', '21.03.2025', '77 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_gold-wings-muhabbet-kusu-yemi-314895895.jpg', '', 'Yavru muhabbet kuşları için özel olarak formüle edilmiştir. Kuşların ihtiyaç duydukları tüm tahıl ve elementlerin doğru oran ve değerlerde tespiti yapılarak itina ile hazırlanmış tam yemdir. Gold Wings Premium ailesi her zaman gerçek Premium hizmetini sunabilmek için en kaliteli tahıl ve tohumları bir araya getirmiştir. Özel harmanlı içeriği ile tam ve besleyici sunum sağlarken aynı zamanda vitamin ve mineral açısından eksiksiz bir şekilde desteklenmiştir. 8_i Avrupa ülkesi olmak üzere 17 farklı ülke Gold Wings Premium_u tercih etmektedir.', 'Gold Wings' );
