INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kus-urunleri_jungle-touch-lezzet-taneleri-kuslar-icin-ek-besin-150gr.html', 'Jungle Touch Lezzet Taneleri Kuşlar için Ek Besin 150gr', 'Kuş Ürünleri-Kuş Yemleri-Kanarya Yemi', '8682631200992', '44 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_jungle-muhabbet-kusu-yemi-152797497.jpg', '14.04.2024', 'Muhabbet Kuşu, Kanarya, Cennet Papağanı, Sultan Papağanı, Saka, Bülbül, İspino Jungle Touch Lezzet Taneleri 150 gr her bir tohumun yumuşak ve zarif yapısı sayesinde yavru kuşların yem kırmaya alıştırılması ve henüz sahiplenilmiş kuşların yeni ortamlarına daha hızlı ve stressiz adapte olması için kullanılması tavsiye edilir. Tek tip beslenme doğru olmayacağı için, ana yemlerle birlikte kullanılması kuşların sağlıklı ve yüksek dirençli yapıya kavuşmalar için gereklidir. Kuşların dengeli beslenmesinde etkili rol oynayan, genel gelişimi, tüy gelişimi ve parlak tüylere sahip olmasına yardımcı olan severek tükettikleri ek besindir. Herhangi bir ısıl veya yapay işleme tabi tutulmayan doğal darı en saf hali ile kuşların doğadaki beslenme alışkanlıklarını taklit ederek kendilerini evlerinde hissetmelerini sağlar. Kuşların ihtiyaç duydukları yem, vitamin ve mineral kaynağını sağlamaktadır.', 'Jungle' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kus-urunleri_gold-wings-premium-papagan-yemi-1kg.html', 'Gold Wings Premium Papağan Yemi 1kg', 'Kuş Ürünleri-Ağustos Seçili Ürünler-Gold Wings Ağustos Seçili Ürünler', '27.11.2024', '159 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_gold-wings-papagan-yemi-314987212.jpg', '', 'Büyük cins papağan kuşları için gereksinim duydukları temel ihtiyaçlar dikkate alınarak hazırlanmış tam yemdir. %100 doğaldır. Gold Wings Premium ailesi her zaman gerçek premium hizmetini sunabilmek için en kaliteli tahıl ve tohumları bir araya getirir. Özel harmanlı içeriği ile tam ve besleyici sunum sağlarken aynı zamanda vitamin ve mineral açısından eksiksiz bir şekilde desteklenmiştir. 8_i Avrupa ülkesi olmak üzere 17 farklı ülke Gold Wings Premium_u tercih etmektedir. Özel paketleme tekniği havayı içeride hapsederek yemin bayatlama süresi uzatılmıştır. Ambalajlama esnasında kullanılan özel oksijen tekniği ile ürünün son kullanma tarihine kadar taze kalmasını sağlar.', 'Gold Wings' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kus-urunleri_gold-wings-premium-yumurta-ilaveli-kus-yemi-150g.html', 'Gold Wings Premium Yumurta İlaveli Kuş Maması 150gr', 'Kuş Ürünleri-Kuş Yemleri-Kanarya Yemi', '07.06.2025', '33 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_gold-wings-muhabbet-kusu-yemi-89728988.jpg', '', 'Gold Wings Premium ailesi, formülüne her zaman güvenerek Avrupa ve Uzak Doğudaki en kaliteli ve zengin yemler yarışmalarına katılmış, çeşitli başarılarla ülkemizi bu alanda temsil etmiştir. Tüm kuşlar için özel olarak hazırlanmış, kuşların dengeli beslenmesinde etken rol oynayan, tüy gelişimi destekleyen ve parlak tüylere sahip olmasında yardımcı olan ek besindir.  Kuşların mamalıklarına servis edilir. Yem ile karıştırılmaz.', 'Gold Wings' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kus-urunleri_gold-wings-classic-papagan-yemi-500gr.html', 'Gold Wings Classic Papağan Yemi 500gr', 'Kuş Ürünleri-Ağustos Seçili Ürünler-Gold Wings Ağustos Seçili Ürünler', '15.01.2025', '62 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_gold-wings-papagan-yemi-314713072.jpg', '', 'Sevilen ve değer verilen papağan kuşlarının en iyi şekilde beslenmesi gerekmektedir. Bu nedenle en kaliteli tohum ve tahıllar hassas bir şekilde seçilerek beslenme uzmanları tarafından özenle formüle edildi. Papağan kuşlarının günlük beslenme ihtiyacını karşılarken düzenli tüketimde deri ve tüy sağlığına katkıda bulunur. Özenle seçilen güçlü tohumlar ile yüksek bağışıklık sağlar. Beslenme uzmanları ve veteriner hekimler ile birlikte geliştirilen formülü kuşların günlük beslenme ihtiyacını tam ve dengeli olarak karşılar. Son teknoloji ambalajlama teknikleri ve malzemeleri ile paketlenerek son tüketim tarihine kadar tazeliğini korur.', 'Gold Wings' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kus-urunleri_garden-mix-platin-papagan-yemi-800gr.html', 'Garden Mix Platin Papağan Yemi 800gr', 'Kuş Ürünleri-Kuş Yemleri-Papağan Yemi', '8681085421199', '89 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_garden-mix-papagan-yemi-128132375.jpg', '28.02.2025', 'Tüm papağanlar için, seçkin içeriğiyle tam bir beslenme sağlayan, lezzetli ve değerli bileşenlerden oluşan, gerekli vitamin ve minarelleri içerğinde bulunduran, 100 doğal yemdir. Günde 1-2 defa kuşun büyüklüğüne ve sayısına göre tespit edilecek miktarda yemi kafes yemliğine koyunuz. Yanında her zaman taze su bulundurulması tavsiye edilir.', 'Garden Mix' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kus-urunleri_quik-papagan-yemi-750gr.html', 'Quik Papağan Yemi 700gr', 'Kuş Ürünleri-Ağustos Seçili Ürünler-Quik Ağustos Seçili Ürünler', '8680468040170', '108 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_quik-ayin-kampanyasi-89776838.jpg', '25.01.2025', 'Büyük boy papağanlar için, özel olarak hazırlanmış, içeriğinde papağanların doğal yaşamlarında da yedikleri tahıl ve besinleri bulabilecekleri, vitamin katkılı, besleyici yemdir.  Papağanlar için özel olarak formüle edilmiştir. Canlılık ve zindelik verir. Papağanlar fiziksel olarak birçok hububata ihtiyaç duyar. Zengin içeriğiyle Quik papağan yemi kuşunuzun sağlığını korur. Günlük olarak, yemliklere taze porsiyon olarak verilmesi tavsiye edilmektedir. Serin ve kuru yerde saklayınız.', 'Quik' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kus-urunleri_eurogold-bal-ve-meyve-aromali-papagan-yemi-750gr.html', 'EuroGold Bal ve Meyve Aromalı Büyük Papağan Yemi 750gr', 'Kuş Ürünleri-Kuş Yemleri-Papağan Yemi', '8681144130055', '64 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_eurogold-papagan-yemi-750kg-8855617.jpg', '23.01.2025', 'Büyük papağanların, doğal beslenme alışkanlıklarına uygun olarak hazırlanmış iri taneli tam yemdir. Bu karışım, en kaliteli tohumların özenle seçilerek harmanlanmasından elde edilmiştir. Papağanınızın ihtiyacı olan tüm besin maddelerini içeren tam yemdir.', 'EuroGold' );
