INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_trixie-kedi-tirmalama-ve-oyun-evi-27-39cm-gri.html', 'Trixie Kedi Tırmalama ve Oyun Evi 27x39cm (Gri)', 'Kedi Ürünleri-Tırmalama Tahtası ve Evleri-Tırmalama Tahtalı Kedi Evleri', '4047974431191', '2.599 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-tirmalamali-kedi-evi-223626403.jpg', '', 'Üst tarafı doğal sisal, diğer her tarafı peluş kaplı, iç tarafında çift taraflı peluş kedi yatağı bulunan kedi tırmalama ve oyun evidir. İç bölümdeki kedi yatağı elde yıkanabilir. Ürün gri renklidir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_trixie-kedi-evi-ve-tirmalama-topu-36x50cm-kahverengi-beyaz.html', 'Trixie Tırmalama Toplu Kedi Evi 36x50cm (Kahverengi-Beyaz)', 'Kedi Ürünleri-Kedi Evi & Yuvası-Trixie Kedi Evi & Yuvası', '4011905444130', '4.999 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-tirmalamali-kedi-evi-326179020.jpg', '', 'Sağlam taban üzerinde içi, dışı yumuşak kumaş kaplıdır. Kedi evi üzerinde jüt sarılmış kedi tırmalama topu ve oyuncağı vardır. Kedi tırmalama topunu tırmalarken üst tarafa bağlı oyuncak ile oynayarak zevkli zaman geçirecektir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_karlie-4-yonlu-kilitli-kedi-kapisi-19-2x20cm-beyaz.html', 'Karlie 4 Yönlü Kilitli Kedi Kapısı 19,2x20cm (Beyaz)', 'Kedi Ürünleri-Kedi Kapısı-Karlie Kedi Kapısı', '4016598038116', '719 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_karlie-kedi-kapisi-23633549.jpg', '', 'Kedinizin evin içerisine kolay girip çıkabilmesi için üretilmiş kedi kapısıdır. Kaliteli ve dayanıklı malzemeden üretilmiştir.  Kapınızda kedi kapısı genişliği boyutunda bir yer açarak içerisine monte edebilirsiniz. 4 yön özelliği sayesinde kediniz rahatlıkla eve girip çıkabilecektir.', 'Karlie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_trixie-kedi-otlu-ve-toplu-tirmalama-tahtasi-64x11x37cm-bej.html', 'Trixie Kedi Otlu ve Toplu Kedi Tırmalama Kartonu 64x11x37cm (Bej)', 'Kedi Ürünleri-Tırmalama Tahtası ve Evleri-Tırmalama Kartonları', '4011905480329', '1.299 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-tirmalama-paspaslari-130813770.jpg', '', 'Catnipli ve toplu tırmama tahtası. Kedizin tırmalama ihtiyacını giderirken aynı zamanda eşyalarınızı tırmalamasını engeller. Tırmalama tahtaları kedinizin tırnak bakımı için gereklidir. İçeriğindeki catnip sayesinde patili dostunuzun dikkatini çekerek tırmalamayı kullanmasını sağlar. Toplar kedinizin oyun oynamasını sağlar ve gün içerisinde enerjisini atmasına neden olur. Sert ve dayanıklı mukavvadan üretilmiştir. Şık tasarımı sayesinde evinize uyum sağlayacaktır. Özellikle büyük kediler için idealdir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_trixie-kaucuk-kirpi-top-kedi-oyuncagi.html', 'Trixie Kauçuk Kirpi Top Kedi Oyuncağı 3cm (Karışık Renkli)', 'Kedi Ürünleri-Çok Satanlar-Trixie Çok Satanlar', '4011905412511', '', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-oyuncaklari-11518371.jpg', '', 'Kedinizin gün içerisindeki enerjisini atmak için atlaya, zıplaya peşinde koşturacağı basit ama eğlenceli kedi oyuncağı, vinil kirpi top.  Sert kaliteli maddelerden üretilmiştir. Evcil dostunuza veya size zarar vermeyecek şekilde üretilmiştir. Üründen farklı renklerde stoklarımızda bulunmaktadır. Sipariş geldiğinde stokta olan renk gönderilir. Ürünün çapı 3 cm_dir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_catit-kedi-kumu-kuregi-32cm-pembe-xl.html', 'Catit Kedi Kumu Küreği 32cm (Pembe) [XL]', 'Kedi Ürünleri-Kedi Tuvaleti-Kum Küreği', '', '79 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_catit-kum-kuregi-64538435.jpg', '', 'Catit Kedi Kum Küreği geniş tasarımı ile bir seferde daha çok temizlik yapmamızı sağlamaktadır. Geniş delikleri sayesinde kirlenmemiş kullanılabilecek kumlar kolayca elenir ve kum kaybı yaşanmaz. Her türlü kedi kumu ile kullanılabilecek bir tasarıma sahiptir. Ürün pembe renge sahiptir.', 'Catit' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_eastland-kedi-otlu-tuylu-top-kedi-oyuncagi-4-5cm-sari.html', 'Eastland Kedi Otlu Tüylü Top Kedi Oyuncağı 4,5cm (Karışık Renkli)', 'Kedi Ürünleri-Kedi Oyuncağı-Catnipli ve Matatabili Oyuncaklar', '', '31 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_eastland-kedi-top-oyuncagi-80162313.jpg', '', 'Catnip, kokusuyla kedilerizin ilgisini üstüne çeker ve onları sakinleştirir. Bu oyuncak da hem catnipli hem de tüylü olması sebebiyle kedinizin dikkatini hemen çekecektir. Yumuşak yapısı evcil dostunuzun hoşuna gidecektir. Kedinizin sağlığı için kimyasa ve alerjik madde kullanılmamıştır güvenle oynatabilirsiniz. Bu ürünle kediniz gün içerisindeki biriken enerjisini eğlenceli bir şekilde atacaktır.', 'Eastland' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_hills-kitten-tavuklu-yavru-kedi-mamasi-2kg.html', 'Hill_s SCIENCE PLAN Healthy Development Tavuklu Yavru Kedi Maması 1kg + 500gr HEDİYE!', 'Kedi Ürünleri-Kedi Maması-Yavru Kedi Maması', '052742059631', '413 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_hills-yavru-kedi-mamasi-1kg-1349372.jpg', '30.08.2024', '3 hafta - 12 ay arası yavru kediler ve anne kediler için özenle hazırlanan Hill_s Kitten içeriğindeki vitamin ve mineral dağılımı sayesinde bağışıklık sistemini maksimum seviyede destekler. Özellikle yavru kedilerin dış etkilere açık olduğu bu dönemde bağışıklık sisteminin kuvvetli olmasına dikkat edilen Hill_s Kitten_da antioksidanlar ve balık yağından elde edilen DHA bağışıklık sistemini ve sindirim sistemini koruyucu etkiye sahiptir. Anne kedilerin ve yavrularının ihtiyaç duydukları enerjiyi tam olarak karşılayabilen Hill_s Kitten içeriğinde bulunan omega-3 ve omega-6 yağ asitleriyle tüy ve deri sağlığını korur ve devamlılığını sağlar. Yüksek protein oranlı formülü yavru kedilerin kas sistemlerinin gelişmesine katkı sağlar. Mamanın formülünde bulunan kalsiyum ve D vitamini diş ve kemik gelişimini destekler.', 'Hill_s' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_eurodog-kedi-ve-kopekler-icin-pire-taragi-2.html', 'EuroDog Kedi ve Köpekler için Pire Tarağı 19cm', 'Köpek Ürünleri-Kedi Tarağı ve Fırçası-Pire Tarağı', '', '89 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_eurodog-kedi-pire-taragi-164678932.jpg', '', 'Kedi ve köpekler için özel olarak tasarlanmış pire tarağıdır. Evcilinizi düzenli olarak taradığınızda hem üzerindeki toz hem de pireleri yakalamaya yardımcı olur. Kedi ve köpeklerin kürklerindeki pirelerden temizlenmesi için pratik taraktır. Plastik sapı sayesinde elinizden kaymaz ve pratiklik sağlar. Ürünün boyu 19 cm_dir.', 'EuroDog' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_reflex-yavru-kedi-mamasi-15kg.html', 'Reflex Tavuklu ve Pirinçli Yavru Kedi Maması 2kg', 'Kedi Ürünleri-Kedi Maması-Yavru Kedi Maması', '8698995028851', '', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_reflex-yavru-kedi-mamasi-2kg-1484670.jpg', '05.04.2024', 'Formülünde hayvansal protein kaynağı olarak tavuk bulunan Reflex Kitten, yavru kedilerin günlük enerji ihtiyaçlarını tam olarak karşılar.  Reflex Kitten yavru kedilerin gelişimlerini destekler ve sağlıklılık durumunun devamlılığını sağlar. Kas gelişimini desteklemek için yüksek kaliteli protein bulunan formülünde bağışıklık sistemini destekleyen vitamin ve mineraller vardır. Parlak tüyler ve sağlıklı bri cilt için formülüne bira mayası eklenen Reflex Kitten kolay sindirilebilir formülüyle sindirim sistemini yormaz ve bağırsak sağlığı korunur. ', 'Reflex' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_karlie-kedi-ve-kopek-uzaklastirici-200ml.html', 'Karlie Kedi ve Köpek Uzaklaştırıcı Sprey 200ml', 'Kedi Ürünleri-Bakım ve Temizlik Ürünleri-Köpek Uzaklaştırıcılar', '4016598002384', '329 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_karlie-kedi-uzaklastirici-sprey-182375777.jpg', '', 'Kedi ve köpeklerinizin yaklaşmasını istemediğiniz yerlere uygulayarak uzak durmasını sağlayabilirsiniz.  Ürünü bitkiler üzerinde uygulamayınız. Ürün 200 ml_dir.', 'Karlie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_felicia-somonlu-taurinli-tahilsiz-kisirlastirilmis-kedi-konservesi-85gr.html', 'Felicia Jöle İçinde Somonlu Taurinli Tahılsız Kısırlaştırılmış Kedi Konservesi 85gr', 'Kedi Ürünleri-Kedi Konserve Maması-Kısırlaştırılmış Kedi Konservesi', '8682631200084', '19,50 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_felicia-yetiskin-kedi-konservesi-163503342.jpg', '21.11.2024', 'Kısırlaştırılmış kediler için somonlu yaş kedi maması, veteriner hekimler ve beslenme uzmanları tarafından özel olarak formüle edilmiştir. Dostlarımızın vazgeçilmez yaşam kaynağı olan taurin desteği, GDO, soya ve tahıl içermeyen özel formülü ile benzersiz bir tüketim deneyimine hazır olun.', 'Felicia' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_botanivo-woodsy-floral-tazeleyici-dogal-kopek-kolonyasi-125ml.html', 'Botanivo Woodsy Floral Tazeleyici Doğal Köpek Kolonyası 125ml', 'Köpek Ürünleri-Bakım ve Temizlik Ürünleri-Köpek Parfümü', '', '289 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_botanivo-kopek-parfumu-305324606.jpg', '', 'Organik, %100 saf ve doğal içeriğinde bulunan ve çiçeksi kokusunu petitgrain, palmarosa ve ylang ylang bitkilerinden, odunsu kokusunu ise sedir ağacından alarak vücutta hoş bir koku bırakır. Hem banyo sonrası, hem de iki banyo arası tazelenme ve yenilenme için günlük kullanımı idealdir. İstenmeyen kokuları giderir. Hoş kokusunun ve oluşturduğu uzun süreli tazelenmenin yanı sıra içeriğindeki aloe vera ile doğal ve canlandırıcı bir tüy bakımı sağlarken , aromaterapik içeriğiyle SPA deneyimi yaşatır. Ekolojik, hayvan ve çevre dostu, saf botanik ve vegandır. Parfüm, alkol, paraben, sülfat, boyai renklendirici, zararlı ve toksik kimyasallar içermez.', 'Botanivo' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_kopek-icin-tel-panel-8-panel-61x78cm-krom.html', 'Weipro Köpek için Krom Tel Panel 61x78cm (8 Parça)', 'Köpek Ürünleri-Bakım ve Temizlik Ürünleri-Bahçe Ürünleri', '', '1.699 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_weipro-kopek-guvenlik-urunleri-25484946.jpg', '', 'Evcil dostunuza özel bir oyun alanı oluşturmak yada alanını sınırlamak için kullanabilirsiniz. 8 adet parçadan birleştirerek kolayca kurulum yapabilirsiniz. Ürün köpeğinize zarar vermeden belirlediğiniz alanının içerisinde oynamasını sağlayacaktır. Uzun ömürlüdür ve dayanıklı metallerden üretilmiştir. Darbelere dayanıklıdır.', 'Weipro' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kopek-agility-egitim-tuneli-60cm5m-mavi-1.html', 'Trixie Köpek Agility Eğitim Tüneli 60x5m (Mavi)', 'Köpek Ürünleri-Köpek Oyuncağı-Eğitim ve Zeka Geliştirici Oyuncaklar', '4011905032115', '3.899 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-egitim-ekipmani-21615491.jpg', '', 'İç Ve Dış Mekân Kullanımına Uygun , Boyunu Ayarlayabileceğiniz , Taşıma Çantalı Agility eğitim tüneli. Eğitimin başında 2 Kişi Olmanız Tavsiye Edilir. Bir Kişi Köpekle Beraber Tünelin Girişinde Bulunmalı , Diğer Kişi İse Tünelin Sonunda Köpeğin Dikkatini Tünelin İçerisine Çekmelidir , Tünel İçerisine Girmesiyle Birlikte , Tünelin Başında Ona Refakat Eden Kişide Köpekle Aynı Hizada Yürümelidir. Köpeğin Sorunsuz Olarak Tünelden Çıkması Durumunda İkinci Etaba Geçebilir , Her Seferinde Tünelin Boyunu Uzatarak Onu Eğitebilirsiniz. Agility tüm dünyada , köpek ve sahibinin beraber oynadıkları yeni bir spor olarak yarışmaları yapılmaktadır. Köpeğinizi asla dolu mide ile oynatmayınız ve antrenman sonrası köpeğinizi beslemeyiniz. Köpeğinizi yavaş yavaş oynamaya alıştırınız , onu birkereden zorlamayınız. Daima içebileceği temiz ve bol su bulundurunuz. Su içmeden önce ve sonra dinlendirerek nefeslenmesine müsaade ediniz. Aşırı hızlı nefes alırken su içmesi ve yemek yemesi köpeklerde miğde torsiyonuna sebe olabilir ve bu ölümle sonuçlanabilir. Yavru ve genç köpeklere antrenman yaptırmadan önce veterinerinize müracaat ediniz. Kas ve kemik ve eklem yapısını kontrol ettiriniz. Agilty parkuru için eğitim sayfasında yer alandiğer eğitim ürünlerinide inceleyebilirsiniz. Ürünlerin kullanım videosu sayfanın altında yer almaktadır. Ürün hakkında detaylı ', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_veturel-kedi-ve-kopekler-icin-agiz-ve-dis-bakim-spreyi-100ml.html', 'Veturel Kedi ve Köpekler için Ağız ve Diş Bakım Spreyi 100ml', 'Köpek Ürünleri-Kedi Bakım Ürünleri-Ağız_Diş Sağlığı', '', '137 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_veturel-kedi-agiz-ve-dis-sagligi-291826288.jpg', '', 'Neden Veturel? Dişlerinin fırçalanmasını sevmeyen dostlarımız için mükemmel bir ağız bakım ürünüdür. Düzenli kullanımda plak ve tartar oluşumuna karşı etkilidir. Ağız içinde oluşan enfeksiyonların tedavisine yardımcı olur. Diş etlerini güçlendirir, yaraların hızla iyileşmesini sağlar. Hipokloröz asit, akyuvarların zararlı bakterilere karşı ürettiği doğal bir savunma ajanıdır. Tartar ve kötü kokuların nedeni olan bakterilere karşı etkilidir. Yutulmasında sakınca yoktur. Tüm ürünleri dünyanın çeşitli bölgelerindeki veteriner hekimler tarafından kullanılarak tavsiye edilmektedir. Ürün içerikleri Amerika ve Kanada_da Düşük Riskli Veteriner Sağlık Ürünü olarak onaylanmıştır. Ürünlerini tasarlarken reuse (tekrar kullan) - recycle (geri dönüştür) - reduce (azalt) aksiyonlarını dikkate alır.', 'Veturel' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kopekkedi-cis-ekstra-temizleyici-750ml.html', 'Trixie Kedi ve Köpekler için Ekstra Temizleyici 750ml', 'Köpek Ürünleri-Kedi Bakım Ürünleri-Leke ve Koku Gidericiler', '4011905257525', '459 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-leke-ve-koku-gidericiler-7471780.jpg', '', 'Ekstra konsantre içeriği sayesinde köpeklerin ve kedilerin inatçı çiş kokularını ve çiş lekelerini halı, sert yüzeyler, çiş kabı vb. yerlerden çıkarmada kullanılan suda çözülnmeyen idrar kristallerini çözebilen bio enzimlerden üretilmiş temizleme spreyidir. Bu ürün aynı zamanda çamaşır makinalarının ve halı temizleme makinalarının temizlenmesinde de kullanılabilir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kucuk-kopek-ve-kedi-kutusu-31x33x50cm-xs.html', 'Trixie Küçük Irk Köpek ve Kedi Taşıma Kutusu 31x33x50cm [XS]', 'Köpek Ürünleri-Bakım ve Temizlik Ürünleri-Bahçe Ürünleri', '4011905396910', '1.069 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-araba-urunleri-22553700.jpg', '', 'Köpeğiniz ve kediniz için evde, yolculuk sırasında, tatilde ve yarışmalarda ideal ve güvenli bir yerdir. Katlanarak çanta şeklinde taşınabilir. İki tarafında ve kapısındaki dayanıklı file bölüm sayesinde köpeğiniz veya kediniz içerisinde yatarken etrafını görebileceği için çok rahat edecek ve huzur duyacaktır. Dilerseniz kapısını üst tarafa rulo yaparak cırt cırtı ile sabitleyebilir ve mini bir kulübeye çevirebilirsiniz. Tabanında yer alan özel kopça bölümleri ile bagaja sabitlenebilir. Arka tarafındaki cebi çok kullanışlıdır. Nemli bezle silerek kolayca temizlenebilir.', 'Trixie' );
