INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_karlie-kopek-emniyet-kemeri-baglanti-kayisi-25mm-52-85cm-l-xl-siyah.html', 'Karlie Köpek Emniyet Kemeri Bağlantı Kayışı 25mm_52-85cm [L-XL] (Siyah)', 'Köpek Ürünleri-Araba_Araç Ekipmanları-Emniyet Kemeri Bağlantısı', '5400274535591', '249 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_karlie-kopek-emniyet-kemeri-289189951.jpg', '', 'Köpek emniyet kemeri mutlaka sizin emniyetiniz içinde gerekli olan bir aparattır. Birçok ülkede köpekleri ile yolculuk yapanlara yasal olarak kullanma zorunluluğu getirilmiştir. Ürün siyah bağlantı kayışıdır. Sağlam metal bağlantılara sahiptir. Tamamen ayarlanabilir. Kimyasal salınım yapmaz, insan ve hayvan sağlığına %100 zararsızdır.', 'Karlie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_gimdog-kopek-uzaklastirici-sprey-100ml.html', 'GimDog Köpek Uzaklaştırıcı Sprey 100ml', 'Köpek Ürünleri-Ağustos Seçili Ürünler-Gimpet Ağustos Seçili Ürünler', '4002064504803', '129 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_gimpet-kopek-uzaklastirici-sprey-6186620.jpg', '', 'Limon ve Portakal uçucu yağları ve Elma Sirkesi gibi doğal malzemelerden oluşan fonksiyonel aktif maddelerle oluşturulan belirli bir koku ile özel olarak formüle edilen fısfıs sprey. Bu koku köpeğinizin koku duyusunu rahatsız etmediği gibi zarar da vermez, ancak evcil hayvanınızın korumak istediğiniz yerlere yaklaşma veya oraları kirletmesi hevesini kırar. Kuvvetlice çalkalayın ve köpeğinizin yakınlaşmasını ya da kirletmesini istemediğiniz alanlarda fısfıslayın. İlk on gün boyunca 20-30 cm_lik bir mesafeden günde 3 ila 4 kez püskürtün. Evcil hayvanınız alışana kadar tedaviyi tekrarlayın. Köpeğin gözleri, sarkık üst dudağı ve diş mukozası ile temastan kaçının.', 'Gimpet' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_trixie-kopek-ve-kedi-icin-dis-temizleme-suyu-300ml.html', 'Trixie Kedi ve Köpekler için Diş Temizleme Suyu 300ml', 'Kedi Ürünleri-Kedi Bakım Ürünleri-Ağız_Diş Sağlığı', '4011905254456', '309 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-agiz-ve-dis-sagligi-44925477.jpg', '', 'Kullanımı çok kolay, köpek ve kedi için kullanılabilen elma kokulu diş temizleme suyudur. Köpeğinizin veya kedinizin dişlerini günlük içme suyu aracılığıyla temizler, ağızda bakteri oluşumu ve ağız kokusunu engeller. Köpeğinizin veya kedinizin temiz ve taze bir nefese sahip olmasını ve ağız hijyenini sağlar. Kullanımı çok kolaydır. Diş Temizleme Suyu içme suyunun içerisinde tamamen çözülmektedir. Elma tadındadır. Köpeğinizin veya kedinizin günlük içme suyuna 1:50 oranında ilave ediniz. Örnek : 1Lt lik su kabına 20 ml  ', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kancali-emniyet-kemeri-baglanti-kayisi-30cm-38mm-siyah.html', 'Trixie Kancalı Emniyet Kemeri Bağlantı Kayışı 30cm-38mm (Siyah)', 'Köpek Ürünleri-Araba_Araç Ekipmanları-Emniyet Kemeri Bağlantısı', '4011905127750', '939 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-guvenlik-urunleri-131408892.jpg', '', 'Her tip araç emniyet kemerine uygundur. Çeşitli bağlama şekilleri ile pratik ve kullanışlıdır. Polyester kemer kumaşından üretilmiştir. Uç kısmında oldukça sağlam dağcı karabinası (açılıp kapanabilen kanca) vardır. Dostunuzla birlikte güvenli şekilde seyahat etmenizi sağlar. Güvenli ve aklınızın dostunuzda kalmayacağı yolculuklar için ideal bir ürün. Ürün siyah renktir.', 'Trixie' );
