INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-13201-kopek-bagaj-kapagi-ilave-ust-parcasi-92x27x4cm-gumus-gri-siyah.html', 'Trixie Köpek Bagaj Kapağı İlave Üst Parçası 92x27x4cm (Gümüş Gri_Siyah)', 'Köpek Ürünleri-Araba_Araç Ekipmanları-Araba İçi Aparatları', '4011905132020', '1.699 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-araba-ici-aparatlari-153878660.jpg', '', 'Trixie 13201 köpek bagaj kapağı üst ilave parçasıdır. Ayarlanabilir üst olması sayesinde atm uyumu ve kapamayı sağlar. Alüminyum ve plastikten üretilmiştir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kopek-tasima-aluminyum-kafesi-55x62x78cm.html', 'Trixie Alüminyum Köpek Taşıma Kafesi 55x62x78cm', 'Köpek Ürünleri-Araba_Araç Ekipmanları-Araba İçi Taşıma Ürünleri', '4011905393414', '16.120,24 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-tasima-cantasi-18044797.jpg', '', 'Alüminyum kasalı sağlam, güvenli ve sessizdir. Kompakt panelleri sayesinde sağlam duruşlu ve çok daha güvenlidir. Yapısını oluşturan kalın alüminyum borular sayesinde çok iyi havalandırma sağlarken köpeğinizin görüşünü kapatmayarak rahat etmesini sağlar. Tüm station wagon ve jeep modelleri arka bagaj bölümüne optimum uyum sağlar. Özel kuşaklarıyla bagaj taban bölümüne sağlam şekilde bağlanabilir. Kilitli kapısı ve emniyet kilidi vardır. İçerisinde termal (kışın sıcak yazın soğuk tutan) kaymaz battaniyesi vardır. Battaniye çamaşır makinesinde 30 derecede yıkanabilir özelliğe sahiptir. 
