INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-bisiklet-arkasi-kopek-tasima-sepeti-36x47x46cm-gri.html', 'Trixie Bisiklet Arkası Köpek Taşıma Sepeti 36x47x46cm (Gri)', 'Köpek Ürünleri-Araba_Araç Ekipmanları-Bisiklet Aparatları', '4047974131152', '2.549 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-araba-urunleri-146348408.jpg', '', 'Sele arkasında taşıma alanı olan tüm bisikletler için uygundur. Alt tarafı gri plastik, üst tarafı TPR kaplı metal kafes şeklindedir. Üst taraf, özel tasarımı sayesinde hızlı bir şekilde açılıp, kilitlenebilir. İç tarafında kaymaz tabanlı ince yatağı bulunmaktadır. Bu yatak çamaşır makinasında 30C_de yıkanabilir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kucuk-kopek-ve-kedi-kutusu-32x32x47cm-xs.html', 'Trixie Küçük Köpek ve Kedi Kutusu 32x32x47cm [XS]', 'Köpek Ürünleri-Bakım ve Temizlik Ürünleri-Bahçe Ürünleri', '4011905397016', '1.299 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-araba-urunleri-22528671.jpg', '', 'Köpeğiniz ve kediniz için evde, yolculuk sırasında, tatilde ve yarışmalarda ideal ve güvenli bir yerdir. Katlanarak çanta şeklinde taşınabilir. İki tarafında ve kapısındaki dayanıklı file bölüm sayesinde köpeğiniz veya kediniz içerisinde yatarken etrafını görebileceği için çok rahat edecek ve huzur duyacaktır. Dilediğinizde yan pencerelerini kapatabileceğiniz dış perdeleri vardır. Bu perdeler cırt cırt ile üst tarafa toplanabilir veya kapıtılabilir. Her iki yanında pencerelerinin altında cepleri vardr.Dilerseniz kapısını üst tarafa rulo yaparak cırt cırtı ile sabitleyebilir ve mini bir kulübeye çevirebilirsiniz. Dilerseniz tabanından yere sabitleyebilirsiniz. Üst tarafında kaldırıp taşıyabileceğiniz tutma yeri vardır. İçerisinde ki taban bölümü pleuş kaplıdır. Dış ve peluş iç yatağı elde yıkanabilir. Aynı zamanda nemli bezle silerekte çok kolay temzilenebilir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kopek-tasima-aluminyum-kafesi-63x65x90cm.html', 'Trixie Alüminyum Köpek Taşıma Kafesi 63x65x90cm', 'Köpek Ürünleri-Araba_Araç Ekipmanları-Araba İçi Taşıma Ürünleri', '4011905393421', '18.503,72 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-tasima-cantasi-18014783.jpg', '', 'Alüminyum kasalı sağlam, güvenli ve sessizdir. Kompakt panelleri sayesinde sağlam duruşlu ve çok daha güvenlidir. Yapısını oluşturan kalın alüminyum borular sayesinde çok iyi havalandırma sağlarken köpeğinizin görüşünü kapatmayarak rahat etmesini sağlar. Tüm station wagon ve jeep modelleri arka bagaj bölümüne optimum uyum sağlar. Özel kuşaklarıyla bagaj taban bölümüne sağlam şekilde bağlanabilir. Kilitli kapısı ve emniyet kilidi vardır. İçerisinde termal(kışın sıcak yazın soğuk tutan) kaymaz battaniyesi vardır. Battaniye çamaşır makinesinde 30 derecede yıkanabilir özelliğe sahiptir. 
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kopek-icin-bisiklet-romorku-45x48x74cm.html', 'Trixie Köpek için Bisiklet Römorku 63x68x75cm [M] (Kırmızı-Siyah)', 'Köpek Ürünleri-Araba_Araç Ekipmanları-Bisiklet Aparatları', '4011905128146', '11.102,37 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-bisiklet-aparatlari-7935284.jpg', '', 'Bisiklete binerken artık köpeğinizde sizinle gelecek. Dayanıklı hafif metal şaseye sahip kolay temizlenebilen naylondan imal edilmiş, bekleme anında kullanılmak üzere tekerlek kilitlerine sahip, etrafındaki dayanıklı file sayesinde kusursuz havalandırma özelliği vardır. Ön ve arka girişi bulunan, ön kapısında ekstra yağmur ve rüzgar koruyucusu olan, üst taraftaki file üzeri kapanabilen , gece kullanımı için reflektif bantları olan, petin atlamasını engellemek için içerisinde kısa bağlama kayışı olan, taban yastığı çıkabilen ve elde 30C_de yıkanabilen, kırmızı-siyah renklerde köpekler için bisiklet römorkudur. Römork ağırlığı 11 kg_dir. Taşıma kapasitesi 22 kg_dir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kopek-icin-bagaj-kapagi-aralik-tutucu.html', 'Trixie Köpek için Bagaj Kapağı Aralık Tutucu', 'Köpek Ürünleri-Araba_Araç Ekipmanları-Araba İçi Aparatları', '4011905131054', '689 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-araba-urunleri-22598247.jpg', '', 'Dayanıklı galvaniz metallerden üretilmiştir. Bagaj kapağının aralık tutulması için özel olarak tasarlanmış bir üründür. Köpeğinizin araç içerinde havasız kalmaması düşünülmüştür. Suv, 4x4 ve istasyon, vagon gibi araçlarda bagaj kapağının aralık tutulması, bagaj bölümündeki köpeğinizin havalandırması için kullanılmaktadır.  Uzunluğu ayarlanabilir bir yapıya sahiptir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kopek-teleskopik-inis-rampasi-43x100-180cm.html', 'Trixie Köpek Teleskopik İniş Rampası 43x100-180cm', 'Köpek Ürünleri-Araba_Araç Ekipmanları-Köpek Rampası', '4011905039404', '9.083,05 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-araba-urunleri-22396435.jpg', '', '120 Kg_a kadar taşıma kapasitesine sahiptir. Alüminyum ve plastik malzemeden imal edilmiştir. Üzeri kaymaz malzeme ile kaplıdır ve yanlarında emniyet rayları vardır. Yüksek yerlerden inip çıkarken köpeklerinizin eklemlerini korur, eklem problemli ve yaşlı köpeklerinizin kolayca inip çıkmasını sağlar. Arthrosis ve artrit rahatsızlığı bulunan köpekler için şiddetle tavsiye edilmektedir. Ayarlanabilir boyu sayesinde iniş açısıda ayarlanabilmektedir. Rampa toplam ağırlığı 5,8 Kg_dir ve çok kolay temizlenebilmektedir. 
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_pawise-arac-ici-kopek-bolme-agi-122x64cm.html', 'Pawise Araba için Ön Koltuk Köpek Koruma Ağı 122x64cm', 'Köpek Ürünleri-Araba_Araç Ekipmanları-Araba İçi Aparatları', '', '259 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_pawise-kopek-araba-ici-aparatlari-106002599.jpg', '', 'Köpeklerin bagajda taşınması esnasında ön tarafa geçmelerine karşı bir bariyer oluşturur Petinizin yolculuk esnasında ön tarafa geçmesini ve sürücünün dikkatinin dağılması engellenir. Aynı zamanda bir kaza veya herhangi beklenmeyen bir durum esnasında bagajda yer alan diğer, eşyaların aracın ön bölümüne gelmesine, sürücü ve yolcuların zarar görmesine engel olur. Ürün kaliteli malzemeden üretilmiştir kopma ve yırtılmalara karşı dayanıklıdır.  ', 'Pawise' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-bisiklet-icin-kopek-yurutme-aparati-2.html', 'Trixie Bisiklet için Köpek Yürütme Aparatı', 'Köpek Ürünleri-Araba_Araç Ekipmanları-Bisiklet Aparatları', '4011905012872', '2.549 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-gezdirme-kayislari-69479916.jpg', '', 'Tüm ırklara uygun olan bu bisiklet yürütme aparatı aynı zamanda büyük ırk köpekler ve giant ırklar içinde kullanılabilir. Bisiklet yürüyüşlerinizde köpeğnizin size katımasını ve rahat bir yürüyüş sağlar. Oldukça dayanıklı ve kullanışlıdır. Üzerinde bulunan özel yay sayesinde köpeğin ani çekişleri absorbe edilerek bisiklet içerisinde dengenizi kaybetmenizi engelleyecektir. Özel tasarımı sayesinde bisiklete monte edildiği noktadan belli bir mesafede bağlantı sağlandığı İçin kullanımı kolaydır.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kopek-ve-kedi-icin-merdiven-40x38x45cm.html', 'Trixie Kedi ve Köpekler için Merdiven 40x38x45cm', 'Köpek Ürünleri-Araba_Araç Ekipmanları-Köpek Rampası', '4011905039435', '3.999 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-guvenlik-urunleri-2449356.jpg', '', 'Hafif cilalı huş ağacından üretilmiştir. Tüm küçük ırk köpekler, kediler ve yaşlı-hasta köpeklerin kullanımı için uygundur. Tüm basamakları güvenli iniş-çıkış için halı ile kaplıdır. Kedi ve köpeklerinizin yüksek noktalara zıplamadan sernestçe çıkabilmelerini sağlar. Çok amaçlı kullanıma uygundur. Sökülüp takılabilmesi sayesinde kolay depolanabilmektedir. 50 kg ağırlığa kadar olan petlerde kullanılabilir. Ürün ölçüleri 40x38x45 cm_dir. 
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kopek-icin-bagaj-ortusu-230x170m-siyah.html', 'Trixie Köpek için Bagaj Örtüsü 230x170cm (Siyah)', 'Köpek Ürünleri-Araba_Araç Ekipmanları-Koltuk Koruma Örtüsü', '4011905013183', '1.699 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-araba-urunleri-22495319.jpg', '', 'Bu çok kullanışlı bagaj örtüsünün diğer bagaj örtülerine göre en büyük farkı kenarlarının yüksek olması ve istasyon (station wagon) vagon araçlarda bagaj bölümü yan kenarlardaki halıların üzerini kapayacak yükseklikte olmasıdır. Bu sayede bagajınızın kirlenmesini önlersiniz. Tabanındaki cırtlar ve bağlantı kayışları sayesinde mükemmel şekilde bagaja monte edilebilmektedir.Çok kolay monte edilip çıkarılabilir. Su geçirmezdir ve elde yıkanabilir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kopek-emniyet-kemeri-20-50cm-xs.html', 'Trixie Köpek Emniyet Kemeri 20-50cm [XS]', 'Köpek Ürünleri-Araba_Araç Ekipmanları-Emniyet Kemeri Bağlantısı', '4011905012889', '379 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-emniyet-kemeri-77827752.jpg', '', 'Yorkshire Terrier vb. ırklar için uygundur. Köpek için araç seyahat göğüs tasması ve emniyet kemeri bağlantı kayışıdır. Göğüs tasması aynı zamanda günlük olarakta kullanılabilir. İç bölümü özel olarak yumuşak malzemeden üretilmiştir. Göğüs ve beli tamamen ayarlanabilir. Siyah renktedir. 20-50cm boyutlarındadır.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kopek-arka-koltuk-ortusu-140x120m.html', 'Trixie Köpek Arka Koltuk Örtüsü 1,40x1,20m', 'Köpek Ürünleri-Araba_Araç Ekipmanları-Koltuk Koruma Örtüsü', '4011905132372', '1.249 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-araba-urunleri-22565127.jpg', '', 'Köpek için araba arka koltuk örtüsüdür. Naylon_dur. Bu sayede su geçirmez ve 30C_de makinada yıkanabilir. Araba arka koltuğunuzun kirlenmesini ve tüy olmasını önler. Emniyet kemeri açıklıkları sayesinde köpeğinizi güvenle Trixie emniyet kemeri ile bağlayabilirsiniz. İhtiyaç durumunda ayaralanabilir bölümü sayesinde arka koltuğua bir kişi köpeğin yanına oturabilir. Çok kolay kurulabilir ve toplanabilir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_karlie-kopek-icin-arac-on-koltuk-ortusu-70x130cm-siyah.html', 'Karlie Köpek için Araç Ön Koltuk Örtüsü 70x130cm (Siyah)', 'Köpek Ürünleri-Ağustos Seçili Ürünler-Karlie Ağustos Seçili Ürünler', '4016598314975', '689 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_karlie-araba-koltuk-ortusu-241648347.jpg', '', 'Araba koltukları için yumuşak koruma örtüsüdür. Araba koltuklarını kir, nem ve hayvan tüylerinden en iyi şekilde korur.  Dayanıklı malzemeden üreiltmiştir. Temizliği ve bakımı oldukça kolaydır. Elde yıkanabilir.  ', 'Karlie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kopek-cift-tarafli-tuy-toplama-fircasi.html', 'Trixie Çift Taraflı Tüy Toplama Fırçası 26cm', 'Köpek Ürünleri-Köpek Tarağı ve Fırçaları-Çift Taraflı', '4011905023298', '209 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-tarak-ve-fircasi-757731.jpg', '', 'Trixie marka çift taraflı olarak kullanılabilen özel yapısı sayesinde her çeşit kumaştan tüyleri temizleyebileceğiniz harika bir fırçadır. Gerek köpeklerimizle oynayıp keyifli vakitler geçirirken gerekse evimizde çeşitli eşyaların üstüne ve alanlara dökülmüş tüyler istemeden kıyafetlerimizde toplanıp kötü bir görüntüye sebep olabilirler. Acil durumlarda pratik bir çözüm sunan bu çift taraflı toplama fırçası kolaylıkla üzerinizdeki tüyleri toplayarak temiz bir görüntü sağlar. Uzun ömürlü bir kullanıma sahiptir. Üzerini temizleyerek tekrar ve tekrar kıyafetleriniz veya kumaş yapılı eşyalarınız üzerinde uygulayabilirsiniz. Oldukça kaliteli bir toplama fırçasına sahiptir. Uygulandığı alan üzerinde yapışkan bir his bırakmaz. Ürünün ölçüsü 26 cm_dir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_pawise-emniyet-kemerli-kopek-tasmasi-60cm-m.html', 'Pawise Emniyet Kemerli Köpek Tasması 60cm [M]', 'Köpek Ürünleri-Ağustos Seçili Ürünler-Pawise Ağustos Seçili Ürünler', '', '249 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_pawise-kopek-emniyet-kemeri-105528546.jpg', '', 'Ayarlanabilir rahat ve güvenli bir emniyet kemeri. Aracınızın yolcu kabininde köpeğinizin hareketini sınırlar ve acil fren durumunda güvenle tutar. Emniyet kemeri aynı zamanda bir göğüs tasması olarak kullanılabilir.  1. Sınıf naylon dokumadan imal edilmiştir uzun yıllar kullanım ömrü sunar ve köpeğinizi rahatsız etmez. Temizlemesi kolay ve pratiktir. Leke tutmaz özelliğe sahiptir.', 'Pawise' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_bioline-kedikopek-goz-bakim-damlasi-50ml.html', 'Bioline Kedi ve Köpek Göz Bakım Damlası 50ml', 'Köpek Ürünleri-Kedi Bakım Ürünleri-Göz Bakımı', '6970117120141', '149 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_bioline-kedi-goz-bakimi-22179784.jpg', '', 'Bioline Eye Care Drops, tüm evcil hayvanlarınız için kullanabileceğiniz bir göz temizleme ve bakım sıvısıdır. Göz içine ve etrafına damlatıp, bir pamuk yardımı ile silin. Bu sayede göz ve etrafında oluşan toz, pisliklerden evcil hayvanlarınızı arıtmış, gözlerine bakım yapmış olacaksınız.', 'Bioline' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_pawise-kedi-ve-kopekler-icin-hijyenik-islak-mendil.html', 'Pawise Kedi ve Köpekler için Hijyenik Islak Mendil (70_li)', 'Köpek Ürünleri-Kedi Bakım Ürünleri-Yavru Kedi Bakımı', '', '119 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_pawise-yavru-kedi-bakim-urunleri-167555093.jpg', '', 'Kedi ve köpekler için, genel temizlik amacıyla kullanılabilen, kokusuz ve hijyenik, ıslak temizlik mendilidir. Göz çevresi, kulak, pati, tüy ve dış genital bölge temizliği için kullanıma uygundur. 6,5 - 7,5 pH derecesine sahiptir. Alkol ve kimyasal madde içermez. Paket içerisinde 70 adet hijyenik mendil bulunmaktadır. Kedi, köpek tüy ve patilerin temizliği için uygundur.', 'Pawise' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_bioline-kedi-ve-kopek-biftek-aromali-agiz-bakim-sivisi-100g.html', 'Bioline Kedi ve Köpek Biftek Aromalı Ağız Bakım Jeli 100gr', 'Köpek Ürünleri-Kedi Bakım Ürünleri-Ağız_Diş Sağlığı', '6970117122589', '169 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_bioline-kedi-agiz-ve-dis-sagligi-75429977.jpg', '', 'Kedi ve köpekler için geliştirilmiş diş ve diş eti temizleme jelidir.  Biftekli olması sebebiyle evcillerinizin çok sevmesini ve sizlerin de ağız bakımını kolayca yapabilmenizi sağlar. Diş etlerine günde bir kez ve hafifçe masaj yaparak uygulamanız gerekir. Evcillerinizin yutması halinde herhangi bir zarara sebebiyet vermez. Ağız sağlığının korunmasına destek olur.', 'Bioline' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-uzun-tuy-icin-lolay-tarama-kopek-spreyi175ml.html', 'Trixie Uzun Tüy İçin Kolay Tarama Köpek Spreyi 175ml', 'Köpek Ürünleri-Köpek Şampuanı-Tüy Çeşitlerine Göre', '4011905029320', '245 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-deri-ve-tuy-bakimi-9966671.jpg', '30.08.2024', 'İçerdiği doğal jojoba yağı sayesinde köpeğinizin kürkünü hem temizler hemde besler.Aynı zamanda ipeksi ve lüks bir parlaklık ve yumuşaklık verir.Alkolsüzdür.Onarıcı özelliğe sahiptir.Hassas ciltli köpekler için idealdir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_trixie-super-yapiskanli-tuy-toplama-rulosu.html', 'Trixie Süper Yapışkanlı Tüy Toplama Rulosu', 'Kedi Ürünleri-Kedi Bakım Ürünleri-Tüy Toplayıcılar ve Rulolar', '4011905232317', '209 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-tuy-toplayici-ve-rulo-26338400.jpg', '', 'Minik dostunuzun tüyleri ona çok yakışsada dökülmesi sizin için sorun olabilir. Kıyafetler ve eşyalar üzerine kolaylıkla tutunan tüylerin elle toplanımı zordur ve hoş bir görüntü sergilemez.  Ürün minik dostunuzun kıyafetinize ve eşyalarınıza yapışan tüylerini toplamak için özel yapılmıştır. Yapışkan kalitesinden dolayı tüyleri hızlı ve etkili bir şekilde toplayacaktır. Rulo şeklinde olması tutumunu ve kullanımını kolaylaştırır. Kullandığınız parçayı rahatlıkla kopararak atabilirsiniz. Her bir ruloda 60 parça yer almaktadır.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_flip-kopek-tuvalet-alistirma-pedi-60x90cm-10-adet.html', 'Flip Köpek Tuvalet Alıştırma Pedi 60x90cm (10_lu)', 'Köpek Ürünleri-Çok Satanlar-Flip Çok Satanlar', '8681299605392', '', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_flip-kopek-cis-pedi-59277115.jpg', '', ' Yavru ve yetişkin köpekler için imal edilmiş tuvalet eğitim pedleri, sızdırmayı önleyici süper-absorbe polymerden üretilmiştir. Köpeğiniz Flip köpek pedinin üzerine ihtiyacını giderdiği zaman sıvıyı jel haline getirir ve sıvının ped dışına akmasına izin vermez.   Henüz dışarı çıkamayan, aşı programı henüz tamamlanmamış yavru köpekler, hasta köpekler ve küçük cins yetişkin köpekler için kullanılabilir. Evde yalnız kalan köpeklerde ve seyahat esnasında kullanılabilir. 
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_eastland-bahce-baglama-kayisi-3-6m.html', 'Eastland Bahçe Bağlama Kayışı 3,6m', 'Köpek Ürünleri-Bakım ve Temizlik Ürünleri-Bahçe Ürünleri', '', '107 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_eastland-kopek-bahce-urunleri-182653067.jpg', '', 'Dış çevre şartlarının olumsuzluğundan çelik telin korunması için dayanıklı pvc ile kaplanması yapılmış maksimum 185.07 kg ağırlığa dayanabilen bahçe bağlama. Ürünün uzunluğu 3,6 metredir.', 'Eastland' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-petler-icin-ozel-islak-mendil.html', 'Trixie Kedi ve Köpeklere Özel Cilt ve Tüy Temizliği İçin Islak Mendil (30_lu)', 'Köpek Ürünleri-Kedi Bakım Ürünleri-Leke ve Koku Gidericiler', '4011905029405', '309 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-leke-ve-koku-gidericiler-9939389.jpg', '30.05.2025', 'Tüm köpek, kedi ve küçük petler için kullanılabilecek petlere özel üretilmiş ıslak mendildir. İçerdiği aloe vera sayesinde tüyleri ve cildi besler, korur. Kolay kullanım için açılıp kapanabilen özel kutusunda 30 adet ıslak mendil bulunmaktadır.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_vet-s-plus-hamile-ve-yavru-kopekler-icin-kalsiyumlu-sut-tozu-200gr.html', 'Vet_s Plus Hamile ve Yavru Köpekler İçin Kalsiyumlu Süt Tozu 200gr', 'Köpek Ürünleri-Bakım ve Temizlik Ürünleri-Köpek Süt Tozları', '08.09.2024', '129 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_vet-s-plus-yavru-kopek-sut-tozlari-189232341.jpg', '', 'Annesinden erken dönemde ayrılmış yavrular ve öksüz yavrular için anne sütünün içerdiği doğal besin maddelerini içeren vitamin, mineral ve yağ gibi yavrunun tüm ihtiyaçlarının karşılayabilecek nitelikte süt tozu mamasıdır. 1 ile 90 günlük yavrular için uygun olan bu süt tozu yüksek değerli besin maddeleri içerdiğinden hamilelik esnasında ve yavruları emzirme zamanlarında takviye besin olarak da kullanılması uygundur. Bu ürün dengeli bir formül içerisinde gerekli olan bütün proteinleri, vitaminleri, mineralleri ve yağları ihtiva ederek anne sütü yerine kullanılır. İçeriğindeki kalsiyum ile hamile ve büyüme dönemindeki yavru kedilerin diş ve iskelet sisteminin kalsiyum ihtiyacını karşılar ve sağlıklı bir şekilde gelişmesine de yardımcı olur. 100ml ılık suya (1 çay bardağı) 2 tatlı kaşığı köpek sütü koyun ve iyice karıştırın. İhtiyaca göre 4 saatte bir verilebilir. Hazırlandıktan sonra 45 dakika içinde tüketilmelidir.  
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kopek-dis-bakim-topu-oyuncagi-dental-o6-cm.html', 'Trixie Dental Kauçuk Diş Bakım Topu Köpek Oyuncağı 6cm', 'Köpek Ürünleri-Köpek Oyuncağı-Plastik ve Kauçuk Oyuncaklar', '4011905329413', '', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-plastik-ve-kaucuk-oyuncak-8388245.jpg', '', 'Köpeğinizin diş, mide ve bağırsak sağlığı için daima doğal kauçuk veya latex oyuncakları tercih ediniz. Ürünle oynarken köpeğinizin dişleri özel olarak tasarlanmış diş sağlığı oyuncağının delik kısımlarına girerek dişlerinde biriken yemek artıklarını temizler ayrıca diş etlerinede masaj yapar. Oyuncak, evcil dostunuzun dişlerinde tartar oluşumunu engelleyerek ağız kokusunu da önler. Köpeğiniz için cazip kılmak için topun üzerine balık ezmesi veya et suyu sürebilirsiniz. Ürünü temiz ve sabunlu su ile zaman zaman yıkayınız ve durulayınız. Ürünün çapı 6 cm_dir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_pro-one-kedi-ve-kopekler-icin-goz-temizleme-solusyonu-50ml.html', 'PRO ONE Kedi ve Köpekler için Göz Temizleme Solüsyonu 50ml', 'Köpek Ürünleri-Kedi Bakım Ürünleri-Göz Bakımı', '', '75 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_pro-one-kedi-goz-bakimi-239963525.jpg', '', 'Kedi ve köpeklerde göz akıntısının sebep olduğu göz çevresindeki birikimleri temizler. Çözeltiyle nemlendirilmiş (1 göz için yaklaşık 2 ml) pamuk veya gazlı bez ile göz çevresindeki lekeler temizlenir. Oda sıcaklığında direkt güneş ışığından uzakta saklanır.', 'PRO ONE' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_bioline-kopek-tuvalet-egitim-spreyi-50ml.html', 'Bioline Köpek Tuvalet Eğitim Spreyi 50ml', 'Köpek Ürünleri-Eğitim Ürünleri ve Ekipmanları-Tuvalet Eğitim Spreyi', '6970117120271', '86 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_bioline-kopek-yavrusu-bakimi-urunleri-17597297.jpg', '', 'Özellikle evde beslenen köpekler için en önemli eğitim, tuvalet eğitimidir. Bioline Puppy Training Sprey, yavru köpeklerde tuvalet alışkanlığı sağlamak için kullanılır. Kapalı mekanlarda (ev, ofis vb.) kullanımı daha sağlıklı sonuçlar verir. Köpeğinizin tuvaletini yapmasını istediğiniz bölgeye birkaç kere uygulayınız.', 'Bioline' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kopek-dis-macunu-et-tadinda-100gr.html', 'Trixie Et Tadında Köpek Diş Macunu 100gr', 'Köpek Ürünleri-Bakım ve Temizlik Ürünleri-Ağız_Diş Sağlığı', '4011905025452', '189 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-agiz-dis-sagligi-urunleri-7407537.jpg', '', 'Tüm köpekler için et tadında diş macunu. Tadı sayesinde kolay kullanım. Plak oluşumunu ve kötü nefes kokularını önler. Yavru köpeğinize bebekliğinden itibaren alışkanlık edindirmeniz gereken bir davranıştır. İlerki yıllarda yavru köpeğinizin diş temizliği konusunda göstermiş olduğunuz hassasiyet onun sağlığı açısından faydalı olacaktır. Köpeğinizi diş macununa alıştırmak için, öncelikle ufak bir miktarı parmağınıza sıkıp parmağınızı, köpeğinizin dişlerinde ve dişetlerinde nazikçe ovarak dolaştırınız. Köpeğiniz dişmacununu yutsa dahi, kullanımı tamamen zararsızdır.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_pawise-parmak-dis-fircasi-2-adet.html', 'Pawise Parmak Diş Fırçası (2_li)', 'Köpek Ürünleri-Kedi Bakım Ürünleri-Ağız_Diş Sağlığı', '', '77 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_pawise-kedi-agiz-ve-dis-sagligi-62567698.jpg', '', 'Parmağınıza takıp kedi ve köpeğinizin dişlerine masaj yapabileceğiniz üründür. Kedi ve köpeklerde dişler rutin olarak fırçalanmalı ve diş etlerine masaj yapılmalıdır. Günde 2 kez hayvanınızın dişlerini fırçalayıp, diş etlerine masaj yapmanız tavsiye edilir.', 'Pawise' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_pawise-tuy-toplama-rulosu-yedek-rulo-hediye.html', 'Pawise Tüy Toplama Rulosu 48 Yaprak + Yedek Rulo HEDİYE!', 'Kedi Ürünleri-Çok Satanlar-Pawise Çok Satanlar', '', '', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_pawise-kedi-stok-fazlasi-22747657.jpg', '', 'Kedilerin ve köpeklerin tüylerinin toplanması için kullanımı uygun, Pawise marka tüy toplama rulosudur. Paket içerisinde 1 adet yedek tüy toplama rulosu daha bulundurur. İlk rulo bittikten sonra, diğer rulosunu takarak kullanmaya devam edebilirsiniz.', 'Pawise' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_pawie-kucuk-irk-kopek-ve-kedi-tirnak-makasi-14cm.html', 'EuroGold Küçük Irk Köpek ve Kedi Tırnak Makası 14cm (Karışık Renkli)', 'Köpek Ürünleri-Kedi Bakım Ürünleri-Tırnak_Pati Bakımı', '8681144190547', '72 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_eurogold-kedi-tirnak-bakimi-47263396.jpg', '', 'Köpekler ve kediler için kolay kavranabilen, pratik kullanımlı tırnak makasıdır. Ürün karışık renklidir. Stoktaki renk durumuna göre gönderim yapılır.', 'EuroGold' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_trixie-kedi-ve-kopek-kulak-bakim-damlasi-50ml.html', 'Trixie Kedi ve Köpekler için Kulak Bakım Damlası 50ml', 'Kedi Ürünleri-Çok Satanlar-Trixie Çok Satanlar', '4011905025476', '', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-kulak-temizlik-bakim-26304038.jpg', '', 'Köpekler, kediler ve diğer küçük petler için kullanılan, özel damlalıklı kulak bakım ve temizleme damlasıdır. Kulak bölgesini hassas şekilde toz ve kirden temizler. Güzel kokuludur. Yavru köpeğinizin yüz bölgesindeki uzuvlara dokunmanız kulak içi, göz bölgesi ve dişlerine bakım yapmanız onun ileriki yıllarda erişkin bir köpek olduğu zaman veteriner bakımlarının daha sorunsuz yapılmasını sağlayacaktır.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kedi-ve-kopek-icin-dis-temizleme-jeli-100gr.html', 'Trixie Kedi ve Köpekler için Biftek Aromalı Diş Temizleme Jeli 100gr', 'Köpek Ürünleri-Kedi Bakım Ürünleri-Ağız_Diş Sağlığı', '4011905254463', '245 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-agiz-ve-dis-sagligi-44899804.jpg', '', 'Kullanımı çok kolay, köpek ve kedi için kullanılabilen biftek aromalı diş ve dişeti temizleme jelidir. Köpeğinizin veya kedinizin dişlerini ve dişetlerini hem temizler hemde gerekli hijyeni sağlar. Temiz ve ferah bir nefes sağlar. İlk kullanım öncesi tüpün üst kısmını kesiniz. Parmağınızın ucuna bir parça jel alınız ve köpeğinizin veya kedinizin diş etlerine yumuşakça masaj yapınız. Ürünün bulaşması durumunda tamamen zararsızdır, yenebilir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_puffy-love-dogal-pamuk-ve-okaliptus-ozlu-yuzey-temizleyici-960ml.html', 'Puffy Love Doğal Pamuk ve Okaliptüs Özlü Yüzey Temizleyici 960ml', 'Köpek Ürünleri-Kedi Bakım Ürünleri-Leke ve Koku Gidericiler', '', '49 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_puffy-love-kedi-leke-ve-koku-gidericiler-288702747.jpg', '', 'Evcil hayvanların oyun ve yaşam alanları, mutfak tezgahı, yiyecek hazırlama alanları, zeminler, tuvalet, küvet, duş, klozet, musluk, lavabo temizliğinde kullanılabilir. Doğrudan ya da sulandırarak kullanım için uygundur. Banyo, mutfak, evcil hayvan kaynaklı kötü kokuları önlemeye ve azaltmaya yardımcı olur. Yüzeylerde etkili temizlik ve parlaklık sağlar. Evcil hayvan yaşayan evler için özel olarak formüle edilmiştir. Doğal pamuk, okaliptüs özleri ve %100 doğal kaynaklı temizlik aktifleri içerir.', 'Puffy Love' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_puffy-love-dogal-badem-ve-aloe-vera-ozlu-tuy-tutmaz-tekstil-spreyi-750ml.html', 'Puffy Love Doğal Badem ve Aloe Vera Özlü Tüy Tutmaz Tekstil Spreyi 750ml', 'Köpek Ürünleri-Kedi Bakım Ürünleri-Tüy Toplayıcılar ve Rulolar', '', '39 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_puffy-love-kedi-tuy-toplayici-ve-rulo-288762022.jpg', '', 'Puffy Love Tüy Tutmaz Tekstil Spreyi evcil hayvan tüylerinin tekstillere tutunmasını zorlaştırır. Evcil hayvan yaşayan evler için özel olarak formüle edilmiştir. Hipoalerjenik ve %100 doğada çözünebilir parfüm ile formüle edilmiştir. %100 doğal kaynaklı temizlik aktifleri, doğal badem ve aloe vera özleri içerir.', 'Puffy Love' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_rimba-kopek-diski-poseti-4-rulo.html', 'Rimba Köpek Dışkı Poşeti 4 Rulo', 'Köpek Ürünleri-Bakım ve Temizlik Ürünleri-Tuvalet_Dışkı Torbaları', '01.01.2025', '48 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_rimba-kopek-tuvalet-torbasi-322366655.jpg', '', 'Gezintileriniz esnasında köpeğinizin dışkısını kolayca ve hijyenik bir şekilde toplamanızı sağlar.  Köpeğinizin dışkısını torbayla aldıktan sonra poşeti düğümleyip çöp kutusuna atabilirsiniz. Paketin içerisinde 4 rulo dışkı poşeti bulunmaktadır.', 'Rimba' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_puffy-love-kedi-ve-kopekler-icin-dogal-lavanta-ozlu-leke-cikarici-sprey-750ml.html', 'Puffy Love Kedi ve Köpekler için Doğal Lavanta Özlü Leke Çıkarıcı Sprey 750ml', 'Köpek Ürünleri-Kedi Bakım Ürünleri-Leke ve Koku Gidericiler', '', '39 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_puffy-love-kedi-leke-ve-koku-gidericiler-288733074.jpg', '', 'Evcil hayvanların mama, salya, idrar lekelerinde etkilidir. Sulandırarak ya da direkt olarak kullanılabilir.  Sert yüzeylerde, halı ve koltuk yüzlerinde, kıyafetlerinizde, evcil hayvanların yatak, yastık, kumaş oyuncaklarında doğal lavanta özü içeren formülü ile derinlemesine ve hızlı temizlik sağlar.', 'Puffy Love' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_hypaw-clean-wipes-kedi-ve-kopekler-icin-temizleme-ve-bakim-kesesi.html', 'HYPAW Clean Wipes Kedi ve Köpekler için Temizleme ve Bakım Kesesi 23x15cm', 'Köpek Ürünleri-Kedi Bakım Ürünleri-Deri ve Tüy Bakımı', '', '3,79 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_hypaw-kedi-deri-ve-tuy-bakimi-189272734.jpg', '', 'Tüm ırk kedi ve köpekler için uygundur. Yıkama gerektirmeden patili dostunuza bakım ve temizlik yapmanızı sağlar. Temizleme etkisi ile birlikte içeriğinde bulunan E vitamini ve Aloe Vera özleri ile evcil hayvanınızın tüylerine bakım yaparken B5 vitamini ile cildini besler ve kurumasını engeller. Ayrıca deri üstünde bulunan ölü hücrelerin temizlenmesine katkıda bulunur. Günlük kullanım için uygundur. Ürünün eni 23 cm, boyu 15 cm_dir.  Paketi çentiğinden yırtarak kilitli kısımdan açınız. Keseyi elinize takarak evcil hayvanınızın temizlemek istediğiniz bölgesine tatbik ediniz.  Farklı bölgeler için ayrı kese kullanımı önerilir. Kullanım sonrası yıkama ya da durulama gerektirmez.', 'HYPAW' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_hypaw-clean-wipes-kedi-ve-kopekler-icin-temizleme-ve-bakim-mendili.html', 'HYPAW Clean Wipes Kedi ve Köpekler için Temizleme ve Bakım Mendili 30x30cm', 'Köpek Ürünleri-Çok Satanlar-HYPAW Çok Satanlar', '', '', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_hypaw-kedi-deri-ve-tuy-bakimi-189264737.jpg', '', 'Tüm ırk kedi ve köpekler için uygundur. Yıkama gerektirmeden patili dostunuza bakım ve temizlik yapmanızı sağlar. Temizleme etkisi ile birlikte içeriğinde bulunan E vitamini ve Aloe Vera özleri ile evcil hayvanınızın tüylerine bakım yaparken B5 vitamini ile cildini besler ve kurumasını engeller. Ayrıca deri üstünde bulunan ölü hücrelerin temizlenmesine katkıda bulunur. Günlük kullanım için uygundur. Ürünün eni ve boyu 30 cm_dir. Mendili evcil hayvanınızın temizlemek istediğiniz bölgesine tatbik ediniz. Farklı bölgeler için farklı yaprak kullanınız.', 'HYPAW' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_ferplast-gro-plastik-sapli-kedi-ve-kopek-tarama-fircasi-8x16cm.html', 'Ferplast Gro Plastik Saplı Kedi ve Köpek Tarama Fırçası 8x16cm', 'Kedi Ürünleri-Ağustos Seçili Ürünler-Ferplast Ağustos Seçili Ürünler', '8010690111889', '339 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_ferplast-plastik-sapli-kedi-taragi-115024003.jpg', '', 'Kedi ve köpeklerde tüy dökme sorunu sık sık görülmektedir. Kedi ve köpeğinizin daha az tüy dökmesi ve daha sağlıklı tüylere sahip olması için tüy tarama fırçalarından yardım alabilirsiniz. Ferplast plastik saplı tarama fırçasını kedi ve köpeğinizin için kullanabilirsiniz. Ürün oldukça dayanıklıdır. Evcil dostunuzun tüylerini daha kolay taramanız için ergonomik olarak tasarlanmıştır. İnsan ve hayvan sağlığı açısından %100 zararsız malzemelerden üretilmiştir. Alerjenik maddeler bulunmaz.', 'Ferplast' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_vet-s-plus-brewer-yeast-kedi-ve-kopekler-icin-sarimsakli-maya-tableti-100-lu.html', 'Vet_s Plus Brewers Yeast Sindirim Sistemi Düzenleyici Kedi ve Köpek Sarımsaklı Maya Tableti (100_lü)', 'Kedi Ürünleri-Vitaminler ve Ek Besinler-Tablet', '10.01.2026', '129 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_vet-s-plus-kedi-tablet-odulleri-13425563.jpg', '', 'Tüm ırk kedi ve köpeklerde sağlıklı ve kaliteli tüy gelişimini destekleyen doğal protein ve B vitamini kaynağı vitamin tablettir. Bağışıklık sistemi destekleyici ve iyileşme hızlandırıcı etkisi bulunan B Vitamini sayesinde evcilleriniz sağlıklı bir ömür geçirecektir. B vitamini aynı zamanda kas ve kemik sistemini destekler ve sağlıklı bir iskelet sistemine yardımcıdır.   Yaraları ve operasyon sonrasında deri iyileşmelerini hızlandırmaktadır. Aşırı hareketli ve stresli kedi ve köpekleri sakinleştiren prebiyotik etkisi sayesinde mide bağırsak mikro-flora düzenini korumakta ve sindirimi kolaylaştırmaktadır. Aynı zamanda katı dışkı problemi olan köpeklerde dışkının yumuşamasını sağlar. Direk güneş ışığı almayan serin ve kuru yerde muhafaza ediniz. Çocukların ulaşamayacağı yerlerde saklayınız.', 'Vet_s Plus' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-cift-tarafli-tahta-kopek-fircasi-6x17cm.html', 'Trixie Çift Taraflı Köpek Tarama Fırçası 6x17cm', 'Köpek Ürünleri-Köpek Tarağı ve Fırçaları-Çift Taraflı', '4011905023229', '239 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-tarak-ve-fircasi-47371713.jpg', '', 'Yuvarlak çift taraflı tahta fırça. Bir taraflı ince tel kıllı, diğer tarafı plastik kıllı bu fırça ile köpeğinizi haftada bir taramanız onu hem fazla ve kirli tüylerden temizlemenizi hemde postu üzerindeki kan dolaşımını hızlandırarak daha sağlıklı bir hale getirmenizi sağlayacaktır. Nazik bir şekilde köpeğinizi okşayın ve rahatlamasını sağlayınız. Öncelikle tüylerin çıkış yönünün tersine doğru tarama yapınız böylece düğümlenmiş topaklar açılacaktır. Birbirine dolaşmış tüyler için tüylerin diplerini hassasça tarayarak köpeğinizin derisinin yukarıya doğru çekilmemesine dikkat edin. Son olarak tarama yönünü bu sefer tüylerin çıkış yönüne göre tarayın. Tarakta kalan tüyleri sık sık temizleyiniz.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_gimdog-firca-igne-105x182cm.html', 'GimDog Kedi ve Köpek Fırçası 10,5x18,2cm [M] (Yeşil)', 'Köpek Ürünleri-Köpek Tarağı ve Fırçaları-Gimpet Köpek Tarağı ve Fırçaları', '8009632039480', '64 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_gimpet-kopek-tarak-ve-fircasi-8955068.jpg', '', 'Kedi ve köpeklerin taranması için özel hazırlanmıştır. İğne uçlu tarama fırçası, siz tarama yaparken evcil dostunuza masaj etkisi yapacaktır. Ulaşılması zor olan bölgeler için tasarlanmış kedi ve köpek fırçası, oval şeklinde özel olarak tasarlanmıştır. Tutma sapı, ergonomik ve soft yapısı ile kullanım kolaylığı sağlarken elinize tam olarak oturur.', 'Gimpet' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_zampa-kedi-ve-kucuk-irk-kopek-tuy-toplama-fircasi-14x7cm-gri-s.html', 'Zampa Kedi ve Küçük Irk Köpek Tüy Toplama Fırçası 14x7cm (Gri) [S]', 'Kedi Ürünleri-Köpek Tarağı ve Fırçaları-Sık Dişli Fırça ve Taraklar', '', '45 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_zampa-plastik-sapli-kedi-taragi-136329793.jpg', '', 'Kedi ve küçük ırk köpekler için uygundur. Düzenli olarak taranan tüyler sağlıklı ve parlak görünür. Tüyleri havalandırarak cildin nefes almasını sağlar. Vücudu ölü ve cansız tüylerinden arındırır. Masaj etkisi yaratarak kan dolaşımını hızlandırır. Temizliği kolaydır.', 'Zampa' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_8in1-perfect-coat-deshedder-furminator-orta-irk-kopek-taragi-m.html', '8in1 Perfect Coat DeShedder Furminator Orta Irk Köpek Tarağı [M]', 'Köpek Ürünleri-Ağustos Seçili Ürünler-8in1 Ağustos Seçili Ürünler', '', '299 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_8in1-kopek-sik-disli-firca-ve-taraklar-187618250.jpg', '', 'Orta ırk köpeklerin kullanımına uygundur. Tarak kısmı paslanmaz çelikten üretilmiştir. Plastik sapı sayesinde kolayca tutulabilir ve kayma yapmaz. Sağlıksız tüyleri tarayarak almanızı sağlar. Tüy dökülmesini %90 oranında azaltır. Normal taraklarla ulaşılamayan tüyleri kolayca almanızı sağlar.', '8in1' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_furminator-kucuk-irk-uzun-tuylu-kopekler-icin-tuy-toplayici-tarak.html', 'Furminator Küçük Irk Uzun Tüylü Köpek Tarağı 4x15cm', 'Köpek Ürünleri-Köpek Tarağı ve Fırçaları-Sık Dişli Fırça ve Taraklar', '4048422141037', '869 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_furminator-kopek-sik-disli-firca-ve-taraklar-11099201.jpg', '', 'Alerjiye yol açan cansız ve gevşek tüyleri kesmeden kolay ve çabuk alır. Tüyün üzerindeki ölü tabaka Furminatör_ün paslanmaz çelikten yapılan ağzıyla sıyrılır, tüye en ufak zarar vermeden toplanır. Tüylerin saçılmasını %90 azaltır. Altta kalan ve diğer fırçalarla ulaşılamayan tüyleri kolayca alır. Paslanmaz çelik ve ergonomiktir.', 'Furminator®' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kopekler-icin-plastik-cift-tarafli-pire-ve-toz-temizleme-taragi-14cm.html', 'Trixie Plastik Köpekler için Çift Taraflı Pire Tarağı 14cm', 'Köpek Ürünleri-Köpek Tarağı ve Fırçaları-Çift Taraflı', '4011905024004', '79 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-plastik-sapli-tarak-firca-158794482.jpg', '', 'Köpeklerin sırt bölümü, bacak dış yüzeyleri ve geniş bölgelerindeki pirelerin bulunması ve temizlenmesi için tasarlanmış plastik pire tarağıdır. Ürünün boyu 14 cm_dir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_zampa-sik-ve-seyrek-disli-cift-tarafli-kitik-acici-tarak-17x5cm.html', 'Zampa Sık ve Seyrek Dişli Çift Taraflı Kıtık Açıcı Tarak 17x5cm', 'Köpek Ürünleri-Köpek Tarağı ve Fırçaları-Kıtık Açıcı', '', '58 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_zampa-kopek-kitik-acici-136617688.jpg', '', 'Kedi ve köpekler için kulanılabilir. Tarakta hem syerek hem de sık dişler mevcuttur. Kıtık açıcı özelliği sayesinde mevcut kıtıkları açmanızı sağlar. Düzenli kullanımda kıtık oluşumunu önler. Tüyleri cansızlaşan dostunuzu tarayarak kürkünü havanlandırabilirsiniz. Ahşap sapı sayesinde kolayca kavranabilir.', 'Zampa' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_zampa-kedi-ve-kopek-icin-naturel-killi-bakim-fircasi-18x6cm-pembe.html', 'Zampa Kedi ve Köpek için Natürel Kıllı Bakım Fırçası 6x18cm (Pembe)', 'Kedi Ürünleri-Çok Satanlar-Zampa Çok Satanlar', '', '', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_zampa-kedi-yumusak-firca-ve-taraklar-19164158.jpg', '', 'Kediler ve köpekler için, ahşap saplı olan bu tarak aynı zamanda doğal kıldan yapılmıştır.  Kedi ve köpeklerinizin ölü tüylerini temizleyerek, tüy sağlığının ve dolayısıyla deri sağlığının korunmasına yardımcı olur. Evcilinizin tüylerini temizlerken, deri altına da masaj etkisi yapar ve kan dolaşımının hızlandırır. Böylece yeni çıkacak olan tüylerin daha sağlıklı ve canlı olmasına olanak sağlar. 
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kopek-tarama-ve-masaj-eldiveni-14x25cm.html', 'Trixie Kedi ve Köpekler için Tarama ve Masaj Eldiveni 14x25cm', 'Köpek Ürünleri-Köpek Tarağı ve Fırçaları-Masaj Fırçası', '4011905023359', '249 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-tarak-ve-fircasi-12225946.jpg', '', 'Kedi ve köpeklerde tüy dökülmesi önemli bir problemdir. Bu problem için en uygun yöntemi seçmek çözümünü kolaylaştıracaktır. Minik dostunuz tarak ile taranmayı sevmiyor ise tarama ve masaj eldiveni onun için idealdır. Tarama ve masaj eldiveni yardımıyla kolaylıkla tüylerini tararken minik dostunuzla paylaştığınız bu zamanda ayrıca ona sevginizi gösterip mutlu edebilirsiniz. Tarama ve masaj eldivenleri kedi ve köpek için kullanılabilir. Eldiven şeklinde olması kullanım açısından da rahatlık sağlar.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_eastland-silikon-uclu-kedi-ve-kopek-tuy-toplama-fircasi.html', 'Eastland Silikon Uçlu Kedi ve Köpek Tüy Toplama Fırçası', 'Köpek Ürünleri-Köpek Tarağı ve Fırçaları-Yumuşak Fırça ve Taraklar', '', '119 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_eastland-plastik-sapli-kedi-taragi-155108308.jpg', '', 'İki taraflı tüy toplayıcı ve temizleyici fırça. Kumaş veya koltuklardan tüy toplamak için çok bastırmadan fırçalayınız. Binlerce gözenek içerek fırça uçları elektrostatik bir yükleme yaratır ve tüyleri mıknatıs gibi çeker. Halı, köşeler, merdivenler, dolaplar, kıyafetler, araba koltukları ve evcil hayvanlar üzerinde kullanılabilir. Temizlemek için sabunlu suyla durulayınız. Bulaşık makinesinin en üst rafına bile koyulabilir.', 'Eastland' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_gimdog-kedi-ve-kopek-tarama-fircasi-6-5x21-5cm-yesil.html', 'GimDog Kedi ve Köpek Tarama Fırçası 6,5x21,5cm (Yeşil)', 'Kedi Ürünleri-Ağustos Seçili Ürünler-Gimpet Ağustos Seçili Ürünler', '8009632039510', '165 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_gimpet-kedi-yumusak-firca-ve-taraklar-312254509.jpg', '', 'Kedi ve köpeğinizin tüy bakımlarını yapabilmeniz için yumuşak saplı tel tarama fırçası. Kedi ve köpeğinizin daha az tüy dökmesi ve daha sağlıklı tüylere sahip olması için tüy tarama fırçalarından yardım alabilirsiniz.  İnsan ve hayvan sağlığı açısından %100 zararsız malzemelerden üretilmiştir. Alerjenik maddeler bulunmaz. Güçlü plastik dişlere sahiptir. Ürün oldukça dayanıklıdır.', 'Gimpet' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_eurogold-tahta-sapli-kedikopek-fircasi-115x135cm-l.html', 'EuroGold Tahta Saplı Kedi ve Köpek Fırçası 11,5x13,5cm [L]', 'Köpek Ürünleri-Köpek Tarağı ve Fırçaları-Sık Dişli Fırça ve Taraklar', '8681144190370', '59 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_eurogold-firsat-petshop-urunleri-34803921.jpg', '', 'Orta ırk köpekler ve kediler için, tüylerin taranması ve ölü tüylerin toplanmasına yardımcı bakım fırçasıdır. Evcil dostunuz uzun tüylüyse, tüylerini her gün ya da en azından haftada birkaç kez taramalısınız. Kısa tüylü evcilleriniz yalnızca haftada bir kez taranmalıdır. Tellerinin ucundaki toplar evcillerinizin hassasiyeti düşünülerek canını acıtmadan taramanızı sağlar. Kullanımı gayet pratiktir. İnce telli, geniş yüzeyi sayesinde daha fazla alanın taranmasını sağlar. İnsan ve hayvan sağlığı açısından %100 zararsız malzemelerden üretilmiştir. Alerjenik maddeler bulunmaz.', 'EuroGold' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_karlie-tuy-acici-sik-disli-kedi-ve-kopek-taragi-16x11x5cm-siyah-kirmizi.html', 'Karlie Sık Dişli Tüy Açıcı Köpek Tarağı 16x11x5cm (Siyah_Kırmızı)', 'Köpek Ürünleri-Ağustos Seçili Ürünler-Karlie Ağustos Seçili Ürünler', '4016598036587', '275 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_karlie-plastik-sapli-kedi-taragi-84436933.jpg', '', 'Kedi veya köpeğinizin tüylerinin kolayca açılmasını sağlar. Döner metal dişleri sayesinde tüylere zarar vermez. Kullanım sonrasında antiseptik bir solüsyon ile temizlenip sonrasında suyla durulanması tavsiye edilir. Sık dişlidir. Dostlarınızın tüylerindeki düğümleri kolayca çözmekte birebirdir. Böylelikle dostunuzun tüyleri daima düzenli ve bakımlı kalmasını sağlar. İnsan ve hayvan sağlığı açısından %100 zararsız malzemelerden üretilmiştir. Alerjenik maddeler bulunmaz.  Kırmızı,Siyah', 'Karlie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_eurodog-kedi-ve-kopekler-icin-pire-taragi-2.html', 'EuroDog Kedi ve Köpekler için Pire Tarağı 19cm', 'Köpek Ürünleri-Kedi Tarağı ve Fırçası-Pire Tarağı', '', '89 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_eurodog-kedi-pire-taragi-164678932.jpg', '', 'Kedi ve köpekler için özel olarak tasarlanmış pire tarağıdır. Evcilinizi düzenli olarak taradığınızda hem üzerindeki toz hem de pireleri yakalamaya yardımcı olur. Kedi ve köpeklerin kürklerindeki pirelerden temizlenmesi için pratik taraktır. Plastik sapı sayesinde elinizden kaymaz ve pratiklik sağlar. Ürünün boyu 19 cm_dir.', 'EuroDog' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kedi-ve-kopek-tarama-eldiveni-18x24cm.html', 'Trixie Kauçuk Köpek Tarama Eldiveni 18x24cm', 'Köpek Ürünleri-Köpek Tarağı ve Fırçaları-Tüy Toplayıcı Eldiven', '4011905233918', '269 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-deri-ve-tuy-bakimi-4438910.jpg', '', 'Eldiven şeklinde köpek tarağıdır. Ergonomik tasarımı sayesinde ele tam olarak oturur. Bilek bölümündeki cırt cırtlı bölüm sayesinde tam bileğinize göre ayarlanır. Özel kauçuk tasarımı sayesinde tüm köpeklerin ve özellikle taranmaktan çok hoşlanmayan, taranmaya çok alışık olmayan köpeklerin rahatça taranabileceği, tarama sayesinde kan akışını destekleyen bu sayede canlı ve parlak tüylere sahip olunmasını sağlayan köpek tarama eldivenidir. Köpeğinizin kürkünü ölü tüylerden ve pisliklerden temizlemek için idealdir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_flip-yumusak-uclu-kedi-ve-kopek-taragi-10x16cm.html', 'Flip Yumuşak Uçlu Kedi ve Köpek Tarağı 10x16cm', 'Köpek Ürünleri-Köpek Tarağı ve Fırçaları-Yumuşak Fırça ve Taraklar', '8681299608645', '119 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_flip-kopek-yumusak-tarak-ve-fircalar-230267020.jpg', '', 'Evcil hayvanınızın derisine zarar vermeden tüyleri temizler. Tüylerinin daha sağlıklı ve parlak olmasını sağlar. Kedi ve köpekler taranmaya alışmadıklarında pek hoşlanmazlar bundan dolayıdır ki taramaya alıştırmak çok ufakken başlar. Bebeklik dönemlerinde genelde taranmayı ihmal ederiz böylece ilerleten yaşlarda zorlukla taramaya ihtiyaç duyarız. Taramak kılların dökülmesini engellediği gibi zayıf olan tüylerin toplanmasını sağlar. Özellikle banyodan sonra ıslak tüyleri tarayarak kurutmak daha sağlıklıdır.', 'Flip' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kene-ve-pire-kopek-taragi-7cm.html', 'Trixie Kauçuk Köpek Kene ve Pire Tarağı 7cm', 'Köpek Ürünleri-Köpek Tarağı ve Fırçaları-Pire Tarağı', '4011905237619', '259 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-paraziter-pire-kene-engelleyici-26876465.jpg', '', 'Evcil dostunuzun pirelerden kolayca kurtulması için tasarlanmıştır. Kenelerin ve pirelerin bulunmasında kullanılan çok kullanışlı bir taraktır. Tarak bölümü metal, tutma bölümü plastik ve kaymaz kauçuktur. Kedi ve köpekler için uygundur. Kulaklar, omuzlar ve karın bölgelerinde kullanılırken daha hassas davranılmalıdır. Düzenli olarak su ve antiseptik bir solüsyon ile temizlenmelidir. Hem kısa hem uzun tüylerde kullanılabilir. Ürün ölçüsü 7 cm_dir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_gimdog-seyrek-disli-kitik-acici-tirmik-kopek-taragi-12x15cm-yesil.html', 'GimDog Seyrek Dişli Kıtık Açıcı İnce Uçlu Tırmık Köpek Tarağı 12x15cm (Yeşil)', 'Köpek Ürünleri-Ağustos Seçili Ürünler-Gimpet Ağustos Seçili Ürünler', '8009632039633', '125 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_gimpet-kopek-kitik-acici-312439810.jpg', '', 'Köpeklerde tüy bakımı için tasarlanmış, keçeleşmiş tüyleri açmak için özel dizayn edilmiş kıtık açıcı ince uçlu tırmık taraktır. Kıtıklaşmış (keçeleşmiş) tüy yapısında mutlaka ek kıtık açıcı sprey ya da kremler yardımı ile kullanılması gereken köpekler için üretilmiş kaliteli, mükemmel bir üründür. Uygun Irklar: Poodle, Bichon Frise, Koli, Golden Retriever, Bernese Mountain, Border Koli, Tibet Terrier, Labrador, Rottweiler, Beagle, Alman Kurdu, Husky, Dachshund, Fox Terrier ve Schnauzer vs.', 'Gimpet' );
