INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kucuk-kopek-ve-kedi-kutusu-31x33x50cm-xs.html', 'Trixie Küçük Irk Köpek ve Kedi Taşıma Kutusu 31x33x50cm [XS]', 'Köpek Ürünleri-Bakım ve Temizlik Ürünleri-Bahçe Ürünleri', '4011905396910', '1.069 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-araba-urunleri-22553700.jpg', '', 'Köpeğiniz ve kediniz için evde, yolculuk sırasında, tatilde ve yarışmalarda ideal ve güvenli bir yerdir. Katlanarak çanta şeklinde taşınabilir. İki tarafında ve kapısındaki dayanıklı file bölüm sayesinde köpeğiniz veya kediniz içerisinde yatarken etrafını görebileceği için çok rahat edecek ve huzur duyacaktır. Dilerseniz kapısını üst tarafa rulo yaparak cırt cırtı ile sabitleyebilir ve mini bir kulübeye çevirebilirsiniz. Tabanında yer alan özel kopça bölümleri ile bagaja sabitlenebilir. Arka tarafındaki cebi çok kullanışlıdır. Nemli bezle silerek kolayca temizlenebilir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kopek-bariyeri-4-parca-60-160x75cm-beyaz.html', 'Trixie Köpek Bariyeri 4 Parça 60-160x75cm (Beyaz)', 'Köpek Ürünleri-Bakım ve Temizlik Ürünleri-Bahçe Ürünleri', '4011905394572', '5.799 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-guvenlik-urunleri-25231849.jpg', '', 'Büyük ırk köpekler için alan sınırlamada, oda, merdiven çıkışı vb girişlerinin engellenmesinde kullanılacak köpek bariyeridir. Fırınlı ve boyalı çam ağacından üretilmiştir. 4 parçalıdır. Bu sayede 60cm ile 160cm arasında istenen boya ayarlanabilir. Yüksekliği 75cm dir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kopek-agility-egitim-tahterevalli.html', 'Trixie Köpek Eğitim Tahterevalli 300x54x34cm', 'Köpek Ürünleri-Eğitim Ürünleri ve Ekipmanları-Trixie Eğitim Ürünleri ve Ekipmanları', '4011905032139', '8.714,65 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-egitim-ekipmani-18025045.jpg', '', '300×54×34cm. Kaymaz yüzeyi sayesinde köpeğinizin üzerinde rahatça yürüyebileceği , cilalı çamdan üretilmiş , köpeğinizi zinde ve sağlıklı tutacak , 80kg a kadar tüm ırk köpeklerin kullanabileceği köpek agility eğitim tahtıravallisidir. Asla dolu mide ile oynamayınız ve antrenman sonrası köpeğinizi beslemeyiniz. Agility tüm dünyada , köpek ve sahibinin beraber oynadıkları yeni bir spor olarak yarışmaları yapılmaktadır. Köpeğinizi asla dolu mide ile oynatmayınız ve antrenman sonrası köpeğinizi beslemeyiniz. Köpeğinizi yavaş yavaş oynamaya alıştırınız , onu birkereden zorlamayınız. Daima içebileceği temiz ve bol su bulundurunuz. Su içmeden önce ve sonra dinlendirerek nefeslenmesine müsaade ediniz. Aşırı hızlı nefes alırken su içmesi ve yemek yemesi köpeklerde miğde torsiyonuna sebe olabilir ve bu ölümle sonuçlanabilir. Yavru ve genç köpeklere antrenman yaptırmadan önce veterinerinize müracaat ediniz. Kas ve kemik ve eklem yapısını kontrol ettiriniz. Agilty parkuru için eğitim sayfasında yer alandiğer eğitim ürünlerinide inceleyebilirsiniz. Ürünlerin kullanım videosu sayfanın altında yer almaktadır. Detaylı bilgi için ', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kopek-bariyeri-63-108x50x31cm.html', 'Trixie Köpek Bariyeri 63-108x50x31cm', 'Köpek Ürünleri-Bakım ve Temizlik Ürünleri-Bahçe Ürünleri', '4011905039442', '2.749 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-egitim-ekipmani-7241719.jpg', '', 'Yavru köpekler ve küçük köpekler için , cilalı huş ağacından imal edilmiş , galvaniz telleri olan , 63cm den 108 cm e kadar olan kapılarda veya merdivenlerde kullanılabilecek köpek bariyeridir. 
