INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_eastland-kopekler-icin-bahce-baglama-celik-halat-4-5m-kirmizi.html', '', 'Köpek Ürünleri-Günün Fırsatı-Eastland Günün Fırsatı', '', '', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_eastland-kopek-bahce-urunleri-206045895.jpg', '', 'Özel kancalı , plastik kaplı 4,5 metre uzunluğunda çelik bahçe halatıdır. Nokta bağlamalar için önerilir. Gezdirme için uygun değildir.Kimyasal salınım yapmaz insan ve hayvan sağlığına %100 zararsızdır. Çelik halat kalınlığı 2 mm_dir. 
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_beavis-beyaz-tuylu-kopekler-icin-hypoallergenic-sampuan-250ml.html', 'Beavis Beyaz Tüylü Köpekler için Hypoallergenic Şampuan 250ml', 'Köpek Ürünleri-Köpek Şampuanı-Tüy Çeşitlerine Göre', '30.05.2025', '79 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_beavis-kopek-tuy-cesitlerine-sampuan-194801705.jpg', '', 'Hypoalllergenic ve göz yakmayan özel formülü ile etkili bakım sağlayarak beyaz renkli tüylere sahip sevimli dostlarımızın yaşamlarını daha sağlıklı ve hijyenik koşullarda sürdürmelerine yardımcı olmaktadır. İdeal pH dengesi ve optik arttırıcılarla geliştirilen özel formülü ile kürk yapılarının orijinal rengini koruyarak daha ipeksi ve güçlü bir tüy yapısı sunmaktadır. Yoğun kirleri derinlemesine temizleyen güçlü formülü ilk kullanımdan itibaren dostumuzun ve yaşam alanının kötü kokulardan arınmasını da sağlamaktadır. Tüy dökülmelerine karşı etkili olan hypoallergenic içeriği ile alerjen hassasiyeti olan sevimli dostlarımızın yaşam kalitesini arttırarak, daha sağlıklı ve mutlu hissetmelerine yardımcı olmaktadır.', 'Beavis' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_profarm-acik-tuylu-kopekler-icin-aloe-verali-ve-papatya-ozlu-sampuan-250ml.html', 'Profarm Açık Tüylü Köpekler için Aloe Veralı ve Papatya Özlü Şampuan 250ml', 'Köpek Ürünleri-Köpek Şampuanı-Bitki Özlü Şampuan', '30.06.2024', '75 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_profarm-kopek-kopuk-sampuan-276207013.jpg', '', 'Beyaz ve açık renkli köpekler için özel şampuan, yoğun kirleri derinlemesine temizleyen güçlü formülü ile ilk kullanımdan itibaren dostumuzun ve yaşam alanının kötü kokulardan arınmasını ve doğal rengin korunmasını sağlar. Aloe vera, papatya ve B5 vitamini yıpranmış deride yatıştırıcı etkiye sahiptir. Aleovera: Kızarıklık ve cilt hastalıklarının tedavisinde etkilidir. Toksinlerin atılmasını sağlar ve hücrelerin yenilenmesine yardımcı olur. Aloe vera nemlendirici etkisi sayesinde cilde ihtiyaç duyduğu nem bileşenlerini sunar ve yatıştırır. Nem içeriği sayesinde cilt üzerinde oluşacak pullanma ve döküntüleri engeller. Papatya: Nemlendirir ve yumuşatır. Papatyanın sakinleştirici etkisi vardır. Uygulanan bölgedeki ağrıların azalmasına yardımcı olur. Hücre yenilenmesini destekler. B5 Vitamini: Tüyleri kuvvetlendirerek sağlam ve parlak görünüm kazandırır. Paraben ve boya içermez. Açık renkli köpeklerde yıkama ve temizlik amacıyla kullanılır.', 'Profarm' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_profarm-kedi-ve-kopekler-icin-cilekli-kopuk-sampuan-150ml.html', 'Profarm Kedi ve Köpekler için Çilekli Köpük Şampuan 150ml', 'Köpek Ürünleri-Kedi Şampuanı-Köpük Şampuan', '30.06.2024', '84 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_profarm-kedi-kopuk-sampuani-276326710.jpg', '', 'Kedi ve köpekler için çilekli kuru yıkama köpük şampuan, güçlü formülü ile ilk kullanımdan itibaren dostumuzun ve yaşam alanının kötü kokulardan arınmasını, tüyleri canlandırarak dökülmesini engeller. E vitamini ve kepek oluşumu engelleyen pentanol (vitamin) içerir. Paraben ve boya içermez. Köpeklerde ve kedilerde yıkama ve temizlik amacıyla kullanılır.', 'Profarm' );
