INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-2in1-2si-birarada-kopek-sampuani-250ml.html', 'Trixie 2in1 2_si Birarada Köpek Şampuanı 250ml', 'Köpek Ürünleri-Köpek Şampuanı-Köpek Doğal Şampuan', '4011905291970', '245 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-dogal-sampuan-2599615.jpg', '30.12.2025', 'Çok kaliteli ve etkin içeriklere sakip şampuan ve tüy bakım kreminin bir arada olduğu, içerdiği D-Panthenol sayesinde onarıcı ve iyileştirici etkiye sahip, jojoba yağı sayesinde tüylere ipeksi ve dolgun bir görünüm veren, bakım kremi sayesinde hacimli ve kolay taranabilirlik sağlayan ikisi bir arada bir şampuandır.İnsan ile köpek deri ph ı birbirinden farklıdır. Bu yüzden bebek şampuanı bile köpekler için uygun değildir.Köpeğinizi yıkarken muhakkak köpek şampuanı ile yıkamanız gerekmektedir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_bioline-kedikopek-dogal-sampuan-250ml.html', 'Bioline Doğal Kedi ve Köpek Şampuanı 250ml', 'Köpek Ürünleri-Kedi Şampuanı-Sıvı Şampuan', '6970117120066', '129 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_bioline-kedi-sampuani-1747690.jpg', '21.06.2025', 'Bazı kediler ve köpekler yabancı kokulardan rahatsız olabilirler. Bioline Neutral Shampoo, bu tip evciller için kullanılan kokusuz doğal şampuandır.', 'Bioline' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-yavru-kopek-sampuani-250ml.html', 'Trixie Yavru Köpek Şampuanı 250ml', 'Köpek Ürünleri-Köpek Şampuanı-Yavru Köpek Şampuanı', '4011905029061', '245 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-yavru-kopek-sampuani-7339136.jpg', '30.06.2025', 'Özellikle yavru köpeğinizin hassas cildine uygun yavru köpek şampuanıdır.İnsan ile köpek deri ph ı birbirinden farklıdır.Bu yüzden bebek şampuanı bile köpekler için uygun değildir.Köpeğinizi yıkarken muhakkak köpek şampuanı ile yıkamanız gerekmektedir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_bioline-kedi-ve-kopek-sabunu-100gr-bitpirekene-engelleyici.html', 'Bioline Çay Ağacı Özlü Kedi ve Köpek Sabunu 100gr', 'Köpek Ürünleri-Kedi Şampuanı-Bioline Kedi Şampuanı', '6970117120400', '96 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_bioline-kedi-sampuani-26124000.jpg', '30.11.2025', 'Kedi ve köpekler için cildi kurutmadan tüylerinde doğal parlaklık sağlayan, çay ağacı yağı ile formüle edilmiş doğal, katkısız sabundur.', 'Bioline' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-uzun-tuy-icin-lolay-tarama-kopek-spreyi175ml.html', 'Trixie Uzun Tüy İçin Kolay Tarama Köpek Spreyi 175ml', 'Köpek Ürünleri-Köpek Şampuanı-Tüy Çeşitlerine Göre', '4011905029320', '245 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-deri-ve-tuy-bakimi-9966671.jpg', '30.08.2024', 'İçerdiği doğal jojoba yağı sayesinde köpeğinizin kürkünü hem temizler hemde besler.Aynı zamanda ipeksi ve lüks bir parlaklık ve yumuşaklık verir.Alkolsüzdür.Onarıcı özelliğe sahiptir.Hassas ciltli köpekler için idealdir.', 'Trixie' );
