INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_trixie-kedikopek-kuru-sampuan-200gr.html', 'Trixie Kuru Kedi ve Köpek Şampuanı 200gr', 'Kedi Ürünleri-Kedi Şampuanı-Kuru Şampuan', '4011905291826', '375 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-sampuani-7629256.jpg', '30.06.2025', 'Tüm kedi , köpek ve küçük petler (hamster , guinea pig , vb ) için uygun bir kuru şampuandır.Özellikle sudan korkan veya su içerisinde bulunmaktan hoşlanmayan tüm petler için uygun , seyahatlerde çok kolay kullanımı olan , kürkü hem temizleyen hemde güzel kokmasını sağlayan , deri sağlığını koruyan , 12 haftalıktan itibaren kullanılabilecek bir kuru şampuandır.İnsan ile hayvanların deri ph_ı birbirinden farklıdır.Bu yüzden bebek şampuanı bile evcil hayvanlarr için uygun değildir.Evcil hayvanınızı yıkarken muhakkak hayvanlar için üretilen şampuanlar ile yıkamanız gerekmektedir.', 'Trixie' );
