INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_royal-canin-digest-sensitive-yetiskin-kedi-yas-mamasi-85gr.html', 'Royal Canin Digest Sensitive Sos İçinde Yetişkin Kedi Konservesi 85gr', 'Kedi Ürünleri-Kedi Konserve Maması-Yetişkin Kedi Konservesi', '9003579309537', '21,50 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_royal-canin-yetiskin-kedi-konservesi-85kg-2545807.jpg', '10.10.2024', '1 yaş üstü yetişkin kediler için yaş mamadır. Digest Sensitive, sindirim hassasiyeti olan kediler için sindirimi rahatlatır. 1 yaş üstü tüm yetişkin kediler için uygudur. Besinsel olarak kedinizin yaşına ve fizyolojik aktivitesine göre çeşitlendirilmiş tüm Royal Canin yaş mamaları, hem sağlıklı hem de yüksek lezzetiyle kediler tarafından tercih edilen beslenme sunar. İdeal kiloyu korur. Dengeli kalori alımının yanında, seçkin bir lezzet için özel olarak hazırlanmış sos içinde yaş mama. Taş oluşumuna yol açan minerallerin konsantrasyonunu indirgeyerek üriner sistem sağlığına yardımcı olur. Sindirilebilirliği yüksek Digest Sensitive 9, dışkı kokusunu önemli ölçüde azaltır. Vitamin desteği içeren mama kedilerin genel sağlık durumuna olumlu etki eder.  ', 'Royal Canin' );
