INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_pro-one-kopek-uzaklastirici-sprey-250ml.html', 'PRO ONE Köpek Uzaklaştırıcı Sprey 250ml', 'Köpek Ürünleri-Bakım ve Temizlik Ürünleri-Köpek Uzaklaştırıcılar', '', '119 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_pro-one-kopek-uzaklastirici-sprey-34087639.jpg', '', 'Evcil hayvanların oluşturduğu her türlü kötü kokuyu, yağ özleri ile giderir. İpek hariç her türlü tekstil ürünlerinde kullanıma uygundur. Köpeğinizin girmesi istenilmeyen ortama mobilyalardan, perdelerden, ağaçlardan, çöpten, çantalardan, halı ve koltuklardan istenmeyen yasaklı bölgelerden uzaklaştırmak için püskürtün. Hareketli petlerde 6 saatte, sakin irklarda 12 saatte bir yüzeye püskürterek uygulanır. 4 gün içinde sonuç alınır.', 'PRO ONE' );
