INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_bioline-kopek-uzaklastici-sprey-300ml.html', 'Bioline Köpek Uzaklaştıcı Sprey 300ml', 'Köpek Ürünleri-Bakım ve Temizlik Ürünleri-Köpek Uzaklaştırıcılar', '6970117120288', '279 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_bioline-kopek-yavrusu-bakimi-urunleri-17601592.jpg', '', 'Bioline Dog Keep Off Spray, içerdiği kokular sayesinde köpeğinizi uygulanan yerlerden uzaklaştırır. Köpeğinizin gitmesini istemediğiniz noktalara veya eşyalara sıkarak köpeğinizi bu bölgelerden uzak tutabilirsiniz. Köpeklere bir zararı yoktur, sadece uzaklaştırır. İç mekan kullanımı için uygundur.', 'Bioline' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_gimdog-kopek-uzaklastirici-sprey-100ml.html', 'GimDog Köpek Uzaklaştırıcı Sprey 100ml', 'Köpek Ürünleri-Ağustos Seçili Ürünler-Gimpet Ağustos Seçili Ürünler', '4002064504803', '129 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_gimpet-kopek-uzaklastirici-sprey-6186620.jpg', '', 'Limon ve Portakal uçucu yağları ve Elma Sirkesi gibi doğal malzemelerden oluşan fonksiyonel aktif maddelerle oluşturulan belirli bir koku ile özel olarak formüle edilen fısfıs sprey. Bu koku köpeğinizin koku duyusunu rahatsız etmediği gibi zarar da vermez, ancak evcil hayvanınızın korumak istediğiniz yerlere yaklaşma veya oraları kirletmesi hevesini kırar. Kuvvetlice çalkalayın ve köpeğinizin yakınlaşmasını ya da kirletmesini istemediğiniz alanlarda fısfıslayın. İlk on gün boyunca 20-30 cm_lik bir mesafeden günde 3 ila 4 kez püskürtün. Evcil hayvanınız alışana kadar tedaviyi tekrarlayın. Köpeğin gözleri, sarkık üst dudağı ve diş mukozası ile temastan kaçının.', 'Gimpet' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-led-isikli-plastik-kene-cikarma-kalemi-14cm-karisik-renkli.html', 'Trixie Led Işıklı Kene Çıkarma Kalemi 14cm (Karışık Renkli)', 'Köpek Ürünleri-Kedi Bakım Ürünleri-Pire_Kene Ürünleri', '4011905242811', '359 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-paraziter-pire-kene-engelleyici-128792380.jpg', '', 'Kedi ve köpeklerde bulunan kenelerin çıkarılması için üretilmiştir. Kalemin ucunda yer alan led ışık sayesinde keneyi rahatça görebilir ve çıkarabilirsiniz. Askı bölümü sayesinde cebe takılabilir. Eğer kene tamamen çıkmazsa veteriner hekiminize danışmanızı öneririz. Ürün karışık renklidir, stoktaki mevcut renk durumuna göre gönderim sağlanır. Ürünün ölçüsü 14 cm_dir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kedi-ve-kopekler-icin-kene-temizleme-karti-8x5cm-beyaz.html', 'Trixie Kedi ve Köpekler için Kene Temizleme Kartı 5x8cm (Beyaz)', 'Köpek Ürünleri-Kedi Bakım Ürünleri-Pire_Kene Ürünleri', '4011905022994', '109 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-pire-kene-urunleri-186642467.jpg', '', 'Keneyi kolayca köpeğinizin veya kedinizin vücudundan ayırmanızı sağlayacak özel plastik kart. Keneyi dibinden tutun ve keneyi dışarı çekin. Çekiş esnasında kartı çevirmeyin. Kenenin çıkarılması sonrası çıkarılmış olan deri bölgesi dezenfekte edilmelidir. Beklenmedik bir durumda lütfen veterinize müracaat ediniz.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_eurodog-kedi-ve-kopekler-icin-genis-aralikli-pire-taragi.html', 'EuroDog Kedi ve Köpekler için Geniş Aralıklı Pire Tarağı 20cm', 'Köpek Ürünleri-Kedi Tarağı ve Fırçası-Pire Tarağı', '', '89 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_eurodog-kedi-pire-taragi-164701776.jpg', '', 'Kedi ve köpekler için özel olarak tasarlanmış geniş aralıklı pire tarağıdır. Evcilinizi düzenli olarak taradığınızda hem üzerindeki toz hem de pireleri yakalamaya yardımcı olur. Plastik sapı sayesinde elinizden kaymaz ve pratiklik sağlar. Ürünün uzunluğu 20 cm_dir.', 'EuroDog' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-pire-ve-bit-kopek-taragi-21cm.html', 'Trixie Pire ve Bit Köpek Tarağı 21cm', 'Köpek Ürünleri-Köpek Tarağı ve Fırçaları-Pire Tarağı', '4011905237626', '399 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-pire-taragi-78275419.jpg', '', 'Köpeğinizin üzerindeki pireleri ve bitleri bulabilmek için kullanabileceğiniz özel bir taraktır. Uç kısımları yuvarlanmış metal tarak dişleri sayesinde köpeğinizin cildine zarar vermeden nazikçe taramanızı sağlar. Sapındaki kaymaz bölüm sayesinde kolay kullanım sağlar. Köpeğinize herhangi bir rahatsızlık vermez. Ürün 21cm boyutlarındadır.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kopek-pire-ve-toz-temizleme-taragi-15cm.html', 'Trixie Köpek Pire ve Toz Temizleme Tarağı 15cm', 'Köpek Ürünleri-Köpek Tarağı ve Fırçaları-Sık Dişli Fırça ve Taraklar', '4011905024103', '239 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-pire-taragi-153811119.jpg', '', 'Köpeklerin tüyleri içerisine gizlenmiş pirelerin bulunması ve taranarak temizlenmesi için tasarlanmış köpek tarağıdır. Köpeğin bu tarak ile düzenli olarak taranması sonucu hem kürkü üzerinde biriken kirler temizlenmiş olur hemde pireler temizlenir. Ergonomik kauçuk sapı sayesinde kullanımı rahattır. Ürünün uzunluğu 15 cm_dir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_animology-flea-tick-pire-ve-kene-onleyici-kopek-sampuani-250ml.html', 'Animology Flea&Tick Pire ve Kene Önleyici Köpek Şampuanı 250ml', 'Köpek Ürünleri-Köpek Şampuanı-Bitki Özlü Şampuan', '5060180810061', '285 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_animology-kopek-paraziter-pire-kene-engelleyici-325607435.jpg', '18.08.2024', 'Deri ve tüyleri derinlemesine temizler. Cildin nem dengesini sağlar ve cildi besler. Köpeklerin deri ve tüy yapısına uygun olarak formüle edilmiştir. Animology Flea&Tick, pire ve keneleri temizlemek ve ayrıca onları köpek tüylerinden uzak tutmak için özel olarak formüle edilmiştir. Tüm Animology köpek yavrularının ve köpeklerin harika görünmesini, hissetmesini ve aynı zamanda harika kokmasını sağlayacak ilaçlı bir koku ile aşılanmıştır. Uçucu yağlarının kaplamasını sıyırmadan kiri, kokuyu ve böcekleri gideren, hafif ancak derin bir temizleme etkisine sahiptir. Bu şampuan, yıkama süresini minimumda tutan Animology _EASY RINSE_ teknolojisine sahiptir.. Güçlü içeriği ile mikroplara ve pirelere karşı uzun süreli ve etkili bir koruma sağlar.  İçerdiği zengin amino asitler ile köpeklerin cildini ve tüylerini besler ve tüy dökülmesini en aza indirir. Islandıktan sonra doğrudan dostunuzun deri ve tüylerine sürerek kullanabilirsiniz.  Kötü kokuları uzun süreli önler ve giderir. Uygulama için önce hayvanın vücudu suyla ıslatılır. Kullanılacak miktar suyla seyredildikten sonra ovularak şampuan tüm vücuda yayılır. Evcil dostunuz 3-5 dakika köpüklü olarak tutulduktan sonra yıkanır ve havluyla kurulanır. 6 haftalıktan küçük, kedi ve köpek yavrularında kullanılmamalıdır. Şampuan göze temas etmeden uygulanmalıdır.', 'Animology' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kopekler-icin-plastik-cift-tarafli-pire-ve-toz-temizleme-taragi-14cm.html', 'Trixie Plastik Köpekler için Çift Taraflı Pire Tarağı 14cm', 'Köpek Ürünleri-Köpek Tarağı ve Fırçaları-Çift Taraflı', '4011905024004', '79 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-plastik-sapli-tarak-firca-158794482.jpg', '', 'Köpeklerin sırt bölümü, bacak dış yüzeyleri ve geniş bölgelerindeki pirelerin bulunması ve temizlenmesi için tasarlanmış plastik pire tarağıdır. Ürünün boyu 14 cm_dir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kene-ve-pire-kopek-taragi-7cm.html', 'Trixie Kauçuk Köpek Kene ve Pire Tarağı 7cm', 'Köpek Ürünleri-Köpek Tarağı ve Fırçaları-Pire Tarağı', '4011905237619', '259 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-paraziter-pire-kene-engelleyici-26876465.jpg', '', 'Evcil dostunuzun pirelerden kolayca kurtulması için tasarlanmıştır. Kenelerin ve pirelerin bulunmasında kullanılan çok kullanışlı bir taraktır. Tarak bölümü metal, tutma bölümü plastik ve kaymaz kauçuktur. Kedi ve köpekler için uygundur. Kulaklar, omuzlar ve karın bölgelerinde kullanılırken daha hassas davranılmalıdır. Düzenli olarak su ve antiseptik bir solüsyon ile temizlenmelidir. Hem kısa hem uzun tüylerde kullanılabilir. Ürün ölçüsü 7 cm_dir.', 'Trixie' );
