INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_nd-tahilsiz-tavuklu-ve-narli-yavru-kedi-mamasi-15-kg.html', 'N&D Prime Tavuklu ve Narlı Tahılsız Yavru Kedi Maması 1,5kg', 'Kedi Ürünleri-Kedi Maması-Yavru Kedi Maması', '8010276032584', '779 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_nd-yavru-kedi-mamasi-1kg-31093777.jpg', '14.07.2024', 'N&D tavuklu ve narlı yavru kedi maması, yavru kedinizin gelişimi için gerekli besin değerlerine ssahip kuru mamadır. Mama içeriğinde bulunan yüksek oranda protein kedinizin kas kütlesinin gelişmesine yardımcı olur. Bu mama hamile, emziren ve yavru kediler için uygundur. Mama içeriğine bulunan besinler yavru kedinizin gelişimi maksimum oranda desteklemek için özenle seçilmiştir. Ürünün paketi ziplidir. Zip yani kilitli paket sistemi, paket açıldıktan sonra mamanın hava alıp bayatlamasını önler. Beslenme önerileri kedinizin yaşına, kilosuna ve günlük fiziksel aktivitesine göre değişmektedir. Aşağıdaki tabloyu baz alarak günlük öğün miktarını kedinize göre ayarlayabilirsiniz. ', 'N&D' );
