INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_pro-choice-32-sterilised-tavuklu-ve-pirincli-kisirlastirilmis-kedi-mamasi-2kg.html', 'ProChoice 32 Tavuklu ve Pirinçli Düşük Tahıllı Kısırlaştırılmış Kedi Maması 2kg', 'Kedi Ürünleri-Kedi Maması-Kısırlaştırılmış Kedi Maması', '8681465601043', '', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_pro-choice-yetiskin-kedi-mamasi-2kg-31329830.jpg', '17.04.2024', 'Yetişkin kısırlaştırılmış kediler için uygun tavuklu ve pirinçli kedi mamasıdır. Kısırlaştırılmış kedilerin günlük enerji ihtiyaçlarına uygun içerikle hazırlanmıştır.', 'ProChoice' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_pro-choice-38-kitten-kuzulu-ve-pirincli-yavru-kedi-mamasi-2kg.html', 'ProChoice 38 Kuzulu ve Pirinçli Düşük Tahıllı Yavru Kedi Maması 2kg', 'Kedi Ürünleri-Kedi Maması-Yavru Kedi Maması', '8681465601074', '', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_pro-choice-yavru-kedi-mamasi-2kg-3130753.jpg', '26.08.2024', 'Prochoice Kuzu Etli Pirinçli Yavru Kedi Maması - Sütten kesilmiş kedi yavruları için 1 yaşına kadar tavuklu tam mama. 1 - 12 ay arası yavru kedilerin tam ve dengeli beslenmesi için hazırlanmış kedi mamasıdır. Aynı zamanda hamile ve emziren yetişkin kediler içinde tavsiye edilir. Pro Choice Kitten yavru kedi maması tavuklu ve pirinçlidir. İçeriğindeki doğal antioksidanlar ve yüksek düzeyde bulunan sindirilebilir protein sayesinde mükemmel bir beslenme sağlayarak bağışıklık sistemini destekler. Pro Choice Kitten yavru kedi kuru maması yavru kedinizin duyusal fonksiyonlarının sağlığı için vitamin ve minerallerce zenginleştirilmiştir. İçerdiği doğal antioksidanlar sayesinde yavru kedinizin uzun ve sağlıklı bir yaşam sürmesini sağlar. Omega 3 ve Omega 6 yağ asitlerini dengeli oranlarda içermektedir.', 'ProChoice' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_royal-canin-sterilised-37-kisirlastirilmis-kedi-mamasi-4kg.html', 'Royal Canin Sterilised 37 Kısırlaştırılmış Kedi Maması 4kg', 'Kedi Ürünleri-Kedi Maması-Kısırlaştırılmış Kedi Maması', '3182550737616', '', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_royal-canin-yetiskin-kedi-mamasi-4kg-937023.jpg', '16.10.2024', 'Kedinizin kısırlaştırıldıktan sonra, tükettiği besinlerin değişen enerji ihtiyacını desteklemesini sağlamak için bir diyet değişikliği gerekebilir. ROYAL CANIN® Sterilised 37 uygun miktardaki yağ oranıyla, kedinizin kısırlaştırmadan sonra ideal vücut ağırlığını korumasına yardımcı olur. ROYAL CANIN® Sterilised 37 mama ayrıca kedinizin üriner sisteminin sağlığını desteklemeye ve korumaya yardımcı olan dikkatle belirlenmiş bir mineral dengesine sahiptir; yüksek protein içeriği kedinizin sağlıklı kas kütlesini korumaya yardımcı olur. Kısırlaştırma sonrası kedilerin enerji ihtiyaçları azalır. Sterilised 37 orta derecede yağ düzeyi ve yeterli günlük porsiyonlar sayesinde aşırı kilo alımı riskini kısıtlamaya yardımcı olur. Yeterli bir mineral dengesi sağlayarak sağlıklı bir üriner sistemi desteklemeye yardımcı olur. Yüksek protein içeriği sayesinde kas kütlesini korumaya yardımcı olur. L-Karnitin sağlıklı yağ metabolizmasıyla ilgilidir.    ', 'Royal Canin' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_hills-kitten-healty-develoment-ton-balikli-yavru-kedi-mamasi-2-kg.html', 'Hill’s SCIENCE PLAN Healthy Development Ton Balıklı Yavru Kedi Maması 1kg + 500gr HEDİYE!', 'Kedi Ürünleri-Kedi Maması-Yavru Kedi Maması', '052742059655', '', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_hills-yavru-kedi-mamasi-1kg-3595133.jpg', '30.11.2024', '3 haftalıktan 12 aya kadar kedilerin sağlıklı gelişmesi ve dış etkilere hassas oldukları bu dönemde bağışıklık sistemlerinin kuvvetlendirilmesi için geliştirilen Hills_s Ton Balıklı Yavru kedi maması içeriğindeki E ve C gibi vitaminlerle bağışıklık sistemini destekler. Diğer vitamin ve mineral katkıları kemik ve eklem gelişimine destek olur ayrıca yüksek protein oranı hem enerji verir hem de kas sisteminin gelişimini sağlamlaştırır. Kedilerin zeka seviyeleriyle beyin fonksiyonlarının gelişmesi için uygun seviyede DHA ile formüle edilmiştir.', 'Hill_s' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_hills-young-adult-sterilised-kisirlastirilmis-tuna-balikli-yetiskin-kedi-mamasi-35kg.html', 'Hill_s SCIENCE PLAN Ton Balıklı Kısırlaştırılmış Kedi Maması 3kg', 'Kedi Ürünleri-Kedi Maması-Kısırlaştırılmış Kedi Maması', '052742023946', '979 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_hills-yetiskin-kedi-mamasi-3kg-1448323.jpg', '01.10.2024', 'Kısırlaştırılmış kedinizin tüm hayatı boyunca özel beslenme ihtiyaçları bulunmaktadır. İşte bu nedenle Hills Science Plan Sterilised Cat kedinizin uzun süreli beslenmesine uygun olarak, yetişkin ve yaşlılık evrelerinde sağlığının korunubilmesi için formüle edilmiştir.  Kedilerin sağlıklı ve fit olmasını sağlayan yüksek seviyelerde L-Karnitin içerir. Yaşlanmaya bağlı ortaya çıkan serbest radikallerin nötralize edilmesine ve bağışıklık sisteminin desteklenmesine yardımcı olan E ve C vitamini gibi antioksidanlar bulunmaktadır.', 'Hill_s' );
