INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_royal-canin-iran-kedisipersian-30-kedi-mamasi-400-gr.html', 'Royal Canin İran Kedisi için Yetişkin Kedi Maması 400gr', 'Kedi Ürünleri-Kedi Maması-Özel Irk Kedi Maması', '3182550702607', '127 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_royal-canin-yetiskin-kedi-mamasi-400kg-21279268.jpg', '27.05.2024', 'ROYAL CANIN® PERSIAN, sağlıklı tüyleri desteklemek üzere yağ asitleri, aminoasitler ve vitaminlerden oluşan bir kompleks içerir ve aynı zamanda özel liflerden oluşan bir kombinasyon sayesinde tüy yumağı oluşumunun sınırlandırılmasına yardımcı olur. 12 aylık ila 12 yaş arası İran kedileri için, Brakiosefalik çeneye göre adapte edilmiş özel mama tanesi biçimi sağlıklı, uzun tüyleri destekler.Tüy yumağı oluşumunu sınırlandırır. Sindirim sağlığını korur. 
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_royal-canin-kitten-sterilised-kisirlastirilmis-yavru-kedi-mamasi-2kg.html', 'Royal Canin Kitten Sterilised Kısırlaştırılmış Yavru Kedi Maması 2kg', 'Kedi Ürünleri-Kedi Maması-Kısırlaştırılmış Kedi Maması', '3182550805186', '599 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_royal-canin-yavru-kedi-mamasi-2kg-256046401.jpg', '28.01.2024', 'ROYAL CANIN® Sterilised Kitten, kısırlaştırılmış yavru kedilerin büyümelerinin "konsolidasyon evresinde" beslenme ihtiyaçlarını desteklemek için özel olarak formüle edilmiştir. Bu formül, fiziksel ve davranışsal açıdan önemli değişimler yaşayan 6 ila 12 aylık kısırlaştırılmış yavru kediler için uygundur. Bu özel formül, kilo alımı riskini azaltmaya yardımcı olmak için orta seviyede yağ içerir ancak yine de sağlıklı gelişim için optimal seviyelerde protein, kalsiyum ve fosfor içeriği mevcuttur. Ayrıca, yavru kedilerin sağlıklı bağışıklık sistemi gelişimini desteklemek için Vitamin C ve E gibi besin öğeleri içerir. Bu diyetsel antioksidanların aşılardan sonra daha yüksek ve hızlı antikor artışını harekete geçirdiği kanıtlanmıştır. ROYAL CANIN® Sterilised Kitten beyin gelişimini ve göz sağlığını desteklemek için Omega-3 yağ asitleriyle (DHA) zenginleştirilmiştir. Faydalı prebiyotiklerin (MOS) ve çok yüksek sindirilebilirliği olan proteinlerin birleşimi sayesinde, ROYAL CANIN® Sterilised Kitten aynı zamanda sindirim sağlığı açısından bağırsak mikrobiyotasının (bağırsak florası) sağlıklı dengesini desteklemeye yardımcı olur. ROYAL CANIN® Sterilised Kitten_ın taneleri de yavru kedinizin küçük çenesi için özel olarak tasarlanmıştır. Yavru kediniz çiğnerken ortaya çıkan mekanik fırçalama etkisi diş sağlığının korunmasına yardımcı olur. Kısırlaştırılmış kediniz 12 aylık olduğunda, yetişkin bir kedi olarak beslenme ihtiyaçlarını karşılamak için özel olarak uyarlanan bir diyete ihtiyaç duyar. Bu aşamada, kuru mama ya da soslu veya jöleli yaş mama olarak sunulan ROYAL CANIN® Sterilised 37 serisine geçebilirsiniz. Doğal antidoksidanlar içerir. Yapay renklendiriciler içermez. Yapay tatlandırıcılar içermez. Etkinliği bilimsel olarak kanıtlanmış, E ve C vitaminleri de içeren özel kompleks sayesinde yavru kedilerin bağışıklık sistemlerini destekler. Kısırlaştırmadan sonra yavru kedilerin enerji ihtiyaçları değişir ve aşırı kilo alımı riski artar. Bu formül orta seviyede yağ içeriği ile kilo alımını sınırlarken uygun seviyede protein, kalsiyum ve fosfor ile sağlıklı büyümeyi desteklemeye devam eder. Prebiyotik (MOS) kombinasyonu & yüksek sindirilebilirlikli proteinler sayesinde sağlıklı bağırsak mikrobiyotasını ve sindirim sağlığını destekler. Omega 3 yağ asitleri (DHA) ile zenginleştirilmiş bu formül, yavru kedilerin beyin gelişimini ve sağlıklı görme fonksiyonlarını da destekler. 
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_hill-s-ordekli-kisirlastirilmis-kedi-mamasi-10kg.html', '', 'Kedi Ürünleri-Kedi Maması-Kısırlaştırılmış Kedi Maması', '052742035994', '', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_hills-yetiskin-kedi-mamasi-10kg-139008713.jpg', '30.08.2024', 'Kısırlaştırılmış kedilerin kilosunu sağlıklı bir şekilde korumak için benzersiz bir kilo kontrol formülüne sahiptir. Yüksek kaliteli ve sindirimi kolay malzemelerle üretilmiştir. 6 ay ile 6 yaş arasındaki kısırlaştırılmış tüm yetişkin kediler için uygundur.', 'Hill_s' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_royal-canin-sensible-33-hassas-sindirim-sistemi-kedi-mamasi-2-kg.html', 'Royal Canin Sensible 33 Hassas Sindirim Sistemi Destekleyici Kedi Maması 2kg', 'Kedi Ürünleri-Kedi Maması-Yetişkin Kedi Maması', '3182550702317', '', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_royal-canin-yetiskin-kedi-mamasi-2kg-11575467.jpg', '29.09.2024', 'Sindirim sistemi hassasiyetleri kedilerde ishal, yumuşak dışkı gibi bazı sorunlara sebep olabilmektedir, böyle durumlarda kediler sindirim sistemilerinin desteklenmesi gerekmektedir, Royal Canin Sensible 33 sindirim sistemi hassasiyetine sahip kediler için özel olarak geliştirilen içeriği ile sindirim sistemi güvenliği sağlar. Royal Canin Sensible formülünde bulunan Frukto-oligo-sakkaritlerle sindirim kanalına olumlu etki eder, ayrıca omega-3 yağ asitlerinin bağırsaklarda anti-enflamatuvar etkisi vardır. Mineral ve vitaminlarin dengeli seviyeleri sindirim sistemi güvenliği sağlar.', 'Royal Canin' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_kitten-healthy-development-chicken-tavuklu-yavru-kedi-mamasi-5kg.html', 'Hill_s SCIENCE PLAN Healthy Development Tavuklu Yavru Kedi Maması 3kg', 'Kedi Ürünleri-Kedi Maması-Yavru Kedi Maması', '052742024363', '899 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_hills-yavru-kedi-mamasi-3kg-5777081.jpg', '30.01.2024', '3 hafta - 12 ay arası yavru kediler ve anne kediler için özenle hazırlanan Hill_s Kitten içeriğindeki vitamin ve mineral dağılımı sayesinde bağışıklık sistemini maksimum seviyede destekler. Özellikle yavru kedilerin dış etkilere açık olduğu bu dönemde bağışıklık sisteminin kuvvetli olmasına dikkat edilen Hill_s Kitten_da antioksidanlar ve balık yağından elde edilen DHA bağışıklık sistemini ve sindirim sistemini koruyucu etkiye sahiptir. Anne kedilerin ve yavrularının ihtiyaç duydukları enerjiyi tam olarak karşılayabilen Hill_s Kitten içeriğinde bulunan omega-3 ve omega-6 yağ asitleriyle tüy ve deri sağlığını korur ve devamlılığını sağlar. Yüksek protein oranlı formülü yavru kedilerin kas sistemlerinin gelişmesine katkı sağlar. Mamanın formülünde bulunan kalsiyum ve D vitamini diş ve kemik gelişimini destekler.', 'Hill_s' );
