INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_gimcat-urinary-paste-kedi-macunu-50g.html', 'GimCat UT Balance Üriner Sistem Sağlığı için Kedi Macunu 50gr', 'Kedi Ürünleri-Vitaminler ve Ek Besinler-Macun ', '4002064427041', '169 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_gimpet-kedi-macun-odulleri-36175342.jpg', '28.02.2024', 'Evrimleşmelerinin sonucu olarak, kediler doğaları gereği su konusunda ekonomiktir ve idrarları mümkün olduğu kadar az suyun dışarı atılması için çok konsantre olur, bu da idrar taşlarının birikmesine neden olabilir.  Kedilerin, köpeklere kıyasla idrar yolu rahatsızlığı yaşama ihtimalleri daha yüksektir. Gimcat Balance Kedi Macunu, bağırsakta fosfor ve oksalatlarla reaksiyona giren bileşenler içerir.  Bazı idrar taşlarında fosfor ve oksalatlar bulunur. Gimcat Balance Kedi Macunu böylece idrar yolu enfeksiyonlarının engellenmesine ve asgariye indirilmesine yardımcı olur. Normal diyetlerinin bir parçası olarak da kedilere verilebilir.', 'Gimpet' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_vet-s-plus-yasli-kedi-ve-kopekler-icin-multivitamin-tablet-100-lu.html', 'Vet_s Plus Senior Yaşlı Kedi ve Köpekler İçin Multivitamin Tablet (100_lü)', 'Köpek Ürünleri-Vitaminler ve Ek Besinler-Tablet', '10.01.2026', '129 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_vet-s-plus-kedi-tablet-odulleri-199771547.jpg', '', 'İleri yaştaki kedi ve köpeklerin daha kaliteli ve sağlıklı bir yaşam sürmeleri için özel bileşenler içermektedir. Eklem sağlığının korunmasına ve ileri yaşa bağlı gelişen eklem ağrılarının azalmasına yardımcı olur. Enerji seviyesinin artmasına destek olur. Bağışıklık sistemini destekler. Hafızayı güçlendirir.   Göz, kalp, tüy ve tırnak sağlığının korunmasında yardımcı olur', 'Vet_s Plus' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_vet-s-plus-kedi-ve-kopekler-icin-c-vitamini-damla-100ml.html', 'Vet_s Plus Vitamin C Kedi ve Köpekler İçin Sıvı Vitamin Damla 100ml', 'Kedi Ürünleri-Vitamin ve Ek Besinler-Sıvı & Likit', '20.01.2025', '139 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_vet-s-plus-sivi-likit-kedi-vitaminleri-228241300.jpg', '', 'Kedi ve köpeklerde C vitamini eksikliğini gidermek için formüle edilmiş sıvı takviyedir. Enfeksiyon, eklem rahatsızlıkları, alerji ve solunum yolu rahatsızlıkları gibi stres şartlarında vücudu destekleyip güçlendirir. C Vitamini antioksidan etkisi ile güçlü bir doku yenileyicidir. C vitamini, virüs ve bakterilere karşı bağışıklık sistemini güçlendirir. C vitamini damlayı kutudan çıkan pipet yardımıyla aşağıdaki dozajlara uygun olarak kedinizin veya köpeğinizin kuru mamasına ya da suyuna ekleyebilirsiniz. Her kullanımdan önce iyice çalkalayınız. Direkt güneş ışığı almayan serin ve kuru yerde muhafaza ediniz. Çocukların ulaşamayacağı yerlerde saklayınız.', 'Vet_s Plus' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_vet-s-plus-kedi-ve-kopekler-icin-multivitamin-damla-100ml.html', 'Vet_s Plus Multivitamin Kedi ve Köpekler İçin Sıvı Vitamin Damla 100ml', 'Kedi Ürünleri-Vitamin ve Ek Besinler-Sıvı & Likit', '09.12.2024', '139 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_vet-s-plus-sivi-likit-kedi-vitaminleri-228065808.jpg', '', 'Zengin içeriğiyle kedi ve köpeğinizin günlük vitamin ve mineral ihtiyacının karşılanmasına yardımcı olan sıvı takviyedir.  Görme yeteneğini güçlendirir, cildin ve tüylerin sağlıklı kalmasına katkı sağlar. 
