INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_gimcat-taurin-paste-taurinli-macun-50gr.html', 'GimCat Kalp ve Göz Sağlığı Destekleyici Taurinli Kedi Macunu 50gr', 'Kedi Ürünleri-Vitaminler ve Ek Besinler-Macun ', '4002064402109', '169 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_gimpet-kedi-macun-odulleri-14919133.jpg', '30.01.2024', 'Taurin kedilerde kalp ve görme fonksiyonlarının sağlıklı olarak sürdürülebilmesi için gıdalardan almaları zorunlu olan bir amino asittir. Kediler Taurin_i kendileri üretemezler, bu nedenle gıdalarında muhakkak yeterli şekilde bulunması gerekir. Gimpet Taurinli Macun kedinizin ihtiyacı olan Taurin_i ihtiva eder, aynı zamanda zevkle tüketeceği lezzette ve bir ödüldür.', 'Gimpet' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_gimcat-anti-stress-rahatlatici-kedi-macunu-50gr.html', 'GimCat Relax Rahatlatıcı Şekersiz Kedi Macunu 50gr', 'Kedi Ürünleri-Vitaminler ve Ek Besinler-Macun ', '4002064421698', '169 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_gimpet-kedi-macun-odulleri-61745355.jpg', '28.02.2024', 'Kediler; veteriner ziyaretleri, yılbaşı gecesi, yeni aile ilişkileri, tatil gezileri, tadilat_taşınma veya yeni bir hayvan ya da eşyanın yaşam alanına dahil edilmesi gibi değişikliklere sebep olan gergin durumlarda çok hassas tepki verirler. Gimcat Relax Macun, bu gibi durumlarda içerdiği acem lalesi ve sarı kantaron ile rahatlatır ve huzur sağlar. Ayrıca içeriğindeki L-triptofan, kediyi daha mutlu hale getirir ve böylece rahatlamasını sağlayan serotonin oluşumununu (mutluluk hormonları) teşvik eder. Ayrıca İçerdiği B vitamini kompleksi, sinir fonksiyonunu ve enerji metabolizmasını destekler.  ', 'Gimpet' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_gimpet-gastrointestinal-bagirsak-sagligi-icin-kedi-macunu-50gr.html', 'GimCat Gastrointestinal Sindirim Sistemi Destekleyici Kedi Macunu 50gr', 'Kedi Ürünleri-Vitaminler ve Ek Besinler-Macun ', '4002064417462', '169 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_gimpet-kedi-vitamin-ve-ek-besinleri-61754384.jpg', '30.11.2023', 'GimCat Gastrointestinal Kedi Macunu hem bağırsağın hem de bağırsak florasının sağlıklı durumda tutulması amacıyla bağırsağın düzenlenmesi için psilyum kabuğundan yapılmış çözünebilir lifler ve prebiyotik TGOS, sindirim sistemindeki tahrişlerin azaltılmasına yardımcı olmak ve sağlıklı bir bağırsak mukoza zarı sağlamak için beta-glukan ve karaağaç kabuğu ve kurutulmuş çimen içerir. Sağlıklı bağırsakları destekler, mukoza zarını korur ve prebiyotik etkisi vardır. Günde 6 cm, ya doğrudan tüpten veya yiyeceklere ilave edilir (1 cm macun = yaklaşık 0.5 g). Oda sıcaklığında saklayın.', 'Gimpet' );
