INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_trixie-kedi-malti-100gr.html', 'Trixie Malt Macun Kedi Vitamini 100gr', 'Kedi Ürünleri-Vitaminler ve Ek Besinler-Macun ', '4011905042206', '219 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-macun-odulleri-10434054.jpg', '30.12.2024', 'Lezzetli, sindirime yardımcı olan metabolizmayı hızlandırır, düzenler ve iyi hazım sağlar. Kedinin tüylerini temizlerken ve yalarken yutmuş olduğu tüylerin topaklanmasını ve dışarı kolayca atılmasını sağlayan kedi maltıdır. Miğde ve bağırsakta tüy yumağı oluşumunu önler ve kedi refahını sağlar. Kedi için Malt lezzetli bir sindirim yardımcısıdır. Şeker içermez. Diş macunu kıvamında olan maltın içerisinde yer alan yağ sıcak havalarda veya raflarda dik bir şekilde muhafaza edilmesinden kaynaklı üste çıkabilir. Kapak ilk açıldığında bir miktar yağ ile karşılaşılması normaldir. İlk kullanımdan önce macunu çalkalamanız gerekir. Çok sıcak günlerde serin bir yerde muhafaza edilmesi önerilir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_vet-s-plus-kedi-ve-kopekler-icin-bagisiklik-sistemi-guclendirici-damla-100ml.html', 'Vet_s Plus Immune System Kedi ve Köpekler İçin Sıvı Bağışıklık Sistemi Güçlendirici Damla 100ml', 'Kedi Ürünleri-Çok Satanlar-Vet_s Plus Çok Satanlar', '11.01.2025', '', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_vet-s-plus-sivi-likit-kedi-vitaminleri-228035631.jpg', '', 'Kedi ve köpekler için üretilmiş bağışıklık sistemi güçlendirici sıvı takviyedir. İçerdiği Beta Glukan sayesinde evcil hayvanınızın vücudundaki enfeksiyonlarla mücadele etmekle görevli olan beyaz kan hücrelerini aktive eder. Ekinezya ile bağışıklık sistemini uyararak vücut direncini artırır. Propolis ile doğal bir antibiyotik etkisi ortaya çıkarır. Vücut tarafından üretilmeyen ancak doku onarımı için gerekli olan C vitamini ve bağışıklık sistemini güçlendirici etkiye sahip çinko minerali bakımından zengindir. İdrar yolu enfeksiyonlarında ve soğuk algınlığı durumlarında destekleyici özellik barındıran mürver içerir. Bağışıklık sistemi güçlendirici damlayı kutudan çıkan pipet yardımıyla aşağıdaki dozajlara uygun olarak kedinizin veya köpeğinizin kuru mamasına ya da suyuna ekleyebilirsiniz. Her kullanımdan önce iyice çalkalayınız. Direkt güneş ışığı almayan serin ve kuru yerde muhafaza ediniz. Çocukların ulaşamayacağı yerlerde saklayınız.', 'Vet_s Plus' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_gimcat-baby-tabs-yavru-kediler-icin-vitamin-tableti-40gr.html', 'GimCat Kitten Tabs Yavru Kediler için Taurinli Multivitamin Kedi Ödül Maması 40gr', 'Kedi Ürünleri-Vitaminler ve Ek Besinler-Tablet', '4002064426174', '75 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_gimpet-kedi-tablet-odulu-30941903.jpg', '30.12.2024', 'Gimcat Kitten Tabs yavru kediniz için en uygun olan doğal kalsiyum ve taurin içeriğiyle yavru kedilerin sağlıklı gelişimini destekleyen bir ödüldür. Kediniz sağlıklı ve güçlü bir yaşama Gimpet Kitten Tabs ile adım atsın. Taurin görme ve kalp fonksiyonu için önemlidir ayrıca L-karnitin enerji kaynağını destekler. Yavru kedilere günde yaklaşık 8 tane verilmesi tavsiye edilir.', 'Gimpet' );
