INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_vet-s-plus-brewer-yeast-kedi-ve-kopekler-icin-sarimsakli-maya-tableti-100-lu.html', 'Vet_s Plus Brewers Yeast Sindirim Sistemi Düzenleyici Kedi ve Köpek Sarımsaklı Maya Tableti (100_lü)', 'Kedi Ürünleri-Vitaminler ve Ek Besinler-Tablet', '10.01.2026', '129 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_vet-s-plus-kedi-tablet-odulleri-13425563.jpg', '', 'Tüm ırk kedi ve köpeklerde sağlıklı ve kaliteli tüy gelişimini destekleyen doğal protein ve B vitamini kaynağı vitamin tablettir. Bağışıklık sistemi destekleyici ve iyileşme hızlandırıcı etkisi bulunan B Vitamini sayesinde evcilleriniz sağlıklı bir ömür geçirecektir. B vitamini aynı zamanda kas ve kemik sistemini destekler ve sağlıklı bir iskelet sistemine yardımcıdır.   Yaraları ve operasyon sonrasında deri iyileşmelerini hızlandırmaktadır. Aşırı hareketli ve stresli kedi ve köpekleri sakinleştiren prebiyotik etkisi sayesinde mide bağırsak mikro-flora düzenini korumakta ve sindirimi kolaylaştırmaktadır. Aynı zamanda katı dışkı problemi olan köpeklerde dışkının yumuşamasını sağlar. Direk güneş ışığı almayan serin ve kuru yerde muhafaza ediniz. Çocukların ulaşamayacağı yerlerde saklayınız.', 'Vet_s Plus' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_vet-s-plus-hamile-ve-yavru-kediler-icin-taurin-katkili-sut-tozu-200gr.html', 'Vet_s Plus Hamile ve Yavru Kediler İçin Taurinli Süt Tozu 200gr', 'Kedi Ürünleri-Vitaminler ve Ek Besinler-Toz', '10.01.2026', '129 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_vet-s-plus-toz-kedi-vitaminleri-130934533.jpg', '', 'Annesinden erken dönemde ayrılmış yavrular ve öksüz yavrular için anne sütünün içerdiği doğal besin maddelerini içeren vitamin, mineral ve yağ gibi yavrunun tüm ihtiyaçlarının karşılayabilecek nitelikte süt tozu mamasıdır. 1 ile 90 günlük yavrular için uygun olan bu süt tozu yüksek değerli besin maddeleri içerdiğinden hamilelik esnasında ve yavruları emzirme zamanlarında takviye besin olarak da kullanılması uygundur. Bu ürün dengeli bir formül içerisinde gerekli olan bütün proteinleri, vitaminleri, mineralleri ve yağları ihtiva ederek anne sütü yerine kullanılır. ; annesinden erken ayrılmış yavruların ve hamile kedilerin gelişimini destekler ; bağışıklık sistemini güçlendirir. ; Enfeksiyonlara karşı vücudun korunmasında büyük rol oynar. ; kalp ve göz sağlığını destekler. Kediler için tamamlayıcı yemdir. Serin, nemsiz ve loş ortamlarda, ambalajında saklamanız gerekmektedir.', 'Vet_s Plus' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_vet-s-plus-bagisik-sistemi-destekleyici-kedi-ve-kopek-vitamin-tableti-100-lu.html', 'Vet_s Plus Immune System Kedi ve Köpek İçin Bağışıklık Sistemi Güçlendirici Tablet (100_lü)', 'Kedi Ürünleri-Vitaminler ve Ek Besinler-Tablet', '10.01.2026', '139 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_vet-s-plus-kedi-tablet-odulleri-134285889.jpg', '', 'Kedi ve köpekler için üretilmiş bağışıklık sistemi destekleyici tablet vitamindir. İçerdiği Beta Glukan sayesinde evcil hayvanınızın vücudundaki enfeksiyonlarla mücadele etmekle görevli olan beyaz kan hücrelerini aktive eder. Bu sayede evcilinizin bağışıklık sistemi kuvvetlenir ve hastalanmasını önleyebilirsiniz. Bağışıklık sistemini uyararak vücut direncini artırır. Bu sebeple hayvan sağlığı açısından çok önemlidir. Propolis ile doğal bir antibiyotik etkisi ortaya çıkarır. Vücut tarafından üretilmeyen ancak doku onarımı için gerekli olan C vitamini ve bağışıklık sistemini güçlendirici etkiye sahip çinko minerali bakımından zengindir. İdrar yolu enfeksiyonlarında ve soğuk algınlığı durumlarında destekleyici özellik barındıran mürver içerir. Direk güneş ışığı almayan serin ve kuru yerde muhafaza ediniz. Çocukların ulaşamayacağı yerlerde saklayınız.', 'Vet_s Plus' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_gimpet-multivitamin-100-gr.html', 'GimCat Multi-Vitamin Kedi Macunu 100gr', 'Kedi Ürünleri-Vitaminler ve Ek Besinler-Macun ', '4002064401393', '345 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_gimpet-kedi-vitamin-ve-ek-besinleri-5472645.jpg', '30.12.2023', 'Oda sıcaklığında saklayınız. Direk olarak veya kedinin yemeğine 4-5cm (2-2.5 gr) ilave edilip verilir. Verilecek miktar 2 katına çıkarilabilir. Yemeklerden önce verilmesi daha idealdir.', 'Gimpet' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_vet-s-plus-biyotin-katkili-tuy-sagligi-destekleyici-kedi-ve-kopek-vitamin-tableti-100-lu.html', 'Vet_s Plus Kedi ve Köpek İçin Tüy Sağlığı Güçlendirici Biyotin Tablet (100_lü)', 'Kedi Ürünleri-Çok Satanlar-Vet_s Plus Çok Satanlar', '10.01.2026', '', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_vet-s-plus-kedi-tablet-odulleri-134278843.jpg', '', 'Kedi ve köpeklerin tüy sağlığını desteklemek için özel olarak üretilmiş, biyotin katkılı vitamin tablettir. İçerdiği biyotin ve çinko sayesinde köpeklerin ve kedilerin deri ve tüy sağlığını destekleyen; barındırdığı vitamin, mineral ve proteinler ile genel sağlığı korumaya yardımcı olan tablet formunda bir besin takviyesidir. Sağlıklı tüy gelişimini destekler ve tüy dökülmesinin azalmasına yardımcı olur. Tüylerin parlak, sağlıklı ve yumuşak olmasını sağlamasının yanı sıra esnek ve kepekten arınmış bir cilde sahip olmalarına da yardımcı olur. 
