INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_gimpet-kediler-icin-malt-soft-extra-20gr.html', 'GimCat Malt-Soft Extra Tüy Yumağı Önleyici Kedi Macunu 20gr', 'Kedi Ürünleri-Çok Satanlar-Gimpet Çok Satanlar', '4002064407524', '', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_gimpet-firsat-petshop-urunleri-2921436.jpg', '30.04.2024', 'Saf ve doğal aromatik malt, özel altın sarısı bitkisel yağ, diyet lifler ve yüksek seviyeli TGOS trans-galaktooligosaccharide katkılı laktoz türevi içerir. Kediler yalanma sonucunda tüylerini yutarlar, bu tüyler zaman içerisinde mide ve barsakta birikerek önemli sindirim sorunlarına yol açabilir. Gimpet Malt Soft Ekstra içerisindeki doğal yağlar ve yüksek kalitedeki malt özleri sayesinde yutulmuş olan tüy yumakları ve diğer sindirilemeyen bileşenlerin doğal yollar ile vücuttan atılması sağlanır. Diyet lifler barsaktaki iyi bakteriler için uygun bir besin kaynağıdır, bu sayede barsak lümeninde bulunan iyi bakterilerin sayısını arttırarak barsak hareketliliğine yardımcı olurlar. Bu ürün Almanya_da üretilmiştir.', 'Gimpet' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_gimcat-energy-enerji-ihtiyacini-karsilayan-sekersiz-kedi-macunu-50gr.html', 'GimCat Energy Enerji Yükseltici Şekersiz Kedi Macunu 50gr', 'Kedi Ürünleri-Vitaminler ve Ek Besinler-Macun ', '4002064421711', '169 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_gimpet-kedi-macun-odulleri-182282145.jpg', '30.01.2024', 'Kedilerin enerji ihtiyaçları yaşına, aktivite düzeyine, ırkına, mizacına ve çevre koşullarına göre farklılık gösterebilir ve bir kedinin hayatı boyunca enerji ve besin gereksinimlerinin arttığı durumlar olabilir. Bu macun yüksek kaliteli yağlar ve önemli fonksiyonel bileşenler formunda oldukça konsantre enerji içerir. İçeriğinde, temel vitaminler, belirli eser elementler ve özenle seçilmiş mineraller bulunmaktadır. Enerji destekleyici formülüyle, kedinize güç ve enerji verecektir. L-karnitin enerji üretimini destekler. Beta-glukanlar ve 13 vitamin bağışıklık sistemini güçlendirir. Beyaz balık proteini kolayca sindirilebilir bir protein kaynağı görevi görür. Çinko, biyotin ve B vitaminleri sağlıklı bir cildi ve tüyleri destekler. Yüksek kaliteli keten tohumu yağı hücre korumasını destekler. Demir, kan oluşumunu destekler. Manganez ve kalsiyum kemik metabolizmasını destekler. İlave şeker, yapay renklendiriciler, koruyucu maddeler, lezzet arttırıcılar ve laktoz içermez. Her 1 kg vücut ağırlığı için 3 cm_lik bir tutam macun (yaklaşık 1,5 g) doğrudan tüpten veya yiyeceklere ilave ederek verilmelidir. Oda sıcaklığında besleyin. Lütfen kediniz için her zaman taze içme suyu bulundurun.', 'Gimpet' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_gimcat-duo-multivitamin-paste-peynir-ve-ton-balikli-50gr.html', 'GimCat Duo Multi-Vitamin Ton Balıklı Kedi Macunu 50gr', 'Kedi Ürünleri-Vitaminler ve Ek Besinler-Macun ', '4002064421858', '', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_gimpet-kedi-macun-odulleri-31703437.jpg', '30.10.2024', 'Bağışıklık sistemini güçlendiren 12 önemli vitamin içerir. Bunların başında A,E,B2,B12,Biotin,K3 gelmektedir. A Vitamini: Görme yeteneğini güçlendirir,cildin ve tüylerin sağlıklı kalmasına yardımcı olur. 
