INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_eastland-pelus-fare-ve-toplu-eldiven-kedi-oyuncagi.html', 'Eastland Peluş Fare ve Toplu Eldiven Kedi Oyuncağı', 'Kedi Ürünleri-Kedi Oyuncağı-Peluş Kedi Oyuncağı', '', '72 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_eastland-kedi-fare-oyuncagi-87873322.jpg', '', 'Elinize giyebileceğiniz eldiven şeklinde olan bu oyuncak sayesinde kedinizle vakit geçirmeniz daha keyifli hale gelecekler. Eldivenin ucuna ip ile bağlı olan peluş oyuncaklar bulunmaktadır. Elinizi hareket ettirerek oyuncakları dilediğiniz yöne rahatça hareket ettirebilir, kedinizi bu sayede oynatabilirsiniz. Eldiven evcil dostunuzu ve elinizi tahriş etmeyecek malzemeden üretilmiştir.', 'Eastland' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_bioline-catnipli-kedi-oyun-topu.html', 'Bioline Catnipli Kedi Oyun Topu 3cm', 'Kedi Ürünleri-Kedi Oyuncağı-Catnipli ve Matatabili Oyuncaklar', '6970117121353', '69 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_bioline-kedi-otu-31654343.jpg', '', 'Bioline catnipli kedi oyun topudur. Kediler de diğer birçok tür gibi günlük olarak mutlaka egzersiz yapma ihtiyacı hissederler. Gün içinde genellikle rutin alışkanlıklarını yerine getirdikten sonra hareketsiz kaldıkları için kas gelişimi ve kilo kontrolünün sağlanması açısından kedi oyuncaklarıyla hareket etmeye teşvik edilmeleri hem eğlenceli hem de faydalı bir seçenektir. Bu oyun topunun içerisinde de bulunan catnip kedilerde pozitif davranışlara yönelme eğilimini arttır. Kediniz catnipna yalayarak, koklayarak veya patileriyle oynayarak tepki verebilir. Catnip_i koklayan kediniz çok kısa bir süre içinde sakinleşecek, mırlayacak, oyuncu ve arkadaş canlısı olacaktır. Catnipli oyun topuyla kediniz dakikalarca sıkılmadan zevkle oynayacaktır. Ürün boyutu 3cm_dir.', 'Bioline' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_zampa-catnipli-top-kedi-oyuncagi.html', 'Zampa Catnipli Top Kedi Oyuncağı 5cm', 'Kedi Ürünleri-Kedi Oyuncağı-Catnipli ve Matatabili Oyuncaklar', '', '39 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_zampa-kedi-otlu-oyuncaklar-334484174.jpg', '', 'Kedilerin ağzını temizlemesine, bağırsak sistemini desteklemesine yardımcı olur.  Bu kedi oyuncağı güvenli, saf ve %100 doğal maddelerden üretilmiştir. Hiçbir kimyasal, böcek ilacı veya dolgu maddesi içermez. Islak mama yercesine kedinizin çılgına dönüp yalamasını izleyin. Kedinizin stresini azaltmaya yardımcı olur. Seyahat anında veya kedinizin stresli olduğu bir anda verebilirsiniz. Kedinizin nefesini temizler ve gastrointestinal sağlığının güçlenmesine yardımcı olur. Ürünün Çapı 5 cm_dir', 'Zampa' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_trixie-zilli-ipli-sunger-top-kedi-oyuncagi.html', 'Trixie Zilli İpli Sünger Top Kedi Oyuncağı 80cm', 'Kedi Ürünleri-Kedi Oyuncağı-Top Kedi Oyuncağı', '4011905041339', '112 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-oyuncaklari-44398799.jpg', '', 'Kedinizin gün içerisinde biriken enerjisini keyifli bir şekilde atabilmesi için tasarlanmıştır. Kaliteli elastik ip üzerine dizilmiş 3,5 cm çapında 3 adet sünger top ve 3 adet zil ve tüyden oluşmaktadır. Bu oyuncağın baş tarafında yer alan halkadan oyuncağı parmağınıza takarak kedinizle çok zevkli ve neşeli zaman geçirebilirsiniz. Kedinizin sağlığı için içerisinde kimyasal ve aelrjik madde kullanılmamaktadır.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_eastland-vantuzlu-pelus-fare-kedi-oyuncagi-6x3cm.html', 'Eastland Vantuzlu Peluş Fare Kedi Oyuncağı 6x3cm', 'Kedi Ürünleri-Kedi Oyuncağı-Peluş Kedi Oyuncağı', '', '39 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_eastland-kedi-pelus-oyuncaklar-85333947.jpg', '', 'Vantuz ayaklığı ile sert zemine tutturularak kullanılabilen uç kısmında peluş fare olan kedi oyuncağıdır. Tabanının sabit, ucunun hareketli olması sayesinde kedinizin dikkatini kolayca çekecektir. Bu oyuncak kedinizin av içgüdüsünü harekete geçirir ve uzun süre aktif bir şekilde oyun oynamasını sağlar.', 'Eastland' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_pet-toys-yumusak-top-kedi-oyuncagi-3cm-3-lu.html', 'Pet Toys Yumuşak Top Kedi Oyuncağı 3cm (3_lü)', 'Kedi Ürünleri-Çok Satanlar-Pet Toy_s Çok Satanlar', '', '', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_flip-kedi-top-oyuncagi-128004681.jpg', '', 'Kediniz için salınım yapmayan malzemeden üretilmiştir. Dostunuzun keyifli vakit geçirmesini sağlar. Paket içerisinde 3 adet top bulunur. Ürün karışık renklidir. Stoktaki renk durumuna göre gönderim yapılır.', 'Pet Toy_s' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_trixie-kediotlu-fare-balik-kedi-oyuncagi-9-12cm.html', 'Trixie Kediotlu Peluş Kedi Oyuncağı 9-12cm (Karışık Desenli_Renkli)', 'Kedi Ürünleri-Kedi Oyuncağı-Peluş Kedi Oyuncağı', '4011905407630', '99 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-oyuncaklari-52771699.jpg', '', 'Kumaş içi catnip dolu balık veya fare şeklinde kedi oyuncağıdır. Kedilerin belirli dönemlerinde asabi ve hırçın olmaktadırlar. Bu hırçınlığı evdeki eşyalar yerine bu oyuncaklardan atmaktadırlar. Ürün çeşitli renk ve desenlidir. Tercihinizi not olarak iletmeniz gerekmektedir. Ürün sipariş verildiğinde 1 adet gönderilmektedir. Ürün uzunluğu 9 cm veya 12 cm_ dir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_eastland-ananasli-kedi-otlu-olta-kedi-oyuncagi-44cm.html', 'Eastland Karpuzlu Kedi Otlu Olta Kedi Oyuncağı 44cm', 'Kedi Ürünleri-Kedi Oyuncağı-Olta Kedi Oyuncağı', '', '46 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_eastland-kedi-olta-oyuncagi-80258489.jpg', '', 'Ucunda peluş karpuz olan olta kedi oyuncağıdır. Ucundaki renkli peluş karpuz sayesinde evcil dostunuzun kolayca ilgi alanına girmektedir. Olta oyuncaklar tüylü dostunuzla aranızdaki bağın gelişmesine yardımcı olur. Oyuncağın üzerindeki zil sayesinde kedinizin ilgisini sürekli olarak çekecektir. Ucundaki catnip sayesinde gün içerisinde biriken enerjisini kolayca ve eğlenerek atmasını sağalacak ve oyun oynamayı sevecektir. ', 'Eastland' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_trixie-kedi-kedi-otu-topu-4cm.html', 'Trixie Kedi Otu Topu 4cm', 'Kedi Ürünleri-Kedi Oyuncağı-Catnipli ve Matatabili Oyuncaklar', '4011905455679', '99 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-oyuncaklari-8505346.jpg', '', 'Kediotları kedinizin ilgisini çekerek oyun mekanizmasını harekete geçirecektir. Kediotlarından oluşan oyuncakların kedinizin dikkatini daha çabuk çekmesini enerjisini daha hızlı atmasını sağlayacaktır. Oyuncaklarla oynaması kedinizin eşyalara zarar vermesini engelleyebilir. Tamamen catnip ile kaplanmış plastik toptur.İçerisindeki çıngırak ve üzerindeki catnip sayesinde kedinizin çok severek oynacağı bir toptur. Çıkardığı sesle kedinizin ilgisini çekerken aynı zamanda catnipyla kedinizin vazgeçemeyeceği oyuncağı olacaktır. Ürün oldukça dayanıklıdır. Ürün 4cm ebatlarında olmaktadır.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_hello-kitty-figurlu-tuylu-olta-kedi-oyuncagi-40x8x8cm.html', 'Hello Kitty Figürlü Tüylü Olta Kedi Oyuncağı 40x8x8cm (Kırmızı)', 'Kedi Ürünleri-Ağustos Seçili Ürünler-Hello Kitty ® Ağustos Seçili Ürünler', '', '26,95 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_hello-kitty-kedi-olta-oyuncagi-329475652.jpg', '', 'Patili dostunuz ile keyifle vakit geçirebileceğiniz bir oyuncaktır. Kedinizin avcılık iç güdülerini ortaya çıkararak güzel vakit geçirmesini sağlar. Ürün ölçüleri 40x8x8 cm_dir.', 'Hello Kitty ®' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_tri-xi-e-kedi-otlu-zilli-pelus-oyun-topu-3cm-karisik-renkli.html', 'Trixie Kedi Otlu Zilli Peluş Oyun Topu 3cm (Karışık Renkli)', 'Kedi Ürünleri-Kedi Oyuncağı-Peluş Kedi Oyuncağı', '4011905412313', '', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-top-oyuncagi-15789405.jpg', '', 'Zilli peluş kedi oyun topudur. Oyuncağın içerisindeki catnip sayesinde oyuncak, kedinizin çok daha fazla ilgisini çekecek ve oynmaya teşvik edecektir. Kedinizin topu hem yuvarlayarak hem de yuvarladıkça sesi takip etmesiyle zevkli zaman geçireceği bir oyuncaktır. Ürün çeşitli renklerdedir. Stoktaki renk durumuna göre gönderim sağlanır. Ürün 1 adet üzerinden fiyatlandırılmıştır ve sipariş verildiği takdirde 1 adet gönderim sağlanır. Topun çapı 3 cm_dir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_trixie-kedi-otlu-orgu-top-kedi-oyuncagi-6cm.html', 'Trixie Catnipli Örgü Top Kedi Oyuncağı 6cm', 'Kedi Ürünleri-Kedi Oyuncağı-Catnipli ve Matatabili Oyuncaklar', '4011905040752', '147 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-oyuncaklari-26709488.jpg', '', 'Evcil dostunuzun gün içerisinde biriken enerjisini keyifli bir şekilde atlatması için tasarlanmıştır. İçindeki catnip sayesinde kedinizin dikkatini ve ilgisini çekecek, örgü dokusu sayesinde tırnaklarıyla kolayca yakalayabileceği oyuncaktır. Bu tür oyuncaklar kedinizin av içgüdüsünü harekete geçirir ve uzun süre oyun oynamasını sağlar. Ürün çapı 6 cm_dir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_garfield-figurlu-tuylu-olta-kedi-oyuncagi-40x8x8cm.html', 'Garfield Figürlü Tüylü Olta Kedi Oyuncağı 40x8x8cm (Gri)', 'Kedi Ürünleri-Kedi Oyuncağı-Olta Kedi Oyuncağı', '', '26,95 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_garfield-kedi-olta-oyuncagi-329449133.jpg', '', 'Patili dostunuz ile keyifle vakit geçirebileceğiniz bir oyuncaktır. Kedinizin avcılık iç güdülerini ortaya çıkararak güzel vakit geçirmesini sağlar. Ürün ölçüleri 40x8x8 cm_dir.', 'Garfield ®' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_trixie-tuylu-sesli-pelus-fare-kedi-oyuncagi-9cm.html', 'Trixie Tüylü Sesli Peluş Fare Kedi Oyuncağı 9cm (Karışık Renkli)', 'Kedi Ürünleri-Çok Satanlar-Trixie Çok Satanlar', '4011905411613', '', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-oyuncaklari-47051839.jpg', '', 'Kedinizin gün içerisinde biriken enerjisini keyifli bir şekilde atabilmesini sağlamaktadır. Fare şeklinde olması sayesinde kedinizin doğal avlanma iç güdüsünü tetikleyerek oyuncak ile uzun süre oynamasını sağlar. Aynı zamanda içerisindeki zil ile kedinizin dikkatini çekecektir. Ürünün uzunluğu 9 cm_dir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_eastland-yastikli-pelus-i-oltasi.html', 'Eastland Yastıklı Zilli Peluş Olta Kedi Oyuncağı 55cm', 'Kedi Ürünleri-Kedi Oyuncağı-Olta Kedi Oyuncağı', '', '59 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_eastland-kedi-olta-oyuncagi-80059489.jpg', '', 'Kediniz günlük olarak rutin ve az hareket gerektiren alışkanlıklarının dışında mutlaka egzersiz ihtiyacı da duyar. Bu onların hem eğitimi ve zeka gelişimi hem de kas gelişimi ve kilo kontrolü açısından oldukça önemli ve gereklidir. Kedilerinizin eğlenceli ve güvenli bir şekilde oynayabilmesi amacıyla tasarlanmıştır. Evcil hayvan sağlığına %100 zararsız hammaddelerden imal edilmiştir.  Bu sevimli oyun oltasıyla kedinizle dakikalarca sıkılmadan oynayabilir, evcil dostunuzla keyifli dakikalar geçirebilirsiniz.', 'Eastland' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_rimba-zilli-tuylu-ipli-matatabi-cubuklar-kedi-oyuncagi-35cm-karisik-renkli.html', 'Rimba Zilli Tüylü İpli Matatabi Çubuklar Kedi Oyuncağı 35cm (Karışık Renkli)', 'Kedi Ürünleri-Kedi Oyuncağı-Tüylü Kedi Oyuncağı', '', '39 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_rimba-kedi-otlu-oyuncaklar-24615650.jpg', '', 'Matatabi bitkisi %100 doğaldır ve kediler için oldukça neşe verici ve ilgi çekici bir bitkidir. Matatabinin uzun zamandır kedilerde rahatlatıcı bir etki yarattığı bilinmektedir. Genellikle yuvarlanma, çene ve yanak sürtünmesi ve zıplama gibi eğlenceli hareketlere sebep olur. Çiğneme dürtüsü ile kediniz matatabi çubukları doğal bir diş fırçası gibi kullanmaya başlar. Matatabinin keyif verici etkileri dışında kedilerin diş ve diş eti sağlığını da olumlu etkilemekte, dişlerin temizlemesine ve plak oluşumunu azaltmaya yardımcı olmaktadır. Kaliteli malzemeden yapılmış tüy ve zil kedinizin ilgisini çeker ve uzun süre sıkılmadan oyun oynamasını sağlar. Ürünün uzunluğu 35 cm_dir. Patili dostumuzun matatabi oyuncağı ile daha keyifli vakit geçirebilmesi için matatabi çubuğunun ucuna küçük bir çentik atın ya da sıcak suyla ıslatın. Bu işlem çubuktaki matatabi kokusunun yayılmasına ve patili dostunuzun oyuncağa ilgi duymasına yarayacaktır.', 'Rimba' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_rimba-zilli-tuylu-yayli-olta-kedi-oyuncagi-90cm.html', 'Rimba Zilli Yaylı Olta Kedi Oyuncağı 90cm (Karışık Renkli)', 'Kedi Ürünleri-Çok Satanlar-Rimba Çok Satanlar', '', '', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_rimba-kedi-olta-oyuncagi-32419274.jpg', '', 'Kedinizle birlikte keyifle vakit geçirmeniz için esnek kedi oltasıdır. İstediğiniz gibi katlanıp bükülebilir.  Oltanın ucundaki tüyler ve zil sayesinde kedinizin dikkatini kolayca çekebilirsiniz. Sağlam malzemeden üretilmiştir.', 'Rimba' );
