INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_garfield-figurlu-tuylu-olta-kedi-oyuncagi-40x8x8cm-2.html', 'Garfield Figürlü Tüylü Olta Kedi Oyuncağı 40x8x8cm', 'Kedi Ürünleri-Ağustos Seçili Ürünler-Garfield ® Ağustos Seçili Ürünler', '', '', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_garfield-kedi-olta-oyuncagi-329509521.jpg', '', 'Patili dostunuz ile keyifle vakit geçirebileceğiniz bir oyuncaktır. Kedinizin avcılık iç güdülerini ortaya çıkararak güzel vakit geçirmesini sağlar. Ürün ölçüleri 40x8x8 cm_dir.', 'Garfield ®' );
