INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_mp-kapakli-hazneli-kedi-kumu-kuregi-28x10x4cm.html', 'Mp Bergamo Kapaklı Hazneli Kedi Kumu Küreği 28x10x4cm (Karışık Renkli)', 'Kedi Ürünleri-Kedi Tuvaleti-Kum Küreği', '', '83 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_mp-bergamo-kum-kuregi-80856416.jpg', '', 'Kedinizin kumunu kolayca temizleyebilmenizi sağlayan, hazneli kum küreğidir. Kumu haznenin içine alıp küreği hafifçe salladıktan sonra temiz kumlar deliklerden aşağıya süzülür ve içerisinde kalan atıkları kolayca ayırabilirsiniz. Kum israfının önüne geçen bir üründür. Sağlam plastikten üretildiği için uzun süreli kullanıma uygundur. Kolay temizlenebilir.', 'Mp Bergamo' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_kum-toplayan-elekli-kedi-kumu-paspasi-pembe-58x76cm.html', 'Pets Kum Toplayan Elekli Kedi Kumu Paspası 58x76cm (Pembe)', 'Kedi Ürünleri-Kedi Tuvaleti-Tuvalet Önü Paspası', '', '449 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_pets-kedi-tuvalet-onu-paspaslari-75515701.jpg', '', 'Kediler için elekli kedi tuvaleti önü paspasıdır. Kedinizin tuvalet kabının önüne koyarak kullanmanız kolaylık ve hijyen sağlar. Kedileriniz kumdan çıktıktan sonra patilerine yapışmış olan kumların eve dağılmasını önler. Tuvalet kabından dışarı taşan kumları toplar ve kolayca temizlemenize yardımcı olur. Elekli olması sayesinde, kum ilk katmandaki deliklerden geçerek içeride birikir. İç kısmında kalan bu kumu yeniden kedi tuvaleti kabına dökebilirsiniz. Ürün rengi; pembedir.', 'Pets' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_eurocat-kedi-tuvaleti-onu-paspasi-koyu-60x45cm-koyu-yesil.html', 'EuroCat Kedi Tuvaleti Önü Paspası 60x45cm (Koyu Yeşil)', 'Kedi Ürünleri-Kedi Tuvaleti-Tuvalet Önü Paspası', '', '145 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_eurocat-kedi-tuvalet-onu-paspaslari-173402675.jpg', '', 'Tuvalet önü paspası, kedinizin ev içinde patisinde kalan kumları temizlemek ve etrafa saçılmasını engellemek için harika bir çözümdür.  Bu yumuşak paspas, sentetik liflerden yapılmıştır ve özellikle hassas kediler için oldukça uygundur. Paspasın temizliği oldukça kolaydır, elinizle silkeleyerek veya elektrikli süpürgeyle temizliğini sağlayabilirsiniz. Bu şekilde kumdan kolaylıkla arınacaktır. Üretildiği malzemenin dayanıklılığı sayesinde uzun süreli kullanım ömrü vardır. Koyu yeşil renklidir.', 'EuroCat' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_catit-tuvalet-kabinleri-icin-karbon-filtre-2-li.html', 'Catit Tuvalet Kabinleri için Karbon Filtre (2_li)', 'Kedi Ürünleri-Kedi Tuvaleti-Kapalı Kedi Tuvaletleri', '', '239 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_catit-kapali-kedi-tuvaleti-126582660.jpg', '', 'Catit markalı kapalı kedi tuvaletleri için üretilmiş yedek karbon filtredir. Tuvaletin filtre yerine takarak kötü kokuları engellemesini sağlayabilirsiniz. 6 ayda 1 tuvaletinizin filtresini değiştirmenizi öneririz.', 'Catit' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_trixie-zilli-kedi-otlu-pelus-kedi-oyuncagi.html', 'Trixie Zilli Peluş Kedi Oyuncağı 4cm (Karışık Renkli)', 'Kedi Ürünleri-Çok Satanlar-Trixie Çok Satanlar', '4011905412610', '', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-top-oyuncagi-11523068.jpg', '', 'Ucundaki ipler sayesinde kedinizin hemen dikkatini çekecektir. Kediniz, enerjisini hiç sıkılmadan bu top ile atabilir ve eğlenceli zamanlar geçirebilir. Hem oyun hem de avcılık iç güdülerinin gelişmesine ve refleksleinin artmasına yardımcı olur. Ürün çeşitli renklerdedir, stok durumuna göre gönderim yapılır. 4 cm batlarındadır. ', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_misa-acik-elekli-kedi-tuvaleti-54x38x16cm.html', 'Miso Açık Elekli Kedi Tuvaleti 54x38x16cm', 'Kedi Ürünleri-Kedi Tuvaleti-Elekli ', '', '619 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_miso-acik-kedi-tuvaleti-58013749.jpg', '', 'Mükemmel elekli tasarımı sayesinde zahmetsiz ve çok kolay bir şekilde idrar ve dışkıyı ayırabilirsiniz. Kedilerimiz tuvalet ihtiyaçlarını giderirken etrafın temiz kalmasını sağlar. Esnek ve dayanıklı plastikten imal edilmiştir. 100% salınımsız materyal kullanılmıştır, güvenle kullanabilirsiniz. Temizlik için sadece ılık su ve sabun kullanmanız yeterlidir.', 'Miso' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_moderna-kedi-kumu-kuregi-26-5cm-gri-1.html', 'Moderna Kedi Kumu Küreği 26,5cm (Gri)', 'Kedi Ürünleri-Kedi Tuvaleti-Kum Küreği', '', '26,95 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_moderna-kum-kuregi-174908302.jpg', '', 'Kediler için hijyenik ve pratik bir temizlik sağlayan, kedi kum küreğidir. Temizliği kolaylaştırmak için tasarlanmıştır. Rahat kullanım için ergonomik sap. Ilık sabunlu su ile kolay temizlik. Kürek kullanmak hem kedi kumunun daha uzun süre dayanmasını hem de kötü kokulardan kurtulmayı sağlar! BPA içermeyen, toksik olmayan ve +%98 geri dönüştürülmüş birinci sınıf plastikten üretilmiştir!', 'Moderna' );
