INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_trixie-kedi-tirmalama-kulesi-40x100cm.html', 'Trixie Kedi Tırmalama Kulesi 40x100cm', 'Kedi Ürünleri-Kedi Evi & Yuvası-Trixie Kedi Evi & Yuvası', '4047974043387', '11.401,15 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-tirmalama-tahtasi-18034079.jpg', '', 'Dış yüzeyi tamamen tırmalamaya uygun malzeme ile kaplı, kule dış yüzeyi üzerindeki delikleri uzun tüylü peluş ile kaplıdır. İçerisinde peluş kaplı katları mevcuttur. İçerisinde dört bölüm vardır ve peluş ile kaplıdır. Elastik ip ucuna bağlı oyuncağı vardır. Kahverengi_krem rengindedir. Kedinizi bu ürüne alıştırmak için Trixie_nin 4238 ve 4241 kodlu catnip spreyi ( catnip ) ürününü kullanabilirsiniz. Catnip kedinizin ürüne karşı merakını arttıracaktır. Kediniz catnip kokusunu aldığında rahatlamış ve sakinleşmiş olarak ürünü benimseyecektir. Kedinizi herhangi bir ürüne alıştırmak için oldukça etkili bir yöntemdir. Özellikle taşıma kaplarında taşıma kabını seyahatten önce kedinizle tanıştırmanız ve ürüne güven duymasını sağlamanız çok önemlidir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_trixie-kedi-tirmalama-ve-oyun-evi-64cm-gri.html', 'Trixie Kedi Tırmalama ve Oyun Evi 64cm (Gri)', 'Kedi Ürünleri-Tırmalama Tahtası ve Evleri-Tırmalama Tahtalı Kedi Evleri', '4011905444338', '3.399 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-tirmalamali-kedi-evi-256071848.jpg', '', 'Kaliteli pleuştan ve doğal sisal kullanılarak üretilmiş kedi tırmalama ve oyun evidir. İç bölümünde yer alan kedilerin en sevdiği şekilde tasarlanmıştır. İç köşesinde yatan kedi dışarıyı rahatlıkla görebilmkte, takip edebilmekte, ancak dışarıdan içeri bakıldığında kedi görülmemektedir. Üst tarafında yer alan yatağın altı kedi oyuncakları vb. depolama alanı olarak kullanılabilir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_trixie-kedi-otlu-ve-toplu-tirmalama-tahtasi-64x11x37cm-gri.html', 'Trixie Catnipli Kedi Tırmalama Kartonu 64x11x37cm (Gri)', 'Kedi Ürünleri-Tırmalama Tahtası ve Evleri-Tırmalama Kartonları', '4011905480312', '1.599 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-tirmalama-paspaslari-130829570.jpg', '', 'Özellikle büyük kediler için uygundur. İçeriğinde catnip bulunur ve catnip patili dostunuzun dikkatini çekerek teşvik eder.   Kediniz hem oyun hem de tırmala ihtiyacını tek bir ürünle giderebilir. Şık tasarımı sayesinde kullanacağınız alana uyum sağlar. Dayanıklı mukavvadan üretilmiştir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_trixie-kediler-icin-catnipli-oyun-toplu-karton-ve-ahsap-tirmalama-oyuncagi-25x46x4cm.html', 'Trixie Kediler için Catnipli Oyun Toplu Karton ve Ahşap Tırmalama Oyuncağı 46x25x4cm', 'Kedi Ürünleri-Tırmalama Tahtası ve Evleri-Oyuncaklı Tırmalama Tahtaları', '4011905480206', '819 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-oyuncakli-tirmalamalar-223682353.jpg', '', 'Ahşaptan üretilmiş ortasında kedi tırmalama kartonu ve çevresinde kedinin dışarı çıkaramayacağı ama çıkarmak için uğraştıkça zevk alacağı kedi tırmalama ve oyuncağıdır. Ortasında kedi tırmalama kartonu ve çevresinde kedinin dışarı çıkaramayacağı ama çıkarmak için uğraştıkça zevk alacağı toplar mevcuttur. Ürünün ortasındaki karton tırmalama eskidiğinde Trixie 48021-10 kodlu ürün satın alınarak değiştirilebilir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_trixie-kedi-otlu-silindir-karton-tirmalama-tahtasi-64x11x37cm-acik-gri.html', 'Trixie Kedi Otlu Silindir Tırmalama Kartonu 64x11x37cm (Açık Gri)', 'Kedi Ürünleri-Tırmalama Tahtası ve Evleri-Tırmalama Kartonları', '4011905480305', '1.299 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-tirmalama-paspaslari-13083459.jpg', '', 'Özellikle büyük kediler için üretilmiştir. İçeriğinde bulunan catnip dostunuzun dikkatini çekerek tırmalama tahtasına yönlendirir. Kediniz tırmalama ihtiyacı ve tırnak bakımı için tırmala tahtasına ihtiyaç duyar. Eşyalarınız yerine tırmalama tahtası kullandırırsanız eşyalarınızın zarar görmesini engellersiniz. Şık tasarımı sayesinde kullanacağınız alana uyum sağlar. Dayanıklı mukavvadan üretilmiştir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_ultra-care-silver-ions-hassas-kediler-icin-parfumsuz-bentonit-kedi-kumu-8lt.html', 'Ultra Care Küçük Irk ve Yavru Kediler İçin İnce Taneli Bahar Kokulu Bentonit Kedi Kumu 8lt', 'Kedi Ürünleri-Kedi Kumu-Doğal Bentonit Kedi Kumu', '', '129 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_ultra-care-dogal-kedi-kumu-332297242.jpg', '', 'Üründe, yapıları küçük olan kedilerin ya da yavru kedilerinizin kumu kazmalarını ve tuvaletlerini örtmelerini kolaylaştırmak için granül boyları küçültülmüştür.  Ayrıca kötü kokuları nötralize etme özelliği olan bir bahar kokusu ile koku kontrolü etkinliği artırılmıştır. Ultra güçlü topaklanma özelliği vardır. Ürün %99,5 tozsuzdur. Bentonit madeni, yapısı gereği tozludur ve aslen bir çeşit kildir. Kedi kumlarımız tozdan arındırılmak için pek çok işlemden geçse de %100 tozsuz olması mümkün değildir.', 'Ultra Care' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_trixie-kedi-tirmalama-ve-oyun-evi-176cm-gri-xxl.html', 'Trixie Kedi Tırmalama ve Oyun Evi 176cm (Gri) [XXL]', 'Kedi Ürünleri-Tırmalama Tahtası ve Evleri-Tırmalama Tahtalı Kedi Evleri', '4011905446615', '28.502,88 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-tirmalamali-kedi-evi-217592957.jpg', '', 'Özellikle büyük kediler için ideal kedi tırmalama ve oyun evidir. İçindeki yatak sayesinde kedinin tüm ihtiyaçlarını karşılayan özelliklere sahiptir. Geniş,kalın ve ağır taban alanı sayesinde dengelidir. Üzerindeki merdiven sayesinde kedinin günlük doğal hareketlerini yapmasına yardımcı olur ve kedinin sağlıklı kalmasını sağlar. En üstte açık yatağı ve kutu içerisinde ise gizli yatağı vardır. Üst yatağın altındaki halat oyuncağı ile kedinin üzerinde oyun oynayabileceği özgün bir tasarımdır. Ürünün yüksekliği 176 cm_dir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_trixie-kedi-tirmalama-ve-oyun-evi-77cm-gri-kum-beji.html', 'Trixie Kedi Tırmalama ve Oyun Evi 77cm (Gri_ Kum Beji)', 'Kedi Ürünleri-Tırmalama Tahtası ve Evleri-Tırmalama Tahtalı Kedi Evleri', '4047974447413', '8.345,03 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-tirmalamali-kedi-evi-256012020.jpg', '', 'Ahşap bölümleri gri boyalı ve vernikli plywoodtan üretilmiş kedi oyun evidir. Kullanılan tüm malzemeler kedi sağlığına zarar vermeyecek, Avrupa Birliği standartlarındadır. yun evi içerisinde yer alan her üç yatakta çift taraflı kullanılabilir ve elde yıkanabilir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_trixie-kedi-tirmalama-tahtasi-97cm-bej-xxl.html', 'Trixie Kedi Tırmalama Tahtası 97cm (Bej) [XXL]', 'Kedi Ürünleri-Tırmalama Tahtası ve Evleri-Çubuk Tırmalama Tahtaları', '4011905447155', '4.599 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-cubuk-tirmalamalar-217927554.jpg', '', 'Trixie kedi tırmalama tahtası kedinizin tırnaklarını kaşımasını ve enerjisini atmasını sağlar. Tırmalama alanı hariç diğer tüm alanları doğal ahşaptır. Ürünün yüksekliği 97 cm_dir.', 'Trixie' );
