INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_trixie-oyuncakli-kedi-tirmalamasi-48x25cm-pembe.html', 'Trixie Oyuncaklı Kedi Tırmalaması 48x25cm (Pembe)', 'Kedi Ürünleri-Tırmalama Tahtası ve Evleri-Oyuncaklı Tırmalama Tahtaları', '4011905480053', '619 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-tirmalama-tahtasi-62247016.jpg', '', 'Kalın mukavvadan üretilmiş kedi tırmalama tahtasıdır. Hem yavru hem yetişkin kediler için uygundur. İçerisinde kedinizin alışmasını kolaylaştıracak 2 adet toplu oyun kısmı bulunmaktadır. Kediniz oyun oynarken tırmalama tahtasına kolaylıkla alışacaktır.  Boyutları 48 cm ile 25 cm_dir.', 'Trixie' );
