INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_trixie-kedi-tirmalama-tahtasi-59x21cm.html', 'Trixie Kedi Tırmalama Tahtası 59x21cm', 'Kedi Ürünleri-Tırmalama Tahtası ve Evleri-Çubuk Tırmalama Tahtaları', '4011905431611', '479 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-tirmalama-tahtasi-10418190.jpg', '', 'Duvara veya kapı koluna asabileceğiniz, kedi şeklinde tırmalama tahtası. Kedinizi bu ürüne alıştırmak için Trixie_nin 4238 ve 4241 kodlu catnip spreyi ( catnip ) ürününü kullanabilirsiniz. Catnip kedinizin ürüne karşı merakını arttıracaktır, kediniz catnip kokusunu aldığında rahatlamış ve sakinleşmiş olarak ürünü benimseyecektir. Kedinizi herhangi bir ürüne alıştırmak için oldukça etkili bir yöntemdir. Özellikle taşıma kaplarında taşıma kabını seyahatten önce kedinizle tanıştırmanız ve ürüne güven duymasını sağlamanız çok önemlidir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_flamingo-fare-seklinde-kedi-tirmalamasi-33-cm.html', 'Flamingo Fare Şeklinde Kedi Tırmalaması 33cm', 'Kedi Ürünleri-Ağustos Seçili Ürünler-Flamingo Ağustos Seçili Ürünler', '', '469 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_flamingo-kedi-oyuncakli-tirmalamalar-2680798.jpg', '', 'Fare şekli sayesinde kedinizin uzun süre eğlenceli vakit geçirmesini sağlar. Kedinizin koltuk, perde veya halı gibi alanları tırmalamasını engellemek için kullanmanızı tavsiye ederiz. Ürün uzunluğu 33 cm_dir.', 'Flamingo' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_trixie-oyuncakli-kedi-tirmalama-tahtasi-38x30cm-beyaz.html', 'Trixie Oyuncaklı Kedi Tırmalama Kartonu 38x30cm (Beyaz)', 'Kedi Ürünleri-Tırmalama Tahtası ve Evleri-Tırmalama Kartonları', '4011905480060', '639 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-tirmalama-tahtasi-62214371.jpg', '', 'Kalın mukavvadan üretilmiş kedi tırmalama kartonudur. Hem yavru hem yetişkin kediler için uygundur. İçerisinde kedinizin alışmasını kolaylaştıracak 2 adet toplu oyun kısmı bulunmaktadır. Kediniz oyun oynarken tırmalama kartonuna kolaylıkla alışacaktır.  Ürün ölçüleri 38x30 cm_dir.', 'Trixie' );
