INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_trixie-elektromanyetik-kedi-kapisi-21-1x24-4cm.html', 'Trixie Elektromanyetik Kilit Kontrollü Kedi Kapısı 21,1x24,4cm', 'Kedi Ürünleri-Kedi Kapısı-Trixie Kedi Kapısı', '4011905038698', '1.799 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-kapisi-76728310.jpg', '', 'Sadece evin kedilerinin içeri girebilmelerini sağlayan elektromanyetik kilit kontrollu kedi kapısıdır. Özel conta sistemi sayesinde sessiz bir kedi kapısıdır. Şeffaf flap kapısı vardır. Kedinizin boynundaki tasmaya takacağınız magnet sayesinde kapı sadece boyun tasmasında magnet olan kedilere açılmakta, böylece yabancı kedilerin girişi önlenmektedir. Kedi kapısı tünel elemanı kutu içerisinde bulunmkatadır. Kapı kalınlığı 10-35mm olan kapılarda kullanılabilir. İlave tünel parçası alarak daha kalın kapılarda da kullanılabilir. Ölçüsü 21,1x24,4cm dir. Kapı üzerinde kesilmesi gereken boşluk 16,5x21,6cm dir. Kedinin girip çıkacağı flap kapı ölçüsü 14,7x15,8cm dir. Pil ile çalışmaktadır. ( 9V pil kutuya dahil değildir. ) ', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_trixie-plastik-cift-yonlu-kedi-kapisi-20x22cm-beyaz.html', 'Trixie Plastik Çift Yönlü Kedi Kapısı 20x22cm (Beyaz)', 'Kedi Ürünleri-Kedi Kapısı-Trixie Kedi Kapısı', '4047974442012', '679 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-kapisi-104792051.jpg', '', 'Cam duvarlar ve kapılar hariç tüm kapılarda kullanılabilecek çift yönlü kedi kapısıdır. Kedi kapısı plastik ve şeffaftır. İstenildiğinde çift yönlü kilitlenebilir kedi kapısıdır. Kilit Sistemi: giriş ve çıkış, kilitli. 20-25 mm kapı kalınlığı olan bütün kapılar için uygundur. Daha kalın kapılarda kullanabilmeniz için ilave tünel elemanı satın alınabilir. Ürünün montajı kolaydır. Dış hava koşullarına dayanıklıdır. İstediğiniz takdirde kedi kapısı tamamen kilitlenebilmektedir. Kapı montajı için kapıda kesilerek açılması gereken alan 19.7x21.7 cm_dir.', 'Trixie' );
