INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kucuk-kopek-ve-kedi-kutusu-31x33x50cm-xs.html', 'Trixie Küçük Irk Köpek ve Kedi Taşıma Kutusu 31x33x50cm [XS]', 'Köpek Ürünleri-Bakım ve Temizlik Ürünleri-Bahçe Ürünleri', '4011905396910', '1.069 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-araba-urunleri-22553700.jpg', '', 'Köpeğiniz ve kediniz için evde, yolculuk sırasında, tatilde ve yarışmalarda ideal ve güvenli bir yerdir. Katlanarak çanta şeklinde taşınabilir. İki tarafında ve kapısındaki dayanıklı file bölüm sayesinde köpeğiniz veya kediniz içerisinde yatarken etrafını görebileceği için çok rahat edecek ve huzur duyacaktır. Dilerseniz kapısını üst tarafa rulo yaparak cırt cırtı ile sabitleyebilir ve mini bir kulübeye çevirebilirsiniz. Tabanında yer alan özel kopça bölümleri ile bagaja sabitlenebilir. Arka tarafındaki cebi çok kullanışlıdır. Nemli bezle silerek kolayca temizlenebilir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kucuk-kopek-ve-kedi-kutusu-32x32x47cm-xs.html', 'Trixie Küçük Köpek ve Kedi Kutusu 32x32x47cm [XS]', 'Köpek Ürünleri-Bakım ve Temizlik Ürünleri-Bahçe Ürünleri', '4011905397016', '1.299 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-araba-urunleri-22528671.jpg', '', 'Köpeğiniz ve kediniz için evde, yolculuk sırasında, tatilde ve yarışmalarda ideal ve güvenli bir yerdir. Katlanarak çanta şeklinde taşınabilir. İki tarafında ve kapısındaki dayanıklı file bölüm sayesinde köpeğiniz veya kediniz içerisinde yatarken etrafını görebileceği için çok rahat edecek ve huzur duyacaktır. Dilediğinizde yan pencerelerini kapatabileceğiniz dış perdeleri vardır. Bu perdeler cırt cırt ile üst tarafa toplanabilir veya kapıtılabilir. Her iki yanında pencerelerinin altında cepleri vardr.Dilerseniz kapısını üst tarafa rulo yaparak cırt cırtı ile sabitleyebilir ve mini bir kulübeye çevirebilirsiniz. Dilerseniz tabanından yere sabitleyebilirsiniz. Üst tarafında kaldırıp taşıyabileceğiniz tutma yeri vardır. İçerisinde ki taban bölümü pleuş kaplıdır. Dış ve peluş iç yatağı elde yıkanabilir. Aynı zamanda nemli bezle silerekte çok kolay temzilenebilir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_zampa-suya-dayanikli-plastik-kopek-kulubesi-64x62cm.html', 'Zampa Suya Dayanıklı Plastik Köpek Kulübesi 64x62cm', 'Köpek Ürünleri-Köpek Kulübesi-Plastik Kulübe', '', '1.169 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_zampa-plastik-kopek-kulubesi-336228947.jpg', '', 'Plastik hammedden üretilmiştir. Dış mekanda kullanıma uygundur. Yağmur, nem ve güneş ışınlarına dayanıklıdır. Ahşap ürünlere nazaran daha hafiftir. Toplamda 7 kg ağırlığa sahiptir. Demonte özelliği ile kolay taşıma imkanı sağlar, 8 parçadan oluşmaktadır. Ürün ölçüleri 64x62 cm_dir.', 'Zampa' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kopek-kulube-kapisi-34x52cm.html', 'Trixie Köpek Kulübe Kapısı 34x52cm', 'Köpek Ürünleri-Köpek Kulübesi-Ahşap Kulübe', '4011905395739', '669 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-kulubesi-40314340.jpg', '', 'Köpeğinize almış olduğunuz 39553 kodlu kulübeye uyumlu köpeğinizi rüzgar ve soğuğa karşı koruyacak özel termoplastik flap kapı. Montajı için gerekli olan vidaları ilavedir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_bioline-kopek-tuvalet-egitim-spreyi-50ml.html', 'Bioline Köpek Tuvalet Eğitim Spreyi 50ml', 'Köpek Ürünleri-Eğitim Ürünleri ve Ekipmanları-Tuvalet Eğitim Spreyi', '6970117120271', '86 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_bioline-kopek-yavrusu-bakimi-urunleri-17597297.jpg', '', 'Özellikle evde beslenen köpekler için en önemli eğitim, tuvalet eğitimidir. Bioline Puppy Training Sprey, yavru köpeklerde tuvalet alışkanlığı sağlamak için kullanılır. Kapalı mekanlarda (ev, ofis vb.) kullanımı daha sağlıklı sonuçlar verir. Köpeğinizin tuvaletini yapmasını istediğiniz bölgeye birkaç kere uygulayınız.', 'Bioline' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_sherlock-pets-kucuk-irk-kopek-kundagi-22-33cm-xxs.html', 'Sherlock Pets Küçük Irk Güvende Hissettiren Köpek Kıyafeti 22-33cm (Gri) [XXS]', 'Köpek Ürünleri-Köpek Elbise ve Galoşları-Koruyucu Elbise', '', '103,95 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_sherlock-pets-kopek-stok-fazlasi-60462660.jpg', '', 'Yavru Köpekler, Kediler, Teacup Irklar Pet Kundağı stresli zamanlarda evcil dostlarınızı rahatlatmada yardımcı olur. Yüksek sesli ortamlar, hiperaktivite, araç yolculukları, kapalı ortamlar, ayrılık anksiyetesi, aşırı havlama, gök gürültüsü, titreme gibi sorunlarda evcil dostunuzu sararak onun kendisini güvende hissettirir. Pet Kundağı_nın SherlockPets baskılı tarafını evcil dostunuzun boynunun üstüne gelecek şekilde sırtına yerleştirin. 
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_zampa-metal-kopek-citi-75x70cm-beyaz.html', 'Zampa Metal Köpek Çiti 75x70cm (Beyaz)', 'Köpek Ürünleri-Eğitim Ürünleri ve Ekipmanları-Köpek Çiti', '', '709 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_zampa-kopek-citi-337634058.jpg', '', 'Dış mekan ve iç mekanlarda kullanıma uygun köpek çiti, köpeklerde tuvalet eğitimi amacıyla alan sınırlandırmak için de kullanılır. Aşı takip sürecinde açık havada tecrit amaçlı kullanılabilir. Paneller isteğe bağlı olarak altıgen, kare veya dikdörtgen şekilli kullanılabilmektedir.', 'Zampa' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kopek-tasima-kafesi-88x58x51cm-m.html', 'Trixie Plastik Metal Kapılı Köpek Taşıma Kafesi 88x58x51cm [M]', 'Köpek Ürünleri-Köpek Taşıma Çantası-Kafes', '4011905394138', '4.299 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-tasima-cantasi-21654229.jpg', '', 'Kaliteli ve sağlam plastikten üretilmiştir. Darbelere karşı dayanıklıdır. Yanlarında bulunan eğimleri sayesinde SUV, 4x4 ve istasyon vagon araçlarının bagajlarında rahatlıkla kullanılabilir. Kapıları metal alaşımdan yapılmıştır. Kapağın yukarı doğru katlanarak açılması sayesinde dostlarınızın girip çıkması rahat ve kolay olur. Izgaraları sayesinde çantanın içinde hava sirkülasyonu sağlar ve dostunuz çantanın içinde havasız kalmaz.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_gulliver-kopek-tasima-kafesi-vi-92cm.html', 'Trixie Gulliver Metal Kapılı Plastik Köpek Taşıma Kafesi 64x64x92cm', 'Köpek Ürünleri-Köpek Taşıma Çantası-Kafes', '8003507974609', '7.080,83 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-tasima-cantasi-18398568.jpg', '', 'Kara, deniz ve hava yolu seyahatlerinizde dostunuz için kullanabileceğiniz bir taşıma kafesidir. Kilitlenebilir galvaniz materyalli kapıya ve kapının içerisine koyabileceğiniz mama ve su kabına sahiptir. IATA(Uluslararası Hava Taşımacılığı Birliği) tarafından onaylanmıştır. Ek ürün olarak tekerlekler isteğe göre takılıp çıkarılabilen yapıya sahiptir. Dostunuzu rahatça gezdirebilmeniz için üst tarafına bir çekme sapı bulunur.  ', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_trixie-kedikopek-plastik-depolu-mamasu-kabi-600ml.html', 'Trixie Kedi ve Köpekler İçin Plastik Hazneli Mama ve Su Kabı 20cm 600ml (Karışık Renkli)', 'Kedi Ürünleri-Kedi Mama ve Su Kabı-Hazneli Mama ve Su Kabı', '4011905247618', '147 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-hazneli-kedi-mama-ve-su-kabi-11239250.jpg', '', 'Şeffaf opak haznesi sayesinde seviye kontrolunu kolayca yapabileceğiniz kediler içinde kullanılabilen plastik su ve mama kabıdır. Kaliteli plastik malzemeden üretilmiştir ev uzun yıllar kullanım ömrü sunmaktadır. Temizliği kolay ve hijyeniktir. Elde veya bulaşık makinasında kolayca temizlenebilir. İnsan ve hayvan sağlığına %100 zararsız malzemelerden üretilmiştir. Ürün teklidir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kopek-tasima-galvaniz-kafes-93x69x62cm.html', 'Trixie Galvanez Metal Köpek Taşıma Kafesi 93x69x62cm', 'Köpek Ürünleri-Köpek Taşıma Çantası-Kafes', '4011905039244', '4.119 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-tasima-cantasi-18882652.jpg', '', 'Sağlam ve dayanıklı galvanizli materyallerden imal edilmiştir. Ön ve yan taraflarda olmak üzere 2 adet kapı bulunmaktadır. Kafesin alt tabanında plastik tepsi bulunmaktadır. Katlanabilir özelliği sayesinde saklaması ve kullanımı çok kolay ve pratiktir. Ameliyatlar sonrası veteriner hekimlerin kullanabileceği bir kafes türüdür. Özellikle kolay katlanma ve az yer kaplaması sayesinde çok kullanışlı bir üründür.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kopek-kimlik-tupu-krom-kaplama.html', 'Trixie Krom Kaplama Köpek Kimlik Tüpü', 'Köpek Ürünleri-Köpek Tasmaları ve Kayışları-Kimlik Tüpü ve Künyeler', '4011905022758', '55 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-tasmalari-kayislari-9177542.jpg', '', 'Kimlik tüpleri köpeğinizin kaybolması durumunda onu daha kolay bulmanız için tasarlanmıştır. Kimlik tüpüne yazacağınız isim, adres ve telefon numarası gibi bilgiler sayesinde köpeğinizi bulan kişi sizinle kolaylıkla iletişim kurabilecektir. Trixie krom kimlik tüpü oldukça dayanıklıdır. Köpeğinizin tasmasına rahatlıkla asabilirsiniz. Köpeğinizi rahatsız etmez. Şık görünümüyle tasmaya uyum sağlar. Gümüş rengindedir.  ', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_beaphar-laveta-carnitine-kopekler-icin-tuy-vitamini-50ml.html', 'Beaphar Laveta Carnitine Köpekler için Tüy Vitamin Damlası 50ml', 'Köpek Ürünleri-Vitamin ve Ek Besinler-Macun', '02.12.2023', '235 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_beaphar-kopek-deri-ve-tuy-bakimi-91304210.jpg', '', 'Köpekler için özel olarak laveta ve carnitin vitamin eksikligini kapatmak için üretilmiş bir damladır. 
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_beaphar-kopek-kalsiyum-tableti-180-tablet.html', 'Beaphar Köpek Kalsiyum Tableti (180 Tablet)', 'Köpek Ürünleri-Vitamin ve Ek Besinler-Tablet', '01.01.2025', '399 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_beaphar-kopek-tablet-vitamin-91132724.jpg', '', 'Köpekler için besin takviyesidir. Kalsiyum tabletleri sağlıklı kemik, diş, deri ve tüy gelişimi için sebze ekstraktları ve yosun ile birleştirilmiş yüksek kaliteli mineralleri içerir. 
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_gimdog-mordimi-natural-press-kemik-9cm-3lu-paket.html', 'GimDog Mordimi Natural Press Kemik 9cm (3_lü)', 'Köpek Ürünleri-Köpek Kemiği-Gimpet Köpek Kemiği', '8009632015712', '58 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_gimpet-press-kemik-29856002.jpg', '30.04.2024', 'Gimdog çiğneme kemikleri köpekler için harika bir ödüldür. Son derece kaliteli ve sağlıklı % 100 hayvan derisinden üretilmiş olan bu kemikler , zengin şekil çeşitliliği ile köpekler için en popüler ödül çeşididir. Köpeklerin kemirme ihtiyaçlarını giderirken aynı zamanda mekanik etkisi sayesinde daha sağlıklı bir diş ve diş eti oluşumunu sağlar. Daha sağlıklı bir diş ve dişetine sahip köpeklerde ağız kokusu oluşmaz. Gimdog Mordimi Çiğneme kemikleri köpeklerin boyu dikkate alınarak verilmelidir.', 'Gimpet' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_pro-choice-kuzu-etli-sekersiz-tahilsiz-ezme-yavru-kopek-konservesi-400gr.html', 'ProChoice Kuzu Etli Şekersiz Ezme Yavru Köpek Konservesi 400gr', 'Köpek Ürünleri-Köpek Konserve Maması-Yavru Köpek Konservesi', '8681465602989', '43 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_pro-choice-yavru-kopek-konservesi-142586415.jpg', '02.01.2025', 'Mineral ve vitaminlerle zenginleştirilmiş kuzu etli leziz ezme, tüm ırk yavru köpekler için dengeli, sağlıklı ve günlük aktiviteleri için gerekli enerji ihtiyacını karşılayan tam bir besindir.  2,5 kg ağırlığındaki bir köpek 380 gr, 5 kg_lık bir köpek 600 gr, 7,5 kg_lık bir köpek 750 gr, 10 kg_lık bir köpek 915 gr, 15 kg_lık bir kpek ise günlük 1180 gr Prochoice konserve mamaya ihtiyaç duyar. Yemek miktarını günlük aktivite ve vücut durumuna göre ayarlayınız. Oda sıcaklığında ve her zaman taze su ile birlikte servis ediniz. Açıldıktan sonra buzdolabında saklayınız ve 72 saat içerisinde tüketiniz. Tavsiye edilen miktarlar ırk, yaş ve mevsimsel faktörlere göre değişkenlik gösterebilir. ', 'ProChoice' );
