INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_wanpy-bi-ftek-ve-tavsan-eti-sargili-yuksek-proteinli-kopek-odulu-85gr.html', 'Wanpy Ördek ve Biftek Eti Sargılı Yüksek Proteinli Köpek Ödülü 85gr', 'Köpek Ürünleri-Köpek Ödül Maması-Atıştırmalık', '28.04.2024', '137 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_wanpy-kopek-atistirmalik-odul-mamasi-156183822.jpg', '', 'Biftek sargılı ödül maması dostlarınızın davranışlarını en iyi şekilde ödüllendirebilmenize olanak sağlar. Yüksek proteinli ve az yağlıdır. Bunun yanı sıra fırında kavrulmuş olması sebebi ile de enfes bir lezzete sahiptir. Yumuşak bir yapısı olan biftek sargılı ödül maması dostunuzun diş sağlığına da katkıda bulunarak plak oluşumunu engeller. Kolayca sindirilebilir içerikten üretilmiştir.', 'Wanpy' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_pedigree-rodeo-tavuklu-kopek-odulu-70gr.html', 'Pedigree Rodeo Biftekli Köpek Ödül Çubuğu 70gr (4_lü)', 'Köpek Ürünleri-Çok Satanlar-Pedigree Çok Satanlar', '08.12.2024', '', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_pedigree-kopek-stick-odul-mamasi-1202471.jpg', '', 'Köpeklar için tamamlayıcı yarısulu ödül mamasıdır. Tüm köpekler için, burgulu, yumuşak formda, kolay taşınabilen 4 adet çubuk içeren,ambalajı ile her an, her yerde kullanabileceğiniz ödül çubukları. Küçük köpekleri (örneğin: Dachshund) haftada 3 çubuğa kadar besleyebilirsiniz. Orta boy köpekleri (örneğin: Cocker Spaniel) haftada 6 çubuğa kadar besleyebilirsiniz. Büyük boy köpekleri (örneğin: Labrador) haftada 12 çubuğa kadar besleyebilirsiniz. Ödül maması ile beslediğinizde ana besin miktarını buna göre ayarlayınız. Sadece 5kg ve üzerindeki köpekler için uygun çiğneme ödülü. 4 aylıktan küçük yavru köpekler için uygun değildir.   ', 'Pedigree' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_brit-endurance-kuzu-etli-ve-muzlu-kopek-odulu-150gr.html', 'Brit Endurance Kuzu Etli ve Muzlu Köpek Ödülü 150gr', 'Köpek Ürünleri-Köpek Ödül Maması-Atıştırmalık', '04.01.2025', '139 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_brit-care-kopek-atistirmalik-odul-mamasi-12116706.jpg', '', 'Brit Endurance Kuzu Etli Muzlu Köpek Ödül Maması 150 Gr Fonksiyonel yarı yumuşak tedaviler, her köpeğin düzenli diyetine sağlıklı, etli ve lezzetli bir takviyedir. Laktobasiller, fulvik asitler ve şeker kavun özü gibi fonksiyonel bileşenlerle zenginleştirilmiştir. Aktif köpeklerin iyi fiziksel durumda kalmasına yardımcı olur. Aktif köpekleri iyi durumda tutmak için L-karnitin ve taurin ile zenginleştirilmiştir. Tahıl ve patates olmadan Fulvik asitler besin maddelerini emmeye yardımcı olur Antioksidan kaynağı olarak kavun özü Kollajen kas-iskelet sisteminin yenilenmesine yardımcı olur. Tyndalize laktobasiller sağlıklı bir bağırsak mikroflorasının korunmasına yardımcı olur. Muzlar, potasyum, magnezyum, C vitamini, B6 vitamini ve lif gibi büyük bir vitamin ve mineral kaynağıdır, yani aktif köpeklerde artan enerji seviyelerine katkıda bulunurlar. Buna ek olarak, tüm köpekler muz sever çünkü inanılmaz lezzetli! Kuzu, vücutta doğru enerji seviyesini korumaya yardımcı olan mükemmel bir amino asit kaynağıdır. 
