INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_gimdog-sportsnacks-tavukl-carnitinli-odul-tableti-60-gr.html', 'GimDog Sportsnacks Tavuk L-Carnitinli Şekersiz Tahılsız Köpek Ödülü 60gr', 'Köpek Ürünleri-Köpek Ödül Maması-Tablet Ödül', '4002064500119', '54 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_gimpet-kopek-odul-mamasi-4969096.png', '01.09.2024', 'Lezzetli ve seçkin kümes hayvanları etinden hazırlanmıştır. Protein açısından zengindir ve sindirimi kolaydır. Köpeğinizin zevkle ve istekle tüketeceği şekilde ve lezzette formüle edilmiştir. Proteinden zengin içeriğiyle günlük ödül için idealdir. İçeriğindeki L-carnitin yeterli egzersizle birlikte dokularda yağ birikimini azaltır ve köpeğinizin enerji metabolizmasının desteklenmesinde önemli rol oynar. Sportif köpeklerde dayanıklılığı ve çalışma isteğini arttırır. Oda sıcaklığında saklayınız Orta boy köpeklere günde 2- 3 tablet verilir', 'Gimpet' );
