INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_o-dog-dana-etli-sargili-kemik-kopek-odul-mamasi-100gr.html', 'O_Dog Dana Etli Sargılı Kemik Köpek Ödül Maması 100gr', 'Köpek Ürünleri-Köpek Kemiği-O_Dog Köpek Kemiği', '17.09.2025', '', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_o-dog-kopek-atistirmalik-odul-mamasi-179343798.jpg', '', 'O_Dog marka ithal köpek ödülleri eşşiz lezzete sahiptir. Köpeklerinizin vazgeçemeyeceği tamamlayıcı besinlerde yerini ilk sırada yer alacak olan besin değeri yüksek bu ödül maması, sağlık açısından da yapılmış uzunca testlerden, HACCP* standartlarına uyularak, başarılı bir şekilde geçmiştir.  O_Dog ödül mamaları sindirim açısından kolay, düşük yağ oranına sahip ve iştahlı bir atıştırmalıktır. Bütün köpek ırk ve yaş gruplarına uygundur.', 'O_Dog' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_beavis-derma-comfort-kucuk-ve-orta-irk-kopekler-icin-sindirim-sistemi-destekleyici-tablet-75gr.html', 'Beavis Derma Comfort Küçük ve Orta Irk Köpekler için Sindirim Sistemi Destekleyici Tablet 75gr', 'Köpek Ürünleri-Vitamin ve Ek Besinler-Tablet', '27.06.2024', '76 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_beavis-kopek-tablet-vitamin-282768654.jpg', '', 'Küçük ve orta ırk köpekler için yucca, biyotin ve probiyotik katkılı sarımsaklı bira mayası destekli tablettir. Derma Comfort" özellikle küçük ve orta ırk köpeklerin hassas sindirim sistemlerini, sağlıklı cilt ve tüy yapısı oluşumunu optimum düzeyde güçlendirmek üzere geliştirilmiştir. İçerdiği vitamin ve amino asit kombinasyonları sayesinde aşırı tüy dökülmelerini, olması gerekenden fazla dışkı kokusu ve miktarının azalmasına önemli düzeyde yardımcı olur. Antibakteriyel bir besin takviyesi olan Derma Comfort sevimli dostlarımızın vücudundaki zararlı bakterilerin azalmasını sağladığı gibi yararları bakteri sayısını arttırarak bağışıklık sistemlerini de güçlendirmektedir. Toksin attırıcı ve karaciğer koruyucu özel bir formüle sahip olan Derma Comfort sevimli dostlarımızın daha uzun ve sağlıklı yaşamaları için önemli bir destek sağlamaktadır. Kutu içerisinde 150 adet tablet bulunmaktadır. 
