INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_beavis-triple-strength-glucosamine-kopek-eklem-sagligi-destekleyici-chondroitin-tablet-60-li.html', 'Beavis Triple Strength Glucosamine Köpek Eklem Sağlığı Destekleyici Chondroitin Tablet (60_lı)', 'Köpek Ürünleri-Vitamin ve Ek Besinler-Tablet', '18.05.2024', '145 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_beavis-kopek-tablet-vitamin-277978878.jpg', '', 'Özel vitamin ve amino asit bileşenlerinden oluşan profesyonel bir eklem, kıkırdak ve bağ dokusu destekleyicisidir. Tüm ırklardan yetişkin ve yavru köpeklerin fiziki kondisyonu ve sağlığı açısından çok önemli bir takviye gıdasıdır. Birçok ırklarda kronik kalça ve kemik sorunlarına, hamilelik ve sağlıklı yavru gelişimine kadar optimum seviyede destek sağlar. ​Aşırı kilolu köpeklerde hareket kolaylığı sağlarken eklem yapısı ve sağlığına yardımcı olarak vücutlarının daha esnek ve formda olmalarını kolaylaştırır.', 'Beavis' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_beaphar-drucal-kedi-ve-kopek-icin-eklem-destekleyici-vitamin-250gr.html', 'Beaphar Drucal Kedi ve Köpek için Eklem Destekleyici Vitamin 250gr', 'Kedi Ürünleri-Vitaminler ve Ek Besinler-Toz', '24.03.2024', '249 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_beaphar-kedi-macun-odulleri-147488733.jpg', '', 'Kedi ve köpekler için enerji kaynağı olarak dekstroz, vitamin kaynağı olarak yosun kullanılarak hazırlanmış, kas, eklem ve diş yapısını güçlendiren toz formda özel vitamin, mineral preparatıdır.  Hamile ve emziren annelerde, kas ve eklem problemi olanlarda, sindirim sistemi problemi olanlarda hekim kontrolü altında doz iki katına kadar artırılabilir.  Ölçü kaşığı kutunun içerisindedir.', 'Beaphar' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_pro-one-glucosamine-kopekler-icin-eklem-sagligi-guclendirici-glukozamin-tablet-75-li.html', 'PRO ONE Glucosamine Köpekler İçin Eklem Sağlığı Güçlendirici Glukozamin Tablet (75_li)', 'Köpek Ürünleri-Vitamin ve Ek Besinler-PRO ONE Vitamin ve Ek Besinler', '03.04.2025', '155 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_pro-one-kopek-vitamin-ve-ek-besini-317538988.jpg', '', 'Evcil dostlarımız biz onlarla sosyalleşirken, oyun oynarken ve en önemlisi yaşlanmaya bağlı olarak bazı kalça ve eklem problemleri ile karşılaşabilirler. Pro One Glucosamine tablet, içeriğinde bulunan glikozamin, kondroitin sülfat ve MSM sayesinde dostlarınıza sağlıklı kemik gelişimi, kıkırdak ve eklem esnekliği gibi konularda destek sağlar. Mamasına karıştırarak ya da direk ağız yoluyla kullanılabilir. Günde 3 tablet olacak şekilde verilmelidir. Düzenli ve günlük kullanım tavsiye edilir. 0-20 kg olan köpekler için 3 tablet verilmelidir.', 'PRO ONE' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_beaphar-10-vitaminli-kopekler-icin-vitamin-tableti-180-tablet.html', 'Beaphar 10 Vitaminli Köpekler için Vitamin Tableti (180 Tablet)', 'Köpek Ürünleri-Vitamin ve Ek Besinler-Tablet', '28.04.2025', '259 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_beaphar-kopek-tablet-vitamin-9118582.jpg', '', 'Zenginleştirilmiş vitamin,mineral ve iz elementler köpeklerinize canlılık,dayanıklılık ve güçlü fizik kondüsyonu kazandırır.  
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_supravet-kopekler-icin-bagisiklik-guclendirici-sivi-probiyotik-ve-prebiyotik-takviyesi-100ml.html', 'Supravet Köpekler İçin Bağışıklık Güçlendirici Sıvı Probiyotik ve Prebiyotik Takviyesi 100ml', 'Köpek Ürünleri-Vitamin ve Ek Besinler-Sıvı & Likit', '10.01.2025', '189 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_supravet-kopek-sivi-likit-vitaminler-339258323.jpg', '', 'Supravet köpekler için Prebiyotik ve Probiyotik takviyesi, köpeklerin normal bağırsak sağlığının korunması, sindirim sorunlarının giderilmesine yardımcı olmanın yanı sıra, stresi hafifletmeye, akut enteritten sonra sindirimi iyileştirmeye, apetiti geri yüklemeye ve bağışıklık sistemini güçlendirmek için, tedavi amaçlı kullanılabilir. Köpeklerdeki hazımsızlık belirtilerine; (iştah azalması, kusma, dışkı değişiklikleri) yardımcı olmakla kalmaz, aynı zamanda bağışıklık sistemini güçlendirmeye de yardımcı olur. Supravet gıda takviyesi ayrıca köpeklerin bağışıklık sistemini desteklemek için antioksidanlar içerir. Hem yavru köpeklere hem de yetişkin köpeklere uygulama için uygundur. Üretimdeki yüksek kalite standartları nedeniyle güvenli ve kapsamlı bir üründür. Supravet Prebiyotik ve Probiyotik Likit, sıvı olması sebebiyle hap takviyelerine nazaran, daha iyi emilim göstereceği için daha çabuk etkili olur. Damla olarak kullanım çok kolaydır. Probiyotik ve prebiyotik kombinasyonunun sıvı hali daha stabildir ve sindirim sisteminde daha hızlı dağılır.  1 damlalık 2 ml_dir Kullanmadan önce çalkalanması gerekmektedir. Diğer ilaçlar ile birlikte karıştırmayınız. Çocukların erişemeyeceği yerde ağzı kapalı muhafaza ediniz. Kuru ve serin bir yerde, güneş ışığından korunarak muhafaza ediniz. Raf ömrü Üretim tarihinden itibaren 3 yıldır. Sırasıyla üretim tarihi, son kullanım tarihi ve parti no tüpün üzerindedir. ', 'Supravet' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_pro-one-kalsiyum-ve-biyotin-destekli-yavru-kopek-multvitamin-macunu-100gr.html', 'PRO ONE Kalsiyum ve Biyotin Destekli Yavru Köpek Multivitamin Macunu 100gr', 'Köpek Ürünleri-Vitamin ve Ek Besinler-Macun', '07.04.2024', '145 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_pro-one-kopek-macun-vitamin-239933359.jpg', '', 'Yavru köpeklerin sağlıklı büyümesini destekleyen vitamin, mineral ve aminoasit içeren tamamlayıcı yemdir. Yavru köpeklere günlük 2-3 cm verilmesi önerilmektedir. Köpeğinizin mamasına karıştırarak aroması sayesinde kolayca yemesini sağlayabilirsiniz.', 'PRO ONE' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_viyomega-somonlu-omega-3-ve-omega-6-takviyesi-250ml.html', 'Viyomega Omega 3 Omega 6 Kedi ve Köpek Somon Yağı Takviyesi 250ml', 'Köpek Ürünleri-Vitamin ve Ek Besinler-Sıvı & Likit', '10.05.2025', '249 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_viyo-kedi-vitamin-ve-ek-besinleri-76859965.jpg', '', 'Viyomega Somonlu ; %100 somon yağı içermektedir. Somon yağı yüksek oranda Omega 3veOmega 6yağ asitleri içermektedir. Omega3 ve Omega 6 yağ asitlerinin kanıtlanmış faydaları şunlardır:', 'Viyo' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_supravet-biotine-kopekler-icin-tuy-sagligi-destekleyici-multivitamin-damla-100ml.html', 'Supravet Biotine+ Köpekler için Tüy Sağlığı Destekleyici Multivitamin Damla 100ml', 'Köpek Ürünleri-Vitamin ve Ek Besinler-Sıvı & Likit', '', '149 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_supravet-kopek-sivi-likit-vitaminler-293893753.jpg', '', 'Eklem ve kas geliştirici damlayı kutudan çıkan pipet yardımıyla aşağıdaki dozaja uygun olarak köpeğinizin kuru mamasına ya da suyuna ekleyebilirsiniz. Kullanmadan önce her seferinde mutlaka iyice çalkalayınız. Direkt güneş ışığı almayan serin ve kuru yerde muhafaza ediniz.  Çocukların ulaşamayacağı yerlerde saklayınız.  Tavsiye edilen kullanım süresi, üretim tarihinden itibaren 36 aydır. ', 'Supravet' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_provit-biotin-kedi-ve-kopek-tuy-sagligi-guclendirici-vitamin-tozu-100gr.html', 'Profarm Provit Biotin Kedi ve Köpek Tüy Sağlığı Güçlendirici Vitamin Tozu 100gr', 'Köpek Ürünleri-Vitamin ve Ek Besinler-Toz', '13.01.2025', '76 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_provit-kedi-tablet-odulleri-129929061.jpg', '', 'Kedi ve köpeklerin tüy sağlığını güçlendirmek için üretilmiştir. Biotin karbonhidrat, yağ ve protein metabolizmasında rol oynayan önemli bir takviyedir. Tiroid ve adrenal bezlerinin normal çalışmasını sağlar aynı zamanda üreme ve sinir sistemi için gereklidir. Egzama, pençelerde boynuzlaşma, pigmentasyonda bozukluk, tüy dökülmesi biyotin eksikliğinden kaynaklanan rahatsızlıklardır. Bu rahatsızlıkların tamamı biyotin ile desteklenebilir. İçeriğinde bulunan niasin deri sağlığı ve sindirim metabolizmasını destekler. Vitamin B2 deri gelişimi, deride elastikiyet ve iyileşme oranlarında önemli bir rol oynamaktadır. DHA deri ve tüy sağlığı için gerekli olup deride ve tüylerde oluşan hastalıklarda iyileşmeye yardımcı olur. Taurin göz sağlığı, sindirim sistemi, kalp kası fonksiyonları, gebelik ve fetal gelişim ve sağlıklı bir bağışıklık sistemi için gerekli bir amino asitttir. Tüylere ve deriye canlı ve sağlıklı bir görünüm sağlar. Ayrıca dökülme ve kırılmayı önler. Sindirime ve sağlıklı büyümeye yardımcı olur. Saçkıran, egzama ve deri iltihabı tedavilerinde kullanılabilir. Deride döküntü ve kalınlaşmayı önler.   5 kg ağırlığa kadar 2 g, 5-15 kg ağırlığa kadar 4 g, 15+ ağırlığa 6-8 g kuru veya yaş mamaya karıştırılarak verilebilir. 5 kg ağırlığa kadar 1-2 g kuru veya yaş mamaya karıştırılarak verilebilir.', 'Profarm' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_profarm-provit-kedi-ve-kopek-karaciger-destekleyici-ve-kilo-yonetimine-yardimci-vitamin-tozu-100gr.html', 'Profarm Provit Karnitin Kedi ve Köpek Kilo Yönetimi ve Karaciğer Sağlığı için Vitamin Tozu 100gr', 'Köpek Ürünleri-Vitamin ve Ek Besinler-Toz', '13.01.2025', '59 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_provit-kedi-tablet-odulleri-141836103.jpg', '', 'L-Carnitin, Taurin, Vitamin E, Kolin Klorid ve organik selenyum içeren toz formda yem premiksidir. Yağ metabolizmasına yardımcı olur; kalbin ve karaciğerin düzgün çalışmasını destekler 
