INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_pet-comfort-lima-varius-17-buyuk-irk-kopek-yatagi-75x110cm-gri-xl.html', 'Pet Comfort Lima Varius 17 Büyük Irk Köpek Yatağı 75x110cm (Gri) [XL]', 'Köpek Ürünleri-Köpek Yatağı-İç Mekan Köpek Yatağı', '', '959 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_pet-comfort-ic-mekan-kopek-yatagi-183589031.jpg', '', 'Yetişkin ağırlığı 26 - 44 kg arasında olan veya 44 kg_dan daha ağır olan büyük ırk köpeğinizin konforu ve rahatı için her ayrıntısı düşünülmüş, ergonomik, şık ve çok kaliteli köpek yatağıdır. Dış kılıfı çok kaliteli hayvan sağlığına uygun kumaştan, içi ayrı özel kılıf içerisinde 1. sınıf elyaftan üretilmiştir. Dış kılıf düşük ısı kuru temizleme ile temizlenebilir veya çamaşır makinesinde 30 derecede yıkanabilir. İçindeki özel kılıf içerisindeki kaliteli elyaf yastık elde düşük ısıda yıkanabilir. Ürünün alt tarafında yer alan özel üretim kaymaz kumaş sayesinde yatak, parke ve mermer gibi yüzeylerde kaymaz. Köpeğiniz güvenle üzerine çıkabilir, yatabilir, olduğu yerde ayağa kalkıp dönebilir. Özel vakumlu ambalajında el değmeden paketlenmekte ve size güvenle ulaştırılmaktadır. Köpek yatağının yüksekliği 16 cm_dir.  Ürün dış ölçüleri 75x110 cm_dir.', 'Pet Comfort' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_pet-comfort-oscar-nidus-11-kopek-yatagi-70cm-gri-m.html', 'Pet Comfort Oscar Nidus 11 Köpek Yatağı 70cm (Gri) [M]', 'Köpek Ürünleri-Ağustos Seçili Ürünler-Pet Comfort Ağustos Seçili Ürünler', '', '529 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_pet-comfort-ic-mekan-kopek-yatagi-234882778.jpg', '', 'Yetişkin ağırlığı 111-25 kg köpek ırkları için uygun konforlu ve rahat köpek yatağıdır. Ergonomik, şık, dekoratif ve çok rahattır. Yatak kılfı ve iç yastık kılıfı evcil hayvan dostu kumaştan üretilmiştir. Tüm yatak 1. Kalite elyaf dolguludur. Yatak dış kılıfı ve iç kılıfı çamaşır makinesinde 30 derecede yıkanabilir. İç yastıkların tamamı çamaşır makinasında ‘Elde Yıkama_ programında yıkanabilir. Ürünün alt tarafında yer alan özel üretim kaymaz kumaş sayesinde yatak, parke ve mermer gibi yüzeylerde kaymaz. Evciliniz güvenle üzerine çıkabilir, yatabilir, kenarlarına sırtını yaslayabilir ve olduğu yerde ayağa kalkıp kendi etrafında dönebilir. Özel vakumlu ambalajında el değmeden paketlenmekte ve size güvenle ulaştırılmaktadır.', 'Pet Comfort' );
