INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kopek-dis-bakim-oyuncagi-termoplastik-6cm-kirmizi.html', 'Trixie Termoplastik Diş Bakım Köpek Oyuncağı 6cm (Karışık Renkli)', 'Köpek Ürünleri-Köpek Oyuncağı-Toplar', '4011905336800', '235 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-dis-ipleri-10776173.jpg', '', 'Termoplastik kauçuktan üretilmiş dayanıklı ve özel tasarımı sayesinde ısırıldıkça, köpeğiniz dişleriyle kavradıkça diş etlerine masaj ve dişlerine fırçalama etkisi yapacak köpek topudur. Köpeğinizin diş sağlığı ve mide ve bağırsak sağlığı için daima natürel kauçuk veya latex oyuncakları tercih ediniz. Ürünle oynarken köpeğinizin dişleri özel olarak tasarlanmış diş sağlığı oyuncağının delik kısımlarına girerek dişlerinde biriken yemek artıklarını temizler ayrıca diş etlerinede masaj yapar. Oyuncağı köpeğiniz için cazip kılmak için üzerine balık ezmesi veya et suyu sürebilirsiniz. Ürünü temiz ve sabunlu su ile zaman zaman yıkayınız ve durulayınız. Ürün çeşitli renklerdedir. Sipariş verdiğinizde stokta olan renk gönderilir. Ürün çapı 6 cm_dir.', 'Trixie' );
