INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-latex-mini-domuz-kopek-oyuncagi-135cm.html', 'Trixie Latex Sesli Mini Domuz Köpek Oyuncağı 13,5cm (Karışık Renkli)', 'Köpek Ürünleri-Köpek Oyuncağı-Plastik ve Kauçuk Oyuncaklar', '4011905350929', '99 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-sesli-oyuncak-48204130.jpg', '', 'Diş, mide ve bağırsak sağlığı için uygun bir oyuncaktır. Kauçuk ve lateks kumaştan üretilmiştir. Yırtılmalara ve kopmalara karşı dayanıklıdır. Dostlarınızın sağlığı için kauçuk ve lateks oyuncakları kullanmanızı tavsiye ederiz. İçerisindeki yumuşak dolgu malzeme sayesinde köpeğiniz zevkle ısıracaktır ve enerjisini atacaktır. Ses çıkarması ile dostunuzun dikkkatini çekecektir. Ürün çeşitli renklerdedir, stoktaki renge göre gönderim yapılır. Ürün uzunluğu 13,5 cm_dir.', 'Trixie' );
