INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_pawise-dura-chew-et-aromali-kemik-17cm.html', 'Pawise Dura Chew Tavuk Eti Aromalı Kemik 17cm', 'Köpek Ürünleri-Köpek Oyuncağı-Plastik ve Kauçuk Oyuncaklar', '', '185 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_pawise-kopek-kemigi-25036348.jpg', '', 'Pawise marka, ambalajlı ve ekstra hijyenik köpek kemiğidir. Köpeğinizin sağlığı için içerisinde kanserojen ve alerjik madde kullanılmamıştır. Diş kokusunu ve tartar oluşumunu engelleyici etkisi vardır. Köpeklerin ağız ve diş sağlıkları için çiğneme yapmaları önemli olduğundan diş sağlığı için idealdir. Ödül ya da eğitim yardımcısı olarak kullanabilirsiniz. Ürünle beraber her zaman temiz içme suyu bulundurmaya özen gösterin. Köpekleriniz beslenirken yakınlarında olmanızı tavsiye ederiz. Orta ırk ve büyük ırk köpekler için kullanımı uygundur.  17 cm', 'Pawise' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-ipli-fosforlu-kaucuk-kopek-oyuncagi-6cm-30cm.html', 'Trixie Kauçuk İpli Fosforlu Top Köpek Oyuncağı 6x30cm (Karışık Renkli)', 'Köpek Ürünleri-Köpek Oyuncağı-Toplar', '4011905345918', '147 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-plastik-ve-kaucuk-oyuncak-15564614.jpg', '', 'Süngerimsi sert doğal kauçuk top fosforlu renklerdedir ve yüzme özelliği dolayısı ile deniz ve havuz oyuncağı olarak kullanılır. Tutamaçlı ipi ile tut-çek oyunu oynanabilir. Renkleri sayesinde evcil dostlarınızın dikkatini kolaylıkla çekecektir. Kanserojen madde içermeyen malzemelerden imal edilen hijyenik ve sağlıklı evcil dostunuz için güvenilir bir oyuncaktır. Dostlarınızın oyuncakla işi bittiği zaman oyuncak kaldırılmalıdır. Böylelikle bir sonraki oyunlarında daha istekli ve heyecanla oynamaya devam edebilirler. Ürün çeşitli renk veya görünümdedir. Sipariş verdiğinizde stokta olan renk gönderilir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-lateks-ordek-kopek-oyuncagi-18cm-1.html', 'Trixie Lateks Polyester Dolgulu Köpek Oyuncağı 18cm (Karışık Renkli)', 'Köpek Ürünleri-Köpek Oyuncağı-Plastik ve Kauçuk Oyuncaklar', '4011905350318', '169 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-plastik-ve-kaucuk-oyuncak-113362636.jpg', '', 'Sesli lateks oyuncak içi polyester dolguludur. Köpeğinizin diş sağlığı ve mide ve bağırsak sağlığı için daima naturel kauçuk ve lateks oyuncakları tercih ediniz. Asorti olan bu ürün çeşitli renk veya görünümdedir. Oyuncağın içerisindeki özel yumuşak dolgu malzemesi sayesinde köpeğiniz oyuncak ile çok eğlenecektir. İçindeki mekanizma sayesinde köpeğiniz her ısırdığında ses çıkararak dikkatini oyuncağa vericektir. Isırmayı ve parçalamayı seven köpekler için özel olarak üretilmiştir. Köpeğinizin diş sağlığı ve mide ve bağırsak sağlığı için daima naturel kauçuk ve lateks oyuncakları tercih ediniz. Ürün çeşitli renk ve görünümdedir. Stoktaki renge göre gönderim yapılır. Ürünün uzunluğu 18 cm_dir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_zampa-dikenli-kemik-kopek-oyuncagi-15-5cm-karisik-renkli.html', 'Zampa Dikenli Kemik Köpek Oyuncağı 15,5cm (Karışık Renkli)', 'Köpek Ürünleri-Köpek Oyuncağı-Plastik ve Kauçuk Oyuncaklar', '', '54 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_zampa-plastik-ve-kaucuk-oyuncak-240442644.jpg', '', 'Zampa Kedi ve köpek ürünleri her zaman gerçek birinci kalitede hammaddelerden üretilerek, yüksek dayanıklı yapıya sahiptir.Ürün üzerinde ki tasarım ve dokular ileri teknoloji ile imal edilmiştir. Ürünler CE güvence ve kalitesindedir. Kimyasal salınım yapmadığı için hayvan sağlığına da %100 zararsızdır. Sevimli dostunuz ile birlikte mükemmel bir eğlence deneyimi sunar ve birlikte sosyalleşmenize yardımcı olur. 
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-vinyl-havuc-adam-kopek-oyuncagi-20cm.html', 'Trixie Vinyl Sesli Havuç Adam Köpek Oyuncağı 20cm', 'Köpek Ürünleri-Köpek Oyuncağı-Plastik ve Kauçuk Oyuncaklar', '4011905033983', '159 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-plastik-ve-kaucuk-oyuncak-26695999.jpg', '', 'Köpek sahibi olmanın en güzel yanlarından biri onunla oyunlar oynamak ve aranızdaki bağı güçlendirerek bundan ne kadar zevk aldığınızı keşfetmektir. Ayrıca köpek oyuncakları köpeğinizin günlük olarak ihtiyaç duyduğu egzersizlerini eğlenceli bir yolla tamamlamasına ve hareket kabiliyetini geliştirmesine, doğal yeteneklerini unutmamasına yardımcı olur. Köpek oyuncaklarının bir diğer avantajı ise köpeğinizin zeka gelişimine ve eğitimine katkıda bulunmasıdır. Oyuncağıyla heyecanlı bir şekilde pozitif davranışlar eğiliminde olacak ve daha arkadaş canlısı tavırlar sergileyecektir. Trixie Vinyl havuç formunda köpek oyuncağı sesli olma özelliği sayesinde köpeğinizin daha çok ilgisini çekecek daha keyifli dakikalar geçirmesini sağlayacaktır. Ürünün uzunluğu 20 cm_dir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-ipli-tenis-topu-kopek-oyuncagi-6cm-50cm.html', 'Trixie İpli Tenis Topu Köpek Oyuncağı 6x50cm (Karışık Renkli)', 'Köpek Ürünleri-Köpek Oyuncağı-Toplar', '4011905034799', '119 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-oyuncak-top-8353738.jpg', '', '6,5 cm çapında tenis topuna bağlı tutamaçlı ip ile oynayabileceğiniz ipli tenis topudur. Camyünü (elyaf) ve gaz içermez. Köpekler doğası gereği hareketli, sıcakkanlı ve eğitilebilir canlılardır. Sıcakkanlı dostlarımızın eğitimi onlarla daha yakın ve iyi iletişim sağlamamızda yardımcı olacaktır. Köpekleri eğitmenin en kolay yöntemi de oyuncaklardan yardım almaktır.  Eğitim oyunlarında kullanabileceğiniz gibi sadece oyun amaçlı köpeğinizle güzel vakit geçirmek için de kullanabilirsiniz. Ürün tenis topuna bağlı ipten oluşmaktadır. Ürün oldukça dayanıklıdır.', 'Trixie' );
