INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_zampa-ipli-kemik-kopek-oyuncagi-25cm-karisik-renkli.html', 'Zampa İpli Kemik Köpek Oyuncağı 25cm (Karışık Renkli)', 'Köpek Ürünleri-Köpek Oyuncağı-Plastik ve Kauçuk Oyuncaklar', '', '41 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_zampa-kopek-dis-ipleri-169355613.jpg', '', 'Köpeğinizin severek oynayacağı ipli kemik oyuncak. Zampa kedi ve köpek ürünleri her zaman gerçek birinci kalitede ham maddelerden üretilerek, yüksek dayanıklı yapıya sahiptir. Ürün üzerindeki tasarım ve dokular ileri teknoloji ile imal edilmiştir. Ürünler CE güvence ve kalitesindedir. Kimyasal salınım yapmadığı için hayvan sağlığına da %100 zararsızdır. Ürünün ölçüsü 25 cm_dir. Ürün çeşitli renklerdedir. Stoktaki renk durumuna göre gönderim sağlanır.', 'Zampa' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_petlebi-sesli-pelus-kemik-kopek-oyuncagi-17cm.html', 'Petlebi Sesli Peluş Kemik Köpek Oyuncağı 17cm', 'Köpek Ürünleri-Köpek Oyuncağı-Kumaş ve Peluş Oyuncaklar', '', '62 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_petlebi-kopek-kumas-ve-pelus-oyuncak-21717818.jpg', '', 'Köpekler için sesli peluş çiğneme oyuncağıdır. Oyuncağın her iki tarafına da basıldığında ses çıkarmaktadır. Ayrıca oyuncak içindeki elyafın oyun sırasında salya ile ıslanmasını önlemek için dış kumaşın altında su geçirmez özel bir malzeme vardır.  Ürünün uzunluğu 17 cm_dir.', 'petlebi' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kopek-dis-bakim-topu-oyuncagi-dental-o6-cm.html', 'Trixie Dental Kauçuk Diş Bakım Topu Köpek Oyuncağı 6cm', 'Köpek Ürünleri-Köpek Oyuncağı-Plastik ve Kauçuk Oyuncaklar', '4011905329413', '', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-plastik-ve-kaucuk-oyuncak-8388245.jpg', '', 'Köpeğinizin diş, mide ve bağırsak sağlığı için daima doğal kauçuk veya latex oyuncakları tercih ediniz. Ürünle oynarken köpeğinizin dişleri özel olarak tasarlanmış diş sağlığı oyuncağının delik kısımlarına girerek dişlerinde biriken yemek artıklarını temizler ayrıca diş etlerinede masaj yapar. Oyuncak, evcil dostunuzun dişlerinde tartar oluşumunu engelleyerek ağız kokusunu da önler. Köpeğiniz için cazip kılmak için topun üzerine balık ezmesi veya et suyu sürebilirsiniz. Ürünü temiz ve sabunlu su ile zaman zaman yıkayınız ve durulayınız. Ürünün çapı 6 cm_dir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_zampa-orgu-toplu-kopek-oyun-ipi-100cm.html', 'Zampa Örgü Toplu Köpek Oyun İpi 100cm', 'Köpek Ürünleri-Köpek Oyuncağı-Eğitim ve Zeka Geliştirici Oyuncaklar', '', '', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_zampa-kopek-dis-ipleri-169119177.jpg', '', 'Köpeğinizle eğlenceli çekiştirme oyunu oynayabilirsiniz. Köpeğinizi kemirme ihtiyacını karşılarken sürtünme ile mekanik olarak tartarın temizlenmesini sağlar. Köpeğinizle birlikte oynayabileceğiniz çok fonksiyonlu köpek oyuncağıdır. Köpek oyuncakları köpeğinizin ısırma ve kemirme gibi ihtiyaçlarını karşılayarak eğlenceli vakit geçirmesini sağlar. Ürünün boyu 100 cm_dir.  ', 'Zampa' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-ipli-top-kopek-oyuncagi-60cm-30cm.html', 'Trixie Kauçuk İpli Top Köpek Oyuncağı 30x60cm (Karışık Renkli)', 'Köpek Ürünleri-Köpek Oyuncağı-Plastik ve Kauçuk Oyuncaklar', '4011905033051', '205 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-zeka-gelistirici-oyun-15554717.jpg', '', 'Trixie marka ipli top şeklinde köpek oyuncağıdır. Köpeğinizle çeşitli oyunlar oynamak gerek eğitimi gerekse günlük egzersizlerini tamamlayabilmesi için oldukça önemlidir. Onunla oyun oynarken geçirdiğiniz keyifli vakitler ayrıca aranızdaki bağı güçlendirecek önemli bir etkileşimdir. Köpeklerin doğal yeteneklerini hatırlamaları ve kaybetmemeleri önemlidir. Eğitim oyuncakları hem bunları hatırlatacak hem de hem zeka gelişimleri, psikolojik yapıları üzerinde geliştirici rol oynayacaktır. Bu tür eğitim oyuncaklarıyla onları hem istediğiniz yönde eğitebilir hem de bu gibi konularda pozitif yönde gelişimine destek olabilirsiniz. Sahibiyle oyun oynayan köpekler daha arkadaş canlısı olurlar ve etraflarına olumlu davranışlar sergilerler.  Üründe kullanılan top naturel kauçuk maddeden özel olarak üretilmiştir ve sağlam yapılı bir ipe bağlıdır. Özellikle eğitim oyunlarında hem sizin hem de köpeğinizin severek kullanacağı bir oyuncaktır. Ürünün boyutu 30cm ila 60cm_dir. Ürün karışık renklidir. Stoktaki renk durumuna göre gönderim yapılır', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-tenis-topu-kopek-oyuncagi-6cm.html', 'Trixie Tenis Topu Köpek Oyuncağı 6cm (Karışık Renkli)', 'Köpek Ürünleri-Köpek Oyuncağı-Toplar', '4011905347516', '', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-oyuncak-top-8512489.jpg', '', 'Camyünü (elyaf) ve gaz içermeyen tenis topudur. Köpekle sahibinin iletşimin ve bağın kuvvetlenmesini sağlayan köpeklerin sevdiği bir oyuncaktır. Farklı renklerde olması sebebiyle köpekler rahat biçimde topu ayırt edebilir. Hem spor egzersizi olarak hem de eğlence amaçlı olarak oynan yakala-getir oyunları için ideal üründür. Temel köpek oyuncaklarından biri olan bu oyuncak kilo alan köpeklerin egzersizlerinde kullanılabilir. Yetişkin, yavru ve yaşlı köpekler için uygun bir oyuncaktır. Sipariş verdiğinizde stokta olan renk gönderilir. Ürünün çapı 6 cm_dir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_pawise-ayarlanabilir-kumas-kopek-agizligi-s.html', 'Pawise Ayarlanabilir Kumaş Köpek Ağızlığı [S]', 'Köpek Ürünleri-Köpek Tasmaları ve Kayışları-Köpek Ağızlığı', '', '119 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_pawise-kopek-agizligi-167135883.jpg', '', 'Köpekler için ısırma ve yabancı cisim yeme gibi durumları önlemek amacıyla tasarlanmış ayarlanabilir kumaş ağızlık. Kullanımı kolay ve rahattır. Kimyasal salınım yapmaz.', 'Pawise' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_karlie-kilitli-kopek-boyun-tasmasi-30-45cm-acik-kahverengi-s.html', 'Karlie Kilitli Köpek Boyun Tasması 30-45cm (Açık Kahverengi) [S]', 'Köpek Ürünleri-Köpek Tasmaları ve Kayışları-Boyun Tasması', '4016598682630', '199 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_karlie-kopek-boyun-tasmasi-119439960.jpg', '', 'Karlie kilitli boyun tasması gerginliği önleyici özelliktedir. Dayanıklı naylon malzemeden üretilmiş olup metal kısımları krom kaplamadır. Sağlam klipsleri sayesinde güvenle kullabilirsiniz. ', 'Karlie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-iki-kopek-icin-gezdirme-aparati-42cm2mm.html', 'Trixie İki Köpek İçin İkili Gezdirme Kayışı 42cm_2mm', 'Köpek Ürünleri-Köpek Tasmaları ve Kayışları-Gezdirme Kayışları', '4011905022512', '345 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-uzatmali-tasma-kayislari-9739491.jpg', '', 'Krom kaplamalı 2 köpek gezdirme apartıdır. İki köpeği bir tasma aracılığıyla gezdirmenizi sağlar. Konforunuz ve köpeklerinizin güvenliği için gerekli bir aparattır.  Bir adet köpek gezdirirken ise sağlamlığı arttırıcı bir etkisi bulunmaktadır. 1. Sınıf kalite malzemeden üretilmiştir uzun yıllar kullanım ömrü sunmaktadır. Kimyasal salınım yapmaz insan ve hayvan sağlığına %100 zararsızdır.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_lishinu-akilli-kontrol-kopek-gezdirme-kayisi-3m-l-siyah.html', 'Lishinu Akıllı Kontrol Köpek Gezdirme Kayışı 3m [L] (Siyah)', 'Köpek Ürünleri-Köpek Tasmaları ve Kayışları-Otomatik Kayışlar', '01.01.2025', '489,06 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_lishinu-kopek-otomatik-tasmalar-kayislar-265949363.jpg', '', 'Lishinu tasmalar bileğe takılabilme özelliği sayesinde siz köpeğinizi gezdirirken ellerinizin tamamen serbest olmasını ve bu sayede özgürce hareket edebilmenizi sağlayan dünyanın en akıllı tasmasıdır. Yüksek kaliteli malzemelerden üretilmiş oldukça güçlü bir yapıya sahiptir. Tasmada bulunan bilek bandı ayarlanarak her bileğe uyacak şekilde tasarlanmıştır. 3 metreye kadar kullanım sunarak köpeğinize kontrollü bir özgürlük sağlar. Sevimli dostlarınızla geçirdiğiniz zamanın kalitesini lishinu tasmanın kolay takma çıkarma aparatı sayesinde arttırabilirsiniz. Kolunuza oldukça basit bir şekilde takıp çıkarabilirsiniz. Acil bir durum karşısında güvenlik kayışını sert bir şekilde çekerek de tüm aparatı çıkarabilirsiniz. Kullanışlı durdurma düğmesi ile tasmayı kontrol edebilirsiniz. 
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_waudog-kopekler-icin-batman-2-desenli-ve-qr-pasaportlu-boyun-tasmasi-31-49cm-25mm.html', 'Collar WAUDOG Batman 2 Desenli ve QR Pasaportlu Köpek Boyun Tasması 31-49cm_25mm', 'Köpek Ürünleri-Köpek Tasmaları ve Kayışları-Boyun Tasması', '', '599 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_collar-kopek-boyun-tasmasi-26261306.jpg', '', 'Köpekler için şık tasarımlı boyun tasmasıdır. Kaliteli dayanıklı naylondan yapılmıştır ve köpeğinizin cildine zarar vermez.  Ürünün metal tokasına evcilinizin ismini ve numaranızı yazdırabilirsiniz. QR pasaportu ancak, kimlik etiketi ile birlikte verilen aktivasyon talimatlarına göre animal-id.net_e kayıt olduktan sonra aktif hale gelir. Güneşte solmaz ve renk kaybetmez. Desen silinmez veya deforme olmaz, solmaz veya köpeğin paltosunu lekelemez', 'Collar' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_flip-soft-tutmali-zincir-uzatma-kayisi-4mm120cm.html', 'Flip Soft Yumuşak Tutmalı Zincir Gezdirme Kayışı 4mm_120cm', 'Köpek Ürünleri-Köpek Tasmaları ve Kayışları-Gezdirme Kayışları', '8680468043294', '149 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_flip-kopek-uzatmali-tasma-kayislari-37595603.jpg', '', 'Üst Kalitede Çelik malzemeden üretilmiştir. Yüksek dayanıklılık ve mukavemet bağlarıyla ekstra güvenlik sağlar. Kolay kavrama özelliği ile boyna zarar vermeden komut dinletme imkanı sunar. Omurgaya yük bindirip zorlamayan hassas zincir aralıkları vardır. Ekstra güçlendirilmiş ve kolay kullanıma sahip kilitleme sistemi kullanımını kolaylaştırır.', 'Flip' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-pamuk-ipten-orgu-dis-ipi-kopek.html', 'Trixie Pamuk İpten Örgü Köpek Diş İpi 26cm (Karışık Renkli)', 'Köpek Ürünleri-Köpek Oyuncağı-Diş İpi', '4011905032726', '99 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-dis-ipleri-8413488.jpg', '', 'Köpeklerin diş sağlığını korumak için kullanılan örgü oyun ipi veya diş ipi. Kaliteli pamuktan imal edilmiştir. Evcil dostlarınızın çekiştirme oyunları için tercih edebileceğiniz harika bir diş ipidir. Dostlarınızın kemirme iç güdülerini harekete geçirerek bir oyuna dönüştürmeleri için tasarlanmıştır. Köpeklerde diş sağlığı köpek sahiplerinin önem vermesi gereken önemli bir konudur. Köpeklerin dişleri yedikleri gıdaları tutma ısırma koparma ve öğütme işlevini yerine getirir. Bu nedenle diş temizliği ve sağlığı alınan gıdaların hazmının ilk başladığı organdır. Ürünler karışık renklidir. Stoktaki renk durumuna göre gönderim yapılır. Ürün uzunluğu 26 cm_dir.', 'Trixie' );
