INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_karlie-kilitli-kedi-boyun-tasmasi-20-35cm-kirmizi-xs.html', 'Karlie Kilitli Köpek Boyun Tasması 20-35cm (Kırmızı) [XS]', 'Köpek Ürünleri-Köpek Tasmaları ve Kayışları-Boyun Tasması', '4016598645673', '86 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_karlie-kopek-bandanasi-79809851.jpg', '', 'Karlie kilitli boyun tasması, gerginliği önleyici özelliğe sahiptir. Üzerinde bulunan sağlam klipsleri sayesinde kolay bir şekilde takılıp çıkartılabilir. Özel kumaşı sayesinde kedinize herhangi bir rahatsızlık vermez.', 'Karlie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kopek-boyun-tasma-kimlik-tupu.html', 'Trixie Boyun Tasması Kimlik Tüpü', 'Köpek Ürünleri-Köpek Tasmaları ve Kayışları-Kimlik Tüpü ve Künyeler', '4011905022802', '63 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-tasmalari-kayislari-9224075.jpg', '', 'Köpek dostunuzun başına gelebilecek kaybolma durumlarına karşı içerisine kişisel adres ve telefon bilgilerinizi yazabileceğiniz bir üründür.  Kimlik tüpü içerisine yazabileceğiniz kişisel bilgilerinizle olası bir durumda kişiler sizinle direkt olarak irtibata geçebilecektir. Sizin için değerli olan minik dostunuz kimlik tüpü sayesinde daha güvende olacaktır. Kimlik tüpü küçüklüğü sayesinde köpeğinizi rahatsız etmez, ayrıca şık bir görünüme sahiptir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_beaphar-sakinlestirici-kopek-tasmasi-65cm.html', 'Beaphar Sakinleştirici Köpek Tasması 65cm', 'Köpek Ürünleri-Köpek Tasmaları ve Kayışları-Boyun Tasması', '', '245,17 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_beaphar-kopek-boyun-tasmasi-245109021.jpg', '', 'Köpekler için; stres altında oldukları dönemlerde kullanılması için özel olarak üretilmiş, bitkisel, sakinleştirici köpek tasmasıdır. İçerdiği valerian (kedi otu) özü sayesinde, stresi hafifletir, daha iyi bir uyku sağlar. Stres altında oldukları dönemlerde, anksiyete azalması için idealdir. Tasma takıldıktan yaklaşık olarak 1 saat sonra valerian özü etkisini göstermeye başlar ve köpeğinizin sakinleşmesini sağlar. Boyun genişliği 65 cm_e kadar olan köpeklerin kullanımına uygundur. Veteriner ziyaretleri, havai fişek, gök gürültüsü gibi sesler, seyahat gibi stresli durumlardan kaynaklanan davranış bozukluklarını azaltmaya yardımcı olur. Stresli olduğu durumların yanı sıra aşırı havlama, çiğneme ve uygunsuz yerlere idrar yapma gibi davranışları önlemeye de yardımcı olur. Sakinleştirici tasma büyüme dönemindeki bir köpeğe takıldıysa kontrollü olarak gevşetilmelidir. Tasmanın etkin kalması için farklı bir tasmayla takılmaması ve deriye temas etmesi gerekmektedir. Islandığı durumda kuruduktan sonra etkisini sürdürmeye devam etmektedir. 6 haftaya kadar etkilidir. Köpeğinizin boyun genişliğine göre fazla sıkmadan boşluk kalacak şekilde takınız. Boyun uzunluğu ayarlandıktan sonra fazla gelen kısmı makas yardımı ile kesiniz. 
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kopek-bahce-baglama-celik-halati-5m-kirmizi.html', 'Trixie Köpek Bahçe Bağlama Çelik Halatı 5m (Kırmızı)', 'Köpek Ürünleri-Bakım ve Temizlik Ürünleri-Bahçe Ürünleri', '4011905022918', '699 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-bahce-baglama-kayislari-42577984.jpg', '', 'Şok emici özel kancalı, plastik kaplı çelik halat. Nokta bağlamalar için önerilir. Gezdirme için uygun değildir.  Kaliteli malzemeden üretilmiştir. Uzun yıllar kullanım ömrü sunmaktadır. Kimyasal salınım yapmaz insan ve hayvan sağlığına %100 zararsızdır. Temizlemesi çok kolay ve pratiktir.', 'Trixie' );
