INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kopekler-icin-paslanmaz-celik-mama-ve-su-kabi-400ml-14cm-karisik-desenli.html', 'Trixie Köpekler için Paslanmaz Çelik Mama ve Su Kabı 14cm 400ml (Karışık Çeşitli)', 'Köpek Ürünleri-Köpek Mama ve Su Kabı-Çelik Mama ve Su Kabı', '4011905252551', '305 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-celik-kopek-mama-ve-su-kabi-18639762.jpg', '', 'Köpekler için kuru mama, yaş mama ve su kullanımına uygundur. Paslanmaz çelikten üretilmiştir uzun ömürlü ve hijyeniktir. Kolayca temizlenebilir bulaşık makinesi ve ya elde yıkamaya uygundur. Evcilinizin mamasını ve suyunu sağlıklı bir şekilde tüketebilmesi için uygun bir üründür. Ürün karışık desenlidir. Stoktaki desen durumuna göre gönderilir.', 'Trixie' );
