INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_eurodog-kopekler-icin-ikili-paslanmaz-celik-mama-ve-su-kabi-285ml-11-5cm.html', 'EuroDog Köpekler için İkili Çelik Mama ve Su Kabı 2x285ml', 'Köpek Ürünleri-Köpek Mama ve Su Kabı-İkili Mama ve Su Kabı', '', '109 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_eurodog-ikili-mama-kabi-kopek-176137109.jpg', '', 'İki adet paslanmaz çelik mama ve su kabı ile krom stanttan oluşan mama ve su kabı setidir. Mama ve su kaplarının krom standa oturduğu bölgeye denk gelen bölümde yer alan silikon bantlar sayesinde evcilinizin mama yerken ve su içerken tıkırtı sesi engellenmiş olur. Mama ve su kabı setinin ayaklarındaki silikonlar sayesinde kaplar hem kaymaz hem de ses yapmaz. Mama ve su kapları bulaşık makinesinde yıkanabilir.', 'EuroDog' );
