INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_flip-figurlu-celik-kedi-ve-kopek-mama-ve-su-kabi-21cm-475ml.html', 'Flip Köpekler için Figürlü Çelik Mama ve Su Kabı 21cm 475ml', 'Köpek Ürünleri-Köpek Mama ve Su Kabı-Çelik Mama ve Su Kabı', '8681299602070', '94 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_flip-celik-kedi-mama-ve-su-kabi-64258064.jpg', '', 'Flip mama ve su kapları her zaman birinci sınıf kaliteli paslanmaz çelikten işlenmiş ve sıkıştırılarak dayanıklılığı garanti altına alınmıştır. Ürün çeliği ekstra dayanıklı kaplamaya sahip olup yıllarca ihtiyaçlarınızı karşılayabilecek şekilde tasarlanmıştır. Ürün üzerindeki kaplamalar ileri teknoloji ile çeliğe işlenmiştir. Böylece salınım yapmadığı için hayvan sağlığına da 100% zararsızdır. Ayrıca makinede yıkanabilir özelliği ile tam bir hijyen ve güvenlik sağlar. Flip mama kapları köpeklerin yemek saatini konforlu geçirmeleri için harika bir mama kabı ürünüdür. Flip köpek su ve mama kapları, salınım yapmadığı için yemeklerin ve özelliklede suyun tadını ve lezzetini bozmaz. Bakteri üreterek koku oluşturmaz. Krom parlaklığında yapıya ve şık bir tasarıma sahipken aynı zamanda yenilikçi canlı renkli formlarıylanda dikkat çekicidir. Flip mama ve su kapları hem ihtiyaca yönelik işlevselken hem de salonunuza çok yakışacak, siz ve köpeğiniz her zaman en iyisine layıksınız.', 'Flip' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_ankur-oval-celik-mama-ve-su-kabi-470ml-15-5cm.html', 'EuroDog Küçük Irk Köpekler için Paslanmaz Çelik Mama ve Su Kabı 15,5cm_470ml', 'Köpek Ürünleri-Köpek Mama ve Su Kabı-Çelik Mama ve Su Kabı', '', '92 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_ankur-celik-kedi-mama-ve-su-kabi-70149362.jpg', '', 'Küçük ırk köpekler için kuru mama, yaş mama ve su kullanımına uygundur. Alt kenarları çıkarılabilir kauçuk şerit ile güçlendirilmiştir. Bu sayede kayması ve devrilmesi engellenmiştir. Sağlam ve hafiftir. Paslanmaz çelikten üretilmiştir uzun ömürlü ve hijyeniktir. Kolayca temizlenebilir bulaşık makinesi veya elde yıkamaya uygundur. (Bulaşık makinesine koymadan önce mutlaka kauçuk şeritin çıkarılması gerekir.) Evcilinizin mamasını ve suyunu sağlıklı bir şekilde tüketebilmesi için uygun bir üründür. Ürün 1 adet üzerinden fiyatlandırılmıştır. Sipariş verildiği takdirde 1 adet gönderim sağlanacaktır.', 'EuroDog' );
