INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_evohe-lux-plastik-mama-ve-su-kabi-700ml-xl.html', 'Evohe Kedi ve Köpekler için Lux Plastik Mama ve Su Kabı 600ml (Karışık Renkli) [XL]', 'Köpek Ürünleri-Kedi Mama ve Su Kabı-Plastik Mama ve Su Kabı', '', '29 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_evohe-plastik-kedi-mama-ve-su-kabi-73041992.jpg', '', 'Evohe lux plastik mama ve su kabı dayanıklı ve kalitelidir. Siz evde yokken evcilinizin beslenimine devam etmesinde yardımcı olacaktır. Kolay temizlenebilir. İnsan ve hayvan sağlığına %100 zararsız malzemeden imal edilmiştir. Mama veya su kabı olarak kullanabilirsiniz. Her ırk ve cins kedi veya köpeğiniz için kullanabilirsiniz.  ', 'Evohe' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_flip-celik-mama-ve-su-kabi-230ml.html', 'Flip Kedi ve Küçük Irk Köpekler için Çelik Mama ve Su Kabı 230ml', 'Köpek Ürünleri-Köpek Mama ve Su Kabı-Çelik Mama ve Su Kabı', '8680468045632', '48 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_flip-celik-kedi-mama-ve-su-kabi-37858251.jpg', '', 'Kedi ve köpekler için genel kullanım amaçlı mama ve su kabıdır. Flip mama kapları her zaman birinci sınıf kaliteli paslanmaz çelikten işlenmiştir. Ürünler sıkıştırılarak dayanıklılığı garanti altına alınmıştır. Ürünün paslanmaz çeliği ekstra dayanıklı kaplamaya sahiptir.Yıllarca ihtiyaçlarınızı karşılayabilecek şekilde tasarlanmıştır. Ürün üzerinde ki kaplamalar ileri teknoloji ile çeliğe işlenmiştir.  Makinede yıkanabilir özelliği ile tam bir hijyen ve güvenlik sağlar. Flip marka köpek su ve mama kapları, salınım yapmaz. Böylece salınım yapmadığı için hayvan sağlığına da %100 zararsızdır. Yemeklerin ve özelliklede suyun tadını ve lezzetini bozmaz. Bakteri üretmez ve koku oluşturmaz.  Ürünün altında siyah kauçuk kaydırmaz lastik bulunmaktadır. Kaydırmaz lastik sayesinde düz zeminlerde mama kabı sabit kalmaktadır.', 'Flip' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_ankur-paslanmaz-celik-mama-ve-su-kabi-230ml-12cm.html', 'EuroDog Küçük Irk Köpekler için Paslanmaz Çelik Mama ve Su Kabı 12cm_230ml', 'Köpek Ürünleri-Köpek Mama ve Su Kabı-Çelik Mama ve Su Kabı', '', '57 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_ankur-celik-kedi-mama-ve-su-kabi-64091557.jpg', '', 'Küçük ırk köpekler için kuru mama, yaş mama ve su kullanımına uygundur. Alt kenarları çıkarılabilir kauçuk şerit ile güçlendirilmiştir. Bu sayede kayması ve devrilmesi engellenmiştir. Sağlam ve hafiftir. Paslanmaz çelikten üretilmiştir uzun ömürlü ve hijyeniktir. Kolayca temizlenebilir bulaşık makinesi veya elde yıkamaya uygundur. (Bulaşık makinesine koymadan önce mutlaka kauçuk şeritin çıkarılması gerekir.) Evcilinizin mamasını ve suyunu sağlıklı bir şekilde tüketebilmesi için uygun bir üründür. Ürün 1 adet üzerinden fiyatlandırılmıştır. Sipariş verildiği takdirde 1 adet gönderim sağlanacaktır.', 'EuroDog' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_trixie-paslanmaz-celik-ikili-mamasu-kabi-kucuk.html', 'Trixie Kedi ve Küçük Irk Köpekler için Paslanmaz Çelik İkili Mama ve Su Kabı 13,5cm 450ml', 'Kedi Ürünleri-Kedi Mama ve Su Kabı-Çelik Mama ve Su Kabı', '4011905248318', '295 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-celik-kedi-mama-ve-su-kabi-11151488.jpg', '', 'Kediler ve küçük ırk köpekler içim kuru mama, yaş mama ve su kullanımı için uygundur. Paslanmaz çelikten imal edilmiştir ve uzun yıllar kullanım ömrü sağlamaktadır. Temizliği oldukça kolaydır ve hijyeniktir. Bulaşık makinesinde veya elde rahatlıkla yıkanabilir. İnsan ve hayvan sağlığına %100 zararsız malzemeden üretilmiştir. İki kap olmasının avantajı da bir tarafında su bir tarafında mama sunabilirsiniz.  ', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_ferplast-vega-otomatik-su-selalesi.html', 'Ferplast Vega Kedi ve Köpekler için Otomatik Su Şelalesi 2000ml', 'Köpek Ürünleri-Köpek Mama ve Su Kabı-Otomatik Mama ve Su Kabı', '8010690111568', '2.149 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_ferplast-plastik-kopek-mama-ve-su-kabi-93809114.jpg', '', 'Dostunuz suyun hareket içgüdüsü etkisi ile su içme ihtiyacını uyarır. 2 litre kapasitesi, ayarlanabilir su akışı ve farklı içme noktaları sayesinde küçük ırk köpek ve kediler için uygundur. Kaymaz ayakları sayesinde dostunuz su içerken altından kaymaz. Kullanımını kolaylaştıran ergonomik kavrama noktaları vardır. Temizlemesi kolaydır. Pompa, adaptör ve aktif karbon filtre ürüne dahildir.', 'Ferplast' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_kyane-lux-plastik-mama-ve-su-kabi-500ml.html', 'Kyane Kedi ve Köpekler için İkili Lux Plastik Mama ve Su Kabı 500ml (Karışık Renkli)', 'Kedi Ürünleri-Kedi Mama ve Su Kabı-Plastik Mama ve Su Kabı', '', '', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_petlebi-kedi-ikili-mama-kabi-73038133.jpg', '', 'Kyane lux plastik mama ve su kabıdır. Kedinizin beslenmesini kolaylaştırmak için kullanabilirsiniz. Her ırk ve yaş kediniz için kullanabilrsiniz. İnsan ve hayvan sağlığına %100 zararsız malzemeden imal edilmiştir. Kyane lux plastik mama ve su kabı toplamda 500 ml_dir. Kolay temizlenebilir olarak üretilmiştir. Ürünün farklı renkleri mevcuttur. Stok durumuna göre gönderim yapılır.', 'Kyane' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_petlebi-plastik-konserve-kapagi.html', 'Petlebi Kedi ve Köpek Konserveleri için Plastik Koruma Kapağı 7,5cm', 'Kedi Ürünleri-Kedi Konserve Maması-Kısırlaştırılmış Kedi Konservesi', '30.08.2024', '', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_petlebi-kedi-konserve-mamasi-210607462.jpg', '', 'Kedi ve köpek konserveleri için özel olarak tasarlanmış plastik konserve kapağıdır. 400 gram ve 200 gram gibi açıldığında tamamı tek seferde tüketilemeyen konserve mamaların ilk açıldığındaki tazeliğinin korunması için kullanılmaktadır. Konserve kapağı, çapı 7,5 cm olan konserveler için uygundur. Ürün çapı 7,5 cm_dir.', 'petlebi' );
