INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kopek-tasima-cantasi-33x32x54cm.html', 'Trixie Köpek Taşıma Çantası 33x32x54cm', 'Köpek Ürünleri-Köpek Taşıma Çantası-Omuz Çantası', '4047974289037', '4.699 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-tasima-cantasi-18624947.jpg', '', 'Jakar ve polyesterden üretilmiştir. Yan taraflarında yer açılabilir bölümlerin açılmasıyla yatma alanı ; yatağı iki kat genişletilebilir. Önden ve üstten açılabilir. Ekstra cepleri vardır. Takılıp çıkarılabilir omuz taşıma askısı vardır. İçerisindeki kısa kayış sayesinde çanta içerisindeki petin dışarı aniden atlaması engellenir. Üzerindeki file açıklıklar sayesinde iç bölümüne iyi bir havalandırma sağlar.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kedi-urunleri_trixie-plastik-kedi-ve-kopek-tasima-cantasi-37x34x55cm-acik-gri-acik-lila.html', 'Trixie Plastik Kedi ve Köpek Taşıma Çantası 37x34x55cm (Açık Gri_Açık Lila)', 'Kedi Ürünleri-Kedi Taşıma Çantası-Plastik Kapılı', '4047974398234', '1.119 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kedi-tasima-cantasi-149556063.jpg', '', 'Kedinizi veya köpeğinizi bir yerden başka bir yere nakli için kullanabileceğiniz, emniyet kemerinin geçebileceği özel tasarıma sahip, sert plastikten, havalandırma ızgaralarına sahip kedi veya köpek taşıma kabı. Kedinizi bu ürüne alıştırmak için Trixie_nin 4238 ve 4241 kodlu catnip spreyi ( catnip ) ürününü kullanabilirsiniz. Catnip kedinizin ürüne karşı merakını arttıracaktır. Kediniz catnip kokusunu aldığında rahatlamış ve sakinleşmiş olarak ürünü benimseyecektir. Kedinizi herhangi bir ürüne alıştırmak için oldukça etkili bir yöntemdir. Özellikle taşıma kaplarında taşıma kabını seyahatten önce kedinizle tanıştırmanız ve ürüne güven duymasını sağlamanız çok önemlidir. Ürün ölçüleri 37x34x55 cm_dir.', 'Trixie' );
