INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_flip-tel-kopek-citi-80x80cm-8-parca.html', 'Flip Tel Köpek Çiti 80x80cm (8 Parça)', 'Köpek Ürünleri-Eğitim Ürünleri ve Ekipmanları-Köpek Çiti', '8682631201098', '1.849 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_flip-kopek-citi-320111301.jpg', '', 'Köpekleriniz için özel olarak üretilmiş köpek çitidir. Genişliği sayesinde köpeğinizin rahatlıkla hareket etmesini sağlar. Malzeme yapısı paslanmaya ve deforme olmaya yüksek direnç gösterir bu sayede uzun yıllar sorunsuzca kullanılabilir. Kapısı sayesinde dostunuz çitin dışına çıkabilir veya içine girebilir. Kullanılmadığı zaman katlanarak yer tasarrufu sağlar.', 'Flip' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kopek-odul-bel-cantasi-13x18x7cm-siyah.html', 'Trixie Köpek Ödül Bel Çantası 13x18x7cm (Siyah)', 'Köpek Ürünleri-Eğitim Ürünleri ve Ekipmanları-Eğitim Çantaları', '4011905322858', '479 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-egitim-ekipmani-42365262.jpg', '', 'Çok dayanıklı ve kullanışlı bir köpek eğitim ödül çantasıdır. Mıknatıslı kolay açılıp kapanabilir kapağı sayesinde hızlı bir şekilde ödülü alıp çantanın kapağını tekrar kapatarak köpeğinizin dikkatinin dağılmasını önlemiş olursunuz. Kemere takılan bölümü yumuşak olduğu için rahattır. Sabit ve düzgün bir formu vardır. Bu sayede ödülü kolaylıkla içerisinden alabilirsiniz. Ön tarafında ilave bir cebi vardır. Kemere kolayca takılabilmesi için klipsleri ve bağlantıları vardır. Temizlemesi çok kolaydır. Su geçirmez. Bu sayede her iklimde, karda, yağmurda veya deniz kenarında kolaylıklar ve rahatça kullanılabilir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kopek-agility-egitim-tahterevalli.html', 'Trixie Köpek Eğitim Tahterevalli 300x54x34cm', 'Köpek Ürünleri-Eğitim Ürünleri ve Ekipmanları-Trixie Eğitim Ürünleri ve Ekipmanları', '4011905032139', '8.714,65 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-egitim-ekipmani-18025045.jpg', '', '300×54×34cm. Kaymaz yüzeyi sayesinde köpeğinizin üzerinde rahatça yürüyebileceği , cilalı çamdan üretilmiş , köpeğinizi zinde ve sağlıklı tutacak , 80kg a kadar tüm ırk köpeklerin kullanabileceği köpek agility eğitim tahtıravallisidir. Asla dolu mide ile oynamayınız ve antrenman sonrası köpeğinizi beslemeyiniz. Agility tüm dünyada , köpek ve sahibinin beraber oynadıkları yeni bir spor olarak yarışmaları yapılmaktadır. Köpeğinizi asla dolu mide ile oynatmayınız ve antrenman sonrası köpeğinizi beslemeyiniz. Köpeğinizi yavaş yavaş oynamaya alıştırınız , onu birkereden zorlamayınız. Daima içebileceği temiz ve bol su bulundurunuz. Su içmeden önce ve sonra dinlendirerek nefeslenmesine müsaade ediniz. Aşırı hızlı nefes alırken su içmesi ve yemek yemesi köpeklerde miğde torsiyonuna sebe olabilir ve bu ölümle sonuçlanabilir. Yavru ve genç köpeklere antrenman yaptırmadan önce veterinerinize müracaat ediniz. Kas ve kemik ve eklem yapısını kontrol ettiriniz. Agilty parkuru için eğitim sayfasında yer alandiğer eğitim ürünlerinide inceleyebilirsiniz. Ürünlerin kullanım videosu sayfanın altında yer almaktadır. Detaylı bilgi için ', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kopek-agility-oyuncagi-23x30cm-78cm-3-adet.html', 'Trixie Köpek Agility Oyuncağı 23x30cm (3_lü)', 'Köpek Ürünleri-Eğitim Ürünleri ve Ekipmanları-Trixie Eğitim Ürünleri ve Ekipmanları', '4011905320915', '1.749 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-zeka-gelistirici-oyun-6953725.jpg', '', 'Köpeğinizin konsantrasyon ve çevikliğinin arttırılması için yapacağınız eğitimlerde kullanabileceğiniz köpek aktivite ekipmanıdır. Köpeğinizin eğitimi açısından rahatlıkla kullanabilirsiniz. Köpekler için fizik tedavi uygulamalarında da kullanılabilir. Yükseklik seviyesi ayarlanabildiği için her ırktan ve yaştan köpek için kullanılabilir. Paket içerisinden 6 adet kuka ve 3 adet direk çıkmaktadır. Ürünler oldukça dayanıklı malzemelerden üretilmiştir. Paket içerisinde köpeğinizi nasıl eğitebileceğinizi gösteren İngilizce kitapçıkta bulunmaktadır.', 'Trixie' );
