INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kopek-odul-tasima-cantasi-11x16cm.html', 'Trixie Köpek Ödül Taşıma Çantası 11x16cm', 'Köpek Ürünleri-Eğitim Ürünleri ve Ekipmanları-Eğitim Çantaları', '4011905322810', '489 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-odul-mamasi-63935757.jpg', '', 'Köpeğinizin ödül mamalarını rahatlıkla yanınızda taşıyabileceğiniz bu çanta dayanıklı naylon malzemeden üretilmiştir. Belinize rahatlıkla takıp çıkarabilmenizin yanında tek elle açıp kapanabilir olması da çok pratiktir. Bu pratik tasarım sayesinde yürüşlerinize ya da eğitim sırasında rahat edeceksiniz. Çantanın fosforlu şeritleri ve ön tarafında küçük bir cebi bulunmaktadır. Temizlemesi kolay bir üründür.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_zampa-metal-kopek-citi-75x70cm-siyah.html', 'Zampa Metal Köpek Çiti 75x70cm (Siyah)', 'Köpek Ürünleri-Eğitim Ürünleri ve Ekipmanları-Köpek Çiti', '', '709 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_zampa-kopek-citi-337608569.jpg', '', 'Dış mekan ve iç mekanlarda kullanıma uygun köpek çiti, köpeklerde tuvalet eğitimi amacıyla alan sınırlandırmak için de kullanılır. Aşı takip sürecinde açık havada tecrit amaçlı kullanılabilir. Paneller isteğe bağlı olarak altıgen, kare veya dikdörtgen şekilli kullanılabilmektedir.', 'Zampa' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_zampa-askili-kopek-egitim-clickeri-6x3cm-kirmizi.html', 'Zampa Askılı Köpek Eğitim Clickerı 3x6cm (Kırmızı)', 'Köpek Ürünleri-Eğitim Ürünleri ve Ekipmanları-Eğitim Clicker', '', '58 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_zampa-kopek-egitim-clicker-191582732.jpg', '', 'Çıkardığı ses ile köpeğinizin dikkatini çeker ve vereceğiniz komutlarla eğitim vermenize yardımcı olur. Clicker ucunda takılı olan lastik sayesinde bileğinizde rahatça kullanabilirsiniz.', 'Zampa' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kopek-egitim-odul-cantasi-10x13cm-karisik-renkli.html', 'Trixie Köpek Eğitim Ödül Çantası 10x13cm (Karışık Renkli)', 'Köpek Ürünleri-Eğitim Ürünleri ve Ekipmanları-Eğitim Çantaları', '4011905322834', '399 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-tasinabilir-mama-su-kabi-kopek-258651852.jpg', '', 'İki amaca hizmet eden bir köpek ödül çantasıdır. Çok dayanıklı malzemeden üretilmiştir. Ödül çantası fonksiyonu yanında aynı zamanda köpek kaka torbası taşıma bölümü vardır. Bütün Trixie markalı köpek kaka torbalarıyla kullanılabilir. Ergonomik tasarımı sayesinde kolayca kemere bağlanabilir. Ön tarafındaki D halkaya klikır veya sessiz eğitim düdüğü bağlanabilir. Yan tarafında cırt cırtlı ayrı bir cebi daha vardır. Kolay temizlenebilir. Ürün çeşitli renklerdedir. Stoktaki mevcut renk durumuna göre gönderim sağlanmaktadır.', 'Trixie' );
