INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_vetiq-training-aid-kopek-tuvalet-egitim-damlasi-60ml.html', 'vetIQ Training Aid Köpek Tuvalet Eğitim Damlası 60ml', 'Köpek Ürünleri-Eğitim Ürünleri ve Ekipmanları-Tuvalet Eğitim Spreyi', '', '279 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_vetiq-kopek-tuvalet-egitim-spreyi-279599543.jpg', '', 'Yavru ve yetişkin köpekler için tuvalet alışkanlığı kazanabilmesi ve ihtiyaçlarını sizin istediğiniz yerde giderebilmesi amacıyla kullanılan, tuvalet eğitim damlasıdır. Köpek tuvalet eğitimi, yavru köpeğin eve ilk geldiği günden itibaren alması gereken temel eğitimlerden biridir. Yavrularda motor fonksiyonların gelişmesine bağlı olarak gecikmeler olabilir. vetIQ köpek çiş eğitim damlası, bu süreci hızlandırır ve tuvalet eğitimini kolaylaştırır. Serin ve kuru bir yerde, direkt güneş ışığından uzak bir yerde saklayın.', 'vetIQ' );
