INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_pawise-training-kopek-egitim-aparati-clicker.html', 'Pawise Köpek Eğitim Clickerı 3,5x5,3cm (Mavi)', 'Köpek Ürünleri-Eğitim Ürünleri ve Ekipmanları-Eğitim Clicker', '', '64 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_pawise-kopek-egitim-clicker-240623349.jpg', '', 'Her yaşta köpek, kedi, tavşan, kuş için kullanabileceğiniz, pozitif eğitim aracıdır. Çıkarttığı özel ses ile petinizin doğru yaptığı hareketi onaylayacağınız bir eğitim aracıdır. Paket içerisinden kolay kullanım kılavuzu çıkmaktadır.', 'Pawise' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_zampa-askili-kopek-egitim-clickeri-6x3cm-mavi.html', 'Zampa Askılı Köpek Eğitim Clickerı 3x6cm (Mavi)', 'Köpek Ürünleri-Eğitim Ürünleri ve Ekipmanları-Eğitim Clicker', '', '58 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_zampa-kopek-egitim-clicker-191573830.jpg', '', 'Çıkardığı ses ile köpeğinizin dikkatini çeker ve vereceğiniz komutlarla eğitim vermenize yardımcı olur. Clicker ucunda takılı olan lastik sayesinde bileğinizde rahatça kullanabilirsiniz.', 'Zampa' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_supravet-yavru-kopek-tuvalet-egitim-damlasi-50ml.html', 'Supravet Yavru Köpek Tuvalet Eğitim Damlası 50ml', 'Köpek Ürünleri-Eğitim Ürünleri ve Ekipmanları-Tuvalet Eğitim Spreyi', '10.01.2025', '86 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_supravet-kopek-tuvalet-egitim-spreyi-33934321.jpg', '', 'Her yaş ve her cins köpeklerin tuvalet alışkanlığı kazanabilmesi amacıyla, ev içerisinde ve açık alanlarda kullanılabilen, tuvalet eğitimine yardımcı çiş alıştırma spreyidir. Ev içerisinde tuvaletini yapmasını istediğiniz bir bölgeye tuvalet alıştırma pedi seriniz. Bu bölgenin mama kabından ve yatağından uzak olmasına özen gösteriniz. Tuvaletini yapmasını istediğiniz bölgeye yaklaşık 15 - 20 cm uzaklıkta bir mesafeden bir miktar damlatınız ve köpeğinizin damlattığınız yeri koklamasına izin veriniz, özellikle yemekten, oyundan ve uykudan sonra, ürünü uyguladığınız noktaya tekrar getiriniz. Spreyin etkisinin geçtiği durumlarda tekrar sprey sıkınız ve uygulamayı alışkanlığını kazanana kadar tekrarlayınız. Tuvaletini istediğiniz bölgeye yaptığında mutlaka ödüllendiriniz. İhtiva ettiği maddeler nedeniyle köpek tuvaletini belirlenen yere yapmaya başlar. Kullanmadan önce çalkalanması gerekmektedir. Çiş eğitim pedi ile kullanılması tavsiye edilir. Diğer ilaçlar ile birlikte karıştırmayınız. Çocukların erişemeyeceği yerde ağzı kapalı muhafaza ediniz. Ürünün vücuda ya da göze temasından kaçınılmalı, temas halinde bol su ile yıkanmalı. Kuru ve serin bir yerde, güneş ışığından korunarak muhafaza ediniz. Raf ömrü üretim tarihinden itibaren 2 yıldır.', 'Supravet' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_dill-kopek-tuvalet-egitim-seti-46x36x22cm-gri.html', 'DILL Köpek Tuvalet Eğitim Seti 46x36x22cm (Gri)', 'Köpek Ürünleri-Eğitim Ürünleri ve Ekipmanları-Tuvalet Eğitim Spreyi', '', '389 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_diil-kopek-tuvalet-egitim-spreyi-104552408.jpg', '', 'Dışarı çıkamayan yavrular ve küçük ırk köpekler için, ev içerisinde tuvalet ihtiyacını karşılayabilecekleri bir üründür. Ortasında ki çubuğu ile yavrunun nereye tuvaletini yapacağını daha belirgin gösteren özelliğe sahiptir. Üst kısmında ki ızgarası ile patilerinin kuru kalmasını sağlayan ve arka kısıma sıçramasını engelyen duvar bulunur. Kaliteli plastik malzemeden üretilmiştir ve uzun yıllar kullanım ömrü sunmaktadır. Temizliği kolay ve pratiktir.', 'DIIL' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_pets-family-yavru-kopek-egitim-damlasi-50ml.html', 'Pets Family Yavru Köpek Eğitim Damlası 50ml', 'Köpek Ürünleri-Eğitim Ürünleri ve Ekipmanları-Tuvalet Eğitim Spreyi', '', '16,95 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_pets-family-kopek-tuvalet-egitim-spreyi-190116460.jpg', '', 'Yavru köpek eğitim damlası kullanmadan önce şişe çalkalanmalıdır. Ev içinde tuvaletini yapmasını istediğinizbir bölgeye 15-20 cm mesafeden bir miktar sıkılır ve köpeğe koklatılır. Yemekten, uykudan ve oyundan sonra ürün uygulanan noktaya köpek getirilir ve koklatılır. Uygulama tuvalet alışkanlığı sağlanana kadar devam edilir.  Diğer ilaçlarla karıştırılmamalıdır. Ürünün vücüda ve göz teması halinde bol su ile yıkayınız.', 'Pet_s Family' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_zampa-metal-kopek-citi-80x95cm-siyah.html', 'Zampa Metal Köpek Çiti 80x95cm (Siyah)', 'Köpek Ürünleri-Ağustos Seçili Ürünler-Zampa Ağustos Seçili Ürünler', '', '919 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_zampa-kopek-citi-337428631.jpg', '', 'Dış mekan ve iç mekanlarda kullanıma uygun köpek çiti, köpeklerde tuvalet eğitimi amacıyla alan sınırlandırmak için de kullanılır. Aşı takip sürecinde açık havada tecrit amaçlı kullanılabilir. Paneller isteğe bağlı olarak altıgen, kare veya dikdörtgen şekilli kullanılabilmektedir.', 'Zampa' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_pro-one-kopek-tuvalet-egitim-spreyi-100ml.html', 'PRO ONE Köpek Tuvalet Eğitim Spreyi 100ml', 'Köpek Ürünleri-Eğitim Ürünleri ve Ekipmanları-Tuvalet Eğitim Spreyi', '', '58 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_pro-one-kopek-yavrusu-bakimi-urunleri-239956576.jpg', '', 'Yavru köpeklerde tuvalet alışkanlığının kazandırılmasında kullanılır. İçeriği sayesinde yavru köpeğinizin tuvaletini belirlenen yere yapmasını sağlar.', 'PRO ONE' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kopek-odulu-tasima-cantasi-9cm-karisik-renk.html', 'Trixie Köpek Ödülü Taşıma Çantası 9cm (Karışık Renkli)', 'Köpek Ürünleri-Eğitim Ürünleri ve Ekipmanları-Eğitim Çantaları', '4011905322827', '195 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-egitim-cantalari-118974195.jpg', '', 'Köpeğinizin ödül bisküvilerini veya eğitim yiyeceklerini taşıyabileceğiniz, askısı sayesinde belinize asabileceğiniz ödül taşıma bel çantasıdır. Üst tarafındaki ipli-kilit saysinde ağzını büzerek ve kitleyerek ağzını kapatabilirsiniz. Kaliteli malzemeden üretilmiştir uzun yıllar kullanılabilir. Kolay temizlenebilir yapıya sahiptir makinada yıkanabilir. Ürün çeşitli renklerdedir stok durumuna göre gönderim sağlanacaktır.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kopek-egitimi-renkli-clicker.html', 'Trixie Kemik Şeklinde Köpek Eğitim Clickerı 3,5x5,3cm (Karışık Renkli)', 'Köpek Ürünleri-Eğitim Ürünleri ve Ekipmanları-Eğitim Clicker', '4011905022895', '119 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-egitim-ekipmani-17688247.jpg', '', 'Her yaşta köpek, kedi, tavşan, kuş için kullanabileceğiniz, pozitif eğitima aracı olan bu clicker; çıkarttığı özel ses ile petinizin doğru yaptığı hareketi onaylayacağınız, bir eğitim aracıdır. Paket içerisinden kolay kullanım kılavuzu çıkmaktadır.  ', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_beavis-yavru-kopek-tuvalet-egitim-spreyi-100ml.html', 'Beavis Yavru Köpek Tuvalet Eğitim Spreyi 100ml', 'Köpek Ürünleri-Eğitim Ürünleri ve Ekipmanları-Tuvalet Eğitim Spreyi', '', '33 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_beavis-kopek-tuvalet-egitim-spreyi-19469315.jpg', '', 'Ailenize yeni katılan sevimli dostumuzun tuvalet ihtiyacını evinizin her hangi bir yerine yapması onun için çok doğal bir harekettir. Ortak yaşam alanlarınızın konforu ve temizliği için geliştirilmiş ve sevimli dostumuzun tuvalet ihtiyacını belirlediğiniz bölgeye yapabilmesi için uzmanlarımız tarafından özel olarak geliştirilmiştir. Tuvalet eğitim pedinin belirlediğiniz bölümüne 3-4 kez spreyi püskürtünüz ve sevimli dostumuzun eğitim spreyini tanıması için koklatınız. Kendisini hazır hissettiğinde pedin belirlediğiniz yerine ihtiyacını giderecektir.  Olumlu sonuca ulaştığınız süre boyunca kendisine ismiyle hitap ederek ödüllendirmeniz onun için paha biçilmez olacaktır. Ailenize yeni katılan sevimli bireyinizin ortak yaşamınızda hayatını daha pozitif şekilde kolaylaştıracaktır.', 'Beavis' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-parmak-tipi-kopek-egitimi-clicker.html', 'Trixie Parmağa Takılabilen Köpek Eğitim Clickerı 3x6cm (Karışık Renkli)', 'Köpek Ürünleri-Eğitim Ürünleri ve Ekipmanları-Eğitim Clicker', '4011905228600', '165 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-egitim-clicker-118631069.jpg', '', 'Parmağa takılabilen bu kullanışlı ve pratik clicker ile köpeğinizi, kedinizi, tavşanınızı ve hatta kuşunuzu eğitebilirsiniz. Üst tarafında bulunan düğmeye basarak çıkan özel, sabit ses sayesinde etkili bir eğitim verebilirsiniz.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_karlie-kopek-egitim-hizli-clicker-6x4cm-kirmizi.html', 'Karlie Kablolu Köpek Eğitim Clickerı 6x4cm (Karışık Renkli)', 'Köpek Ürünleri-Eğitim Ürünleri ve Ekipmanları-Eğitim Clicker', '4016598478288', '109 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_karlie-kopek-egitim-clicker-8479365.jpg', '', 'Köpekler için geliştirilmiş köpek eğitim clickerıdır. Kemik desenli ve metal klipslidir. Gelişmiş köpek eğitimleri için uygundur. Kablosu sayesinde kolay ve pratik kullanım imkanı sunar. Ürün boyutu 6x4cm_dir.', 'Karlie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kopek-sessiz-egitim-dudugu.html', 'Trixie Köpek Sessiz Eğitim Düdüğü', 'Köpek Ürünleri-Eğitim Ürünleri ve Ekipmanları-Eğitim Düdüğü', '4011905022581', '139 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-egitim-ekipmani-11173585.jpg', '', 'Köpekler ses tonlarına ve akustik sinyallere tepki verirler. Köpeklerin duyma frekans aralığı insanlara göre daha geniş olduğu için insanların duyamadığı birçok sesi duyarlar. Bu prensipten hareketle üretilmiş bu düdükten çıkan sesleri insan duyamaz veya çok az duyabilir. Düdük üzerindeki ayar sayesinde çıkarılacak farklı seslerle köpeğinizi eğitebilirsiniz.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-pet-activity-kopek-egitimi-clicker.html', 'Trixie Pet Activity Köpek Eğitimi - Clicker', 'Köpek Ürünleri-Eğitim Ürünleri ve Ekipmanları-Eğitim Clicker', '4011905022987', '159 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-egitim-ekipmani-17662013.jpg', '', 'Her yaşta köpek için kullanabileceğiniz , pozitif eğitima aracı olan bu Clicker ; çıkarttığı özel ses ile köpeğinizin doğru yaptığı hareketi onaylayacağınız , bele takılabilen ve uzayıp kısalabilen özel bağıyla rahatça kullanabileceğiniz bir eğitim aracıdır.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_kong-anksiyete-giderici-kopek-elbisesi-ml.html', 'Kong Anksiyete Giderici Köpek Elbisesi 45,7cm [M_L]', 'Köpek Ürünleri-Köpek Elbise ve Galoşları-Anksiyete Giderici', '721343711803', '899 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_kong-kopek-anksiyete-giderici-27852003.jpg', '', 'Kong köpek anksiyete giderici elbise ile kolay ve etkili bir biçimde birçok sorunu çözmek mümkündür. Köpeğinizi sakinleştirmeniz gereken birçok duruma kusursuz çözüm sağlar. Kong köpek anksiyete giderici elbise ile köpeğiniz kendini sürekli güvende hissedecek ve korkularını, stresini yenebilecektir. Veteriner Kliniği_ne gitmekten, arabaya binmekten ve araba ile seyahat etmekten korkan, huzursuz olarak kusan veya havlayan, havai fişekten, gök gürültüsü ve şimşekten korkan, yalnız kalmaktan ve sahibinden ayrı kalmaktan korkarak sürekli havlayan köpeklerin sakinleştirilmesi için idealdir. Tüm vücudu kaplayan özel tasarımı, kutu içerisinden çıkan sakinleştirici etkiye sahip kurutulmuş lavanta kesesi, üzerindeki fosforlu şeritleri, ayarlanabilir ve tam vücuda oturan şık tasarımı, nefes alabilen özel kumaşı ve yıkanabilir olmasıyla çok faydalı ve kullanışlı bir üründür. Çamaşır makinasında soğuk suda ve düşük devirde yıkanabilir.  İç mekan ve dış mekan kullanımı için uygundur.', 'Kong' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kopekler-icin-ayarlanabilir-havlu-bornoz-50cm-gri-m.html', 'Trixie Köpekler için Ayarlanabilir Havlu Bornoz 50cm (Gri) [M]', 'Köpek Ürünleri-Köpek Elbise ve Galoşları-Köpek Kazağı', '4047974235737', '1.099 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-elbiseleri-149372400.jpg', '', 'Havlu kumaştan (Poleyester_pamuk) üretilmiş köpek bornozudur. Boyun bölümündeki geniş ve çapı ayarlanabilir bölüm sayesinde köpek yıkama sonrası boyun ve göğüs bölümünden üşümez. Bel bölümündeki ayarlanabilir kuşak sayesinde köpek vücuduna göre ayarlanabilir. Ürün tanımında belirtilmiş ölçü ense kökünden kuyruk dibine olan ölçüdür.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kaymaz-kopek-corabi-gri-l-xl.html', 'Trixie Kaymaz Köpek Çorabı (2_li) (Gri) [L-XL]', 'Köpek Ürünleri-Köpek Elbise ve Galoşları-Köpek Çorabı', '4011905195056', '299 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-corabi-129771242.jpg', '', 'Paket içerisinde 2 adet çorap bulunur. Ürün pamukludur ve dostunuzu rahatsız etmez. Kaydırmaz tabanı sayesinde köpeğinizin güvenle giyebilir. Pati yaralanmalarında köpeğinizin yaralı yere dokunmaması için kullabilirsiniz. İç mekanda kullanıma uygundur. Dış mekanlarda kullanılmaz. Çorabı kullanarak yerlerde ve mobilyalarınızda oluşan tırnak çiziklerini engelleyebilirsiniz. Temizliği oldukça kolaydır elde yıkanabilir. Ürün gri renklidir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kopekler-icin-ayarlanabilir-havlu-bornoz-70cm-gri-s.html', 'Trixie Köpekler için Ayarlanabilir Havlu Bornoz 40cm (Gri) [S]', 'Köpek Ürünleri-Köpek Elbise ve Galoşları-Köpek Kazağı', '4047974235720', '889 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-kazagi-150068491.jpg', '', 'Havlu kumaştan üretilmiş köpek bornozudur. Boyun bölümündeki geniş ve çapı ayarlanabilir bölüm sayesinde köpek yıkama sonrası boyun ve göğüs bölümünden üşümez. Bel bölümündeki ayarlanabilir kuşak sayesinde köpek vücuduna göre ayarlanabilir. Ürün tanımında belirtilmiş ölçü ense kökünden kuyruk dibine kadar olan ölçüdür.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kopek-paltosu-ve-yagmurlugu-40cm-siyah-s.html', 'Trixie Köpek Paltosu ve Yağmurluğu 40cm (Siyah) [S]', 'Köpek Ürünleri-Köpek Elbise ve Galoşları-Köpek Paltosu ve Yağmurluğu', '4011905305035', '1.099 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-elbiseleri-19766181.jpg', '', 'İç astar bölümü farklı hava şartlarında takıp çıkarılabilmektedir. Bu sayede hem palto olarak hemde yağmurluk olarak kullanılabilmektedir. Göğüs koruyan ve sırtı tam kavrayan özel tasarımı sayesinde hem çok kullanışlı ve rahattır hemde rüzgara karşı korumalıdır. Arka bacaklara kolayca geçebileb lastikli bölüm sayesinde çok rahattır v köpeğinizin vücuduna tam oturur. Göğüs bölümündeki cırt cırtlı bölüm sayesinde köpeğinizin göğüs çevresine göre tam olarak ayarlanabilir. Su ve rüzgar geçirmezdir. Yağmurda ve karda rahatça kullanılabilir. Çamaşır makinasında 30C_de yıkanabilir.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kopek-koruyucu-elizabeth-yakalik-50-58cm28cm-l-xl.html', 'Trixie Köpek Koruyucu Yakalık 50-58cm_28cm [L-XL]', 'Köpek Ürünleri-Köpek Elbise ve Galoşları-Koruyucu Elbise', '4011905195162', '789 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-guvenlik-urunleri-27438076.jpg', '', 'Köpekler için yakalıktır.Veteriner Hekim tarafından uygulanmış herhangi bir tedavi, ameliyat vb durumlarda bandajlı vb bölgenin yalanmasını, kemirilmesini önlemek için kullanılmaktadır. Kuvvetli cırt cırtlı birleşim yeri sayesinde hızlı ve tam ayarlanması mümkündür.Kenarlarındaki özel kaplama sayesinde yakalığın sağa sola çarpması sonucu verdiği zarar ve kendi kendine kıvrılma-kırılma durumu önlenmektedir. Ürün tanımı içerisinde aralıklı olarak belirtilmiş ilk ölçü boyun çevresi_tasma boyunu göstermektedir. Opak şeffaftır.', 'Trixie' );
INSERT INTO petlebi ( `UrL`, `Name`, `Category`, `Barcode`, `Price`, `Images`, `Sku`, `Description`, `Brand` ) VALUES ( 'https:__www.petlebi.com_kopek-urunleri_trixie-kopek-yagmurlugu-50cm-kirmizigri-m.html', 'Trixie Köpek Yağmurluğu 50cm (Kırmızı_Gri) [M]', 'Köpek Ürünleri-Köpek Elbise ve Galoşları-Köpek Paltosu ve Yağmurluğu', '4047974302750', '829 TL', '__images.petlebi.com_v7__ptlb_up_ecommerce_product_lg_trixie-kopek-elbiseleri-19794001.jpg', '', 'Göğüs bölümünü koruyan, rüzgar geçirmeyen özel kumaştan üretilmiş, arka bacak üstlerini koruyan, cırt cırtlı kolay bağlamaya sahip, üzerinde fosofrlu çizgileri olan kaliteli bir yağmurluktur.', 'Trixie' );
